INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('Achatina fulica', 'Ốc sên', 'insect_Achatina_fulica', 'Ốc sên là động vật thân mềm, thuộc họ chân bụng. Vì dưới chân có tuyến dịch, khi di chuyển, nó tiết ra chất dính, vẫn thường để lại dấu vết. Mùa sinh sản của ốc sên là mùa xuân. Nó đẻ trứng thành nhiều lần. Ốc sên con vừa ra đời đã có thể tự kiếm ăn. Thức ăn chính của nó là rau cỏ, rễ cây, mầm non, quả chín. Bởi vậy, nó là loài động vật gây hại cho mùa màng.', '', '', '', '', 'null', '', 'Achatina', 'null'),
('Acrida chinensis', 'Cào cào lớn', 'insect_Acrida_chinensis', 'Con đực thường có chiều dài 40-50mm (1.6-2.0 in) trong khi con cái là 70-80mm(2.8-3.1 in). Chúng có màu xanh lục hoặc nâu với đôi cánh không màu', '', '', '', '', 'null', '', 'Acrida', 'null'),
('Adelphocoris lineolatus', 'rệp cây cỏ linh lăng', 'insect_Adelphocoris_lineolatus', 'Nhộng có bề ngoài tương tự như nhộng bọ chét bông có màu xanh lục nhạt và mắt đỏ. Chúng lớn hơn bọ chét bông với cá thể thứ 3 dài khoảng ¼ inch. Nhộng non của Creontiades có đốm đỏ trên râu, nhưng điều này thường không được quan sát thấy sau lần thứ 3.\r\n\r\nHiện tại, hầu như không có thông tin liên quan đến vòng đời của loài gây hại đặc biệt này, nhưng giả sử nó giống với các loài Creontiades khác, trứng sẽ nở sau 5-10 ngày sau khi được đẻ. Nó sẽ trải qua 5 giai đoạn ấu trùng trước khi lột xác thành con trưởng thành; mỗi lần xuất hiện nymphal sẽ kéo dài 2-3 ngày. Con trưởng thành có thể sống từ 3 - 4 tuần.', 'Những con bọ Lygus trưởng thành dài khoảng 0,25 inch và rộng 0,1 inch (2,5 mm), và dẹt trên lưng. Chúng có nhiều màu sắc khác nhau từ xanh lục nhạt đến nâu vàng với các mảng màu nâu đỏ đến đen, và có một hình tam giác dễ thấy ở trung tâm của lưng. Nhộng giống con trưởng thành, nhưng có màu xanh lục nhạt đồng nhất với đôi râu màu đỏ; nhộng lớn hơn có năm đốm đen ở bề mặt trên của cơ thể. Nhộng không có cánh. Các loài côn trùng khác có thể bị nhầm lẫn với bọ lygus, bao gồm cả những loài có ích như bọ bigeyed.', 'Rệp cây cỏ linh lăng đòi hỏi một số điều kiện tối ưu nhất định để phát triển và trở thành dịch hại ở bất kỳ quốc gia nào. A. lineolatus chủ yếu nằm trong môi trường ẩm ướt với nhiệt độ lạnh. [6] Thông thường, người ta có thể tìm thấy những con bọ thực vật này trên cánh đồng hoặc đồng cỏ, ở cả khu vực khô và ẩm ướt. [7] Tuy nhiên, bọ xít hại cây cỏ linh lăng không thành công ở các hồ nước mặn, sa mạc, cồn cát, thời tiết gió hoặc khí hậu quá ấm. [6] Adelphocoris lineolatus sẽ dễ dàng thích nghi với điều kiện môi trường mát mẻ hơn, điều này đã cho phép chúng xâm chiếm một lượng lớn lãnh thổ ở Canada', 'Hàng ngày cần quan sát vườn cây cảnh nếu thấy có rệp là bắt giết ngay hoặc cắt nhánh cây có rệp rồi bỏ đi không để chúng nhân mật số lên  cao.\r\n\r\n- Nếu mật độ rệp cao hơn bạn có thể dùng miếng dẻ lau có nhúng cồn rồi chấm vào những chố rệp bột bám vào hoặc dùng nước xà phòng phun lên các khu vực bị rệp tấn công, cách hiệu quả hơn bạn có thể áp dụng là hòa nước rửa chén (loại bất kỳ) cùng với thuốc thuốc Ditarex theo tỷ lệ: 50g thuốc Ditarex + 10ml nước rửa chén hòa trong bình 15 nước phun trực tiếp và phần lá và thân cây có rệp lúc trời nắng to (tốt nhất lúc 9 - 10h sáng), phun liên tục 5 lần (mỗi lần cách nhau 5 ngày) đến khi rệp chết hẳn.\r\n\r\n- Hoặc có thể dùng một trong các loại thuốc sau đây để phun xịt: Supracide 40ND, Suprathion 40ND, Applaud-Bas 27BTN, Applaud-Mipc 25BTN, Sherpa 10EC, Bi 58 40EC, DC- Tron Plus 98,8EC…. (về liều lượng và cách sử dụng thuốc có thể đọc kỹ hướng dẫn của nhà sản xuất có in sẵn trên vỏ bao bì).', 'nguồn gốc từ Tây Âu , Bắc Phi , Châu Á và Trung Đông', 'null', 'insect_Adelphocoris_lineolatus/31874.jpg', 'Adelphocoris', 'null'),
('Adris tyrannus', 'bướm đêm thuộc họ Erebidae', 'insect_Adris_tyrannus', 'Như đã nói ở trên, một vòng đời của loài bướm này khá ngắn, thông thường à từ 1 đến 2 tuần. Cá thể bướm khế có chu trình phát triển cũng giống như các loài bướm khác, bao gồm: Giai đoạn trứng, ấu trùng sâu bướm, nhộng và bướm trưởng thành.Cá thể cái sẽ tiết ra một loại Pheromone thông qua một tuyến ở bụng để thu hút bạn tình. Với bộ râu nhạy bén mà con đực có thể phát hiện ra bướm khế cái cách đó vài km.\r\n\r\nSau khi được thụ tinh, cá thể bướm khế cái sẽ đẻ một số trứng có hình cầu, đường kính khoảng 2.5mm ở mặt dưới của lá cây.', 'Palpi với khớp thứ hai dày lên và đạt đến đỉnh đầu, và khớp thứ ba trần truồng bị cùn. Ăng-ten có lông cực nhỏ ở nam giới. Metathorax có các búi nhẹ. Bụng có lông thô trên lưng. Xương chày không có xương sống và mặc quần áo với mái tóc dài. Cánh trước có cổ chân cong và đỉnh nhọn. Lề trong chia thùy và có các búi tóc gần gốc và ở góc ngoài. Ấu trùng có bốn cặp chân bụng, nơi đầu tiên có đôi thô sơ', 'null', 'Phương pháp của ông Oánh là dùng màn tuy có kích cỡ phù hợp với cây để trùm bao phủ lên trên thân cây, ngăn cách toán bộ cây trồng với bên ngoài.', 'đông nam Siberia, Ấn Độ, đông Trung Quốc, Philippines và Nhật Bản.', 'null', 'insect_Adris_tyrannus/64020.jpg', 'Adris', 'null'),
('Agriona germari', 'Xén tóc', 'insect_Agriona_germari', 'Con xén tóc thuộc họ bọ cánh cứng, có thân hình dài, dẹt, cùng đôi râu dài đặc trưng và có 3 chân chia đều cho mỗi bên. Mắt xén tóc có màu đen, có miệng rộng, hàm phát triển. Ngực trước và ngực sau của xén tóc có các đường ngang song song. Bên cạnh đó, cánh của chúng dài và cứng sáng bóng, bụng dưới có 5 đốt. Tùy thuộc vào điều kiện môi trường sống mà màu sắc trên thân của chúng sẽ biến đổi đa dạng để ngụy trang như đen, nâu hay đốm vàng.', '', '', '', '', 'null', '', 'Apriona', 'null'),
('Agromyza sp', 'Ruồi đục lá lúa', 'insect_Agromyza_sp', '* Vòng đời: 25-30 ngày\n\n- Trứng: 3-5 ngày\n\n- Giòi: 15-18 ngày\n\n- Nhộng: 5-7 ngày\n\n- Trưởng thành: 5-7 ngày Ruồi trưởng thành sống ở những lá lúa gần mặt nước. Một con cái đẻ trung bình 100 trứng. Giòi sống và phá hại ở đọt non lúa khi chưa bung ra nên ít khi thấy, khi lá mở ra giòi bò xuống phía dưới kẻ tai lá để hoá nhộng. Ruồi đục lá có thể phát sinh gây hại liên tục trong năm, thường chỉ gây hại ở giai đoạn lúa còn nhỏ trước khi có đòng. Ruộng lúa cấy bị hại nặng hơn ruộng mạ và lúa sạ thẳng.', '', '', '', '', 'null', '', 'Agromyza', 'null'),
('Agromyzidae', 'ruồi khai thác lá', 'insect_Agromyzidae', 'Giao phối bắt đầu trên không và kết thúc trên mặt đất, nơi con cái sau đó đẻ một khối trứng đôi khi có chất bài tiết bóng hay trắng như phấn, hỗ trợ giữ nước. Trứng được đẻ thành các khối có từ 100 đến 1000 trứng trên một bề mặt thẳng đứng treo trên mặt nước hay nền đất ướt thuận lợi cho ấu trùng phát triển. Trứng nở trong vòng 5-7 ngày. Chúng ngủ đông trong giai đoạn ấu trùng và phát triển thành nhộng vào mùa xuân và đầu mùa hè. \r\nVòng đời của con trưởng thành là 30 đến 60 ngày.', 'Một họ trên  toàn thế giới với khoảng 2.500 loài, chúng nhỏ, một số có cánh dài 1 mm. Kích thước tối đa là 6,5 mm. Hầu hết các loài có kích thước từ 2 đến 3 mm.Các agromyzid trưởng thành có thể được nhận biết bởi sự xơ cứng đặc biệt của đầu. Phần trên của các vây , phía trên đường khâu lỗ chân lông (được gọi là thủy tinh thể phía trước ) bị xơ cứng nhẹ và không có nốt sần , trong khi phần dưới của các vây và vùng lưng của đầu có xu hướng bị xơ cứng và đóng cặn nhiều hơn. Vì vậy, thủy tinh thể trán thường tạo thành một mảng đặc biệt trên đầu, khác biệt về màu sắc và kết cấu so với phần còn lại của đầu. Các mắt kép thường hình bầu dục và khá nhỏ, mặc dù trong một số loài, họ lớn hơn và tròn hơn.Các cánh thường hủy của , mặc dù những người của một vài loài nhiệt đới có đậm dấu. Một vài loài, bao gồm tất cả agromyza spp., Có khả năng stridulation , sở hữu một \"tập tin\" vào ngày đầu tiên bụng phân khúc và một \"cạo\" trên chân sau xương đùi . Họ Agromyzidae thường được gọi là ruồi đục khoét lá, vì thói quen kiếm ăn của ấu trùng của chúng , hầu hết chúng đều là những con sâu đục khoét lá trên nhiều loại cây khác nhau.', 'Ấu trùng Agromyzidae là loài thực vật ăn thực vật , kiếm ăn như những kẻ khai thác lá, ít thường xuyên hơn là những con sâu đục khoét thân hoặc sâu đục thân. Một số ít sống bằng hạt đang phát triển, hoặc tạo ra túi mật . Đôi khi ấu trùng ở rễ hoặc dưới vỏ cây. Sinh học của nhiều loài vẫn chưa được biết. Có một mức độ đặc hiệu cao đối với vật chủ , một ví dụ là Phytomyza ilicis , loài khai thác lá nhựa ruồi châu Âu không ăn các loài khác', 'Do có nhiều loại ký sinh trùng phổ biến, sâu vẽ bùa nói chung không phải là loài gây hại nghiêm trọng. Tuy nhiên, chúng có thể gây ra những thiệt hại lẻ tẻ. Việc tiêu diệt các loài thiên địch bằng cách sử dụng thường xuyên các loại thuốc trừ sâu được áp dụng để kiểm soát các loài gây hại khác có thể làm bùng phát sâu vẽ bùa. Trong số rất nhiều loại ký sinh trùng tấn công sâu vẽ bùa ở California, ong bắp cày, Solenotus trung gian, là loài có nhiều nhất trong khi Diglyphus spp. và Chrysocharis spp. có lẽ là quan trọng nhất để kiểm soát sâu vẽ bùa. Môi trường sống của thực vật thu hút các loài thiên địch và tránh sử dụng các loại thuốc trừ sâu phổ rộng gây hại cho các loài thiên địch.', 'Bắc, Trung Mỹ và Caribê,', 'null', 'insect_Agromyzidae/25725.jpg', 'Agromyza', 'null'),
('Agrotis ipsilon', 'Sâu xám', 'insect_Agrotis_ipsilon', 'Đẻ trứng rời rạc thành từng quả trên mặt đất, một bướm cái có thể đẻ khoảng 1000 trứng.Chúng giao phối và đẻ trứng vào ban đêm, có hứng thú với mùi chua ngọt. Tập tính của sâu non là có khả năng giả chết, khi bị đụng vào sẽ cuộn thân lại và lăn ra bất động.', '38–48 mm. Antennae ở đực lưỡng tính. Cánh chim có màu nâu, hơi đỏ, trộn lẫn với chất nhờn màu xám nhạt, màu trắng và đôi khi vùng trung bình có nhiều lông sẫm màu; dòng đầu tiên và dòng thứ hai có viền màu tối; các điểm được viền bằng màu đen, sau đó là dấu gạch ngang ngắn màu đen; đường phụ bị che khuất, thường có hai vết đen nhỏ ở trước ở giữa. Cánh sau có màu xám trắng hoặc hơi trắng, cuối cùng có nhiều lông mềm. Ấu trùng màu nâu nâu hoặc xám xám, hai bên đôi khi hơi xanh; đường lưng, đường dưới lưng và đường gai có màu đậm hơn hoặc nhạt hơn một cách mờ nhạt, thường có viền đậm hơn; đầu có màu nâu thường được sử dụng đánh dấu.', 'Loài này là loài di cư theo mùa, di cư lên phía bắc vào mùa xuân và phía nam vào mùa thu để thoát khỏi nhiệt độ khắc nghiệt vào mùa hè và mùa đông. Các mô hình di cư phản ánh cách sinh sản xảy ra vào mùa xuân và chấm dứt vào mùa thu.', 'Đối với những ruộng nhỏ, khi mật độ sâu thấp có thể bắt sâu bằng tay vào buổi sáng sớm hay chiều tối bằng cách bới đất quanh gốc cây bị sâu cắn để bắt sâu.Biện pháp sinh học:– Hạn chế phun thuốc để bảo tồn thiên địch trên đồng ruộng như nhện, bọ rùa, ong ký sinh…\r\n– Dùng bẫy bả chua ngọt để bẫy bướm. Cách làm bẫy bả chua ngọt: Trộn hỗn hợp gồm 4 phần đường + 4 phần dấm + 1 phần rượu + 1 phần nước. Cho vào trong bình đậy kín sau 3 – 4 ngày thì thêm vào 1% thuốc trừ sâu. Quấn giẻ hay bùi nhùi rơm rạ vào đầu gậy nhúng vào bả cắm trên bờ ruộng. Bướm trưởng thành sẽ bay vào ăn bả chua ngọt và bị chết. Cứ 2 – 3 ngày nhúng bả lại 1 lần.', 'Các quần thể của loài này đã được tìm thấy ở miền nam Canada , 48 của Hoa Kỳ (và thêm cả Hawaii ), Mexico , Trung và Nam Mỹ, Úc , New Zealand , Vành đai Thái Bình Dương , Bắc Phi , Châu Âu và Châu Á', 'null', 'insect_Agrotis_ipsilon/11961.jpg', 'Agrotis', 'null'),
('Aiolopus thalassinus', 'Châu chấu hoa', 'insect_Aiolopus_thalassinus', 'Vòng đời của châu chấu khoảng 200-210 ngày trong đó giai đoạn trứng 15-21 ngày. Giai đoạn sâu non: 100 ngày. Giai đoạn trưởng thành: khoảng 3 tháng. Con trưởng thành của châu chấu sống khoảng 3 tháng, trong đó con cái sống lâu hơn con đực. Sau khi hóa trưởng thành được 5-40 ngày thì bắt đầu giao phối, sau 10-41 ngày (trung bình trên dưới 20 ngày) bắt đầu đẻ trứng.Mỗi con cái có thể đẻ 3 ổ, mỗi ổ có 10-102 quả. Châu chấu thường thích đẻ trứng ở đất ẩm, xốp, có nhiều cỏ dại, nhiều ánh nắng, thích đẻ trên đất cát pha. Trứng hình ống hơi cong ở giữa, một đầu hơi to màu vàng đậm, ổ trứng hình túi, trong đó trứng xếp xiên hai hàng. Trứng đẻ thành ổ từ 10-30 quả trong thân lúa, nếp gấp của lá lúa và trong những bụi cỏ trên mặt nước.', '', '', '', '', 'null', '', 'Aiolopus', 'null'),
('Aleurocanthus spiniferus', 'ruồi trắng gai cam quýt', 'insect_Aleurocanthus_spiniferus', 'Sự bắt đầu và thời gian của chu kỳ sống, cũng như số thế hệ mỗi năm phụ thuộc nhiều vào khí hậu xung quanh. [5] [6] Nhiệt độ ôn hòa cùng với độ ẩm cao là môi trường lý tưởng để cây sinh trưởng và phát triển thành công. Kuwana và cộng sự. (1927) đã có thể ghi lại khoảng 4 thế hệ mỗi năm, với 7 thế hệ xảy ra trong điều kiện phòng thí nghiệm lý tưởng này. [6] Nghiên cứu này cũng có thể chứng minh sự thay đổi trong thời gian của vòng đời.', 'Các quả trứng thường được đẻ gần nhau trên cây lương thực, chẳng hạn như cây họ cam quýt, thường là trên lá. Đom đóm có sáu giai đoạn phát triển: trứng, giai đoạn thu thập thông tin (giai đoạn đầu tiên), hai giai đoạn nhộng trùng không cuống (giai đoạn thứ 2 và thứ 3), nhộng (giai đoạn thứ 4) và trưởng thành. Về mặt nhận dạng trong họ Aleyrodidae, giai đoạn nhộng (giai đoạn 4) hiển thị nhiều đặc điểm chẩn đoán nhất của loài bướm trắng có họ hàng gần.', 'Chất lượng và sản lượng trái cây có múi là mục tiêu chính mà các nhà nghiên cứu đang tập trung vào. A. spiniferus gây hại trực tiếp cũng như gây hại gián tiếp cho cây bị nhiễm bệnh. [7] Thiệt hại trực tiếp bao gồm sự suy yếu của những cây bị nhiễm bệnh do nhựa cây ăn vào. Loại thiệt hại thứ hai xảy ra khi ruồi trắng tiết mật trên bề mặt lá. Điều này lại thúc đẩy sự phát triển của nấm mốc, khiến nhiều bộ phận của cây bị nhiễm bệnh như lá, quả và cành bị bao phủ bởi nấm mốc. Điều này cản trở quá trình quang hợp, do đó làm giảm chất lượng tổng thể của cây. Người ta đã quan sát thấy rằng những loài gây hại cây có múi này cũng đã tấn công cây chè, chẳng hạn như Camellia sinensis được tìm thấy ở Nhật Bản. Tuy nhiên, các nhà nghiên cứu phát hiện ra rằng những con cái trưởng thành của quần thể nhiễm bệnh có múi không đẻ trứng trên lá của những cây chè này, và chỉ trên những cây có múi, do đó chứng tỏ tính độc quyền của mỗi quần thể.', 'các biện pháp kiểm soát hóa học đã được cố gắng để đối phó với sự bùng phát như phun thuốc trừ sâu, có thể được coi là hiệu quả tuy nhiên điều này phải trả giá đắt. Nồng độ thuốc trừ sâu cao này có thể dẫn đến kháng thuốc trừ sâu, và thuốc trừ sâu trong đồ uống trà gây ra các nguy cơ độc hại cho con người. [13] Do đó, do những yếu tố này, nói chung nó không được chứng minh là có hiệu quả đối với A. spiniferus, bao gồm cả các loài ruồi trắng khác trong các hệ thống cây trồng', 'Châu Phi, Úc, Châu Mỹ, các đảo Thái Bình Dương và Ý', 'null', 'insect_Aleurocanthus_spiniferus/61043.jpg', 'Aleurocanthus', 'null'),
('Aleurodicus dispersus', 'Rầy phấn trắng', 'insect_Aleurodicus_dispersus', 'Vòng đời từ 32 đến 44 ngày. Lá non chưa hoàn chỉnh (chưa mở) là nơi con cái ưa thích để đẻ trứng. Thời gian pha trứng từ 8 đến 31 ngày. Mỗi con cái có thể đẻ 80 trứng, số lượng trứng thay đổi theo mùa. Ấu trùng từ 1 đến 3 tuổi có thể di chuyển và gây hại trong phạm vi ngắn; đến tuổi thứ 4 thường được gọi là nhộng. Khi ấu trùng phát triển, chúng phủ một lớp bọc bằng sáp trắng giúp bảo vệ khỏi các tác động bên ngoài, nhất là thuốc trừ sâu, đây là đặc điểm riêng biệt của bọ phấn trắng ở các pha phát dục, trừ pha trứng.', '', '', '', '', 'null', '', 'Aleurodicus', 'null'),
('Alissonotum impressicolle', 'Bọ hung (đen), sùng trắng', 'insect_Alissonotum_impressicolle', 'Khi mới vũ hóa có màu nâu nhạt, đen óng ánh, kích thước 15 - 20 mm, mép ngoài của đốt chày chân trước có nhiều răng cưa, đốt đùi của chân giữa và sau có 3 túm lông nhỏ.Trứng hình bầu dục, mặt ngoài của trứng có vân ngang, mới đẻ màu trắng nhạt, xám.Sâu non mới nở màu trắng sữa, đầu ngực có màu nâu. Sâu ít chân, hình cong chữ C. Đốt cuối bụng của sâu non có nhiều gai và xếp không tạo hình nhất định. Đẩy sức từ 19 – 25 mm. Nhộng trần màu trắng nhạt, gần vũ hóa có màu nâu nhạt', '', '', '', '', 'null', '', 'Alissonotum', 'null'),
('Allocaridara malayensis', 'Rầy nhảy, rầy phấn', 'insect_Allocaridara_malayensis', 'Ấu trùng có màu xanh hơi ngả vàng và cơ thể được phủ sáp trắng, đặc biệt có các đuôi sáp dài ở cuối bụng.Thành trùng có màu xanh nâu, cơ thể không có phủ sáp trắng và sống ở mặt dưới mặt, ít khi bay chỉ nhảy khi bị động.\n\nẤu trùng và trưởng thành sống ở mặt dưới lá.Thành trùng đẻ trứng ở mặt trên lá non còn xếp lại thành từng ổ.\n\nTrứng có màu vàng hoặc nâu.\n', '', '', '', '', 'null', '', 'Allocaridara', 'null'),
('Alticini', 'Bọ nhảy hại rau (Flea Beetles)', 'insect_Alticini', '- Con trưởng thành là hình bầu dục, cơ thể dài khoảng 2 - 2,5 mm, cánh cứng, màu đen bóng, giữa mỗi cánh có một vạch màu vàng nhạc, cong hình củ lạc, chân sau to khỏe, có sức nhảy dài nên gọi là bọ nhảy sọc cong. ', '', '', '', '', 'null', '', 'Alticini', 'null'),
('Ampelophaga rubiginosa', 'Bướm đêm', 'insect_Ampelophaga_rubiginosa', 'Hầu hết các loài đều đa năng lượng, có khả năng tạo ra vài thế hệ trong năm nếu điều kiện thời tiết cho phép. [8] Con cái đẻ trứng trong mờ, màu xanh lục, dẹt, nhẵn, thường đơn lẻ trên cây chủ. Thời gian phát triển của trứng rất khác nhau, từ ba đến 21 ngày.Sâu bướm Sphingid có kích thước từ trung bình đến lớn, thân hình mập mạp. Chúng có năm cặp chân trước . [8] Thông thường, cơ thể họ thiếu bất kỳ sợi lông hoặc tubercules, nhưng hầu hết các loài có một \"sừng\" ở cuối sau, [2] có thể được giảm đến một nút, hoặc vắng mặt, trong trận chung kết instar . [8] Nhiều người khó hiểu rau xanh và nâu, và đã countershading mẫu để che giấu chúng. Những con khác có màu rõ ràng hơn, thường có các đốm trắng trên nền đen hoặc vàng dọc theo chiều dài của cơ thể. Một mô hình của các đường gạch chéo dọc theo cạnh là một đặc điểm chung. Khi nghỉ ngơi, ấu trùngthường giữ chân của nó khỏi bề mặt và cúi đầu xuống bên dưới (tư thế cầu nguyện), giống như Đại nhân sư Giza , dẫn đến cái tên \"bướm đêm nhân sư\". [8] Một số ấu trùng nhiệt đới được cho là bắt chước rắn. Ấu trùng nhanh chóng nôn ra chất dính, thường là chất độc, bám trước những kẻ tấn công như kiến ​​và ký sinh trùng. [8] Tốc độ phát triển phụ thuộc vào nhiệt độ, và để tăng tốc độ phát triển, một số loài ở phía bắc và độ cao phải tắm nắng. Ấu trùng đào sâu vào đất để tạo thành nhộng, chúng ở lại trong hai đến ba tuần trước khi trưởng thành.', 'Các sải cánh là 72-100 mm.Ấu trùng của bướm đêm thuộc họ này thường có cơ thể ngắn, nhiều thịt, và có nhiều loài có dạng như con sên. Chân ngực nhỏ, không có chân bụng và ấu trùng chủ yếu bò, trườn. Ấu trùng thường có dạng rất đặc biệt, cơ thể có nhiều gai cứng, gây ngứa, đặc biệt là ở loài Parasa lepida. Ngài (sinh học) được hình thành trong một cái kén rất cứng, còn gọi là nhộng, bên ngoài có một lớp tơ mỏng. Kén có hình tròn, hoặc bán cầu (có một mặt dính để bám chặt vào nơi làm kén). Khi vũ hóa, ngài thoát ra ngoài vỏ kén, mở cánh bắt đầu cuộc sống bay lượn.', 'null', 'Phương pháp của ông Oánh là dùng màn tuy có kích cỡ phù hợp với cây để trùm bao phủ lên trên thân cây, ngăn cách toán bộ cây trồng với bên  ngoài.\r\n\r\nƯu điểm của phương pháp này:  Hạn chế tối đa việc bị bướm và ruồi vàng phá hoại quả, không phải sử dụng đến thuốc bảo vệ thực vật. Nâng cao chất lượng nông sản để bán được giá cao hơn.\r\n\r\nSau mỗi vụ thu hoạch màn tuyn được dỡ ra, giặt sach, phơi khô và cho vào túi nilon để bảo quản. Thông thường sẽ dùng được khoảng 5 năm.', 'Nó được tìm thấy từ phía đông bắc Afghanistan , phía đông quanh rìa phía nam của dãy Himalaya đến Vân Nam , sau đó khắp Trung Quốc đến Viễn Đông Nga , Hàn Quốc. Bán đảo và Nhật Bản . Nó cũng được tìm thấy ở phía nam qua Thái Lan và Việt Nam đến Sumatra và bán đảo Malaysia', 'null', 'insect_Ampelophaga_rubiginosa/43920.jpg', 'Ampelophaga', 'null'),
('Ampittia maro', 'Sâu cuốn lá lớn bướm vàng nhỏ', 'insect_Ampittia_maro', 'Vòng đời của sâu cuốn lá lớn từ 32-40 ngày: Thời gian trứng: 4 ngày,Thời gian sâu non: 18-19 ngày,Thời gian nhộng: 6-7 ngày,Thời gian bướm: 4-5 ngày.Bướm đẻ trứng vào buổi sáng và đẻ rải rác ở mặt sau lá gần gân chính, mỗi lá từ 1-6 quả, một bướm cái có thể đẻ 120 quả trứng. Sau khi vũ hóa 20 phút là bướm có thể bay đi kiếm ăn. Bướm bay nhanh từng đoạn ngắn theo đường gấp khúc. Thường sau khi giao phối một ngày (cũng có thể sau 2 giờ) sau thì bướm sẽ đẻ trứng. Một năm sâu cuốn lá lớn phát sinh 6-7 lứa. Điều kiện hơi nóng bức và ẩm là thích hợp cho sâu phát sinh gây hại.\n\nSâu non nhả tơ cuốn lá thành bao lớn và cắn khuyết lá. Bị hại nặng cây lúa có thể trụi hẳn lá làm ảnh hưởng đến sinh trưởng, phát triển. Cây bị hại thường thấp nhỏ, đòng ngắn, thời gian lúa chín kéo dài hoặc đòng bị cuốn cong, không trỗ thoát hoặc gãy gập, không nở hoa kết hạt.\n\nSâu cuốn lá lớn phát sinh, gây hại từ giai đoạn lúa mới cấy cho đến khi lúa chín. Vào những năm mưa nhiều, thời tiết mát mẻ, sâu phát sinh nặng. Sâu cuốn lá lớn phân bố ở tất cả các vùng trồng lúa ở trong nước và trên thế giới. Ở Việt Nam, vùng trung du và miền núi bị hại nặng hơn vùng đồng bằng, vùng có bố trí cơ cấu cây trồng phức tạp cũng dễ bị hại nặng.', '', '', '', '', 'null', '', 'Ampittia', 'null'),
('Amsacta lactinea', 'Sâu róm nâu', 'insect_Amsacta_lactinea', 'Trứng đẻ thành hàng trên lá thông dạng elip màu xanh nhạt. Dần chuyển hồng nhạt, đạt màu hồng sẫm là khi trứng sắp nở.Con non có lông với 12 đốt, tổng cộng có 8 cặp chân. Từng giai đoạn có màu và chiều dài khác nhau, trải qua 5 lần lột xác. Con trưởng thành sở hữu thân màu nâu như đất với một lớp lông dẹt phủ bên ngoài. Lớp lông này khá dày,miệng có râu và vòi, lông phủ cả chân. Mỗi con dài 2,8 đến 3cm với cánh dài 2-2,7cm, mắt xanh vàng.Là dạng mắt kép, cánh trước màu đậm hơn điểm vài chấm nâu.', '', '', '', '', 'null', '', 'Aloa', 'null'),
('Anarsia lineatella', 'Sâu đục ngọn, đục quả', 'insect_Anarsia_lineatella', '+ Trứng: Trứng là vàng trắng chuyển dần sang màu cam và hình bầu dục.+ Ấu trùng: Sâu có đầu màu nâu sẫm và đốt ngực trước xen kẽ các dải màu nâu tối và sáng xung quanh vùng bụng. Một ấu trùng trưởng thành có thể dài 1/2 inch (12 mm).+ Nhộng: Các con nhộng mịn màng, màu nâu và không ở trong kén. Nhộng thường được tìm thấy bên dưới mô vỏ cây hoặc vết nứt trên vỏ cây.+ Thành trùng: Kích thước bướm khoảng 1/3 - 1/2 inch (8-12 mm). Nó có màu xám đen với vảy trắng và đen.', '', '', '', '', 'null', '', 'Anarsia', 'null'),
('Anasa tristis', 'Bọ xít (Squash Bug)', 'insect_Anasa_tristis', 'The adult Anasa tristis is a greyish-brown, somewhat flattened insect reaching a length of about 1.5 cm (0.6 in) and a width of 0.75 cm (0.3 in). There is often a row of alternate brown and gold spots along the margin of the abdomen. Adults survive for three or four months.', 'null', 'null', 'null', 'null', 'null', '', 'Anasa', 'null'),
('Andrallus spinidens', 'Bọ xít nâu viền trắng', 'insect_Andrallus_spinidens', 'Trưởng thành cơ thể có màu vàng nâu hoặc màu nâu. Mảnh lưng cứng màu nâu đến nâu đậm. Mút cánh có màu nâu đen. Mặt bụng có lớp phấn trắng (giống như vôi) bao phủ. Bọ xít trưởng thành qua đông lớp phần này bị mất dần hoawchj hoàn toàn không còn, trơ ra phần da cứng màu vàng sáng.- Trứng co hình cốc kích thuóc gần bằng bằng hạt đậu xanh, thường xếp thành 2 – 3 hàng trên lá, cành. Màu sắc thay đổi từ vàng sáng (mới đẻ) đến màu vàng xanh, màu nâu tím, khi sắp nở chuyển thành màu đen\nBọ xít non: mới nở có hình trứng, viền màu đen lốm đốm (gần giống con bọ rùa nhưng dẹt hơn), sau chuyển dần sang màu vàng nâu, nâu.                                                                        ', '', '', '', '', 'null', '', 'Andrallus', 'null'),
('Antestia anchora', 'Bọ xít hoa tròn', 'insect_Antestia_anchora', 'Trứng hình thùng được đẻ ở mặt dưới lá thành từng chùm với hàng kín; vào đầu mùa xuân, những con cái trưởng thành có mùa đông sẽ tìm kiếm những vật chủ thích hợp và thường ký gửi trứng của chúng trên những cây ký chủ hoang dã. Thường thì những quần thể trú đông này được tìm thấy dọc theo các đường biên giới thực địa, đặc biệt là dọc theo các hàng cây gần vị trí trú đông của chúng. Những cây trồng phát triển sau này trở nên hấp dẫn hơn khi những vật chủ hoang dã ban đầu này khô đi, và sự gần gũi của chúng cho phép dễ dàng xâm nhập vào các đàn bọ xít trên cây trồng; nhộng mới nổi có màu xám và ở trên / gần khối trứng, sau đó bắt đầu kiếm ăn và phân tán khi chúng lớn lên.', '', '', '', '', 'null', '', 'Antestiopsis', 'null'),
('Aonidiella aurantii', 'Rệp sáp', 'insect_Aonidiella_aurantii', 'Rệp sáp sinh sản rất nhanh, có thể sinh sản theo kiểu đơn tính và lưỡng tính. Con đực có thêm giai đoạn tiền nhộng và nhộng. Rệp cái đẻ trứng thành từng ổ, một con cái đẻ khoảng 300 - 400 trứng, tỷ lệ nở của trứng khá cao khoảng 80% trở lên. Rệp sáp đẻ trứng sớm, sau khi nở khoảng 20 - 25 ngày (tuổi 3) là rệp sáp bắt đầu đẻ trứng, từ khi bắt đầu đẻ đến lúc ngưng đẻ và chết là khoảng 20 - 30 ngày.', '', '', '', '', 'null', '', 'Aonidiella', 'null'),
('Aphidoidea', 'rệp', 'insect_Aphidoidea', 'Vòng đời của một số loài liên quan đến sự luân phiên giữa hai loài cây ký chủ, ví dụ giữa cây hàng năm và cây thân gỗ . Một số loài chỉ ăn một loại thực vật, trong khi những loài khác là sinh vật tổng hợp, sống tập trung nhiều nhóm thực vật. Khoảng 5.000 loài rệp đã được mô tả, tất cả đều thuộc họ Aphididae . Khoảng 400 trong số này được tìm thấy trên cây lương thực và cây lấy sợi , và nhiều loài là loài gây hại nghiêm trọng cho nông nghiệp và lâm nghiệp , cũng như gây khó chịu cho những người làm vườn . Cái gọi là kiến vắt sữa có mối quan hệ tương hỗ với rệp, chăm sóc chúng để lấy mật, và bảo vệ chúng khỏi những kẻ săn mồi .', 'Rệp cây là một trong những loài côn trùng phá hoại nhiều nhất đối với cây trồng ở các vùng ôn đới.[3] Thiệt hại mà chúng gây ra cho cây cối đã làm cho trở thành kẻ thù của nông dân và người làm vườn trên toàn thế giới, nhưng từ quan điểm động vật, chúng là một nhóm sinh vật rất thành công.[4] Thành công của chúng một phần là do khả năng sinh sản vô tính của một số loài. Có khoảng 4400 loài thuộc 10 họ được biết đến. Trong lịch sử, một số họ được công nhận, hầu hết các loài được đưa vào họ Aphididae. Khoảng 250 loài là loài dịch hại nghiêm trọng cho nông nghiệp và lâm nghiệp cũng như một số ít hơn gây phiền toái cho người làm vườn. Chúng khác nhau về chiều dài từ 1 đến 10 milimét (0,04 đến 0,39 in).', 'Vào mùa thu, nhộng đực được tạo ra để trưởng thành và giao phối với con cái.Con cái đẻ trứng sống qua mùa đông trên cây.\r\nVào mùa xuân, trứng nở và rệp cái mới kiếm ăn và sinh sản.', 'Biện pháp đơn giản nhất là dùng que khều bắt rệp ở khe giường, giũ chiếu xuống sàn để tìm rệp và diệt. Sau đó dùng nước sôi dội vào các khe, kẽ giường hoặc dùng đóm lửa lùa vào để đốt chết rệp con và làm ung trứng. Cũng có thể dùng nước xà phòng đun nóng để đổ vào, rồi cọ rửa sạch và phơi ra ngoài nắng.Nếu có điều kiện, dùng dụng cụ hun khói chứa hóa chất pyrethroid diệt côn trùng để hun khói trong nhà. Dụng cụ sẽ cháy khoảng 3-15 phút và chỉ có thể dùng được một lần. Một làn khói với các hạt hóa chất rất nhỏ được sinh ra có thể len lỏi vào các khe kẽ để giết chết rệp và bọ chét, ruồi, muỗi. Loại màn tẩm hóa chất dùng phòng chống muỗi sốt rét cũng có tác dụng làm sạch rệp và chấy.\r\n\r\nVới những ngôi nhà bị nhiễm rệp nặng, cần phải phun hóa chất diệt tồn lưu do đơn vị quân y thực hiện. Có thể dùng dipterex 2-3%, DDVP 3%o hoặc pyrethrin 0,1-0,2% phun vào nơi có rệp. Chỉ một lần phun cũng có thể tiêu diệt rệp, nhưng nếu rệp vẫn còn thì có thể phun lại một lần nữa cách lần thứ nhất không dưới 2 tuần. Thường phải phun đến khi tường và sàn nhà ướt (tương ứng với 1 lít cho 50 m2 đối với bề mặt không thấm nước, 5 lít cho bề mặt thấm nước như tường gạch, đất). Cần phun vào buổi sáng để cho khô và tối có thể vào nhà ngủ được, hoặc sau khi phun 2 giờ, đem giường chiếu cọ rửa sạch rồi phơi nắng thật khô.\r\n\r\nCó thể diệt rệp theo kinh nghiệm dân gian: dùng một phần hoa hồi, hai phần bồ kết đem tán nhỏ, hòa với thuốc lào, nước điếu rồi nhỏ vào các khe kẽ giường có rệp; hoặc lấy cây thuốc lào tươi rải khắp giường rồi trải chiếu lên; có thể dùng lá thuốc lào khô tán nhỏ, rắc vào khe giường hoặc đốt lùa khói vào khe giường. Một số nơi thì dùng lá xoan lót dưới chiếu. Các biện pháp trên có tác dụng làm cho rệp chui ra để diệt.', 'phân bố phổ biến tại vùng Đông Nam châu Á, Australia, New Zealand, quần đảo Pacific, Nam Mỹ, Caribbean, Floria và Nam Phi. Chúng là loài gây hại chủ yếu trên cây có múi (Citrus).', 'null', 'insect_Aphidoidea/17096.jpg', 'Aphis', 'null'),
('Aphis craccivora', 'Rệp đen, rệp đậu màu đen', 'insect_Aphis_craccivora', 'Muội đen trưởng thành có màu đen hoặc màu nâu bóng với kích thước từ 2 đến 3mm.Khả năng sinh sản của rệp muội đen xâm hại tiêu là rất lớn, trung bình 1 con cái trưởng thành sẽ đẻ đến 50 con.', '', '', '', '', 'null', '', 'Aphis', 'null'),
('Aphis maydis', 'Rệp, rệp hại ngô', 'insect_Aphis_maydis', 'Rệp ngô sinh sản theo lối đơn tính và đẻ con. Trong quần thể rệp thường thấy nhiều loại hình: Rệp cái không cánh, rệp cái có cánh và rệp con. Rệp trưởng thành có hai loại hình, rệp có cánh và rệp không cánh dài 1,5 - 2,3 mm, màu vàng nhạt hoặc xanh xám, cơ thể hình bầu dục, thân mềm. Chân và tuyến tiết sáp ngắn, màu xanh đen. Rệp cái có cánh có đầu, ngực màu đen và bụng màu xanh. Rệp non màu xanh sáng, chân và tuyến tiết sáp giống như trưởng thành có màu đen.', '', '', '', '', 'null', '', 'Rhopalosiphum', 'null'),
('Aphis spp', 'Rệp muội', 'insect_Aphis_spp', ' Rệp non và trưởng thành sống tập trung ở ngọn và mặt dưới lá non, ít di chuyển, khi mật độ rệp cao hoặc vào cuối vụ thường xuất hiện dạng có cánh để di chuyển phát tán.-    Rệp trưởng thành đẽ trứng mặt dưới lá. Trong điều kiện nhiệt độ và ẩm độ thích hợp, rệp sinh sản theo cách đơn tính và đẽ ra con, mật đọ tăng rất nhanh.-    Vòng đời trung bình 15 – 20 ngày.-    Rệp chích hút nhựa cây làm lá bị cong và xoăn lại, cây sinh trưởng kém, lá bị vàng héo, quả nhỏ và dễ bị cháy xám.-    Chất dịch do rệp tiết ra dẫn dụ kiến đến và là môi trường cho loài nấm muội phát triển.', '', '', '', '', 'null', '', 'Aphis', 'null'),
('Aphis citricola van der Goot', 'rệp hại cam quýt', 'insect_Aphis_citricola_van_der_Goot', 'Rệp non và trưởng thành sống tập trung ở ngọn và mặt dưới lá non, ít di chuyển, khi mật độ rệp cao hoặc vào cuối vụ thường xuất hiện dạng có cánh để di chuyển phát tán.-    Rệp trưởng thành đẽ trứng mặt dưới lá. Trong điều kiện nhiệt độ và ẩm độ thích hợp, rệp sinh sản theo cách đơn tính và đẽ ra con, mật đọ tăng rất nhanh.-    Vòng đời trung bình 15 – 20 ngày.-    Rệp chích hút nhựa cây làm lá bị cong và xoăn lại, cây sinh trưởng kém, lá bị vàng héo, quả nhỏ và dễ bị cháy xám.-    Chất dịch do rệp tiết ra dẫn dụ kiến đến và là môi trường cho loài nấm muội phát triển.', 'Rệp muội đen có cánh hoặc không cánh, hình dạng và kích thước tương tự như rệp muội nâu Toxoptera aurantii, tuy nhiên đốt râu thứ I, II và III của trưởng thành có cánh có màu đen và trên cauda có mang 25-40 lông nhỏ. Vết trên cánh trước nhạt, bên cạnh đó gân media ở cánh trước của rệp muội đen Toxoptera citricida chẻ đôi 2 lần.', 'Đây là loài rệp muội gây hại quan trọng nhất trên cây có múi (Citrus). T. citicidus gây hại bằng cách chích hút chồi non, tập trung chủ yếu ở mặt dưới lá, làm chồi biến dạng, lá cong queo còi cọc, không phát triển. Ngoài ra, rệp muội đen còn tiết mật ngọt làm nấm muội đen phát triển, ảnh hưởng đến sự quang hợp của cây. T. citricidus còn là tác nhân quan trọng trong việc truyền bệnh “Tristeza” trên cam quýt. Đây là một loại bệnh đã gây chết nhiều vườn cam quýt trên thế giới.', 'Tại nhiều nước trên thế giới, biện pháp sinh học đã được sử dụng để phòng trị rệp muội đen, trong điều kiện tự nhiên, thành phần thiên địch của rệp muội rất phong phú, có thể khống chế sự bộc phát của rệp muội. Có thể sử dụng các loại thuốc trừ sâu phổ biến gốc Cúc, Carbamate hoặc gốc lân hữu cơ để phòng trị.', 'hân bố phổ biến tại vùng Đông Nam châu Á, Australia, New Zealand, quần đảo Pacific, Nam Mỹ, Caribbean, Floria và Nam Phi. Chúng là loài gây hại chủ yếu trên cây có múi (Citrus).', 'null', '', 'Aphis', 'null'),
('Apolygus lucorum', 'rệp xanh nhỏ', 'insect_Apolygus_lucorum', 'Hemipterans là dị hóa , có nghĩa là chúng không trải qua quá trình biến thái , sự thay đổi hoàn toàn về hình thức giữa giai đoạn ấu trùng và giai đoạn trưởng thành . Thay vào đó, con non của chúng được gọi là nhộng , và giống con trưởng thành ở mức độ lớn hơn hoặc thấp hơn. Các nymphs thay lông nhiều lần khi chúng lớn, và mỗi instar giống người lớn hơn so với trước đó. Chồi cánh phát triển ở giai đoạn sau nhộng; việc chuyển đổi thức phức tạp hơn là sự phát triển của cánh chức năng (nếu họ có mặt tại tất cả) và chức năng cơ quan sinh dục, không có can thiệp nhộng sân khấu như trong holometabolous côn trùng.', 'Các loài Apolygus có màu xanh lục và hình bầu dục khá rộng. Các gai đen không phát sinh từ các đốm đen và đoạn anten thứ 2 thường ngắn hơn chiều rộng của pronotum ở gốc.Trưởng thành: Tháng 7-10\r\nChiều dài 5-6 mm', 'A.lucorum ăn nhiều loại thực vật bao gồm tansy , tầm ma , Eupatorium , bao da cáo , cây kế chà là ( Cirsium ), cây liễu ( Epilobium ) và đặc biệt là ngải cứu xuyên qua các mô thực vật và ăn nhựa cây. Con trưởng thành được tìm thấy từ tháng bảy đến tháng mười.', 'Các thành viên của các họ Reduviidae , Phymatidae và Nabidae là những kẻ săn mồi bắt buộc. Một số loài săn mồi được sử dụng trong kiểm soát dịch hại sinh học ; chúng bao gồm các loài nabids khác nhau , [74] và thậm chí một số thành viên của các họ chủ yếu là thực vật, chẳng hạn như chi Geocoris trong họ Lygaeidae . [75] Các loài hemipterans khác là động vật ăn tạp , xen kẽ giữa chế độ ăn dựa trên thực vật và động vật. Ví dụ, Dicyphus hesperus được sử dụng để kiểm soát ruồi trắng trên cà chuamà còn hút nhựa cây, và nếu bị tước đoạt các mô thực vật sẽ chết ngay cả khi có ruồi trắng.', 'Được tìm thấy phổ biến trên khắp nước Anh trên nhiều loại cây bao gồm tansy, tầm ma, cây gai dầu và đặc biệt là ngải cứu', 'null', 'insect_Apolygus_lucorum/40703.jpg', 'Apolygus', 'null'),
('Archips micaceana', 'Sâu ăn lá', 'insect_Archips_micaceana', 'Trưởng thành là một loài bướm, có chiều dài cơ thể khoảng 20 - 25mm, sải cánh rộng 60 - 70mm. Thân và cánh mầu đen, trên cánh có nhiều đốm mầu trắng và mầu vàng hình bầu dục.Trưởng thành thường hoạt động ban ngày. Trứng được đẻ rải rác trên các đọt non, lá non.Sâu non hình ống, thân màu xanh trong, đầu màu nâu đen. Khi đẫy sức sâu dài khoảng 25 - 28mm.Sâu non thường nhả tơ kéo vài lá non lại với nhau làm tổ để sống và hóa nhộng ở trong đó.', '', '', '', '', 'null', '', 'Archips', 'null'),
('Asparagus beetles', 'Bọ măng tây (Asparagus Beetles)', 'insect_Asparagus_beetles', 'It is important to correctly identify the two different kinds of asparagus beetles because the common asparagus beetle is found more often and causes more damage.\n\nBoth types of asparagus beetle adults are ¼-inch long with oval-shaped bodies and moderate length antennae.\n\nThe adult common asparagus beetle (Crioceris asparagi) is bluish-black with six cream colored spots on its back.\nAdult spotted asparagus beetles (Crioceris duodecimpunctata) are reddish-orange with twelve black spots.', 'null', 'null', 'null', 'null', 'null', '', 'Crioceris', 'null'),
('Aspidiotus sp', 'Rệp', 'insect_Aspidiotus_sp', 'Trứng đẻ thành từng đám 10-50 quả và gắn vào giá thể nơi cư trú như kẻ nứt của tường, kẻ giường, chiếu. trứng có thể tồn tại 1 tháng đến 1 năm, trung bình 9 – 10 ngày nở ra thiếu trùng.Thiếu trùng trải qua 5 tuổi trong vòng 8 ngày trong điều kiện nhiệt độ và dinh dưỡng thuận lợi. Một con rệp cái đẻ 200 – 500 trứng, trung bình 5 trứng một ngày và đẻ trong vòng đời kéo dài 6 tuần đến vài tháng. Con đực cần đốt máu trước khi giao hợp và con cái cần hút máu trước khi đẻ trứng. Một con đực sẽ giao phối với con cái nhiều lần.Tất cả các giai đoạn thiếu trùng đều hút máu, giống với rệp trưởng thành nhưng kích thước nhỏ hơn và chưa có cơ quan sinh dục.', '', '', '', '', 'null', '', 'Aspidiotus', 'null'),
('Atractomorpha', 'Cào cào nhỏ', 'insect_Atractomorpha', 'Trứng:Đây là nơi bắt đầu vòng đời của cào cào. Sau quá trình giao phối với con đực, cào cào mẹ sẽ đẻ trứng.Trứng được mẹ bảo vệ ở nơi đất cát ẩm, trong các lỗ sâu từ 2 – 10 cm. Cào cào mẹ thường tiết nước bọt bao phủ trứng để bảo vệ chúng, tránh trứng bị thất lạc.Ấu trùng:Sau khoảng 10 – 20 ngày tùy vào độ ẩm và nhiệt độ của đất, trứng cào cào sẽ nở thành ấu trùng. Chúng sẽ trải qua khoảng 5 lần lột da.Các ấu trùng có hình dáng tương tự con trưởng thành nhưng không hoàn thiện.Cận trưởng thành:Đây là giai đoạn cuối cùng đối với sự phát triển của cào cào. Lúc này, toàn bộ các chức năng của cơ thể chúng đã được hoàn thiện.Đây cũng là giai đoạn kết thúc vòng đời của cào cào. Trung bình, 1 vòng đời sẽ kéo dài khoảng 8 tuần kể từ khi chúng được sinh ra cho đến lúc chết.', '', '', '', '', 'null', '', 'Atractomorpha', 'null'),
('Aulacophora frontalis', 'Bọ ăn lá', 'insect_Aulacophora_frontalis', '', '', '', '', '', 'null', '', 'Aulacophora', 'null'),
('Aulacophora similis', 'Bọ dưa, bọ rầy dưa', 'insect_Aulacophora_similis', 'Thành trùng có chiều dài thân từ 6 - 8 mm, cánh màu vàng nâu, mắt đen, râu dài rất linh động. Đời sống của thành trùng rất dài, khoảng 100 - 200ngày. Một thành trùng cái đẻ khoảng 200 trứng.\nTrứng rất nhỏ, dài khoảng 0,8 mm và rộng 0,3 mm, màu vàng xanh khi mới đẻ và màu vàng nâu khi sắp nở. Thời gian ủ trứng từ 8 - 15 ngày.\nẤu trùng mới nở màu trắng sữa, sau thành màu vàng nâu, đầu màu nâu, điểm đặc biệt là có 1 đôi chân giả. Ấu trùng có 3 tuổi với thời gian phát triển từ 18 đến 35 ngày.\nNhộng màu nâu nhạt, thời gian nhộng từ 5 - 14 ngày. Nhộng được hình thành trong đất, bên ngoài bao phủ bằng một kén tơ rất dày. Nhộng phát triển trong thời gian từ 4 - 14 ngày.\nVòng đời bọ dưa từ 80 - 130 ngày.', '', '', '', '', 'null', '', 'Aulacophora', 'null'),
('Bactrocera', 'Ruồi đục trái', 'insect_Bactrocera', 'Trứng hình hạt gạo, màu trắng sữa, khi sắp nở chuyển sang vàng nhạt.Dòi mới nở dài khoảng 1,5mm, phát triển đầy đủ dài 6-8mm, màu vàng nhạt, miệng có móc. Khi phát triển đầy đủ, Dòi búng mình rơi xuống đất để hóa nhộng trong đất, thời gian nhộng khoảng 7-12 ngày hoặc dài hơn nếu gặp lạnh. Dòi làm nhộng sâu trong đất khoảng 3-7cm.Nhộng dài 5-7mm, có hình trứng dài, lúc đầu màu vàng nâu, khi sắp vũ hóa có màu nâu đỏ.Thành trùng có cơ thể dài 6-9mm, sải cánh rộng 1,3mm, đầu có dạng hình bán cầu, mặt màu nâu đỏ với sáu chấm đỏ màu đen.Thân màu vàng nâu đỏ với những vân vàng, cánh trong, hình dạng giống nhưng nhỏ hơn ruồi nhỏ.Thời gian sống của thành trùng 1-3 tháng. Thành trùng có thể bay rất xa.', '', '', '', '', 'null', '', 'Bactrocera', 'null'),
('Bactrocera dorsalis', 'ruồi giấm phương đông', 'insect_Bactrocera_dorsalis', 'Vòng đời của ruồi từ 30 - 40 ngày: Trứng: 2 - 3 ngày → Dòi (sâu non): 10 - 18 ngày → Nhộng: 8 - 10 ngày → Trưởng thành: 10 - 20 ngày. Ruồi cái thường dùng bộ phận đẻ trứng chọc thủng vỏ trái và đẻ trứng vào trong vùng tiếp giáp giữa vỏ và thịt trái. Trứng được đẻ thành từng ổ từ 5 – 10 trứng. Dòi nở ra đục và ăn phần mềm trái, thải phân làm ô nhiễm trái, từ đó làm trái thối và rụng.\r\n\r\nĐẫy sức dòi cắn vỏ chui ra búng mình rơi xuống đất làm nhộng. Ruồi đẻ trứng mạnh trong giai đoạn quả gần già đến chín. Ruồi phát sinh rộ bắt đầu từ cuối mùa khô, đầu mùa mưa và kéo dài cho đến hết mùa mưa. Ruồi ưa hoạt động trong vườn cây rậm rạp, um tùm.', 'Trưởng thành ruồi màu nâu, kích thước 7mm, trên lưng ngực giữa có 2 vệt vàng dọc, lưng ngực sau có vệt vàng ngang, 3 vệt này xếp thành hình chữ \"U\". Bụng tròn giống bụng ong và cuối bụng nhọn. Phía lưng bụng có 2 vệt đậm đen hình chữ \"T\". Trứng ruồi hình trái dưa leo, dài 1mm, màu vàng nhạt. Ấu trùng dạng dòi, màu trắng, mới nở dài 1,5mm, đẫy sức có thể dài đến 8mm. Nhộng dạng nhộng bọc nằm trong kén hình trứng dài, màu nâu đỏ.', 'Loài ruồi này là một loại côn trùng đa thực vì ngoài ổi chúng còn gây hại trên rất nhiều loại quả cây khác, như mận, táo, sapôche, đu đủ, xoài, thanh long, chôm chôm, mãng cầu xiêm... và là một dịch hại nguy hiểm đối với cây ăn quả vì sâu non sinh sống và gây hại trong quả. Ngoài tác hại trực tiếp, ruồi đục quả Phương Đông còn là đối tượng kiểm dịch thực vật của nhiều nước nhập khẩu sản phẩm quả tươi. Ruồi cái thường dùng bộ phận đẻ trứng chọc thủng vỏ trái và đẻ trứng vào trong vùng tiếp giáp giữa vỏ và thịt trái. Vết chích rất nhỏ chỉ nhìn thấy nhờ vết mủ trái chảy ra. Dòi nở ra đục và ăn phần mềm trái, thải phân làm ô nhiễm trái, từ đó làm trái thối và rụng.', 'null', 'Đây là loài đặc hữu Đông Nam Á nhưng cũng được du nhập vào Hawaii, quần đảo Mariana và Tahiti.', 'null', 'insect_Bactrocera_dorsalis/62092.jpg', 'Bactrocera', 'null'),
('Bactrocera tsuneonis', 'ruồi cam nhật bản', 'insect_Bactrocera_tsuneonis', 'Thời kỳ tiền đẻ của con cái là 17 đến 25 ngày. Sự đẻ trứng chủ yếu xảy ra vào tháng 7 và tháng 8, và trứng được đẻ dưới vỏ. Trái cây có vỏ dày hiếm khi bị tấn công vì trứng không đủ dài để tiếp cận cùi. Thông thường, một vết thủng do trứng rụng duy nhất được thực hiện trên một quả; từ hai đến sáu trứng được gửi vào một lỗ thủng mà từ đó chỉ có một ấu trùng xuất hiện. Ấu trùng xuất hiện vào khoảng đầu tháng 10 và ăn hết các chất trong lá noãn này đến lá noãn khác, từ hai đến mười lá noãn bị một con giòi phá hoại. Đến đầu tháng 11, ấu trùng trưởng thành, và khoảng thời gian này trái bị nhiễm bệnh rơi xuống đất. Nhồi máu xuất hiện ở hai inch trên cùng của đất. Thỉnh thoảng, ấu trùng rơi xuống đất để hóa nhộng trong khi quả vẫn còn trên cây. Con trưởng thành ăn mật ong do rệp, cầu trùng và rầy chổng cánh tiết ra; điều này dường như cần thiết cho sức khỏe, tuổi thọ và sản xuất trứng trong giai đoạn tiền đẻ trứng. Giao phối thường xuyên rõ ràng là cần thiết, vì điều này xảy ra sau mỗi đợt trứng đã được gửi vào.', 'Các giai đoạn chưa trưởng thành có bề ngoài tương tự như các giai đoạn Bactrocera khác. Mỗi trong số hai nhánh trước của ấu trùng trưởng thành có khoảng 34 ống. Con trưởng thành lớn hơn so với hầu hết các loài Bactrocera khác. Con cái trưởng thành dài khoảng 11 mm, không kể vòi trứng, với cánh mở rộng khoảng 10 mm; con đực nhỏ hơn một chút. Đầu chủ yếu là màu vàng, với một hình tam giác ô bào màu đen; râu ochraceous, Arista piceous, có gốc màu vàng. Lồng ngực dày đặc, chủ yếu là chất nhờn, với màu vàng, ngắn, màu vàng; một vệt tinh hoàn màu tía hình chữ Y theo chiều dọc trung bình trên lưng, kết thúc ở phía sau ở trung tâm của đờm; một cặp tuyến tinh hoàn màu tía khá mờ nhạt, hơi gợn sóng, bị đứt đoạn ở đường khâu ngang và hợp nhất ở phía sau với các nhánh sau của vệt hình chữ Y, một mảng màu vàng trên mỗi mô sẹo lõm; bìu màu vàng nhạt với hai lông cứng. Các hateres là ochraceous. Chân có chất nhờn, có màu vàng muốt. Bụng có nhiều lỗ thủng, có chất nhờn sáng ở trên, màu vàng ở dưới, và màu nâu ở cuối, với một đoạn ngắn màu vàng nhạt; một vệt dọc màu đen ở giữa, khá rộng, kéo dài chiều dài của bụng, hoặc gần như vậy; các dải ngang xuất hiện trên phân đoạn thứ ba, thứ tư và đôi khi là phân đoạn thứ năm, dải trên đường dọc đánh dấu chéo của phân đoạn thứ ba.', 'Bướm khế chủ yếu sinh sống ở môi trường rừng nhiệt đới khô, rừng thứ sinh và cây bụi.Nơi sống ưa thích của loài bướm này là dưới các tán cây. Đặc biệt, ở Việt Nam loài sinh vật này thường sống và đẻ trứng trên cây khế, đây cũng là một lý do mà chúng được gọi là bướm khế.', 'null', 'Nhật, Mỹ, Trung Quốc', 'null', 'insect_Bactrocera_tsuneonis/62532.jpg', 'Bactrocera', 'null'),
('Beet armyworm', 'sâu quân đội củ cải', 'insect_Beet_armyworm', 'Trứng: Trứng được đẻ thành từng chùm từ 50 đến 150 trứng mỗi khối. Sản lượng trứng bình thường là khoảng 300 đến 600 mỗi con cái. Trứng thường nằm ở mặt dưới của lá, và thường ở gần hoa và đầu cành. Các quả trứng riêng lẻ có hình tròn khi nhìn từ trên xuống, nhưng khi nhìn từ bên cạnh, quả trứng hơi có đỉnh, thuôn nhọn. Trứng có màu từ xanh lục đến trắng và được bao phủ bởi một lớp vảy màu trắng làm cho khối trứng có vẻ ngoài mờ hoặc bông. Trứng nở sau hai đến ba ngày khi thời tiết ấm áp.\r\n\r\nẤu trùng: Thông thường có năm cá thể, mặc dù đôi khi các cá thể bổ sung được báo cáo. Thời gian của các hình ảnh trong điều kiện ấm áp (mùa hè) được báo cáo lần lượt là 2,3, 2,2, 1,8, 1,0 và 3,1 ngày (Wilson 1932) và ở 30 ° C thời gian phát triển không đổi được báo cáo bởi Fye và McAda (1972) tương ứng là 2,5, 1,5, 1,2, 1,5 và 3,0 ngày. Chiều rộng đầu nang trung bình lần lượt là 0,25, 0,45, 0,70, 1,12 và 1,80 mm.Con trưởng thành: Bướm đêm có kích thước vừa phải, sải cánh từ 25 đến 30 mm. Các cánh trước có màu xám và nâu lốm đốm, bình thường có dạng dải không đều và đốm hình hạt đậu màu sáng. Các cánh sau có màu xám hoặc trắng đồng đều hơn và được trang trí bằng một đường sẫm màu ở rìa. Sự giao phối xảy ra ngay sau khi bướm đêm xuất hiện, và sự đẻ trứng bắt đầu trong vòng hai đến ba ngày. Thời gian đẻ trứng kéo dài trong khoảng thời gian từ ba đến bảy ngày, và những con bướm đêm thường chết trong vòng từ chín đến 10 ngày sau khi xuất hiện. Heppner (1998) cung cấp chìa khóa cho những con trưởng thành của Spodoptera Bắc Mỹ .', 'Con trưởng thành là một con bướm đêm màu nâu xám hoặc xám với sải cánh dài 26–32 mm (1– 1+1 ⁄ 4  in). Cánh trước có màu xám đục, rửa sạch có màu vàng xỉn và có vảy đen. Các đường bên trong và bên ngoài là đôi, không rõ ràng, được tô màu vàng nhạt. Bóng tối ở giữa có dải phân cách có thể nhìn thấy trước nửa dưới của đường bên ngoài. Tế bào màu nâu sẫm. Vòi nhụy hình cầu có màu nhạt hoặc vàng tươi, và hình tròn, trong khi bầu dục có hình ống cong màu nâu ở trung tâm. Đường phụ có màu xám nhạt. Có bóng tối trước nó với các vệt tối giữa các đường gân. Các điểm đầu cuối có màu đen. Đá bán nguyệt của Hindwings có màu trắng, với các đường vân màu nâu sẫm. Cả ba lề đều được tô bằng màu khó hiểu.Sâu non có màu nâu hồng, vón cục màu đen. Đường xoắn ốc màu trắng đục, có mép trên sẫm màu. Chúng là những con sâu xanh có màu nâu xanh, thân mềm và phình ra với những sọc dọc sẫm màu', 'Hoạt động theo mùa thay đổi đáng kể theo khí hậu. Ở những nơi ấm áp như Florida, tất cả các giai đoạn có thể được tìm thấy trong suốt cả năm, mặc dù tốc độ phát triển và sự phong phú tổng thể bị giảm trong những tháng mùa đông (Tingle và Mitchell 1977). Vòng đời có thể hoàn thành trong vòng 24 ngày, và sáu thế hệ đã được nuôi trong năm tháng thời tiết mùa hè ở Florida (Wilson 1934).', 'Bẫy pheromone và gắp côn trùng bằng tay cơ học đối với những con trưởng thành và sâu bướm được sử dụng rộng rãi. Các loài ký sinh trùng như Chelonus insularis , Cotesia marginiventris , Meteorus autographae , Lespesia archippivora đẻ trứng trên sâu bướm, ấu trùng của chúng kiếm ăn và xuất hiện. Các loài ăn thịt như Orius sp., Geocoris sp., Nabis sp., Podisus maculiventris cũng là biện pháp phòng trừ hiệu quả. Các giai đoạn của đồng tử có thể được loại bỏ bằng cách đưa Solenopsis invicta vào ruộng.Ngoài biện pháp kiểm soát sinh học, nhiều loại thuốc trừ sâu hóa học được sử dụng rộng rãi. Ấu trùng dễ bị ảnh hưởng bởi các sản phẩm neem . Trứng có thể bị giết bằng cách sử dụng nồng độ dầu mỏ. Bôi dầu hạt bông lên lá có thể diệt được cả trứng và ấu trùng.', 'Nó có nguồn gốc từ châu Á, nhưng đã được giới thiệu trên toàn thế giới và hiện nay được tìm thấy ở hầu hết mọi nơi có nhiều cây chủ được trồng.', 'null', 'insect_Beet_armyworm/27606.jpg', 'Spodoptera', 'null'),
('Bemisia myricae', 'Bọ phấn (trắng)', 'insect_Bemisia_myricae', '– Bọ trưởng thành có kích thước nhỏ, màu vàng nhạt, Toàn thân và cánh được phủ bởi một lớp phấn màu trắng,chân dài và mảnh.\n– Trứng rất nhỏ hình bầu dục, màu trắng trong sau chuyển sang màu nâu nhạt rồi màu nâu xám khi sắp nở.\n– Ấu trùng tuổi 1 màu vàng nhạt, hình ô van, khi mới nở có chân, bò dưới mặt lá. Sang tuổi 2 sâu non không còn chân (nhộng giả), hình bầu dục, màu sáng, có mắt kép, râu đầu và lông thưa ở 2 bên sườn.', '', '', '', '', 'null', '', 'Bemisia', 'null'),
('Bemisia tabaci', 'Ruồi trắng lá bạc', 'insect_Bemisia_tabaci', 'Đầu tiên instar , thường được gọi là một trình thu thập, là giai đoạn nhộng chỉ điện thoại di động. Nhộng trùng đầu tiên có thể phát triển đến khoảng 0,3 mm và có màu xanh lục và cấu trúc cơ thể phẳng. [Nhộng di động đi tìm khu vực thích hợp trên lá với đầy đủ chất dinh dưỡng và lột xác thành giai đoạn bất động. Ba cá thể tiếp theo vẫn tồn tại trong 40–50 ngày, cho đến khi lột xác thành con trưởng thành. Bạc exuvia , hoặc da rụng còn sót lại trên lá. Các bản sao bất động có màu trắng đục. Nhộng ăn bằng cách dùng miệng đâm vào cây và hút dịch cây. Sau lần thứ tư, tiên nữ biến thànhgiai đoạn nhộng , mắt có màu đỏ đậm, thân màu vàng, cấu trúc cơ thể dày lên. Đây không phải là giai đoạn nhộng thực sự, như được tìm thấy ở Endopterygota , nhưng có chức năng tương tự. Ruồi trắng trưởng thành có kích thước gấp 4 lần quả trứng, với cơ thể màu vàng nhạt và đôi cánh màu trắng, nguyên nhân là do sự tiết sáp trên cánh và cơ thể của nó. [6] Ruồi trắng lá bạc trưởng thành có thể dài tới 0,9 mm. Trong khi cho ăn hoặc nghỉ ngơi, con đom đóm trưởng thành gập đôi cánh giống như cái lều trên cơ thể. ', '', '', '', '', 'null', '', 'Bemisia', 'null');
INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('blister beetle', 'bọ phồng rộp', 'insect_blister_beetle', 'Bọ cánh cứng trải qua mùa đông trong giai đoạn ấu trùng. Chúng phát triển thành nhộng vào mùa xuân, và sau khoảng 2 tuần, bọ phồng rộp trưởng thành xuất hiện vào đầu mùa hè. Con trưởng thành kiếm ăn, giao phối và con cái bắt đầu đẻ các cụm trứng trong đất. Trứng nở ra dưới dạng ấu trùng triungulin nhỏ, di động tìm kiếm vật chủ là ong hoặc châu chấu của chúng. Khi tìm thấy vật chủ mà ấu trùng có thể kiếm ăn, ấu trùng có vẻ ngoài ngày càng giống sâu bọ, trước khi hóa nhộng vào mùa xuân. Hầu hết các loài bọ cánh cứng chỉ có một thế hệ mỗi năm', 'Bọ cánh cứng thuộc họ côn trùng Melòidae. Chúng có thể được tìm thấy với nhiều màu sắc khác nhau và một số kích cỡ và hình dạng cơ thể. Đặc điểm đặc biệt nhất của chúng là phần ngực hẹp và đầu rộng hơn, một đặc điểm khác biệt giữa chúng với phần lớn các loài bọ khác. Hầu hết các loài bọ phồng rộp đều có phần bụng dài, hình trụ, nhưng một số loài trông rất khác. Một số loài có bụng tròn \"giống quả bóng\" hoặc cánh ngắn và bụng dạng ấu trùng. Tuy nhiên, tất cả các loài bọ phồng rộp đều có “cổ” hẹp đặc biệt, tương phản với phần đầu và bụng rộng hơn.', 'Bọ cánh cứng trưởng thành ăn thực vật lá rộng, đặc biệt là các loài thuộc họ Dền, Asteraceae, Leguminosae và Solanaceae. Hầu hết những con trưởng thành chỉ ăn các bộ phận của hoa, nhưng một số cũng ăn cả  lá.\r\n\r\nỞ giai đoạn ấu trùng, bọ phồng rộp săn mồi ở giai đoạn chưa trưởng thành của ong đơn độc hoặc trứng của châu chấu trong họ Acrididae (châu chấu sừng ngắn), châu chấu phổ biến ở các đồng cỏ và đồng cỏ được tìm thấy.', 'Nếu bạn đang làm việc, vui chơi hoặc thư giãn ngoài trời, hãy lưu ý đến những khu vực có thể có bọ phồng rộp. Chúng bao gồm các sân cỏ, bồn hoa và đèn chiếu sáng. Mặc áo sơ mi dài tay và quần dài nếu bạn có khả năng gặp phải những con bọ này.\r\n\r\nNếu một con bọ phồng rộp đậu trên da của bạn, đừng bóp nát nó. Nhẹ nhàng loại bỏ bọ cánh cứng bằng cách thổi nó ra khỏi da của bạn. Sau khi da tiếp xúc với bọ cánh cứng, rửa vùng da tiếp xúc với xà phòng và nước.', 'Mỹ,Tây Ấn', 'null', 'insect_blister_beetle/36827.jpg', 'blister', 'null'),
('Brachmia sp', 'Sâu cuốn lá lúa loại nhỏ đầu đen', 'insect_Brachmia_sp', 'Vòng đời:\nVòng đời sâu cuốn lá nhỏ từ 28 - 36 ngày. \n\n- Thời gian đẻ trứng:  6 - 7 ngày;\n\n- Sâu non: 14 - 16 ngày;\n\n- Nhộng: 6 - 7 ngày;\n\n- Trưởng thành sống: 2 - 6 ngày.', '', '', '', '', 'null', '', 'Brachmia', 'null'),
('Brachytrupes portentosus', 'Dế cơm', 'insect_Brachytrupes_portentosus', 'Trứng dài khoảng 3 mm, ngang 1 mm, màu trắng, được đẻ trong đất. Thời gian ủ trứng khoảng 14 ngày. Ấu trùng màu nhạt hơn thành trùng, có 5 tuổi, phát triển từ 20-50 ngày. Vòng đời của dế tùy thuộc vào nguồn thức ăn và vũ lượng, do đó thường chỉ có một thế hệ trong năm. Ấu trùng tuổi 4-5 có thể sống tiềm sinh do chậm phát triển trong mùa nắng, đợi khi mùa mưa đến thì mới vũ hoá để bắt cặp và đẻ trứng cho thế hệ mới.', '', '', '', '', 'null', '', 'Brachytrupes', 'null'),
('Brevipalpus lewisi', '‎mite phẳng cam quýt', 'insect_Brevipalpus_lewisi', 'Sâu bọ thích điều kiện ấm áp và khô ráo, quần thể của chúng đạt đỉnh điểm trong những tháng ấm nhất và khô hạn nhất. Khi được nuôi trên lá nho, con ve hoàn thành một thế hệ trong khoảng năm tuần ở 28 ° C và gửi tới 20 quả trứng. Rất ít con đực được biết đến, cho thấy rằng nó chủ yếu sinh sản bằng cách sinh sản .', 'Ve phẳng có múi nhỏ hơn ve tetranychid (nhện). Nó di chuyển chậm, phẳng và hình dạng thuôn dài, rộng hơn ở đầu trước. Màu sắc dao động từ nâu đỏ đến đỏ.', 'Loài bọ này thường định cư ở đầu cuống của trái cây họ cam quýt, gần hoặc dưới nút. Quả xanh được ưu tiên hơn quả trưởng thành (đặc biệt là trên tán cây), và cả hai vị trí trên cành và lá.', 'Thuốc xịt lưu huỳnh được chấp nhận để sử dụng trong vườn cây ăn quả được quản lý hữu cơ.Trong quá trình phát triển của trái, theo dõi sự phát triển của trái để biết trái bị đóng vảy và thâm đen do bọ cánh cứng trên cây có múi gây ra. Trước khi thu hoạch, theo dõi sự phá hại của ve bẹt đối với các cụm hạt, đồng thời theo dõi các loài gây hại khác. Nếu phát hiện, hãy xem xét một ứng dụng thuốc trừ sâu. Bắt đầu điều trị trước khi hạt bị teo.', 'Trung Đông, Nam Âu, Viễn Đông, Úc và Bắc Mỹ đến Mexico.', 'null', '', 'Brevipalpus', 'null'),
('Brontispa longissima', 'Bọ dừa', 'insect_Brontispa_longissima', 'Trứng: Hình bầu dục, hơi dẹp, màu nâu sậm, được đẻ từng quả rời rạc kết dính lại trong kẻ lá của đọt non chưa bung ra, trứng dính chặt vào mặt lá thành hàng dài. Trứng nở 4 - 5 ngày sau khi đẻ.1 con cái có khả năng đẻ 120 trứng.\nẤu trùng: Có 5 tuổi (có tài liệu nói có 4 tuổi), ấu trùng tuổi 1 có màu trắng, đầu hơi to so với thân mình, trên mặt của lớp chitin có các gai nhỏ, ấu trùng tuổi 2 các gai mọc dài ra ở hai bên thân và một đôi gai giống như cái kẹp ở cuối bụng, ấu trùng tuổi lớn có thân mình hơi dẹp chuyển sang màu vàng nâu, gồm 13 đốt. Ấu trùng mới nở bắt đầu ăn lá non, ít di chuyển và có xu hướng sợ ánh sáng. Ấu trùng hại nặng hơn con trưởng thành. Giai đoạn ấu trùng kéo dài khoảng 30 – 40 ngày.\nNhộng: Giống ấu trùng tuổi 5, nhưng thân mình hơi co rút lại. Giai đoạn nhộng kéo dài khoảng 6 ngày trong kẽ lá non.\nThành trùng: Đầu có màu nâu đậm, có râu dài, ngực màu vàng nâu, cánh trước màu đen, đầu cánh có màu vàng nâu, cánh có ánh kim, trên cánh có các chấm trắng chạy dài dọc theo cánh. Con đực nhỏ hơn con cái. Khi lá chết khô, thành trùng sẽ di chuyển xuống cuống lá (bẹ) bên dưới chờ đọt kế tiếp mọc ra và tiếp tục gây hại. Nếu mật số bọ dừa cao, lá mới mọc ra sẽ bị bọ liên tục cắn phá làm cây suy kiệt dần, còi cọc, cho năng suất trái kém, nếu nặng cây có thể chết. Thành trùng sống kéo dài có thể đến 220 ngày.', '', '', '', '', 'null', '', 'Brontispa', 'null'),
('Bruchophagus roddi', 'hạt cỏ linh lăng chalcid', 'insect_Bruchophagus_roddi', 'Ấu trùng của cây cuối cùng ngủ đông bên trong hạt cỏ linh lăng. Thời gian chết của một số ấu trùng kéo dài đến 3 năm. Có tới 35% dân số chết trong quá trình ngủ đông. Sâu non hóa nhộng bên trong hạt từ cuối tháng 4; con trưởng thành bay từ giữa tháng Năm cho đến cuối tháng Sáu. Con đực bắt đầu bay sớm hơn. Về sau, số lượng cá cái tăng lên, và vào cuối mùa hè, chỉ có cá cái. Sự kết đôi bắt đầu ngay lập tức hoặc 2-3 ngày sau khi cá cái xuất hiện. Khả năng sinh sản khoảng 65 trứng. Trứng hình trứng, bóng, màu trắng, có cuống dài và ngắn. Những quả cỏ linh lăng được 8-9 ngày tuổi sẽ hấp dẫn hơn cho việc đẻ trứng.', 'Màu đen toàn thân; xương chày trước, đầu gối và gân khoeo vàng nhạt. Đầu và ngực có lông mọc ngắn và thưa. Đầu hơi rộng hơn pronotum; genae ngắn hơn một chút so với đường kính mắt dọc. Ăng-ten nhô ra giữa mặt; clava 3 phân đoạn, rộng hơn funicle; lông cái 5 đoạn, con đực 4 đoạn. Các đoạn lông tơ hơi dài ở con cái. Mỗi đoạn đường cong của con đực thu hẹp về phía gốc và đỉnh. Thorax lồi yếu, pronotum rộng hơn chiều dài khoảng 3 lần và ngắn hơn mesonotum một chút. Hình dạng của đầu và ngực với lưới bề mặt. Propodeum dẹt, không có rãnh ở giữa, vùng trung tâm có lỗ thủng. Cánh trong suốt, gân lá màu vàng nâu. Tĩnh mạch sau biên trên cánh trước dài hơn một chút so với tĩnh mạch hướng tâm và ven. Bụng cá cái ngắn hơn ngực, hình trứng, nhọn về phía đỉnh và nhô cao yếu ở phần đỉnh. Cuống lá ngang. Ovipositor nổi rõ yếu ngoài bụng. Chiều dài cơ thể 1,3-1,8 mm ở con cái, 1,2-1,7 mm ở con đực.', 'Con cái trưởng thành của hạt cỏ linh lăng (dài khoảng 1/8 inch) có cấu trúc giống như cây kim được sử dụng để cấy trứng vào hạt cỏ linh lăng chưa trưởng thành. Một ấu trùng duy nhất phát triển trong mỗi hạt và phá hủy tất cả các chất bên trong, chỉ để lại lớp vỏ hạt.', '. Các biện pháp kiểm soát bao gồm sử dụng phân bón, gieo những cánh đồng cỏ linh lăng mới ở khoảng cách hơn 7 km so với những cánh đồng cỏ linh lăng cũ, cày sâu vào mùa thu, loại bỏ những hạt bị nhiễm bệnh khỏi thu hoạch và sử dụng cỏ linh lăng trước mùa xuân năm sau. Alfalfa trồng trong luân canh không phải là mong muốn trong 2-3 năm hoặc hơn. Điều trị bằng thuốc trừ sâu đối với Alfalfa Seed Chalcid là cần thiết vào buổi tối, khi hầu hết ong nghỉ hưu trên cánh đồng. Hóa chất có mức độ độc hại thấp đối với ong mật được sử dụng làm thuốc trừ sâu.', 'Loài phân bố ở Châu Âu, Trung Đông, Ấn Độ, Bắc Mỹ, Úc và New Zealand. Nó sinh sống ở phần châu Âu của Liên Xô cũ ở phía bắc đến Karelia, Caucasus, Tây và Đông Siberia, Viễn Đông, Trung Á và Kazakhstan.', 'null', 'insect_Bruchophagus_roddi/40024.jpg', 'Eurytoma', 'null'),
('Callitettix versicolor', 'Ve sầu bọt cánh đỏ', 'insect_Callitettix_versicolor', 'Chỉ dài 6 mm với dôi chân ngắn có cơ thể nhìn có vẻ nặng nề,ve sầu nhảy(bọ nước bọt) chúng có thể nhảy cao 70 cm nhờ vào kỷ năng đặc bệt này chúng nhanh chóng chạythoát khỏi kẻ thù.\nHai chân sau cùng dành cho việc nhảy trên cây trong lúc di chuyển giữa các tán lá cây chúng kéo lê cặp chân này như bộ phận thừa.Nhưng khi di chuyển xa chúng dồn toàn bộ trọng lượng cơ thể vào 2 chân sau cùng tạo thành lực nén lớn giúp chúng có thể bật nhảy cao.\nVe sầu bọt chúng luôn ở tư thế sẵn sàng để nhanh lẹ nhảy ngay lập tức', '', '', '', '', 'null', '', 'Callitettix', 'null'),
('Cassida circumdata', 'Ba ba xanh hại rau muống', 'insect_Cassida_circumdata', 'Bọ rùa trưởng thành có hình dạng bầu dục dài 4 – 5mm, trông hơi giống con ba ba. Phiến lưng ngực và cánh màu xanh trong suốt, có vân hình võng rất rõ, các bộ phận còn lại có màu xanh óng ánh như kim tuyến. Bọ trưởng thành hoạt động khi trời ấm, nhiệt độ cao. Chúng giao phối và đẻ trứng trên lá rau vào khoảng tháng 3, đầu tháng 4. Từ tháng 5 trở đi, bọ rùa gây hại nặng hơn và nặng nhất vào các tháng 7, 8, 9, 10. Sâu còn có tính giả chết, sâu non mới nở ít hoạt động, chỉ ăn biểu bì lá. Càng lớn, sâu càng phá mạnh. Sâu non đẫy sức dùng đuôi dính vào lá và hoa nhộng ở lưng lá.', '', '', '', '', 'null', '', 'Cassida', 'null'),
('Catantops', 'Châu chấu vệt đen', 'insect_Catantops', 'Trứng là giai đoạn đánh dấu sự bắt đầu vòng đời của châu chấu. Châu chấu đẻ trứng thụ tinh vào giữa mùa hè, chúng đặt trứng xuống đất trong một lỗ nhỏ. Sau đó, châu chấu mẹ tiết một chất dính để kết nối trứng lại một cụm với nhau, đảm bảo rằng con của nó sẽ không bị lạc.Mỗi cụm trứng chứa từ 15 – 150 trứng, tùy thuộc vào loài. Thông thường, một con châu chấu cái có thể đẻ tới 25 cụm trứng. Trứng phải trải qua mùa thu và mùa đông trước khi nở vào mùa xuân hoặc trong những ngày đầu hè.Âú trùng:Đây là giai đoạn thứ hai trong vòng đời của châu chấu, và là giai đoạn đầu tiên trong hình dạng một con châu chấu. Ấu trùng trông giống những con châu chấu trưởng thành, nhưng chúng không có cánh và thiếu các cơ quan sinh sản.1 Ngày sau khi trứng nở, ấu trùng bắt đầu ăn lá cây và hút nhựa để sống. Giai đoạn này kéo dài khoảng 5-6 tuần trước khi những ấu trùng đạt đến hình thái trưởng thành.Ấu trùng phải trải qua 5 giai đoạn nhỏ, đó là 5 lần lột da trước khi phát triển hoàn toàn thành châu chấu trưởng thành. Sau mỗi lần lột da, cơ thể ấu trùng phát triển lớn hơn và ở lần lột da cuối cùng chúng sẽ hoàn thiệt đôi cánh.Giai đoạn lột da:Lột da diễn ra trong giai đoạn ấu trùng. Con châu chấu sẽ làm rụng lớp vỏ ngoài của nó nhiều lần trước khi trở thành người lớn.Lớp vỏ ngoài bao phủ cơ thể của ấu trùng, cung cấp cho nó sự bảo vệ từ những tác động từ bên ngoài nhưng đồng thời cũng ức chế sự tăng trưởng của nó vì lớp vỏ cứng và không có khả năng co giãn. Do đó, chúng phải lột da nhiều lần để phù hợp với sự phát triển của cơ thể. Sau 5 – 6 lần thay đổi lớp vỏ, châu chấu trưởng thành dần xuất hiện với các chức năng hoàn chỉnh.Trưởng thành:Một con chấu chấu trưởng thành phải mất đến 1 tháng để hoàn thiện đôi cánh của mình. Châu chấu trưởng thành linh hoạt hơn ấu trùng, nhờ đó chúng dễ dàng lẩn trốn khỏi tầm nhìn của kẻ thù.', '', '', '', '', 'null', '', 'Catantops', 'null'),
('Ceracris', 'Châu chấu xanh', 'insect_Ceracris', 'Vòng đời của châu chấu khoảng 200-210 ngày trong đó giai đoạn trứng 15-21 ngày. Giai đoạn sâu non: 100 ngày. Giai đoạn trưởng thành: khoảng 3 tháng. Con trưởng thành của châu chấu sống khoảng 3 tháng, trong đó con cái sống lâu hơn con đực. Sau khi hóa trưởng thành được 5-40 ngày thì bắt đầu giao phối, sau 10-41 ngày (trung bình trên dưới 20 ngày) bắt đầu đẻ trứng.\nMỗi con cái có thể đẻ 3 ổ, mỗi ổ có 10-102 quả. Châu chấu thường thích đẻ trứng ở đất ẩm, xốp, có nhiều cỏ dại, nhiều ánh nắng, thích đẻ trên đất cát pha. Trứng hình ống hơi cong ở giữa, một đầu hơi to màu vàng đậm, ổ trứng hình túi, trong đó trứng xếp xiên hai hàng. Trứng đẻ thành ổ từ 10-30 quả trong thân lúa, nếp gấp của lá lúa và trong những bụi cỏ trên mặt nước.', '', '', '', '', 'null', '', 'Ceracris', 'null'),
('Cerambycidae', 'Bù xè, bọ xén tóc', 'insect_Cerambycidae', 'Thành trùng bọ xén tóc có kích thước cơ thể thường lớn, cơ thể thường dài, hình ống với đôi râu đầu dài, cứng, râu đầu thường có 11 đốt và dài vượt quá thân mình hoặc quá nửa chiều dài của thân. Nhiều loài có đủ màu sắc sáng tối và có những đốm hoa văn. Cơ thể phủ lông màu xám rất nhỏ. Thành trùng thường bị thu hút bởi ánh sáng đèn vào đầu mùa mưa sau khi vừa trưởng thành.\n- Ấu trùng bọ xén tóc dài, hình ống, béo trắng, đa số không có chân ngực và khác với ấu trùng của Bổ củi giả (Buprestidae) do phần đầu của ấu trùng xén tóc không rộng bề ngang và không dẹp, ấu trùng của họ nầy thường được gọi là sâu đục gỗ đầu tròn. ', '', '', '', '', 'null', '', 'Cerambycidae', 'null'),
('Cerambycinae', 'bọ cánh cứng longhorn', 'insect_Cerambycinae', 'Quá đông có ấu trùng. Thời gian xuất hiện của người lớn thay đổi một chút giữa các khu vực. Ở Hải Nam , con trưởng thành xuất hiện vào tháng 3-7, tháng 4 đến tháng 6 là sự xuất hiện của đỉnh; ở Vân Nam , tháng 6-8 là đỉnh của sự xuất hiện của con trưởng thành. Con trưởng thành đẻ trứng vào cành, lá, cành gãy hoặc kẽ cây. Trứng được đẻ rời, chủ yếu tập trung một chỗ, có nhiều đến 6-8 trứng dính lại thành một cục, thời gian trứng khoảng 10 ngày. Sau khi nở, sâu non chủ yếu xâm nhập từ đầu cành và ngọn gỗ, từ cuối cành xuống theo hướng của thân chính, đến phân đôi và thường ăn hết một đoạn nhỏ của chạc rồi quay trở lại. thân chính, từ cành, đến thân và cả thân chính. Đường hầm có dạng hình trụ đơn giản với thành bên trong màu đen, ấu trùng có thể di chuyển lên xuống. Trên cành bị thương có các lỗ đại tiện đều đặn. Khi còn nhỏ, lỗ đại tiện nhỏ và dày đặc, khi tuổi côn trùng càng tăng thì lỗ đại tiện càng lớn, khoảng cách xa dần. Các lỗ trên cành nhỏ thải phân côn trùng dạng hạt và mùn cưa, phân lỏng và có màu trắng vàng; phân côn trùng trên cành lớn trộn với chất lỏng sền sệt màu đen và thải ra từ các lỗ phân, rơi xuống các lá phía dưới hoặc trên mặt đất, và cô đặc lại thành khối .', 'Chiều dài thân 25-35 mm, rộng 5-8 mm, màu nâu đến nâu, thân dài và hẹp, hai bên song song. Ngực phía trước hẹp hơn phía sau. Pronotum có các gờ ngang ở đầu trước và sau , với 19 gờ dọc nổi lên ở giữa, và các rãnh ở đỉnh có nhiều lông màu vàng nhạt. Mặt cánh xù xì, có dải dài màu xám lông ngắn và lông tơ vàng, xếp xen kẽ 5 hàng dọc. Bề mặt bụng của cơ thể và bàn chân được bao phủ bởi nhiều lông màu xám hoặc màu nâu. Ấu trùng trưởng thành dài 46-63 mm, hình trụ, màu trắng sữa, có lông thưa màu nâu. Hàm trên có hình răng, màu đen. Hai bên mép trước của tấm đệm và tấm lưng có lông màu nâu, van lồng ngực nằm ở giữa ngực giữa và có hình bầu dục. Mặt sau của bụng tạo thành một lồi giống bong bóng với 2 rãnh ngang và 1 hàng nhú ở mặt trước và mặt sau của rãnh ngang. Mỗi hàng gồm 10-16 lồi. Các đoạn bụng thứ nhất đến thứ ba có đĩa bên, mặt trên của đoạn bụng thứ bảy đến thứ 9 có lồi rõ, hậu môn có 3 thùy. Nó dài 43-47 mm, lúc đầu màu trắng vàng, sau đó màu vàng nâu nhạt. Mắt kép có màu đen khi chúng nhô lên, và phần cuối của xương chày, thân mình và mặt bụng có màu đỏ đất.', 'Một dấu hiệu quan trọng cho thấy sự hiện diện của giun. Đường hầm do ấu trùng gây ra như ở cành nhỏ thì kéo dài xuống tâm cành, nếu ở cành lớn thường bị sâu đục bởi dát gỗ, nếu cành nghiêng thì đường hầm và lỗ đại tiện thường ở phía dưới. ; nếu cành ở thân thẳng đứng, nó có thể bị côn trùng phá hại theo mọi hướng. Dù hướng hầm lên cành nào thì hầm đại tiện phải nghiêng xuống dưới để thuận tiện cho việc đại tiện và ngăn nước mưa xâm nhập. Giai đoạn sâu non là 260-310 ngày. Ấu trùng trưởng thành già xây dựng một buồng nhộng trong đường hầm dài 7-10 cm và rộng hơn một chút so với đường hầm chung, hai đầu của buồng nhộng thường được ngăn cách bởi chất tiết màu trắng có chứa canxi cacbonat. Thời kỳ nhộng 30-50 ngày. Sau khi xuất hiện, con trưởng thành ở trong buồng nhộng một thời gian (10 - 30 ngày), sau đó mở rộng lỗ đại tiện để bò ra ngoài. Nó thường hoạt động vào ban đêm và có hiện tượng quang điều hòa. Ẩn mình trong những tán lá rậm rạp vào ban ngày. Giao phối xảy ra vào lúc 9-10 giờ đêm hôm đó, và những con cái giao phối bắt đầu đẻ trứng trong vòng vài phút sau khi những con đực rời đi. Mỗi con sâu cái đẻ từ 6-25 trứng, thời gian trưởng thành là 13-36 ngày.', '① Loại bỏ những cành sâu bệnh. Từ tháng 7 hàng năm tiến hành kiểm tra cây xoài lần lượt, phát hiện cành bị cắt sâu 15cm dưới hố đào cuối cùng để loại bỏ cành sâu bệnh, kiểm tra phần trên của vết cắt xem có vết côn trùng hay không, nếu có thì dùng máy dây để đâm những con còn lại. ấu trùng.\r\n② có các nhánh lớn của ấu trùng , 80% ống tiêm có sẵn dichlorvos hoặc EC 38% clo lỏng ngựa đến lỗ đại tiện cuối cùng.\r\n③ Đối với những cây bị sâu bệnh phá tán, sau khi thu hoạch tỉa bỏ bớt cành già yếu, sâu bệnh, chỉ để lại cành xương chính, đồng thời tăng cường quản lý, tăng cường bón phân hữu cơ. thúc đẩy sự hình thành của các chi nhánh mới.', 'null', 'null', 'insect_Cerambycinae/68469.jpg', 'Rhynchocoris', 'null'),
('Ceratovacuna lanigera', 'Rệp bông (trắng)', 'insect_Ceratovacuna_lanigera', 'Sâu non tuổi cuối có thân dài 0,7mm. Sâu non có 2 dạng: Sâu non có mầm cánh (râu đầu 5 đốt; sâu non tuổi 4 có mặt lưng ngực giữa nhô lồi, ngực giữa và ngực sau có mầm cánh; ngực sau và lưng phần bụng có lớp xơ sáp trắng) và sâu non không có mầm cánh (râu đầu 4 đốt, mặt lưng phủ nhiều xơ sáp trắng). Trưởng thành có hai loại hình: Có cánh và không có cánh. Trưởng thành có cánh với thân dài 2,5mm. Mắt kép to, râu đầu 5 đốt. Phần đầu và ngực màu nâu đen, phần bụng và chân màu vàng sẫm hoặc xanh đen, hai đôi cánh trong suốt. Trưởng thành không có cánh với thân dài 2,5mm. Cơ thể màu vàng, vàng xanh. Không có ống mật ở hai bên phần bụng. Mặt lưng phủ đầy lớp sáp trắng dạng sợi.', '', '', '', '', 'null', '', 'Ceratovacuna', 'null'),
('Ceroctis capensis', 'bọ phấn rộp họ đậu', 'insect_Ceroctis_capensis', 'Biến thái hoàn toàn; siêu biến hình. Mùa đông được dành cho giai đoạn ấu trùng sau này và nhộng xảy ra vào mùa xuân. Giai đoạn nhộng kéo dài khoảng 2 tuần và con trưởng thành xuất hiện vào đầu mùa hè. Bọ cánh cứng cái đẻ từng chùm trứng trong đất. Ấu trùng giai đoạn đầu (instar) nở ra từ trứng (triungulin) là một ấu trùng chân dài, hoạt động, nhỏ bé tìm kiếm vật chủ thích hợp. Sau khi ở đó, ấu trùng phát triển qua một số giai đoạn, mỗi giai đoạn có các phần phụ giảm dần và ngày càng trông giống như bụi rậm. Số lượng giai đoạn ấu trùng đầu tiên phát triển trong vòng khoảng tháng, nhưng giai đoạn thứ hai đến giai đoạn cuối cùng (pseudopupa) có thể tồn tại trong khoảng 230 ngày trước khi lột xác thành giai đoạn ấu trùng cuối cùng (thứ sáu) vào mùa xuân. Nói chung, một thế hệ xảy ra mỗi năm mặc dù một số phát triển trong 35 đến 50 ngày trong khi ở những thế hệ khác, quá trình phát triển mất 3 năm.', 'Nó có chiều dài cơ thể khoảng 12 mm trong khi elytra của nó có màu đen với những đốm vàng, và đầu, râu và chân có màu đen.', 'Con cái đẻ trứng vào đất, dùng hàm và chân để đào lỗ. Trứng nở thành ấu trùng sáu chân nhỏ và hoạt động rất tích cực tìm kiếm vỏ trứng châu chấu và châu chấu bị chôn vùi. Sau khi định vị được những vị trí này, ấu trùng chui xuống và chui vào vỏ, bong tróc da và thay đổi hình dạng của chúng thành loài sên béo với đôi chân rất ngắn. Chúng sẽ ăn trứng, hạn chế số lượng Orthoptera một cách hiệu quả . Khi phát triển đầy đủ, ấu trùng Ceroctis sẽ hóa nhộng trong một khoang ngầm mà từ đó bọ trưởng thành xuất hiện. Một loài Ceroctis , C. groendali là một loài ký sinh trong tổ của ong bắp cày Ceramius lichtensteinii', 'Dùng máy hút bụi cầm tay hoặc cầm đầu ống hút bụi gia dụng để hút bọ phấn . Đi xung quanh các cây bị nhiễm bọ phấn và hút loài dịch hại bên dưới lá cây và tán lá cây. -Xịt dungk dịch xà phòng lên cây. -Dầu neem.- Sử dụng phân trùng huế.-Dùng vật liệu phản xạ', 'Nam phi', 'null', 'insect_Ceroctis_capensis/35397.jpg', 'Ceracris', 'null'),
('Ceroplastes rubens', 'vảy sáp đỏ', 'insect_Ceroplastes_rubens', 'Ở Australia, mỗi con cái đẻ khoảng 300 quả trứng, nhưng ước tính 50% số bò cái bị mất trong 24 giờ đầu sau khi nở. Con đực không được biết đến ở hầu hết các quốc gia. Sự lan truyền theo khoảng cách xa của quy mô xảy ra khi bánh xích được mang theo gió hoặc bởi các động vật khác. Sự lây lan cũng xảy ra trên thực vật di chuyển trong khu vực buôn bán làm vườn.', 'Vảy sáp đỏ ăn lá, thân, cành và quả của vật chủ. Trên lá, chúng được tìm thấy nhiều hơn ở mặt trên, thường là các đường dọc theo gân lá (Ảnh 1). Khi chúng hút nhựa cây từ cây, phần dư thừa sẽ được thải ra ngoài dưới dạng mật ong, bao phủ các tán lá bằng các chất có đường, chúng trở thành khu trú do nấm đen phát triển (Ảnh 2 & 3). Kiến có xu hướng vảy để thu thập mật ong.', 'trực tiếp qua đường ăn uống và gián tiếp do nấm mốc tích tụ trên bề mặt lá làm giảm khả năng quang hợp. Cả hai hành động này đều có thể làm cây bị suy yếu, gây rụng lá, chết héo và chết. Thông thường, thiệt hại trực tiếp là nhỏ, nhưng quy mô là dịch hại nghiêm trọng trên cây có múi ở một số quốc gia vì nấm mốc làm giảm chất lượng. Tương tự, vẻ ngoài bẩn thỉu của cây cảnh khiến chúng có vẻ ngoài khó coi và giảm giá trị trong nghề làm vườn.', 'Kiểm tra đàn giống không bị đóng cặn; nếu có, hãy cắt tỉa những phần bị nhiễm và phun thuốc diệt côn trùng (xem bên dưới). Tỉa bỏ thân, cành, quả bị nhiễm bệnh và đốt bỏ. Tiêu diệt tổ kiến ​​bằng nước sôi mà không làm hỏng cây trồng bị côn trùng vảy, sử dụng mồi kiến ​​thương mại hoặc thuốc pyrethroid tổng hợp (xem bên dưới); không có kiến, ký sinh trùng và động vật ăn thịt sẽ giúp kiểm soát quy mô một cách tự nhiên.', 'Châu Á, Đông Phi, Bắc (Florida và Hawaii), Nam và Trung Mỹ, Caribê, Châu Âu (trên cây trồng ngoài trời cũng như dưới mái che), Châu Đại Dương. Nó được ghi lại từ Úc, Quần đảo Cook, Fiji, Polynesia thuộc Pháp, Guam, Kiribati, Quần đảo Marshall, New Caledonia, New Zealand, Niue, Quần đảo Bắc Mariana, Palau, Papua New Guinea, Samoa, Quần đảo Solomon và Vanuatu.', 'null', 'insect_Ceroplastes_rubens/60378.jpg', 'Ceroplastes', 'null'),
('Cerotoma trifurcata', 'Bọ cánh cứng, bọ lá đậu', 'insect_Cerotoma_trifurcata', '+ Thành trùng: Thành trùng biến, từ màu đỏ sang màu cam sang màu vàng nhạt.Thường các thành trùng có bốn đốm đen vuông vức trên cánh, tuy nhiên cũng có trường hợp cánh của bọ cánh cứng có hai hoặc không có ô màu đen hay được phủ một vệt to màu đen. Một tam giác màu đen, gọi là lớp vảy, thường có sau gáy của bọ cánh cứng (Hình 2). Bất kể các côn trùng có bốn, hai, hoặc không có màu đen \"ô vuông\" trên cánh, bọ cánh cứng cái hay có mặt màu đen, trong khi những con bọ cánh cứng đực thường có mặt màu xám. + Trứng: Trứng Bọ cánh cứng hình quả chanh và có màu cam, và chúng được tìm thấy trong đất quanh gốc cây đậu tương. Ngoài ra, trứng của bọ cánh cứng trong đất ướt hoặc ẩm ướt nhiều hơn trong đất khô. Trứng bọ lá đậu mất một tuần để nở ở (ở nhiệt độ 28°C). Đất quá ẩm hoặc quá khô đều có thể làm hỏng trứng hoặc ảnh ưởng đến quá trình nở của trứng. Trứng bọ lá đậu thích hợp với đất hữu cơ hơn so với cát pha sét và sét pha cát. Bọ cánh cứng ăn ấu trùng trong đất trên rễ đậu tương và nốt sần. Ấu trùng phát triển qua ba giai đoạn trước khi thành nhộng trong đất. Ấu trùng có khả năng di chuyển trong đất và trong điều kiện đất khô có thể di chuyển lên đến 30 cm mỗi giờ để tìm kiếm của độ ẩm. Các loại đất có thức ăn cho ảnh hưởng đến khả năng sống sót của ấu trùng. Trong điều kiện đất ẩm, ấu trùng sống sót tốt nhất trong đất hữu cơ (0-4% tỷ lệ chết) so với cát pha sét (87-100% tỷ lệ chết) và thịt pha cát sét (0 -20% tỷ lệ chết).+ Ấu trùng: Khi ấu trùng (sâu lá đậu) đầu tiên lên khỏi mặt đất, mình rất mềm và cơ thể thường là màu be màu K57', '', '', '', '', 'null', '', 'Cerotoma', 'null'),
('Chaetocnema basalis', 'Bọ nhảy đen nhỏ', 'insect_Chaetocnema_basalis', ' Con trưởng thành là một loại bọ cánh cứng, hình bầu dục, cơ thể dài khoảng 2-2,5mm, cánh cứng, màu đen bóng, giữa mỗi cánh có một vạch màu vàng nhạc, cong hình củ lạc, chân sau to khỏe, có sức nhảy dài nên gọi là bọ nhảy sọc cong. Chúng có khả năng nhảy xa và bay rất khỏe.Một con trưởng thành cái có thể đẻ đến 200 trứng, ở dưới đất xung quanh vùng rễ chính của cây.\n- Trứng của bọ nhảy rất nhỏ, màu vàng nhạt đẻ trên mặt đất gần gốc cây. \n- Sâu non màu trắng ngà hoặc màu vàng tươi. Sâu non đẩy sức dài khoảng 5 - 6 mm, sống và làm nhộng dưới đất.\n- Ấu trùng nằm trong đất, có hình ống, màu vàng nhạt, đẫy sức dài khoảng 4mm, chúng cắn phá rễ và củ (cải củ), tạo ra những đường lõm ngoằn ngèo, hoặc thành lỗ ăn sâu vào trong củ, trong rễ, làm cho cây cải bị còi cọc, chậm lớn, củ và rễ dễ bị thối.', '', '', '', '', 'null', '', 'Chaetocnema', 'null'),
('Chilo sacchariphagus', 'Sâu đục thân 4 vạch', 'insect_Chilo_sacchariphagus', 'Mỗi năm phát sinh 6 đợt. Vòng đời sâu: trứng 6-7 ngày, sâu non 35-40 ngày, nhộng 10-11 ngày, trưởng thành 1-2 ngày. Ngài cái đẻ từ 8- 11 ổ trứng, tổng số khoảng 250 - 300 trứng.', '', '', '', '', 'null', '', 'Chilo', 'null'),
('Chilo sp', 'Sâu đục thân 5 vạch', 'insect_Chilo_sp', 'Chúng đẻ trứng hình bầu dục dẹt, mới đẻ màu trắng, sau chuyển màu vàng nhạt, vàng tro; trước lúa nở 1-2 ngày thể hiện rõ điểm đen. Trứng đẻ thành từng ổ theo dạng vẩy cá, thường từ 1-3 hàng, nhiều nhất 5 hàng trên mặt lá. Sâu non đẫy sức có đầu màu đỏ đậm tối hoặc đen; mặt bụng của ngực trắng mờ xen lẫn vàng nhạt hoặc nâu nhạt; mảnh lưng ngực trước nâu đen, lưng có 5 vạch dọc. Bình thường sâu non có 5 tuổi, cá biệt có 7 tuổi. Nhộng cái dài hơn nhộng đực. Nhộng mới hóa có màu vàng, mặt lưng có 5 vạch dọc màu nâu gụ. Lỗ thở của bụng hơi lồi, gần mép trước của mặt lưng đốt bụng thứ 5-7 có dẫy chấm nổi, cuối bùng phía lưng có 4 gai xếp thành vòng cung, phía bụng có 2 gai, các gai đều ngắn, thẳng và không có lông.', '', '', '', '', 'null', '', 'Chilo', 'null'),
('Chilo suppressalis', 'Sâu đục thân 5 vạch đầu nâu', 'insect_Chilo_suppressalis', 'Vòng đời của sâu đục thân bướm 2 chấm từ 35-45 ngày. Nhiệt độ từ 16-29oC và độ ẩm 70% có:\r\n+ Thời gian trứng: 5-10 ngày.\r\n+ Thời gian sâu non: 20-48 ngày.\r\n+ Thời gian nhộng: 7-15 ngày.\r\n+ Thời gian ngài vũ hóa đến đẻ trứng: 2-7 ngày.\r\nNgài cái của sâu đục thân 5 vạch đầu nâu có tính hướng quang mạnh, ngài cái vào đèn nhiều hơn ngài đực. Mỗi ngài cái đẻ từ 3-4 ổ trứng (có 40-82 quả trứng/ổ) và số trứng của một con có thể đẻ là 124-210 quả nhưng chúng không bao giờ đẻ hết số trứng, sau khi chết bao giờ cũng còn từ 10-100 quả trong bụng và nếu nhiệt độ thấp, mưa gió nhiều thì số trứng còn lại trong bụng nhiều. Ngài của loại sâu này thích đẻ trên lúa xanh hơn trên mạ. Một năm sâu đục thân 5 vạch đầu nâu phát sinh 6 lứa. Điều kiện nhiệt độ thích hợp cho loài sâu này phát triển trong tất cả các giai đoạn sinh trưởng là nhiệt độ thấp, chúng có thể phát triển bình thường trong môi trường lạnh.', 'Sải cánh dài 18 mm ở con đực và 18–20 mm ở con cái. Ở con đực, đầu và ngực có màu nâu và trắng. Bụng tái nhợt. Cánh chim có đỉnh hơi cấp tính, có chất nhờn, toàn bộ chỉ có màu nâu, ngoại trừ một mảng trong tế bào và một vệt bên dưới dây thần kinh trung gian. Lề bên trong màu trắng. Một đường trung gian gồ ghề hình sin chạy với các đốm bạc ở mặt trong của nó, cũng trên đĩa đệm và bên dưới tĩnh mạch 2. Một đường ranh giới dưới gồ ghề, có góc cao ở vân 6 và với đường màu bạc ở rìa ngoài của nó. Một loạt các đốm đen được tìm thấy. Lông mao to. Bọ cánh cứng màu trắng. [3]\r\n\r\nỞ con cái, nó có màu cam đậm hơn nhiều. Cánh chim đã được khử trùng (rắc) với màu nâu. Đường trung tuyến và đường cận biên hầu như đã lỗi thời. Các đốm màu bạc bên dưới tế bào nổi rõ và đôi khi gấp đôi. Khu vực sau chăm sóc sức khỏe có vảy bạc.', '.Chúng đục khoét thân cây chủ nên được xếp vào loại sâu đục thân lúa. \r\nHầu như tất cả các bộ phận của cây, từ cành, lá, thân đều bị tấn công. Sâu bướm có thể là loài ăn chủ yếu bên trong, trong khi con trưởng thành là loài ăn nhựa cây bên ngoài. Các cây bị tấn công nặng có thể biểu hiện các triệu chứng khác nhau từ chết héo, đầu trắng, lùn, còi cọc, thối rữa, dạng bất thường và ra hoa. Cuối cùng toàn bộ cây sẽ chết. Trái tim chết là triệu chứng hiện trường rõ ràng nhất.', 'Dịch hại nên được chẩn đoán sớm khi có triệu chứng, trừ khi nó không đáng để bảo vệ trồng trọt. Nhiều tập quán nông nghiệp và truyền thống như làm ngập nước và bừa hoặc cày xới gốc rạ để phòng trừ sâu bệnh trong vụ mùa tiếp theo. Việc sử dụng các giống chín sớm và khi thu hoạch, trồng đồng bộ và cắt bỏ thân sát mặt đất được quản lý. \r\nVề mặt sinh học, chúng có thể dễ dàng loại bỏ bằng cách sử dụng tachinid Paratheresia claripalpis, được thực hành rộng rãi ở Malaysia. Ichneumonid Eriborus sinicus cũng được sử dụng ở Châu Á và Hawaii. \r\n\r\nTrồng các giống lúa có sức đề kháng cao và cây chuyển gen cũng được biết là làm giảm sự tấn công của những loài gây hại này.', 'Nó là một loài phổ biến, được biết đến từ Ấn Độ, Sri Lanka, Trung Quốc, Đông Á, Nhật Bản, Đài Loan, Malaysia đến Thái Bình Dương.', 'null', 'insect_Chilo_suppressalis/01874.jpg', 'Chilo', 'Asiatic rice borer'),
('Chilotraea auricilius', 'Sâu đục thân 5 vạch đầu đen', 'insect_Chilotraea_auricilius', 'Vòng đời của sâu đục thân bướm 5 vạch đầu đen từ 35-60 ngày tùy theo điều kiện nhiệt độ:\n+ Thời gian trứng: 4-7 ngày.\n+ Thời gian sâu non: 20-41 ngày.\n+ Thời gian nhộng: 4-6 ngày.\n+ Thời gian ngài vũ hóa đến đẻ trứng: 2-5 ngày.', '', '', '', '', 'null', '', 'Chilo', 'null'),
('Chlorops oryzae', 'Ruồi vàng hại lúa', 'insect_Chlorops_oryzae', '* Vòng đời:\r\n- Trứng: 2-4 ngày\r\n- Ấu trùng: 10 -13 ngày\r\n- Nhộng: 5-7 ngày\r\n- Trưởng thành: 1-3 ngày\r\nCon ruồi cái đẻ trứng trên mặt lá, một con cái có thể đẻ 250 trứng. Trứng nở sau khoảng 3 - 4 ngày tùy thuộc vào nhiệt độ.\r\nDòi đục lá đục ăn mô lá làm giảm diện tích quang hợp, do vậy chúng làm cây vàng, cằn cỗi, lá rụng sớm, chúng gây hại nặng giai đoạn cây con. Khi lá bị hại nặng, nhất là những lá gần quả mới hình thành có thể làm ảnh hưởng đến năng suất. Đối với một số cây rau ăn lá, vết đục của dòi đục lá làm giảm thương phẩm.\r\nNgoài ra, vết thương trên lá do dòi đục lá gây ra tạo điều kiện cho các vi sinh vật gây hại cây khác xâm nhập. Dòi đục lá có thể xuất hiện nhiều lứa gây hại trong năm nhưng thường gây hại nặng vào mùa nắng.', 'Trứng đẻ thành ổ hình bầu dục dài, trên mặt phủ một lớp lông màu vàng nhạt ở giữa hơi nhô lên. Mới đẻ trứng màu trắng sau chuyển màu ngà vàng sắp nở màu đen. Sâu non đẫy sức dài 21 - 25 mm màu trắng sữa, đầu màu nâu vàng.\r\n\r\nNgài đực có đầu ngực và cánh trước màu nâu nhạt, giữa cánh có một chấm đen. Ngài cái thân dài 10 - 13 mm, thân màu trắng vàng hoặc vàng nhạt, cuối bụng có chùm lông màu vàng nhạt, giữa cánh trước có một chấm đen.', 'loài côn trùng này sinh ra 5 thế hệ trong một năm từ cuối tháng 4 đến đầu tháng 11. Nó có nhiều nhất ở thế hệ thứ ba và thứ tư, và những ruộng lúa được cấy từ cuối tháng Bảy đến đầu tháng Tám bị nhiễm bệnh nặng. Trong suốt mùa đông, côn trùng ngủ đông ở giai đoạn ấu trùng trên Leersia sayanuka và các loại cỏ dại đáng kể khác. Những con trưởng thành khá chịu được sự thay đổi nhiệt độ rộng và thể hiện hoạt động bình thường ở 18-39 ° C', 'Vì con trưởng thành bị thu hút bởi nước đọng, biện pháp kiểm soát nuôi được khuyến nghị là tháo nước ruộng lúa với tần suất 3-4 ngày trong 30 DT đầu tiên để giảm sự đẻ trứng. Tuy nhiên, các cánh đồng thoát nước cho phép nhiều cỏ dại mọc hơn. Các phương pháp trồng trọt cho phép cây phủ kín mặt nước nhanh nhất dẫn đến thiệt hại không đáng kể do giòi bọ. Che phủ bề mặt nước bằng azolla giúp ngăn ngừa sự xâm nhập của cây. Nên gieo hạt trực tiếp vì ruộng hoặc luống gieo hạt trực tiếp không hấp dẫn đối với con trưởng thành. Khi cấy, nên sử dụng cây con già hơn để rút ngắn giai đoạn sinh dưỡng của cây trồng.', 'China, Japan, North Korea, South Korea', 'null', 'insect_Chlorops_oryzae/01623.jpg', 'Chlorops ', 'Paddy stem maggot'),
('Chondracris rosea', 'Châu chấu voi', 'insect_Chondracris_rosea', 'Vòng đời của châu chấu kéo dài trong khoảng từ 200 – 210 ngày, gồm:\n\nGiai đoạn trứng: 12 – 21 ngày\nGiai đoạn sâu non: 100 ngày\nGiai đoạn trưởng thành: khoảng 3 tháng, con cái sống thọ hơn con đực\nChâu chấu trưởng thành sau 5 – 40 ngày thì bắt đầu giao phối; sau 10 – 41 ngày thì đẻ trứng. Mỗi con cái có thể đẻ 3 ổ, mỗi ổ có từ 10 – 102 quả\nChâu chấu sinh trưởng qua biến thái không hoàn toàn. Con non phải trải qua nhiều lần lột xác mới trở thành con trưởng thành.', '', '', '', '', 'null', '', 'Chondracris', 'null'),
('Chrlidonium argentatum', 'Sâu đục cành', 'insect_Chrlidonium_argentatum', 'Sâu đục cành có tên khoa học là Chelidonium argentatum Dalm, là sâu non của con xén tóc màu xanh nên gọi là xén tóc xanh. Xén tóc xanh thường đẻ trứng vào tháng 5-6 trên các nách lá ngọn cành tăm. Sau 10-12 ngày sâu non nở và bắt đầu gặm vỏ cành để sống, đục phá từ cành nhỏ đến cành lớn và cả thân cây. Từ 8 đến 9 tháng sau, sâu non đục đến cành cấp 1 hoặc cành cấp 2, thậm chí có thể tới thân, tuỳ theo độ dài của cành. Thông thường tập trung là cành cấp 1, sâu non làm một buồng hoá nhộng bằng cách dùng mùn cưa và chất bài tiết vít đường đục lại rồi đục một lỗ ra ngoài, chừa lại vỏ cành để làm cửa vũ hoá sau này. Khoảng tháng 2, tháng 3, sâu non hoá nhộng, tới tháng 4, tháng 5 thì vũ hoá thành con xén tóc xanh bay ra. Vòng đời của sâu là một năm.Trên một thân cây có thể bị hàng chục con sâu đục cành và nếu 2-3 năm liền bị hại thì cây sẽ chết.', '', '', '', '', 'null', '', 'Chelidonium', 'null'),
('Chrysomphalus aonidum', 'vảy đỏ Florida', 'insect_Chrysomphalus_aonidum', 'Tỷ lệ giới tính ở C. aonidum được phát hiện có xu hướng nghiêng về con cái (Nur, 1990). Mỗi con cái trưởng thành đẻ khoảng 50-150 trứng hình bầu dục dưới vảy trong khoảng thời gian từ 1-8 tuần, tùy thuộc vào bộ phận của cây bị nhiễm bệnh (những quả trên lá ít bị nhiễm bệnh hơn những quả bị nhiễm bệnh) (Rose và DeBach, 1978) . Trứng nở theo quy mô và nhộng đầu tiên hoặc nhộng bò đi tìm nơi kiếm ăn thích hợp trước khi chuyển sang lối sống không cuống. Nhộng trùng lứa thứ hai là giai đoạn kiếm ăn chính ở cả hai giới. Phát triển đến trưởng thành mất 7-16 tuần theo nhiệt độ. Ở California, Hoa Kỳ, C. aonidum có tới sáu thế hệ mỗi năm (Gill, 1997). Ở các quốc gia có mùa đông lạnh giá, chẳng hạn như Đài Loan, có thể có ba thế hệ khác biệt mỗi năm (Su, 1983), trong khi ở điều kiện nhiệt đới (và nhà kính sưởi ấm) việc sinh sản diễn ra liên tục và các thế hệ không đồng bộ.', 'Con cái trưởng thành và ở giai đoạn trung gian có dạng vảy tròn từ phẳng đến lồi vừa phải, đường kính đến 2 mm, mỗi vảy có một điểm dưới trung tâm hơi nhô lên, đôi khi có màu nhạt. Nếu dùng đầu kim nhấc vảy lên, côn trùng bên dưới có màu vàng và dài tới 1,7 mm. Vảy đực hơi nhạt hơn vảy cái, hình bầu dục dài và có kích thước bằng một nửa. Con đực trưởng thành dài 0,7 mm và có một đôi cánh, hai cặp mắt đơn giản, không có miệng và cơ quan sinh dục rất dài. Nhộng đầu tiên dài 0,3 mm và có chân nhưng sau đó sẽ sớm lắng xuống để tạo thành các vảy màu trắng hình tròn (giai đoạn đốm trắng) có chiều ngang lên tới 0,4 mm. Chúng trở nên hợp nhất với quy mô của các giai đoạn tiếp theo, tạo thành điểm dưới trung tâm nhạt màu hơn.', 'C. aonidum đã khá phổ biến, đặc biệt là ở các vùng trồng cam quýt trên thế giới. Khi hiện tượng ấm lên toàn cầu tiến triển, sự phân bố của nó có khả năng mở rộng theo hướng Bắc và Nam với sự gia tăng của các khu vực sản xuất cam quýt. Các quốc gia có ngành công nghiệp cây có múi mới hoặc đang phát triển ngay bên ngoài vùng phân bố hiện tại của C. aonidum (CIE, 1988) sẽ cần phải thận trọng để loại trừ quy mô nếu có thể. Quy mô cũng có thể trở thành một vấn đề đối với cây cảnh ở những nước này, và có thể trở thành một loài gây hại cho các vật trang trí dưới kính ở các nước ôn đới, như ở Hungary (Reiderné và Kozár, 1994). Nó được đề cập trong danh sách kiểm dịch (Burger và Ulenburg, 1990).', 'Sử dụng các biện pháp kiểm soát văn hóa và sinh học và xịt dầu từ dầu mỏ lên cây có múi được quản lý hữu cơ.', 'Châu Âu', 'null', 'insect_Chrysomphalus_aonidum/60661.jpg', 'Chrysomphalus', 'null'),
('Cicadella viridis', 'Rầy xanh lớn', 'insect_Cicadella_viridis', '- Trưởng thành (2 - 21 ngày): Thân dài từ 2,5 - 4 mm, màu xanh lá mạ. Đầu hơi hình tam giác, chính giữa đỉnh đầu có đường vân trắng, và hai bên có chấm đen nhỏ. Cánh trong mờ, màu xanh lục, xếp úp hình mái nhà.- Trứng (5 - 8 ngày): Có hình hơi cong dạng quả chuối, dài khoảng 0,8 mm. Trứng mới đẻ màu trắng sữa, sắp nở có màu lục nhạt hay hơi nâu. Vòng đời của trứng từ 5 - 8 ngày.- Rầy non (9 - 11 ngày (mùa Xuân); 7 - 8 ngày (mùa Hè); 14 - 16 ngày (mùa Đông)): Rầy xanh non có 5 tuổi, tuy chưa có cánh nhưng gần giống trưởng thành. Rầy mới nở màu trắng trong suốt, dài 1 mm. Rầy càng lớn chuyển dần sang màu xanh. Cuối tuổi 5 cơ thể dài 2mm.', 'Con đực trưởng thành của Cicadella viridis có thể đạt chiều dài 5,7–7 mm (0,22–0,28 in), nhưng con cái khá lớn hơn con đực, đạt 7,5–9 mm (0,30–0,35 in). [2] [3]\r\n\r\nPronotum và scutellum của chúng có màu xanh lá cây và màu vàng. [3] Đầu trước màu vàng nhạt, có hai đốm đen gần mắt kép. Cánh trước có màu xanh ngọc lam ở con cái, màu xanh lam hoặc hơi xanh sẫm ở con đực (lưỡng hình giới tính). [3] Mặt bụng màu xanh đen.\r\n\r\nẤu trùng có màu hơi vàng và có hai sọc màu nâu chạy từ đầu đến cuối bụng.', 'Những con rầy lá này sống ở những khu vực cỏ rậm rạp, những bãi than bùn và bãi lầy, đồng cỏ ẩm ướt, gần đầm lầy hoặc trong môi trường sống đầm lầy, nhưng đôi khi cũng sống ở những khu vực khô hơn.', '- Chăm sóc cây khỏe (trồng mật độ vừa phải, bón phân cân đối…) giữ ruộng sạch cỏ, tránh trồng xen hoặc xung quanh ruộng các cây ký chủ của rầy xanh.- Đốn, hái chè đúng kỹ thuật, đúng thời điểm tránh búp chè ra đúng thời điểm rầy rộ.- Thu hái búp chè khi rầy rộ để hạn chế trứng rầy .Thăm vườn thường xuyên để phát hiện sớm Biện pháp hóa học:  Phun thuốc vào buổi sáng hay chiều mát khi rầy tuổi nhỏ mới xuất hiện', 'Loài này có mặt ở hầu hết châu Âu, trong lãnh thổ phía đông Palearctic, ở Cận Đông, trong lãnh thổ Cận đại và trong lãnh thổ Indomalayan', 'null', 'insect_Cicadella_viridis/51111.jpg', 'Cicadella', 'null'),
('Cicadellidae', 'Cicadellidae', 'insect_Cicadellidae', 'thay đổi tùy theo loài; Nói chung, con cái chèn một số trứng vào mô sống của cây ký chủ; trứng hoặc ở trạng thái không hoạt động trong khoảng thời gian từ một tháng đến hơn một năm, hoặc phát triển và nở trong vòng vài tuần; nhộng trải qua năm lần lột xác, đạt đến giai đoạn trưởng thành trong vài tuần hoặc vài tháng', 'Phần râu dày lên rất ngắn và kết thúc bằng một sợi lông tơ (Arista).\r\n\r\nHai mắt ocelli (mắt đơn giản) hiện diện trên đỉnh hoặc phía trước của đầu.\r\n\r\nCác tarsi được làm bằng ba phân đoạn.\r\n\r\nCác xương cái ở phía trước, nhiều nhất là các gai yếu.\r\n\r\nXương chày sau có một hoặc nhiều mỏm nhọn riêng biệt, với một hàng gai có thể di chuyển được trên mỗi xương, đôi khi trên các mấu mở rộng.\r\n\r\nPhần gốc của các chân giữa gần nhau nơi chúng bắt nguồn dưới lồng ngực.\r\n\r\nCác cánh trước không đặc biệt dày.', 'Con cái sẽ khoét lỗ theo gân lá hoặc cuống lá để đẻ trứng vào trong đó, đời sống của rầy lá kéo dài khoảng 40 đến 45 ngày, tuỳ thuộc vào điều kiện khí hậu. Ngoài ra còn có loại rầy lá ở củ cải đường tên khoa học Circulifer tenellus gây nên bệnh cuống lá cà, vi khuẩn nầy nhiễm và truyền bệnh đi liên tục ở mọi lứa tuổi và bệnh cuống lá cà không lây nhiểm hay truyền bệnh.', 'Vệ sinh đồng ruộng, thu gom, tiêu hủy tàn dư, làm sạch trước khi gieo trồng, dùng màng phủ, nông nghiệp, để phủ đất.', 'trên toàn thế giới; ở Bắc Mỹ, một số loài di cư về phía nam vào mùa thu, và trở lại phía bắc vào mùa xuân', 'null', 'insect_Cicadellidae/69497.jpg', 'Cicadellidae', 'null'),
('Cicadidae', 'Ve sầu', 'insect_Cicadidae', 'Sau khi giao phối, ve cái đào những rãnh nhỏ lên vỏ các cành cây và đẻ trứng vào đó. Ve cái có thể làm nhiều lần như vậy cho đến khi nó đẻ hết vài trăm trứng. Khi trứng nở, ấu trùng ve rơi xuống và đào sâu vào trong đất. Hầu hết các loài ve có vòng đời từ 2 đến 5 năm. Một số loài có vòng đời dài hơn nhiều, ví dụ như loài Magicicada có vòng đời 17 năm và đôi khi là 13 năm. Những vòng đời dài như thế là một sự thích ứng để chống lại các loài ăn thịt ve như loài ong bắp cầy ăn ve và bọ ngựa bởi vì các loài ăn thịt này không thể thường xuyên xuất hiện đồng thời với ve.[3]\nPhần lớn cuộc đời của ve là thời kỳ ấu trùng ở dưới đất với độ sâu khoảng từ 30 cm (1 ft) đến 2,5 m (khoảng 8½ ft). Các ấu trùng ve hút nhựa rễ cây và có những chân trước đào bới rất khỏe.\nKhi đến giai đoạn chuyển tiếp cuối cùng để kết thúc thời kỳ ấu trùng, những ấu trùng ve đào một đường hầm lên mặt đất và chui lên. Sau đó, chúng lột xác lần cuối trên một cái cây gần đó và trở thành ve trưởng thành. Xác ve vẫn còn nằm đó và gắn vào vỏ cây.', '', '', '', '', 'null', '', 'Cicadidae', 'null'),
('Clitea metallica', 'Sâu nhớt', 'insect_Clitea_metallica', '– Sâu trưởng thành có cánh cứng màu xanh đen, ánh kim loại. Thân dài khoảng 4 cm. Chúng nghỉ đông ở các kẽ nứt của vỏ gốc cây.Khi lộc xuân bắt đầu nhú thì chúng bay ra sinh sản (tháng 1-3).\n– Con cái đẻ từ 500-700 trứng. Trứng nhỏ màu trắng, sau chuyển thành màu vàng rồi vàng nâu là lúc trứng sắp nở thành sâu non.\n– Sâu non các lứa nở ra vào tháng 2, 3 và tháng 4. Ở tuổi cuối sâu non dài khoảng 6 mm, hoạt động, phá hoại mạnh. Chúng ăn các mô mềm trên lộc, lá non và quả non (sâu ăn từ mặt trên lá xuống dưới thì gây thủng lỗ chỗ, ăn từ mặt dưới lá lên trên thì chừa lại một màng trắng). Sâu non ăn và tiết ra chất dịch nhầy và dính làm cho các lá héo khô rồi rụng.', '', '', '', '', 'null', '', 'Clitea', 'null'),
('Cnaphalocrocis jolinalis', 'Sâu cuốn lá lúa loại nhỏ', 'insect_Cnaphalocrocis_jolinalis', ' Vòng đời của sâu cuốn lá lúa trung bình khoảng 30 – 35 ngày. Bướm sống từ 5 – 10 ngày. Giai đoạn trứng từ 3 – 5 ngày. Sâu non sống khoảng 15 – 28 ngày. Nhộng sống từ 6 – 10 ngày.\n\n+ Trong đó giai đoạn sâu non gây hại chiếm khoảng 15 – 28 ngày, sâu non có từ 5 – 6 tuổi. Sâu non tuổi 2 – 3 sẽ nhả tơ khâu mép lá cuốn lại tạo thành bao để sốngnên gây khó khăn trong việc phòng trừ. Sâu cuốn lá nhỏ gây hại bằng cách ăn mô lá chỉ chừa lại lớp biểu bì màu trắng, ruộng lúa bị hại trông xơ xác, nhìn từ xa thấy bạc trắng, làm giảm khả năng quang hợp, cây lúa sinh trưởng phát triển kém, hạt bị lép lửng nhiều, ảnh hưởng đến năng suất.\n\n+ Thành trùng sâu cuốn lá nhỏ thường gọi là ngài có màu vàng rơm, thân dài khoảng hơn 1cm, đây là đặc điểm rất dễ nhận dạng. Khi chúng đậu, đặc điểm cánh xếp thành hình tam giác và khi có tác động vào chúng bay rất nhanh.\n\n+ Một con sâu cuốn lá thường gây hại từ 3 – 5 lá trong một vòng đời và hóa nhộng ngay trong bao lá.', '', '', '', '', 'null', '', 'Cnaphalocrocis', 'null'),
('Cnaphalocrocis medinalis', 'Sâu cuốn lá nhỏ', 'insect_Cnaphalocrocis_medinalis', 'Vòng đời sâu cuốn lá nhỏ từ 28 - 36 ngày. \r\n- Thời gian đẻ trứng:  6 - 7 ngày;\r\n- Sâu non: 14 - 16 ngày;\r\n- Nhộng: 6 - 7 ngày;\r\n- Trưởng thành sống: 2 - 6 ngày. Ngài trưởng thành hoạt động đẻ trứng về đêm, ban ngày ẩn nấp, có xu tính mạnh với ánh sáng, con cái mạnh hơn con đực. Ngài thường tìm những ruộng xanh tốt để đẻ trứng, mỗi con cái có thể đẻ trên 100 quả trứng, rải rác trên lá lúa. Sâu non có 5 tuổi: Tuổi 1 rất linh hoạt có thể bò khắp trên lá, chui vào lá nõn, mặt trong bẹ lá hoặc bao lá cũ; tuổi 2, 3 trở đi nhả tơ để khâu 2 mép lá cuốn thành tổ nằm trong đó gây hại. Sâu có khả năng di chuyển ra khỏi bao cũ để phá hại lá mới, mỗi con sâu non có thể phá hại từ 5 -9 lá, thời gian di chuyển thường vào buổi chiều (từ 6 giờ - 9 giờ tối), ngày trời mưa hoặc râm mát thì có thể di chuyển bất cứ lúc nào trong ngày. Sâu non đẫy sức chuyển màu vàng hồng chui ra khỏi bao bò xuống gốc lúa, bẹ lá dệt kén mỏng hoá nhộng hoặc hoá nhộng ngay trong bao cũ.', 'Trứng của sâu vẽ bùa gần hình elip, hình dẹt, dài khoảng 1 mm (5⁄128 in), lần đầu đẻ ra có màu trắng sữa, sau chuyển sang màu vàng nâu, trước khi nở sẽ có một đốm đen.\r\n\r\nNhìn chung, ấu trùng có 5 trường hợp, chiều dài cơ thể ấu trùng ở giai đoạn trưởng thành khoảng 15–18 mm (19⁄32–23⁄32 in). Ấu trùng có đầu màu nâu, ngực và bụng lúc đầu có màu xanh lục, sau đó chuyển sang màu xanh lục vàng, khi trưởng thành có màu nâu đỏ. Có hai đường màu đen hình xoắn ốc ở rìa sau của đỉnh của ngực trước và 8 vòng tròn nhỏ màu đen riêng biệt ở tận cùng của ngực giữa và sau, trong đó có sáu cạnh trước và hai cạnh sau. [1]\r\n\r\nNhộng, dài khoảng 9 milimét (23⁄64 in), đốt bụng thứ 5 đến đoạn thứ 7 ở gần mép đầu có 1 vạch mịn màu nâu sẫm, đầu đuôi, có 8 gai, nhộng dài với kén mỏng màu trắng.\r\n\r\nCon trưởng thành dài khoảng 7–9 milimét (9⁄32–23⁄64 in), sải cánh dài khoảng 13–18 milimét (1⁄2–23⁄32 in), hình lanh, proala có 3 đai ngang màu nâu, trong số một ngắn tương đối thô. Phần trung tâm của mép đầu của bọ cánh tơ đực có một hốc mắt sáng và lõm, trong khi đó, bọ cánh tơ cái không có hốc mắt.', 'Bướm đêm rất hiếu động, có màu vàng tươi hoặc màu vàng rơm với hai đường lượn sóng rõ rệt ở cánh trước và một đường gợn sóng riêng biệt ở cánh sau. Nó có sải cánh là 15 mm (19⁄32 in). Trứng được đẻ đơn lẻ hoặc thành từng nhóm, xếp thành hàng dọc ở mặt dưới của lá có màu trắng có vảy. Khả năng sinh sản khoảng 56 trứng. Thời gian ủ bệnh từ 4–8 ngày. Chúng tôi tìm thấy 5–6 cá thể ấu trùng, thời kỳ ấu trùng khoảng 22–23 ngày. Nó phát triển thành nhộng trong nếp lá bị nhiễm bệnh trong khoảng thời gian từ 6–7 ngày. Sâu bướm đã trưởng thành hoàn toàn có màu xanh lục và dài 16,5 mm (21⁄32 in). Tổng vòng đời hoàn thành trong khoảng 5 tuần.\r\n\r\nTất cả các giai đoạn của cây trồng đều bị sâu bệnh này tấn công. Khi nở sâu bướm mới nở cắt mép lá và gấp mép lá lại. Khi cây con bị tấn công, nó sẽ gấp 3–4 lá cây liền kề và cạo sạch chất xanh để những lá bị nhiễm bệnh có màu trắng. Một con sâu bướm làm hại một số lá. Các cây bị tấn công sẽ khô héo và nó làm giảm sức sống của cây. Cuối cùng thì năng suất bị giảm. Sự mất mát năng suất có thể thay đổi lên đến 10–50 phần trăm. Nó có nhiều vấn đề hơn ở giai đoạn khởi động lá.', 'Cải cách hệ thống làm đất, gieo trồng, bón phân hợp lý, tránh để lúa chín sớm, chín muộn. Ngoài ra, tác hại của sâu cuốn lá lúa có thể được giảm thiểu bằng cách tránh trồng hỗn hợp lúa sớm, giữa và muộn. Cũng có thể giảm thiệt hại của sâu bệnh thông qua bố trí giống, thiết lập bẫy và ruộng tiêu diệt và giảm diện tích bón. Cũng có thể thu hoạch lúa sớm theo tốc độ phát triển của sâu cuốn lá, sau đó diệt một số sâu non và nhộng ở vùng nước sâu, để giảm tỷ lệ đẻ lứa sau.', 'Nó được tìm thấy ở Đông Nam Á, bao gồm Hồng Kông, Sri Lanka, Đài Loan, Thái Lan và hầu hết Australia.', 'null', 'insect_Cnaphalocrocis_medinalis/00005_JqcTL4i.jpg', 'Cnaphalocrocis', 'Rice leaf roller'),
('Coccinella transversalis', 'Bọ rùa chữ nhân', 'insect_Coccinella_transversalis', 'Bọ rùa cái đẻ trứng ở mặt sau lá cây. Trứng hình bầu dục màu vàng, dài khoảng 1 đến 1,5 mm và bám chặt ở mặt ngoài lá cây. Một bọ rùa đẻ 10-20 trứng một lần, một đời có thể đẻ đến mấy ngàn trứng.', '', '', '', '', 'null', '', 'Coccinella', 'null'),
('Coccus viridis', 'Rệp vảy xanh', 'insect_Coccus_viridis', 'Vòng đời rệp  từ 26 - 40 ngày, trong đó giai đoạn trứng kéo dài từ 5 - 7 ngày. Rệp đẻ trứng vào các kẽ lá, chùm nụ - hoa, chùm quả non. Một con rệp mẹ có thể đẻ đến 500 trứng theo từng lứa. Rệp non sau khi nở 2 - 3 ngày thì bò ra và nhanh chóng tìm nơi sống cố định.', '', '', '', '', 'null', '', 'Coccus', 'null');
INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('Cofana spectra', 'Rầy trắng lớn', 'insect_Cofana_spectra', 'Giai đoạn Trứng:\nTrứng được đẻ rời rạc hoặc từng ổ ở mặt bên dưới hoặc mặt bên trên của phiến lá. Rầy trắng cái rất có thể đẻ từ 7-100 trứng. Chúng thường đẻ trứng tập trung về phía chóp lá.\n\nTrứng mang hình quả lê hơi thon dài, bề mặt nhẵn bóng, chiều dài trung bình 0.20mm, chiều rộng trung bình 0.09 milimet, một đầu tương đối nhọn, đầu kia tương đối tròn và sở hữu cuống ngắn gắn chặt trứng vào biểu bì của lá. Trứng khi mới đẻ mang một màu trắng đục, một ngày sau chuyển sang xám nhạt và xám đậm lúc sắp nở. Thời gian ủ trứng 6-8 ngày.\n\n+Giai đoạn Ấu trùng: \nẤu trùng của Rầy cánh trắng có 3 tuổi:\n\n-Tuổi một: lúc mới nở hình bầu dục, với 3 đôi chân, hai mắt màu đỏ, chưa có lớp phấn. Chiều dài ấu trùng tuổi 1 là 0.25-0.29 mm, chiều rộng 0.09-0.16 mm. C\n\n-Tuổi 2: Sau khi lột xác, khung hình bám chặt vào mặt lá, không còn thấy dấu vết của những đôi bàn chân. Chiều dài 0.40-0.64 mm, chiều rộng 0.20-0.31 mm. cơ thể có lớp phấn mỏng. Thời gian tuổi 2 là 2-3 ngày.\n\n-Tuổi 3: Giống tuổi 2 về màu sắc và hình dạng. Chiều dài 0.57-1.00 mm, chiều rộng 0.30-0.60 mm. Thời gian tuổi 3 là 2- 3 ngày. Ở cuối tuổi 3, chúng lột xác và chuyển sang giai đoạn nhộng.\n\n+Giai đoạn Nhộng giả:\n Sau lúc lột xác ở cuối tuổi 3 chuyển sang giai đoạn nhộng, lớp vỏ bên ngoài cơ thể vươn lên cứng hơn, tiết ra đa dạng chất sáp và dính chặt vào bề mặt của lá. Nhộng với hình bầu dục, khung người chuyển sang trắng đục đôi ngả vàng. Chiều dài 0.89-1.09 milimet, chiều rộng 0.52-0.62mm. \n\n+Giai đoạn Trưởng thành:Khi này chúng giống một loài bướm nhỏ, có hai cặp cánh màu trắng, cặp cánh trước dài, cặp sau ngắn lại, lúc đậu xếp giống hình dáng của một mái nhà. Khi mới vũ hóa cánh còn yếu, thân chuyển màu vàng tươi, chuyển động chậm chạp và chưa thể bay được. \n\nRầy cánh trắng trưởng thành vẫn tiếp tục chích hút gây hại các loại cây, đặc biệt là cây lúa.\n\nRầy cánh trắng với vòng đời trung bình khoảng 17-24 ngày. \n\nVòng sinh thái của Rầy trắng\nRầy cánh trắng phát triển mạnh ở điều kiện thời tiết khô hạn, nhiệt độ cao, mưa ít và gió ít. Khi gặp mưa to và gió mạnh thì rầy sẽ chết nhưng khi trời nắng hạn trở lại thì tiếp tục phát triển và tăng nhanh chóng mật số.\n\nRầy cánh trắng có rất nhiều loài thiên địch trong như nhện lưới, kiến ba khoang, bọ rùa, bọ xít ăn thịt… Để bảo đảm an toàn nguồn thiên địch, đừng nên phun thuốc trừ sâu sớm ở đầu vụ.', '', '', '', '', 'null', '', 'Cofana', 'null'),
('Conogethes punctiferalis', 'Sâu đục quả, sâu đục trái', 'insect_Conogethes_punctiferalis', '* Vòng đời: 27 - 35  ngày\n- Trứng: 4 - 6 ngày: Trứng hình bầu dục dẹp, kích thước khoảng 2 mm, mới đẻ màu trắng sữa, sau chuyển màu vàng. Trứng  đẻ đơn lẻ từng quả ở  bất cứ vị trí nào trên bề mặt vỏ quả, trứng mới đẻ màu vàng cam, hình bầu dục chiều dài không quá 0,5 cm. Khi sắp nở, trứng chuyển sang màu trắng đục, vỏ màu trắng  bên trong có màu đen.\n- Sâu non: 14 - 16: Ấu trùng mới nở có màu trắng sữa (dài khoảng 1mm), đầu nâu, sau chuyển sang màu hồng nhạt, trên mỗi đốt phía lưng có 4 đốm nâu nhạt, trên mỗi đốt có lông cừng nhỏ, đẫy sức dài 22 mm. ', '', '', '', '', 'null', '', 'Conogethes', 'null'),
('Conopomorpha litchiella', 'Sâu đục gân lá', 'insect_Conopomorpha_litchiella', 'Giai đoạn ấu trùng kéo dài khoảng 14-15 ngày. Sau khi phát triển đầy đủ, ấu trùng chui ra khỏi gân lá, nhả tơ kết thành một lớp màng trắng đục, hình hơi tròn hoặc bầu dục trên lá và hóa nhộng phía dưới lớp màng trắng này. Nhộng dài khoảng 5mm màu  xanh nhạt.\nTrong điều kiện tự nhiên, loài này thường bị nhiều loài Ong ký sinh tấn công, có nhiều vườn tỷ lệ ký sinh lên đến 65%. Giai đoạn nhộng: 6-7 ngày. Thời gian sống trung bình của thành trùng khoảng 5-7 ngày trong điều kiện phòng thí nghiệm. Chu kỳ sinh trưởng kéo dài khoảng 24-25 ngày.', '', '', '', '', 'null', '', 'Conopomorpha', 'null'),
('Conopomorpha sinensis', 'Sâu đục quả', 'insect_Conopomorpha_sinensis', '* Vòng đời: 27-35  ngày\n- Trứng: 4-6 ngày\n- Sâu non: 14 – 16 ngày\n- Nhộng: 7-10 ngày\n- Trưởng thành đẻ trứng: 2-3 ngày\nTrưởng thành hoạt động vào ban đêm, chúng đẻ trứng trên lá non, trái hay các hoa đã nở. Sâu đục vào trái ăn phần thịt trái và cả hạt, trên miệng lỗ đục có thể thấy một ít chất thải của sâu. Vết đục thường là nơi giáp giữa hai trái, nhãn tiêu da bò do trái đóng khít thường bị hại nặng.\nTrái non bị sâu đục thường biến dạng, khô rỗng và rụng, trái lớn bị giảm phẩm chất.', '', '', '', '', 'null', '', 'Conopomorpha', 'null'),
('Cricula trifenestrata', 'Sâu róm đỏ', 'insect_Cricula_trifenestrata', 'Sâu róm đỏ có 4 giai đoạn: Trứng, Sâu non, Nhộng, Bướm - Trứng: Thường ở mặt dưới lá. Trứng hình tròn hoặc bầu dục, màu trắng ngà, vàng, kích thước khoảng 0,9 -1 mm.- Sâu non: Sâu có 5 tuổi, có nhiều màu, chủ yếu màu vàng nhạt, đỏ, màu đen, màu nâu. Kích thước sâu tuổi lớn có chiều dài từ 20-60 mm, thân có nhiều gai, có 10 đốt nối đầu và đuôi, phần đuôi phình to, có 7 đôi chân, 4 đôi ở bụng ngắn và to, 1 đôi gần đầu ngắn 2-3 mm, 2 đôi kế tiếp mảnh và dài 10 mm để di chuyển, ở đuôi có 1 đôi râu dài 5-7 mm, trên lưng có đường màu trắng chạy dọc từ đầu đến đuôi. Sâu non thường gây hại vào lúc sáng sớm hoặc chiều tối, trời nắng bò xuống thân hoặc mặt dưới lá để ẩn nấp. Giai đoạn sâu khoảng 12-15 ngày, tuỳ thuộc vào điều kiện ngoại cảnh.- Nhộng có màu đen, đỏ, chiều dài 20-30 mm, Nhộng cái to hơn Nhộng đực, giai đoạn Nhộng đến Bướm khoảng 10 -14 ngày.- Trưởng thành (bướm) có chiều dài từ đầu đến chóp đuôi 30-40 mm, Bướm cái to hơn Bướm đực, màu sắc ban đầu mới vũ hoá có màu trắng ngà vài ngày sau có  màu vàng, trên lưng có các chấm đen dọc lưng, bướm cái màu sắc rực rỡ hơn bướm đực. Giai đoạn bướm khoảng 5-7 ngày. Mỗi Bướm cái đẻ khoảng 130-150 trứng.\n', '', '', '', '', 'null', '', 'Cricula', 'null'),
('Crocidolomia binotalis', 'Sâu ăn đọt cải 2', 'insect_Crocidolomia_binotalis', 'Bướm màu xám nâu, có đốm nhỏ màu nâu đậm trên cánh và dọc cạnh sau của cánh trước. Bướm có chiều dài thân từ 10 - 14 mm,sải cánh rộng từ 18 - 20 mm.\nTrứng dẹp, hơi tròn và có đường kính từ 1 - 2 mm, được đẻ thành từng khối ở kẻ lá của đọt non. Khi mới đẻ khối trứng màu xanh, sau khoảng 2 ngày có màu xanh vàng và trước khi nở màu đen xám. Thời gian phát triển của trứng lâu độ 3-4 ngày.\nẤu trùng có 5 tuổi và phát triển trong vòng 12-15 ngày. Khi mới nở màu xanh vàng, đầu nâu, dần dần cơ thể chuyển thành màu đậm và đến tuổi cuối có màu nâu đậm với 3 sọc trắng trên lưng và mỗi bên hông có 3 đốm tròn nhỏ ở mỗi đốt. Toàn thân có nhiều lông dài trong suốt. Lớn đủ sức ấu trùng dài từ 14 - 17 mm. Sâu thường sống tập trung ăn đọt non. Nhộng màu nâu đỏ, dài từ 10 - 15 mm và làm nhộng trong đất, lâu 7-8 ngày.', '', '', '', '', 'null', '', 'Crocidolomia', 'null'),
('Cucumber Beetles', 'Bọ dưa', 'insect_Cucumber_Beetles', 'Bọ dưa chuột qua mùa đông khi trưởng thành trong các khu vực được bảo vệ gần các tòa nhà, trong hàng rào hoặc trong lô gỗ. Chúng trở nên hoạt động vào giữa mùa xuân, khi nhiệt độ bắt đầu tăng lên. Hiện tại, không có phương pháp tốt để dự đoán khi nào hoạt động sẽ bắt đầu. Bọ cánh cứng nhanh chóng xác định vị trí cây ký chủ vào mùa xuân. Con trưởng thành kiếm ăn và con cái gửi trứng vào các vết nứt trên đất ở gốc cây bầu bí. Trứng nở ra và ấu trùng ăn rễ. Những ấu trùng này sẽ hóa nhộng trong đất, sau đó vào mùa hè thế hệ bọ tiếp theo sẽ xuất hiện. Những con bọ này cũng sẽ ăn các cây dưa chuột và dưa, bao gồm cả trái cây và mùa đông cho đến mùa xuân năm sau.  ', '', '', '', '', 'null', '', ' beetles', 'null'),
('Curculionidae', 'Bọ vòi voi', 'insect_Curculionidae', 'Trứng bọ vòi voi hại dừa hình ô van, mới đẻ màu trắng trong, kích thước trung bình khoảng 1 mm. Ấu trùng mới nở màu trắng đục, sau chuyển thành màu vàng nhạt, không có chân. Sau nở khoảng 8-10 tuần thì ấu trùng vào nhộng, chiều dài 6-8 mm. Nhộng dạng nhộng trần, màu trắng hơi vàng, vị trí hóa nhộng thường nằm ngay trong lỗ đục trên cây và quả (trái) dừa. Trưởng thành bọ vòi voi hại dừa có màu nâu đen, phần đầu có vòi dài (nguồn gốc của tên gọi bọ vòi voi). Trên 2 cánh trước có 4 đốm lớn màu vàng. Trưởng thành dài 6-8 mm, rộng 1,5 mm.', '', '', '', '', 'null', '', 'Aades', 'null'),
('Cyclopelta siccifolia', 'Bọ xít nâu lớn', 'insect_Cyclopelta_siccifolia', 'Lúc nở ấu trùng đội nấp vỏ trứng và dùng cử động của thân mình trồi ra ngoài, khoảng 40 phút sau ấu trùng khô lịa và cử động bình thường. Sau khi nở ấu trùng tập trung quanh ổ trứng 3-4 ngày sau mới phân tán đi nơi khác. Ấu trùng có 5 tuổi:- tuổi 1: khi mới nở dài khoảng 1,2 mm, màu đen, mình tròn, trên mình có những vần màu vàng nhạt nổi lên, râu đầu 4 đốt, mắt kép màu đỏ, khoảng ngày thứ hai sau khi nở ấu trùng bát đầu hoạt động rất nhanh nhẹn và sau 3 ngày sau phần bụng của ấu trùng tròn lên và có màu đỏ tươi, từ 1-2 ngày sau thì thay da, ấu trùng tuổi này thay da rất đồng loạt.-Tuổi 2: kích thước cơ thể dài từ 2-3mm, chung quanh bụng có rìa vàng, phát triển từ 5-7 ngày, trung bình là 6 ngày.-Tuổi 3: cơ thể dài 3-5mm, kéo dài từ 8-10 ngày. -Tuổi 4: cơ thể dài 5-7mm, phát triển từ 9-23 ngày.-Tuổi 5: cơ thể dài 7-9 mm, phát triển từ 27-31 ngày.', '', '', '', '', 'null', '', 'Cyclopelta', 'null'),
('Cylas formicarius', 'Sùng khoai lang', 'insect_Cylas_formicarius', 'Vòng đời khoảng 1 – 2 tháng (thời tiết nóng chỉ khoảng 35 – 40 ngày). Ở Hoa kỳ, một năm có khoảng 5 – 8 lứa. Khi điều kiện thời tiết bất lợi, thành trùng ngưng hoạt động, tìm nơi trú ẩn. Bọ hà có thể gây hại quanh năm nếu có nguồn thức ăn và ký chủ thích hợp.\n– Trứng:Trứng được đẻ trong những lổ hổng trên củ hay dây do con cái dùng miệng cạp vào. Trứng đẻ từng quả một, được trét kín bằng phân do con cái thải ra nên khó thấy, thông thường trứng được trên dây, gần nơi tiếp giáp giữa dây và củ, đôi khi con cái bò xuống đất qua những kẻ nứt, tìm đến củ để đẻ trứng. Trứng hình bầu dục, có màu trắng kem, dài 0,7 mm, rộng 0,5 mm. Giai đoạn trứng kéo dài khoảng 5 – 6 ngày ở mùa Hè, 11 – 12 ngày nếu thời tiết lạnh hơn. Mỗi ngày con cái đẻ 2 – 4 trứng, hay trong suốt vòng đời ( 30 ngày) , bọ hà đẻ khoảng 75 – 90 trứng.\n– Ấu trùng ( Sùng):Sau khi nở, sùng đục, chui vào dây hay củ. Những con nở trên dây có xu hướng chui xuống đất tìm đến củ đẻ đục vào. Sùng không chân, màu trắng, 3 tuổi. Giai đoạn sùng  kéo dài khoảng 10 ngày ( 30 độ C). Trong củ, sùng đục đường hầm ngoằn nghèo và thải phân trong đó.– Nhộng:Ấu trùng hóa nhộng trong củ hay thân. Nhộng giống thành trùng, dài khoảng 6,5 mm. Giai đoạn nhộng dài khoảng 7 – 10 ngày, nếu trời lạnh kéo dài tới 28 ngày.\n– Thành trùng:Thành trùng giống kiến lửa, dài khoảng 5.5 – 8.0 mm, đầu đen, râu, ngực và chân màu cam đến đỏ nâu, phần bụng có màu xanh ánh kim.  Thành trùng thường gậm mặt dưới lá, giả chết nếu bị động, bay thấp từng đoạn ngắn, hoạt động mạnh về đêm.', '', '', '', '', 'null', '', 'Cylas', 'null'),
('Dactylispa sp', 'Sâu gai (hại ngô)', 'insect_Dactylispa_sp', 'Trứng được đẻ thành ổ từ 1 - 3 quả  trong mô lá ngô. Sâu non  màu trắng đục, đầu màu nâu nhạt. Cơ thể dẹt, hình ô van dài. Sâu non đẫy sức hoá nhộng ngay trong vết hại trên lá ngô. Nhộng  màu nâu cánh gián, hình ovan dài, phía đầu hẹp, phía sau nở rộng hơn. Trư­ởng thành dài khoảng 55 -60 mm, đầu màu vàng nhạt đến vàng nâu. Hai mắt kép to đen nằm ở hai bên đầu. Cánh cứng, màu xanh đen bóng. Mặt lưng cánh cứng và mép bên có nhiều gai màu xanh đen  Mặt bụng, chân  có màu vàng nâu.', '', '', '', '', 'null', '', '​Dactylispa', 'null'),
('Dasineura sp. near capsulae', 'Dasineura sp. near capsulae', 'insect_Dasineura_sp_near_capsulae', 'Con trưởng thành chủ yếu sống về đêm và ẩn náu vào ban ngày. Con cái đẻ nhiều lứa trứng nhỏ (lên đến sáu quả) ở mặt dưới của lá lúa. Những quả trứng lúc đầu có màu đỏ, nhưng đến khi nở, hai đến bốn ngày sau, chúng có màu nâu sô cô la. Những ấu trùng nhỏ bé chui xuống bẹ lá cho đến khi chúng chạm tới nách lá, nơi chúng chui vào thân. Sau khi kiếm ăn khoảng mười ngày và hình thành một túi mật , chúng sẽ hóa nhộng bên trong. Bốn đến bảy ngày sau, chúng sử dụng gai ở đầu bụng để tạo một lỗ trên túi mật gần đầu của nó. Ở đây các côn trùng trưởng thành xuất hiện. Chúng sống trong ba hoặc bốn ngày, và có thể có tới tám thế hệ muỗi vằn trong năm.', 'Những con trưởng thành xuất hiện từ đầu tháng 4 đến cuối tháng 5, sống từ 2–4 ngày. Trứng được đẻ ở phần bên trong của các lá bắc bao bọc cyathium. Ấu trùng sơ sinh di chuyển vào cyathium, nơi chúng gây ra sự hình thành các túi mật. Các túi mật, xuất hiện vào đầu tháng 5, được tạo ra do sự mở rộng và biến dạng của cyathium và ngăn chặn việc sản xuất hạt ở những bông hoa bị nhiễm bệnh. Vào cuối tháng 6 và đầu tháng 7, ấu trùng trưởng thành rời khỏi túi mật, rơi xuống đất nơi chúng xâm nhập vào đất, ngủ đông cho đến mùa xuân năm sau, và hóa nhộng vài ngày trước khi trưởng thành xuất hiện. Các phép thử tính đặc hiệu của vật chủ đối với D. sp. gần capsulae đã được thực hiện, sử dụng 48 cây thử nghiệm trong 17 họ. Loài muỗi vằn đã sinh sản trên 13 cây thử nghiệm (tất cả đều thuộc chi Euphorbia) và đối chứng (E. esula).', 'Giai đoạn trưởng thành (trong đó giao phối và đẻ trứng) có thể chỉ kéo dài từ một đến vài ngày. Trứng được đẻ giữa các vảy của nụ hoa sau khi nụ bắt đầu nở ra. Các chồi ngủ hoàn toàn không bị nhiễm bệnh. Trứng nở sau hai đến ba ngày. Vì ấu trùng tiêu hóa các mô thực vật nên chúng là giai đoạn gây hại cho thực vật. Có thể có từ một đến chín ấu trùng trong một nụ hoa. Ấu trùng dường như ăn các mô chồi và trên cuống giữ các nụ hoa riêng lẻ đến cuống trong cụm hoa đang phát triển. Ấu trùng có thể rơi xuống đất sau khi cho ăn, sau đó hóa nhộng và chuyển sang giai đoạn trưởng thành. Trong điều kiện phòng thí nghiệm, những nụ hoa bị nhiễm bệnh đã trưởng thành sau 12 ngày. Nụ hoa có thể đẻ trứng liên tục từ tháng Giêng đến tháng Ba. Khi thực vật tiến tới nảy chồi sinh dưỡng, sự rụng trứng cũng xảy ra trên các mô phân sinh chồi mới. Các chồi sinh dưỡng bị nhiễm bệnh sưng lên và các lá bên ngoài cuộn tròn lại bọc lấy ấu trùng bên trong. Oviposition tiếp tục cho đến cuối tháng Năm. Trong suốt mùa hè, mùa thu và đầu mùa đông ở Florida, ấu trùng dường như đi vào giai đoạn phát triển và ở lại trong đất. Các chồi sinh dưỡng bị nhiễm bệnh sưng lên và các lá bên ngoài cuộn tròn lại bao bọc lấy ấu trùng bên trong.', 'Các phương pháp kiểm soát vẫn đang được điều tra (Lyrene và Payne 1995). Người lớn dễ dàng bị giết bằng thuốc diệt côn trùng. Tuy nhiên, lịch sử sống đa chủng và tuổi thọ trưởng thành ngắn của chúng đòi hỏi phải theo dõi cẩn thận và xác định thời điểm sử dụng thuốc diệt côn trùng. Liên hệ với văn phòng hoặc đại lý mở rộng dịch vụ hợp tác tại quận của bạn để biết các loại thuốc diệt côn trùng mới nhất được áp dụng. Giai đoạn ấu trùng cho ăn và trứng ít dễ bị chết hơn, vì những giai đoạn này ít nhất được bảo vệ một phần bởi mô thực vật xung quanh. Ấu trùng và nhộng trong đất có thể dễ bị nhiễm thuốc trừ sâu trong đất. Bất kỳ biện pháp xử lý côn trùng nào trong thời kỳ ra hoa của cây việt quất phải được áp dụng một cách thận trọng vì côn trùng thụ phấn đang hoạt động mạnh vào thời điểm này. Ngoài ra, Thuốc trừ sâu có thể được áp dụng sau khi ra hoa khi các mô phân sinh sinh dưỡng đang bị tấn công và các quần thể muỗi vằn đang phát triển. Thời điểm này sẽ làm giảm số lượng ấu trùng quá lớn và sự tấn công của muỗi vằn tiếp theo vào mùa đông và mùa xuân năm sau.', 'Bắc Mỹ , Canada', 'null', 'insect_Dasineura_sp_near_capsulae/66326.jpg', 'Dasineura', 'null'),
('Deporaus marginatus', 'Bọ cắt lá', 'insect_Deporaus_marginatus', 'Con cái trưởng thành sử dụng vòi trứng của mình để gửi trứng đơn lẻ vào các hốc nhỏ được đào trên mặt trên của một chiếc lá non gần gân giữa ; Sau đó, cô cắt bỏ chiếc lá gần cuống từ mép này sang mép khác, kể cả phần gân giữa, sau đó nó rơi xuống đất. [1] Trứng nở sau khoảng hai ngày, và ấu trùng chui vào mô lá. Sau trạng thái ấu trùng kéo dài khoảng mười một ngày, ấu trùng thoát ra khỏi lá và tự hình thành các khoang đất để hóa thành nhộng . Sau khi trải qua quá trình biến thái, những con trưởng thành xuất hiện trong khoảng tám ngày. Sáu ngày sau, chúng trưởng thành hoàn toàn và bắt đầu sinh sản, giao phối thường diễn ra vào sáng sớm, và kéo dài khoảng một giờ. Nữ sinh sản trung bình 614. Những con cái sống cho khoảng mười tuần và những con đực trong khoảng một tuần ít hơn.', 'Con cái trưởng thành sử dụng vòi trứng của mình để gửi trứng đơn lẻ vào các hốc nhỏ được đào trên mặt trên của một chiếc lá non gần gân giữa; Sau đó, cô ấy cắt bỏ chiếc lá gần cuống từ mép này sang mép khác, bao gồm cả gân giữa, sau đó nó rơi xuống đất. [1] Trứng nở sau khoảng hai ngày, và ấu trùng chui vào mô lá. Sau trạng thái ấu trùng kéo dài khoảng mười một ngày, ấu trùng thoát ra khỏi lá và tạo thành các khoang đất để hóa thành nhộng. Sau khi trải qua quá trình biến thái, những con trưởng thành xuất hiện trong khoảng tám ngày. Sáu ngày sau, chúng trưởng thành hoàn toàn và bắt đầu sinh sản, giao phối thường diễn ra vào sáng sớm, và kéo dài khoảng một giờ. Khả năng sinh sản của con cái trung bình là 614. Con cái sống được khoảng mười tuần và con đực sống được khoảng một tuần', 'Nó có màu nâu nhạt với elytra đen(vỏ cánh)', 'Đuông trưởng thành cạo lớp bề mặt của lá xoài khiến lớp lá xoài chuyển sang màu nâu, vò nát và biến dạng. [1] Họ cũng cắt \"khung cửa sổ\" giữa các tĩnh mạch. Dấu hiệu rõ ràng nhất của sự nhiễm bệnh là sự xuất hiện của những chiếc lá bị cắt trên mặt đất bên dưới gốc cây, và những chồi non bị tước lá, có thể được nhìn thấy từ xa. Cây bị nhiễm bệnh làm giảm tốc độ sinh trưởng, ra hoa kém và năng suất thấp hơn, sự phát triển của chồi rễ có thể bị chậm lại và ghép không đạt', 'nguồn gốc từ châu Á nhiệt đới, chúng xuất hiện ở Pakistan, Ấn Độ, Bangladesh, Myanmar, Thái Lan, Malaysia và Singapore.', 'null', 'insect_Deporaus_marginatus/67873.jpg', 'Deporaus', 'null'),
('Diaphorina citri', 'Rầy chổng cánh', 'insect_Diaphorina_citri', 'Vòng đời của rầy chổng cánh từ 28-32 ngày, có thể có từ 12-14 thế hệ/năm. Chúng trưởng thành sau vũ hóa 4-5 ngày sẽ bắt cặp. Con cái đẻ khoảng 200-800 trứng vào ban ngày, thời gian ủ trứng từ 3-7 ngày, ấu trùng có 5 tuổi, phát triển trong thời gian từ 18-25 ngày[1]. Giai đoạn sâu non của rầy chổng cánh có 5 tuổi. Vòng đời rầy tương đối ngắn từ 19,6- 30,3 ngày tuỳ theo điều kiện nhiệt độ và ẩm độ của các tháng trong năm. Ở điều kiện miền Bắc hàng năm có 9- 10 lứa. Các đợt phát sinh với mật độ quần thể cao trong năm trùng với các thời điểm ra lộc của cây như lộc xuân vào tháng 3, 4 và lộc thu vào tháng 8, 9', '', '', '', '', 'null', '', 'Diaphorina', 'null'),
('Dicladispa armigera', 'Sâu gai, Bọ gai', 'insect_Dicladispa_armigera', 'Trứng: Những quả trứng hispa gạo do bọ cái đẻ ra thường được đưa vào bên dưới lớp biểu bì mặt dưới của lá. Đôi khi, trứng cũng được đẻ trên mặt trên của lá. Những quả trứng có hình dạng nhỏ, được bao phủ bởi một chất tối màu và đẻ đơn lẻ. Mỗi con cái đẻ tổng số từ 18 đến 101 trứng trong cuộc đời của chúng, với trung bình là 55. Thời gian ấp khoảng 4 ngày.Âú trùng:Các ấu trùng , trên nở, là ~ 2.4mm dài, dorsoventrally phẳng, và màu vàng nhạt. Chúng đào sâu vào lá, ăn các mô xanh và chỉ để lại hai lớp biểu bì . Hoạt động của sâu non thường sẽ để lại hình thái đổi màu không đều trên lá. Sâu non sẽ kiếm ăn và phát triển thành nhộng trong lá mà không cần di chuyển sang lá tươi. Ấu trùng trưởng thành hoàn toàn dài ~ 5,5 mm, phần lưng dẹt, và có màu vàng nhạt xỉn. Thời kỳ ấu trùng kéo dài từ 7–12 ngày, và sau đó là hóa nhộng.Nhộng:có mặt lưng dẹt, màu nâu và dài thích hợp 4,9mm. Giai đoạn nhộng kéo dài khoảng 4 ngày.Trưởng thành:Cuối cùng con bọ trưởng thành, được biết đến như một imago , nổi lên và cắt giảm theo cách của mình ra khỏi đường hầm ấu trùng và lá xung quanh. Hình tượng dài ~ 5mm và có màu đen hơi xanh với thân có gai. Tuổi thọ trung bình của con trưởng thành là 24 ngày đối với con cái và 16 ngày đối với con đực, mặc dù một số cá thể đã được biết là sống lâu tới 90 ngày. Người lớn từ lâu, gai trên phát triển tốt prothorax và elytra . Dự án bốn gai từ metanotum , và elytra chứa một hàng mười gai dọc theo các mép bên và chín gai ở mặt lưng .', '', '', '', '', 'null', '', 'Dicladispa', 'null'),
('Diconocoris hewetti', 'Bọ xít lưới', 'insect_Diconocoris_hewetti', 'Bọ xít lưới màu đen, cánh có hình lưới, kích thước cơ thể khoảng 4,5 x 3,0mm. Đốt ngực phát triển rộng ra 2 bên tạo thành 2 khối u. Bọ xít lưới đẻ trứng vào cuống hoa, trái. Ấu trùng bọ xít lưới trải qua 5 lần lột xác để phát triển và cơ thể có nhiều gai nhọn. Giai đoạn trứng và ấu trùng bọ xít lưới kéo dài trung bình từ 10-19 ngày, vòng đời của bọ xít trưởng thành là 27 ngày.', '', '', '', '', 'null', '', 'Diconocoris', 'null'),
('Dihamus cervinus', 'Sâu gặm vỏ', 'insect_Dihamus_cervinus', 'Thời kỳ sâu non dài từ tháng 4-5 năm trước đến thang 2-3 năm sau. Sâu thường ẩn náu trong thân cây về ban ngày, ban đên chui ra khỏi thân và gặm vỏ cây.', '', '', '', '', 'null', '', 'Dihamus', 'null'),
('Diplacodes trivialis', 'Chuồn chuồn ngô', 'insect_Diplacodes_trivialis', 'Chuồn chuồn ngô trải qua quá trình biến thái không hoàn toàn gồm ba giai đoạn: trứng, ấu trùng và trưởng thành.Chuồn chuồn giao phối khá phức tạp, chúng nhào lộn trên không cùng nhau, và con đực xuất tinh trên không.\nSau khi giao phối, con chuồn chuồn đẻ trứng ở nơi gần nước. Tùy thuộc vào loài, trứng có thể mất từ ​​vài ngày đến hơn một tháng để nở. Trong mùa đông trứng không nở và đợi đến mùa xuân khi nhiệt độ ấm lên chúng mới bắt đầu cuộc sống mới.\nẤu trùng sống trong nước và lột da nhiều lần để phát triển, có thể hơn chục lần lột da. Ở những vùng nhiệt đới, quá trình lột da chỉ mất một tháng. Trong khi ở vùng ôn đới, giai đoạn này lâu hơn đáng kể, thậm chí kéo dài vài năm.\nKhi ấu trùng bắt đầu sẵn sẵn cho giai đoạn trưởng thànhm ấu trùng ngoi lên khỏi mặt nước và tìm kiếm một cành cây hoặc một tán lá. Nó lột da lần cuối cùng, và người trưởng thành xuất hiện, trông nhợt nhạt. Nó đứng yên một lúc cho cơ thể khô lại và bắt đầu bay đi tìm bữa ăn.', '', '', '', '', 'null', '', 'Diplacodes', 'null'),
('Dolycoris baccarum', 'Bọ xít lông', 'insect_Dolycoris_baccarum', 'Nó là univoltine ở phần phía bắc của phạm vi và bivoltine ở các khu vực phía nam ấm hơn. Những con bọ khiên trưởng thành này có thể được tìm thấy quanh năm, khi chúng vào mùa đông. Chúng xuất hiện vào mùa xuân năm sau, khi chúng giao phối và con cái đẻ trứng. Vào cuối mùa hè, thế hệ trưởng thành mới xuất hiện. Nhộng ăn nhiều thực vật, đặc biệt là các loài thuộc họ Hoa hồng và họ Cúc , Linaria vulgaris và Lamium album .  Có thể tìm thấy con trưởng thành thường xuyên trên cây bụi ăn quả mọng, đặc biệt là cây Kim ngân và Quả mâm xôi.  Mặc dù có tên chung là lỗi sloe, cả ấu trùng và con trưởng thành đều không ăn Sloe ( Prunus spinosa ).', '', '', '', '', 'null', '', 'Dolycoris', 'null'),
('Donacia provesti', 'Bọ nước', 'insect_Donacia_provesti', 'Bọ cạp nước, cũng giống như những loài côn trùng khác trong thế giới tự nhiên, đều trải qua quá trình biến đổi đơn giản hoặc không đầy đủ với ba giai đoạn: trứng, ấu trùng và trưởng thành. Thông thường, con cái sinh sản và đặt trứng của mình vào cây thực vật thủy sinh vào mùa xuân. Các ấu trùng (nymphs) nổi lên vào đầu mùa hè và trải qua 5 hình thái trước khi đến tuổi trưởng thành.', '', '', '', '', 'null', '', 'Donacia', 'null'),
('Dysdercus cingulatus', 'Bọ xít đỏ', 'insect_Dysdercus_cingulatus', 'Vòng đời phát triển của bọ xít hút máu Triatominae khoảng trên, dưới 300 ngày (tùy thuộc vào điều kiện môi trường).\n- Trứng: màu trắng, chuyển sang màu đỏ nhót thì nở.\nThời gian phát triển: 13 - 16 ngày, tỉ lệ nở con đạt: 85,7% - 95,2%\n- Thiếu trùng: 1 - 5 giai đoạn\n- Giai đoạn trưởng thành: Bọ xít đẻ trứng rời rạc, đẻ làm nhiều lần khác nhau, trung bình mỗi con cái đẻ 200 trứng.Giai đoạn bọ xít trưởng thành, cơ thể có màu nâu tối phớt màu đỏ nhạt. Phần đầu hơi kéo dài. Râu đầu có 4 đốt, đốt thứ hai dài nhất, đốt 3 và đốt 4 vuốt nhỏ lại giống như lông cứng, đốt 4 màu trắng sáng. Phụ miệng kiểu chích hút gọi là vòi, có 3 đốt.', '', '', '', '', 'null', '', 'Dysdercus', 'null'),
('Empoasca flavescens', 'Rầy xanh lá mạ, rầy xanh nhỏ', 'insect_Empoasca_flavescens', 'Trưởng thành (2 - 21 ngày): Thân dài từ 2,5 - 4 mm, màu xanh lá mạ. Đầu hơi hình tam giác, chính giữa đỉnh đầu có đường vân trắng, và hai bên có chấm đen nhỏ. Cánh trong mờ, màu xanh lục, xếp úp hình mái nhà.\n- Trứng (5 - 8 ngày): Có hình hơi cong dạng quả chuối, dài khoảng 0,8 mm. Trứng mới đẻ màu trắng sữa, sắp nở có màu lục nhạt hay hơi nâu. Vòng đời của trứng từ 5 - 8 ngày\n- Rầy non (9 - 11 ngày (mùa Xuân); 7 - 8 ngày (mùa Hè); 14 - 16 ngày (mùa Đông)): Rầy xanh non có 5 tuổi, tuy chưa có cánh nhưng gần giống trưởng thành. Rầy mới nở màu trắng trong suốt, dài 1 mm. Rầy càng lớn chuyển dần sang màu xanh. Cuối tuổi 5 cơ thể dài 2mm.', '', '', '', '', 'null', '', 'Empoasca', 'null'),
('Epilachna vigintioctopunctata', 'Bọ rùa', 'insect_Epilachna_vigintioctopunctata', 'Những con trưởng thành đốm màu cam và đen dài khoảng 7-10 mm. Đầu, prothorax (phần đầu của thân giữa) và elytra (bao cánh) được bao phủ bởi những sợi lông mịn ngắn. Các elytra được bao phủ với 28 điểm. Kích thước và hình dạng của các đốm có thể thay đổi, nhưng chỉ các cặp đốm ở đường giữa của hàng ngang thứ hai và thứ tư mới có thể liên kết với nhau. Mặt dưới của bọ rùa màu nâu cam và đen. Có ba cặp chân màu nâu cam. Dưới elytra là một đôi cánh dùng để bay. Đầu nhỏ chủ yếu có màu cam nhạt và có một đôi mắt kép và hai râu ngắn. Các râu có màu nâu cam.\n\nBọ rùa cái đẻ những chùm trứng màu vàng gần những con mồi. Một ấu trùng nở ra từ mỗi quả trứng. Có bốn giai đoạn (giai đoạn) ấu trùng. Khi ấu trùng phát triển, nó lột xác (thay da). Ấu trùng mới nở có màu vàng nhạt và được bao phủ bởi các nốt sần với các seta dài. Cơ thể vẫn có màu vàng và các con mối, vết lao, bộ lông và chân trở thành màu xám đen. Có ba cặp chân. Ấu trùng cũng sử dụng đầu của bụng để bám vào chất nền mà chúng đang đi trên đó.\n\nPhần đầu của bụng cũng giữ ấu trùng trên bề mặt trong quá trình lột xác thành ấu trùng khác và thành nhộng. Khi ấu trùng thứ tư phát triển hoàn toàn, nó tự bám vào một nơi có mái che trên cây. Lớp da gai của ấu trùng vẫn dính vào phần gốc của nhộng. Các nhộng được bao phủ trong cấu trúc lông cứng màu đen. Nó có màu đen ngoại trừ các màng giữa các phân đoạn nhạt màu. Có các gai bụng hình ống màu trắng nổi bật, lỗ thông với ống dẫn khí (khí quản). Con trưởng thành nở ra từ nhộng và giao phối. Khoảng thời gian của mỗi giai đoạn sống phụ thuộc vào nhiệt độ, ngắn hơn ở nhiệt độ cao hơn.', '', '', '', '', 'null', '', 'Epilachna', 'null'),
('Eriophyes vitis', '‎nho erineum mite‎', 'insect_Eriophyes_vitis', 'Mạt rỉ nho rất nhỏ (dài 0,15 mm hoặc 1/100 inch). Chúng là loài thực vật (ăn thực vật), thích ăn các mô nho non vào đầu mùa xuân, gây tổn thương dẫn đến biến dạng  chồi  và  lá  và dẫn đến hoại tử bề mặt được mô tả như sẹo. Người ta tin rằng ve thích các mô mới phát triển, có khả năng do nồng độ chất dinh dưỡng cao hơn; tuy nhiên, tùy chọn này không được xác minh. Bọ ve ăn các tế bào thực vật bằng cách đưa ống định hình (phần miệng) của nó vào một tế bào và tiêu thụ các chất bên trong, mất 10 đến 20 phút để kiếm ăn. Nước bọt của một số loài bọ xít Eriophyid được phát hiện có chứa hormone thực vật  chẳng hạn như các chất tương tự auxin và cytokinin. Khi lắng đọng vào hoặc vào tế bào thực vật, những hormone này gây ra dị dạng trong việc mở rộng mô thực vật (Petanović và Kielkiewicz, 2010). Nói chung, mạt rỉ được tìm thấy chỉ ăn các tế bào ở lớp biểu bì (bề mặt) của mô, không bao giờ xâm nhập vào   lớp phloem .', 'Loại bọ này có hình thái tương tự như bọ xít búp nho. Nó có kích thước siêu nhỏ, giống hình con sâu và có màu vàng trắng. Nó mọc đè lên giữa các vảy chồi bên ngoài và mô chồi và ăn lá trong suốt mùa xuân và mùa hè. Mặt trên của lá bị phồng rộp, và mặt dưới của vết phồng rộp có lông và màu trắng, gần giống như sự phát triển của nấm. Mặt dưới lá chuyển từ màu trắng vào đầu mùa và chuyển sang màu vàng hoặc nâu vào cuối mùa. Trong một số trường hợp nghiêm trọng, những con ve này trong một số trường hợp hiếm hoi có thể xâm nhập vào các cụm vào đầu mùa xuân. Virus Grapevine Pinot Gris ( GPGV ) được biết đến là loài vectơ của loài bọ này; tuy nhiên, mức độ lây lan của vi rút này trong PNW vẫn chưa được biết.', 'Trong mùa hè, các đàn ve erineum sống trong các mụn nước ( erinea ) được hình thành khi chúng ăn các bề mặt dưới lá. Các mụn nước bao gồm các đám lông lá phình to. Những vỉ này bảo vệ bọ ve khỏi những kẻ thù tự nhiên và sự tiếp xúc trực tiếp của bình xịt thuốc trừ sâu. Khi dân số tăng lên, một số di chuyển đến các khu vực mới hoặc các lá khác và hình thành các erinea mới. Từ giữa tháng 8 cho đến khi lá rụng, có một sự di chuyển từ erinea trở lại các vị trí trú đông bên dưới vảy chồi.', 'Các loài ve ăn thịt và bọ cánh cứng là tác nhân kiểm soát sinh học quan trọng đối với các loài ve này.Các loại dầu và thuốc diệt côn trùng mùa sâu được sử dụng cho các loài gây hại khác và các ứng dụng lưu huỳnh đối với bệnh phấn trắng thường kiểm soát loài gây hại này. Các biện pháp kiểm soát trực tiếp dành riêng cho bọ ve thường không cần thiết.Dầu mùa sâu và thuốc diệt côn trùng được sử dụng cho các loài gây hại khác thường kiểm soát loài gây hại này. Ngoài ra, các ứng dụng lưu huỳnh cho bệnh phấn trắng nho thường giữ cho các quần thể bọ ve trong tầm kiểm soát. Lưu huỳnh ướt có hiệu quả hơn so với các công thức lưu huỳnh có thể chảy được. Các biện pháp kiểm soát hóa chất thường không hiệu quả do khả năng bảo vệ bọ ve trong vòng galls.', 'Grabouw , Nam Phi .', 'null', 'insect_Eriophyes_vitis/42806.jpg', 'Eriophyes', 'null'),
('Erythroneura apicalis', 'Erythroneura apicalis', 'insect_Erythroneura_apicalis', 'òng đời rầy xanh (14 - 21 ngày) Empoasca sp và Rầy xanh Empoasca sp ấu trùng và trưởng thành.- Trưởng thành (2 - 21 ngày): Thân dài từ 2,5 - 4 mm, màu xanh lá mạ. Đầu hơi hình tam giác, chính giữa đỉnh đầu có đường vân trắng, và hai bên có chấm đen nhỏ. Cánh trong mờ, màu xanh lục, xếp úp hình mái nhà.\r\n\r\n- Trứng (5 - 8 ngày): Có hình hơi cong dạng quả chuối, dài khoảng 0,8 mm. Trứng mới đẻ màu trắng sữa, sắp nở có màu lục nhạt hay hơi nâu. Vòng đời của trứng từ 5 - 8 ngày\r\n\r\n- Rầy non (9 - 11 ngày (mùa Xuân); 7 - 8 ngày (mùa Hè); 14 - 16 ngày (mùa Đông)): Rầy xanh non có 5 tuổi, tuy chưa có cánh nhưng gần giống trưởng thành. Rầy mới nở màu trắng trong suốt, dài 1 mm. Rầy càng lớn chuyển dần sang màu xanh. Cuối tuổi 5 cơ thể dài 2mm.', 'Trưởng thành 2-2,5 mm chiều dài, với cánh 3-4 mm. Trắng, mắt kép màu vàng đen, vòng đầu với hai đốm đen. Pronotum phía trước, có ba đốm đen quanh. Tấm lá chắn nhỏ trên mỗi bên của một điểm tam giác. Hoặc với những mảng màu nâu nhạt trên cánh.Trứng\r\nMàu vàng trắng, hình chữ nhật, hơi cong, 0,2 mm.\r\nNhộng\r\nĐầu nở trắng, vàng trắng hoặc màu nâu đỏ sau, chiều dài cơ thể 0,2 mm.', '. Tổ chức trong nho, táo, lê, đào hoa. Người lớn và nhộng hút nhựa trên bề mặt của lá, nạn nhân để lại cho thấy những đốm trắng. Lá nặng nhạt, vì vậy thiêu đốt đi.', 'Động thái quần thể của _ Erythroneura apicalis_ đã được điều tra, và các loại thuốc trừ sâu để kiểm soát loài côn trùng gây hại này đã được đánh giá trong giai đoạn 2006-2009. Kết quả cho thấy, mỗi năm rầy nâu có 3 thế hệ. Họ phá hoại nho từ tháng Năm đến tháng Mười. Rầy trưởng thành có 3 đỉnh. Cao điểm đầu tiên vào giữa tháng Năm, cao điểm thứ hai vào đầu tháng Bảy và cao điểm thứ ba sau cuối tháng Chín. Nhộng rầy nâu cũng có 3 đỉnh. Cao điểm đầu tiên từ cuối tháng Năm đến đầu tháng Sáu, cao điểm thứ hai từ giữa đến cuối tháng Bảy, và cao điểm thứ ba từ cuối tháng Tám đến giữa tháng Chín. Thời kỳ tối ưu để kiểm soát rầy là từ cuối tháng Năm đến giữa tháng Sáu. 70% imidacloprid WP, ​​25% thiamethoxam WP và 40% chlorpyrifos EC có thể kiểm soát rầy lá một cách hiệu quả và nhanh chóng. Tỷ lệ hiệu ứng kiểm soát là hơn 95% từ 1 ngày đến 14 ngày. Hiệu quả kiểm soát của 25% buprofezin WP thấp hơn trong 1 ngày, nhưng nó bắt đầu tăng lên sau 7 ngày. Tỷ lệ hiệu ứng khống chế trong _14 ngày là 100%.', 'Trung Quốc (Mãn Châu), Nhật Bản (Hokkaido), Nhật Bản (Honshu), Nhật Bản (Kyushu), Nhật Bản (Shikoku), khu vực phương Đông, Nga (Primorskiy kray), Nga (S Khabarovsk kray), Nga (Đảo S. Kurile), Trung Quốc , Nga (Viễn Đông), Nhật Bản, Hàn Quốc, Hàn Quốc, Đài Loan.', 'null', 'insect_Erythroneura_apicalis/58153.jpg', 'Arboridia', 'null'),
('Erythroneura subrufa', 'Rầy trắng nhỏ', 'insect_Erythroneura_subrufa', 'Giai đoạn Trứng:\nTrứng được đẻ rời rạc hoặc từng ổ ở mặt bên dưới hoặc mặt bên trên của phiến lá. Rầy trắng cái rất có thể đẻ từ 7-100 trứng. Chúng thường đẻ trứng tập trung về phía chóp lá.\n\nTrứng mang hình quả lê hơi thon dài, bề mặt nhẵn bóng, chiều dài trung bình 0.20mm, chiều rộng trung bình 0.09 milimet, một đầu tương đối nhọn, đầu kia tương đối tròn và sở hữu cuống ngắn gắn chặt trứng vào biểu bì của lá. Trứng khi mới đẻ mang một màu trắng đục, một ngày sau chuyển sang xám nhạt và xám đậm lúc sắp nở. Thời gian ủ trứng 6-8 ngày.\n\n+Giai đoạn Ấu trùng: \nẤu trùng của Rầy cánh trắng có 3 tuổi:\n\n-Tuổi một: lúc mới nở hình bầu dục, với 3 đôi chân, hai mắt màu đỏ, chưa có lớp phấn. Chiều dài ấu trùng tuổi 1 là 0.25-0.29 mm, chiều rộng 0.09-0.16 mm. C\n\n-Tuổi 2: Sau khi lột xác, khung hình bám chặt vào mặt lá, không còn thấy dấu vết của những đôi bàn chân. Chiều dài 0.40-0.64 mm, chiều rộng 0.20-0.31 mm. cơ thể có lớp phấn mỏng. Thời gian tuổi 2 là 2-3 ngày.\n\n-Tuổi 3: Giống tuổi 2 về màu sắc và hình dạng. Chiều dài 0.57-1.00 mm, chiều rộng 0.30-0.60 mm. Thời gian tuổi 3 là 2- 3 ngày. Ở cuối tuổi 3, chúng lột xác và chuyển sang giai đoạn nhộng.\n\n+Giai đoạn Nhộng giả:\n Sau lúc lột xác ở cuối tuổi 3 chuyển sang giai đoạn nhộng, lớp vỏ bên ngoài cơ thể vươn lên cứng hơn, tiết ra đa dạng chất sáp và dính chặt vào bề mặt của lá. Nhộng với hình bầu dục, khung người chuyển sang trắng đục đôi ngả vàng. Chiều dài 0.89-1.09 milimet, chiều rộng 0.52-0.62mm. \n\n+Giai đoạn Trưởng thành:Khi này chúng giống một loài bướm nhỏ, có hai cặp cánh màu trắng, cặp cánh trước dài, cặp sau ngắn lại, lúc đậu xếp giống hình dáng của một mái nhà. Khi mới vũ hóa cánh còn yếu, thân chuyển màu vàng tươi, chuyển động chậm chạp và chưa thể bay được. \n\nRầy cánh trắng trưởng thành vẫn tiếp tục chích hút gây hại các loại cây, đặc biệt là cây lúa.\n\nRầy cánh trắng với vòng đời trung bình khoảng 17-24 ngày. \n\nVòng sinh thái của Rầy trắng\nRầy cánh trắng phát triển mạnh ở điều kiện thời tiết khô hạn, nhiệt độ cao, mưa ít và gió ít. Khi gặp mưa to và gió mạnh thì rầy sẽ chết nhưng khi trời nắng hạn trở lại thì tiếp tục phát triển và tăng nhanh chóng mật số.\n\nRầy cánh trắng có rất nhiều loài thiên địch trong như nhện lưới, kiến ba khoang, bọ rùa, bọ xít ăn thịt… Để bảo đảm an toàn nguồn thiên địch, đừng nên phun thuốc trừ sâu sớm ở đầu vụ.', '', '', '', '', 'null', '', 'Erythroneura', 'null'),
('Etiella zinckenella', 'Sâu đục quả', 'insect_Etiella_zinckenella', 'Thành trùng sâu đục trái: Con trưởng thành của loài sâu này có kích thước nhỏ, chiều dài sải cánh 14 - 20mm, chiều dài thân 6 mm, màu nâu. Toàn thân và cánh màu vàng, trên cánh có nhiều chấm đen.Ấu trùng sâu đục trái: Ấu trùng dài khoảng 10 - 22 mm, sâu non có màu hồng hoặc màu hồng tím, đầu nhỏ màu nâu đen, thân mầu trắng ửng hồng, hai đốt ngực (trước và giữa) và hai đốt thân ở cuối đuôi thường có mầu trắng hơi hồng, các đốt còn lại có mầu hồng. Mỗi đốt sống lưng có 4 đốm nâu nhạt, 2 đốm trên to, hai đốm dưới dài và hẹp, trên mỗi đốm  đều có  lông cứng nhỏ, mỗi có một  đốm nhỏ mầu nâu ở bên hông cơ thể, lổ thở mầu đen.Nhộng và trứng: Nhộng mới nở màu lợt, lúc sắp vũ hóa chuyển sang màu nâu sậm, dài 6 - 8mm, thời gian nhộng kéo dài khoảng 8 ngày. Trứng sâu đục trái hình bầu dục, dài khoảng  2-2,5 mm.', '', '', '', '', 'null', '', 'Etiella', 'null'),
('Eudocima salminia', 'Bướm chích hút quả', 'insect_Eudocima_salminia', '* Vòng đời:\n- Trứng: 2-3 ngày\n- Sâu non: 18-22 ngày\n- Nhộng: 16-18 ngày\n- Trưởng thành: có thể sống trên 10 tuần.\nMột con cái đẻ khoảng 30 - 32 trứng, rải rác trên lá cây leo hoang dại.\nThành trùng hoạt động và để trứng vào ban đêm. Chúng gây hại bằng cách châm vòi hút trực tiếp vào trái để hút dịch. \nTác hại của ngài chích hút trái là còn làm cho các vi sinh vật, nấm gây bệnh tấn công.', '', '', '', '', 'null', '', 'Eudocima', 'null'),
('Euproctis similis', 'Sâu róm bướm trắng', 'insect_Euproctis_similis', 'Nó bay vào ban đêm vào tháng 7 và tháng 8  và bị thu hút bởi ánh sáng, đặc biệt là những con đực.\nẤu trùng màu đen, có lông xám đen thưa thớt, sọc dọc lưng chia màu đỏ gạch, sọc bên màu trắng và đầu đen, đoạn 1 có vệt đen pha vàng, các nốt sần ở đoạn 4 và 11 cũng màu đen. Nó thường ăn các loại cây và cây bụi như alder , táo, bạch dương , blackcurrant , blackthorn , cherry , dẻ , táo gai , sồi , rowan và sallow . Nó cũng đã được ghi lại trên cây tu sĩ , là một loại cây thân thảocây. Loài này sống qua mùa đông khi còn là ấu trùng. Ấu trùng phân tán ngay sau khi ra khỏi trứng, được bao phủ bởi len hậu môn của con cái, ngủ đông đơn lẻ và thành nhộng vào đầu tháng sáu. Nhộng màu nâu đen trong kén màu trắng. Nó phổ biến ở khắp mọi nơi trong khu vực phân bố, nhưng số lượng không nhiều như Euproctis chrysorrhoea , và không độc hại. Bướm đêm đến nơi có ánh sáng và khi nghỉ ngơi sẽ gập đôi cánh rất dốc theo hình mái nhà; khi chạm vào nó giả chết, nằm nghiêng và khép cánh lại.', '', '', '', '', 'null', '', 'Sphrageidus', 'null'),
('Euwallacea sp', 'Mọt đục cành', 'insect_Euwallacea_sp', 'Trứng: Màu trắng, kích thước rộng 0,3mm và dài 0, 5mm.Ấu trùng: Sâu non đẫy sức dài khoảng 2mm màu trắng kem, đầu màu nâu nhạt, không có chân.Nhộng: Màu trắng kem, dài gân như con trưởng thành.Trưởng thành: Cơ thể có chiều dài gấp đôi chiều rộng. Con cái màu nâu sẫm đến đen hoàn toàn, dài 1,4-1,9 mm. Con đực nhỏ không có cánh dài 0,8 - 1,1mm.', '', '', '', '', 'null', '', 'Euwallacea', 'null'),
('Eysarcoris ventralis', 'Bọ xít 2 chấm trắng lớn', 'insect_Eysarcoris_ventralis', 'Các loài động vật chủ yếu được tìm thấy trên họ bạc hà (Lamiaceae), chẳng hạn như Ziesten ( Stachys ). Nhộng già và nhộng trưởng thành cũng ăn nhiều cây lương thực khác. Chúng làm điều này chủ yếu trên các hạt chưa trưởng thành. Ngủ đông diễn ra như một ảo ảnh trong các khu vực được bảo vệ trong lòng đất. Giao phối diễn ra vào tháng Năm và tháng Sáu. Các con cái sau đó đẻ thành các ổ không đều từ 10 đến 20 trứng ở mặt dưới của lá cây thức ăn. Con trưởng thành của thế hệ mới xuất hiện từ tháng 8, nhưng nhộng của thế hệ cũ vẫn có thể được tìm thấy với số lượng lớn vào tháng 9. Mỗi năm đào tạo một thế hệ.', '', '', '', '', 'null', '', 'Eysarcoris', 'null'),
('Fall armyworm', 'sâu quân đội', 'insect_army_worm', 'Trứng của sâu bọ có hình vòm,  có đường kính khoảng 0,4 mm ( 1 ⁄ 64 in) và cao 0,3 mm ( 3 ⁄ 256  in). [6] Con cái thích đẻ trứng ở mặt dưới của lá, nhưng ở những quần thể cao, chúng sẽ đẻ ở bất cứ đâu. [33] Trong thời tiết ấm áp, trứng sẽ nở thành ấu trùng trong vòng vài ngày.Ấu trùng trải qua sáu giai đoạn khác nhau , mỗi giai đoạn khác nhau một chút về ngoại hình và kiểu dáng. Quá trình ấu trùng kéo dài từ 14 đến 30 ngày, một lần nữa tùy thuộc vào nhiệt độ. [6] Sâu bướm trưởng thành khoảng 1+Chiều dài 1 ⁄ 2 –2 inch (38–51 mm). [1] Đây là giai đoạn sống phá hoại nhất vì ấu trùng có các bộ phận miệng cắn. Ấu trùng có một vết khâu chữ Y ngược đặc biệt trên trán.Sau đó, ấu trùng sẽ hóa nhộng dưới đất từ ​​7 đến 37 ngày trong một cái kén, chúng tạo thành đất và tơ. Thời gian tồn tại và thời gian tồn tại của giai đoạn nhộng phụ thuộc vào nhiệt độ của môi trường.Sau khi xuất hiện, con trưởng thành sống trong khoảng 10 ngày, và đôi khi lên đến 21 ngày, với con cái đẻ hầu hết trứng trong thời gian đầu đời. [6] Người lớn sống về đêm và thích hợp nhất vào những đêm ấm áp và ẩm ướt', 'Bướm đêm trưởng thành có kích thước từ 32 đến 40 mm ( 1+1 ⁄ 4 đến 1+1 ⁄ 2  in) từ đầu cánh đến đầu cánh, với cánh trước màu nâu hoặc xám, và cánh sau màu trắng. Có một chút lưỡng hình về giới tính , với những con đực có nhiều hoa văn hơn và một đốm trắng riêng biệt trên mỗi cánh trước của chúng. Các ấu trùng đầu tiên instar được ánh sáng màu với một cái đầu đen lớn hơn. Khi chúng phát triển qua các cửa sổ, chúng trở nên nâu hơn với các đường thẳng dài màu trắng. Chúng cũng phát triển các đốm đen với gai.', 'Sâu non gây hại bằng cách tiêu thụ tán lá. Ấu trùng non ban đầu tiêu thụ mô lá từ một phía, để lại lớp biểu bì đối diện còn nguyên vẹn. Đến giai đoạn thứ hai hoặc thứ ba, ấu trùng bắt đầu tạo lỗ trên lá và ăn từ mép lá vào trong. Ăn ngô thường tạo ra một hàng lỗ đặc trưng trên lá. Mật độ ấu trùng thường giảm xuống còn một đến hai con trên mỗi cây khi ấu trùng kiếm ăn gần nhau, do hành vi ăn thịt đồng loại. Sâu non già hơn gây rụng lá trên diện rộng, thường chỉ để lại sườn và thân cây ngô, hoặc có hình dạng xù xì, rách nát. Marenco và cộng sự. (1992) đã nghiên cứu ảnh hưởng của tổn thương sâu vẽ bùa đối với sự phát triển sinh dưỡng sớm của ngô ngọt ở Florida. Họ báo cáo rằng giai đoạn vòng xoắn đầu ít nhạy cảm nhất với chấn thương, giai đoạn vòng tròn trung gian và giai đoạn vòng quay muộn nhạy cảm nhất với chấn thương. Hơn nữa, họ lưu ý rằng mật độ trung bình từ 0,2 đến 0,8 ấu trùng trên mỗi cây trong giai đoạn cuối của ấu trùng có thể làm giảm năng suất từ ​​5 đến 20 phần trăm.', 'Thuốc trừ sâu:Thuốc trừ sâu thường được áp dụng cho ngô ngọt ở các bang miền đông nam để bảo vệ khỏi bị sâu mọt phá hại mùa thu, đôi khi thường xuyên như hàng ngày trong giai đoạn mạ bạc. Ở Florida, sâu vẽ bùa mùa thu là loài gây hại quan trọng nhất đối với ngô. Thường phải bảo vệ cả giai đoạn sinh dưỡng sớm và giai đoạn sinh sản của ngô. Vì ấu trùng ăn sâu trong vỏ của cây ngô non, nên có thể cần một lượng lớn thuốc trừ sâu dạng lỏng để có thể xâm nhập đầy đủ. Thuốc diệt côn trùng có thể được áp dụng trong nước tưới nếu nó được áp dụng từ các vòi phun nước trên cao. Thuốc trừ sâu dạng hạt cũng được áp dụng trên cây non vì các hạt này rơi sâu vào rãnh. Một số khả năng kháng thuốc diệt côn trùng đã được ghi nhận, với mức độ kháng khác nhau theo từng khu vực. Foster (1989) báo cáo rằng việc giữ cho cây không có ấu trùng trong thời kỳ sinh dưỡng làm giảm số lần phun thuốc cần thiết trong thời kỳ trỗ. Người trồng tập trung các lần phun thuốc vào đầu giai đoạn ủ bạc thay vì rải đều các lần phun thuốc sẽ mang lại ít lợi ích.', 'phân bố rộng rãi ở miền đông và trung Bắc Mỹ và Nam Mỹ.', 'null', 'insect_army_worm/16027.jpg', 'Spodoptera', 'null'),
('Flea beetle', 'bọ chét', 'insect_Flea_beetle', 'Bọ chét sống qua mùa đông khi trưởng thành trong thảm lá, hàng rào, hàng rào chắn gió và các khu vực có cây cối rậm rạp.Bọ chét trưởng thành hoạt động mạnh vào đầu mùa xuân. Tùy thuộc vào loài, con cái đẻ trứng đơn lẻ hoặc thành cụm trong các lỗ nhỏ, trong rễ, đất hoặc lá của nhiều loại rau cũng như đôi khi trên hoa và cây bụi trang trí và cây cối.\r\n\r\nẤu trùng nhỏ màu trắng nở ra từ trứng và ăn rễ của cây con mới trồng.\r\n\r\nSau đó ấu trùng biến đổi thành nhộng trong lòng đất. Thường có một đến hai thế hệ mỗi năm.', 'Những con trưởng thành thuộc họ Chrysomelidae có kích thước rất nhỏ đến vừa phải (tức là trong số các loài bọ cánh cứng nói chung chúng có phần hơi nhỏ). Họ cũng giống như bọ cánh cứng lá khác, nhưng đặc trưng có chân sau xương đùi mở rộng đáng kể. Những cái mở rộng này cho phép các loài côn trùng này hoạt động khi bị quấy rầy. Bọ chét cũng có thể đi lại bình thường và bay. Nhiều bọ chét có màu sắc hấp dẫn; màu tối, sáng bóng và thường là kim loại chiếm ưu thế.Bọ chét trưởng thành ăn thực vật bên ngoài, ăn bề mặt của lá, thân và cánh hoa. Khi cho ăn nhiều, các lỗ tròn nhỏ do một con bọ chét ăn vào có thể liên kết lại thành các vùng tổn thương lớn hơn. Một số ấu trùng bọ chét (ví dụ như loài Phyllotreta ) là loài ăn rễ.', 'Hầu hết bọ chét ăn các loại cây rất cụ thể, nhưng bọ chét màu xanh lá cây ( Systena blanda ) ăn nhiều loại cây khác nhau, như bí, đậu, ngô, hoa hướng dương, rau diếp, khoai tây và nhiều loại cỏ dại.', 'Đặt bẫy dính màu vàng trong vườn của bạn để xem bạn có bọ chét hay không.Kiểm tra cây trồng của bạn để tìm bọ chét và thiệt hại của chúng.\r\nNgăn ngừa thiệt hại nghiêm trọng cho cây của bạn bằng cách xử lý cây con khi có hơn năm con bọ chét trên mỗi cây.\r\nBảo vệ cây trồng của bạn nếu 10-30% lá trên cây con và cây cấy bị rụng.', 'Bọ chét hoa cải và bọ chét sọc đều được du nhập từ Âu-Á và là những loài gây hại đáng kể. Theo truyền thống, bọ chét sọc phổ biến hơn ở các khu vực phía bắc của Canada và bọ chét cây thập tự phổ biến hơn ở các khu vực phía nam, cũng như loài phổ biến nhất trên khắp miền tây Canada. Tuy nhiên, phạm vi và quần thể bọ chét sọc đã tăng lên đáng kể trong vài thập kỷ qua, trở thành loài bọ chét thường xuyên gặp nhất ở trung tâm Alberta, trung tâm Saskatchewan và phần lớn Manitoba', 'null', 'insect_Flea_beetle/25964.jpg', 'Flea', 'null'),
('Forficula Auricularia', 'Bộ Cánh da, còn gọi là bộ Sâu tai (earwig)', 'insect_Forficula_Auricularia', 'Forficula auricularia, the common earwig or European earwig, is an omnivorous insect in the family Forficulidae. The European earwig survives in a variety of environments and is a common household insect in North America. The name earwig comes from the appearance of the hindwings, which are unique and distinctive among insects, and resemble a human ear when unfolded; the species name of the common earwig, auricularia, is a specific reference to this feature.', 'null', 'null', 'null', 'null', 'null', '', 'Forficula', 'null'),
('Gastrimargus africanus', 'Châu chấu xe', 'insect_Gastrimargus_africanus', 'Vòng đời của châu chấu khoảng 200-210 ngày trong đó giai đoạn trứng 15-21 ngày. Giai đoạn sâu non: 100 ngày. Giai đoạn trưởng thành: khoảng 3 tháng. Con trưởng thành của châu chấu sống khoảng 3 tháng, trong đó con cái sống lâu hơn con đực. Sau khi hóa trưởng thành được 5-40 ngày thì bắt đầu giao phối, sau 10-41 ngày (trung bình trên dưới 20 ngày) bắt đầu đẻ trứng.\nMỗi con cái có thể đẻ 3 ổ, mỗi ổ có 10-102 quả. Châu chấu thường thích đẻ trứng ở đất ẩm, xốp, có nhiều cỏ dại, nhiều ánh nắng, thích đẻ trên đất cát pha. Trứng hình ống hơi cong ở giữa, một đầu hơi to màu vàng đậm, ổ trứng hình túi, trong đó trứng xếp xiên hai hàng. Trứng đẻ thành ổ từ 10-30 quả trong thân lúa, nếp gấp của lá lúa và trong những bụi cỏ trên mặt nước.', '', '', '', '', 'null', '', 'Gastrimargus', 'null'),
('Graphognathus leucoloma', 'Bọ dừa viền trắng', 'insect_Graphognathus_leucoloma', 'Bọ cánh cứng trưởng thành (univoltine = một thế hệ mỗi năm) xuất hiện từ đất từ ​​tháng 5 đến tháng 10 và ăn các tán lá. Oviposition (sinh sản nội gen) xảy ra từ 5 đến 25 ngày sau khi xuất hiện. Các khối lượng trứng (11 đến 14 trứng) được đẻ trên thân cây, rễ cây, đất và nơi chúng tiếp xúc với đất lên cỏ khô, củi, gỗ và các dụng cụ và máy móc nông nghiệp. Trứng nở từ 11 đến 100 ngày sau khi đẻ (trứng mùa hè trung bình 17 ngày; trứng mùa đông trung bình 100 ngày). Ấu trùng ăn rễ, củ và thân ngầm cũng như vật liệu thực vật chết và hoàn thành quá trình phát triển của chúng trong đất. Bọ cánh cứng trắng mùa đông quá lớn khi còn là ấu trùng.\nNhộng xảy ra từ cuối tháng 4 đến cuối tháng 7 trong các tế bào do ấu trùng tạo ra; tuy nhiên, một số ấu trùng dành một năm thứ hai để ăn thực vật trong đất trước khi chúng thành nhộng. Hầu hết các tế bào nhộng nằm dưới bề mặt đất từ ​​5 đến 15 cm; tuy nhiên, các tế bào đã được tìm thấy ở độ sâu 36 cm. Trong những tháng mùa hè, giai đoạn nhộng kéo dài ca. 13 ngày; trong những tháng lạnh hơn thì dài hơn (Young et al. 1950).', '', '', '', '', 'null', '', 'Naupactus', 'null');
INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('Grasshopper', 'Châu chấu', 'insect_Grasshopper', 'Trứng là giai đoạn đánh dấu sự bắt đầu vòng đời của châu chấu. Châu chấu đẻ trứng thụ tinh vào giữa mùa hè, chúng đặt trứng xuống đất trong một lỗ nhỏ. Sau đó, châu chấu mẹ tiết một chất dính để kết nối trứng lại một cụm với nhau, đảm bảo rằng con của nó sẽ không bị lạc.Mỗi cụm trứng chứa từ 15 – 150 trứng, tùy thuộc vào loài. Thông thường, một con châu chấu cái có thể đẻ tới 25 cụm trứng. Trứng phải trải qua mùa thu và mùa đông trước khi nở vào mùa xuân hoặc trong những ngày đầu hè.- Âú trùng:Đây là giai đoạn thứ hai trong vòng đời của châu chấu, và là giai đoạn đầu tiên trong hình dạng một con châu chấu. Ấu trùng trông giống những con châu chấu trưởng thành, nhưng chúng không có cánh và thiếu các cơ quan sinh sản.1 Ngày sau khi trứng nở, ấu trùng bắt đầu ăn lá cây và hút nhựa để sống. Giai đoạn này kéo dài khoảng 5-6 tuần trước khi những ấu trùng đạt đến hình thái trưởng thành.\r\nẤu trùng phải trải qua 5 giai đoạn nhỏ, đó là 5 lần lột da trước khi phát triển hoàn toàn thành châu chấu trưởng thành. Sau mỗi lần lột da, cơ thể ấu trùng phát triển lớn hơn và ở lần lột da cuối cùng chúng sẽ hoàn thiệt đôi cánh.-giai đoạn lột da:Lột da diễn ra trong giai đoạn ấu trùng. Con châu chấu sẽ làm rụng lớp vỏ ngoài của nó nhiều lần trước khi trở thành người lớn.\r\nLớp vỏ ngoài bao phủ cơ thể của ấu trùng, cung cấp cho nó sự bảo vệ từ những tác động từ bên ngoài nhưng đồng thời cũng ức chế sự tăng trưởng của nó vì lớp vỏ cứng và không có khả năng co giãn. Do đó, chúng phải lột da nhiều lần để phù hợp với sự phát triển của cơ thể. Sau 5 – 6 lần thay đổi lớp vỏ, châu chấu trưởng thành dần xuất hiện với các chức năng hoàn chỉnh.-Trưởng Thành:Một con chấu chấu trưởng thành phải mất đến 1 tháng để hoàn thiện đôi cánh của mình. Châu chấu trưởng thành linh hoạt hơn ấu trùng, nhờ đó chúng dễ dàng lẩn trốn khỏi tầm nhìn của kẻ thù.Ở giai đoạn cuối cùng này, các cơ quan sinh sản được phát triển đầy đủ vì vậy con cái có thể đẻ trứng và con đực có thể thụ tinh. Tuy nhiên, con cái sẽ không giao phối cho đến khi nó được 1 đến 2 tuần tuổi, vì cô ta cho rằng thời điểm mới trưởng thành là chưa đủ trọng lượng để đẻ trứng.Một khi bắt đầu đẻ trứng, con cái vẫn tiếp tục đẻ trứng trong khoảng từ 3 đến 4 ngày cho đến khi nó chết. Những con châu chấu trưởng thành sống khoảng hai tháng, tùy thuộc vào thời tiết.', 'Châu chấu có cơ thể côn trùng điển hình là đầu, ngực và bụng . Đầu được giữ thẳng đứng một góc với thân, với miệng ở phía dưới. Đầu có một cặp mắt kép lớn cho khả năng nhìn toàn diện, ba mắt đơn giản có thể phát hiện ánh sáng và bóng tối, và một cặp râu giống sợi chỉ nhạy cảm với xúc giác và khứu giác. Phần miệng hướng xuống được sửa đổi để nhai và có hai bàn tay cảm giác ở phía trước hai hàm.Ngực và bụng được phân đoạn và có một lớp biểu bì cứng được tạo thành từ các tấm chồng lên nhau bao gồm kitin . Ba đoạn ngực hợp nhất mang ba cặp chân và hai đôi cánh. Các cánh trước, được gọi là tegmina , hẹp và nhiều da trong khi cánh sau lớn và có màng, các tĩnh mạch cung cấp sức mạnh. Các chân được kết thúc bằng móng vuốt để nắm chặt. Chân sau đặc biệt mạnh mẽ; xương đùi là mạnh mẽ và có nhiều rặng núi nơi các bề mặt khác nhau tham gia và các rặng núi bên chịu stridulatorychốt ở một số loài. Mép sau của xương chày có một hàng gai kép và có một đôi cựa khớp ở gần đầu dưới của nó. Phần bên trong lồng ngực chứa các cơ điều khiển cánh và chân.', 'Hầu hết châu chấu là loài đa pha , ăn thực vật từ nhiều nguồn thực vật, [20] nhưng một số loài ăn tạp và cũng ăn mô động vật và phân động vật. Nhìn chung, sở thích của chúng là dành cho các loại cỏ, bao gồm nhiều loại ngũ cốc được trồng làm hoa màu. [21] Hệ tiêu hóa đặc trưng của côn trùng, với các ống Malpighian thải vào ruột giữa. Carbohydrate được tiêu hóa chủ yếu trong cây trồng, trong khi protein được tiêu hóa ở manh tràng của ruột giữa. Nước bọt dồi dào nhưng phần lớn không chứa enzym, giúp di chuyển thức ăn và dịch tiết Malpighian dọc theo đường ruột. Một số loài châu chấu có cellulase , bằng cách làm mềm thành tế bào thực vật làm cho các chất trong tế bào thực vật có thể tiếp cận được với các enzym tiêu hóa khác.', 'Xác định khu vực châu chấu co cụm, đẻ trứng vào khoảng cuối mùa thu để tổ chức diệt trừ. Khi những ổ nhỏ châu chấu mới nở, còn co cụm thì dùng vợt bắt thủ công đem tiêu hủy. Những ổ lớn và khi châu chấu bắt đầu phát tán gây hại lúa, ngô thì cần áp dụng biện pháp phun thuốc hóa học để tiêu diệt. Sử dụng một trong các loại thuốc phòng trừ châu chấu tre như: Lufen extra 1005EC, Neretox 95WP, Victory 585EC...', 'Phân bộ Caelifera chủ yếu phân bổ ở khu vực nhiệt đới nhưng phần lớn các siêu họ thì phân bổ rộng khắp thế giới.', 'null', 'insect_Grasshopper/33344.jpg', 'Nomadacris', 'null'),
('Green moth wax cicada', 'Ve sầu sáp bướm đêm xanh', 'insect_Green_moth_wax_cicada', 'Con trưởng thành xuất hiện vào mùa xuân và mùa hè và sống ở các vùng núi có độ cao thấp hoặc giữa các cây trên mặt đất bằng phẳng. Nhộng hoặc con trưởng thành đôi khi gây hại cho một số cây nông nghiệp.', 'Thân trưởng thành dài 5-6mm, cánh trước màu xanh vàng, mép trước, mép sau và mép ngoài màu nâu sẫm, mép sau là một mảng sẫm màu ở 1/3 góc hông, khi nghỉ, trái và các cánh phải đứng gần nhau. Ve sầu sáp bướm xanh là con trưởng thành, thân dẹp. Trứng có màu xanh nhạt, hình quả chuối ngắn, dài khoảng 1,3mm. Nhộng màu xanh lục, có 4 sọc dọc màu nâu vàng ở ngực và lưng, 2 chùm lông trắng bằng giấy sáp ở cuối bụng, và các bông sáp trắng ở hai bên và sau bụng. Ở trung và hạ lưu sông Dương Tử, mỗi năm có một thế hệ, và thời kỳ xuất hiện của mỗi trạng thái côn trùng muộn hơn khoảng 10 ngày so với ve sầu sáp hại trà. Nhộng và sâu non gây hại bằng cách hút nhựa của thân và lá non', 'Con trưởng thành xuất hiện vào mùa xuân và mùa hè và sống ở các vùng núi có độ cao thấp hoặc giữa các cây trên mặt đất bằng phẳng. Nhộng hoặc con trưởng thành đôi khi gây hại cho một số cây nông nghiệp.', 'G. mellonella gây thiệt hại kinh tế lớn trong ngành nuôi ong mật; Miền Nam Hoa Kỳ mất 4-5% lợi nhuận mỗi năm do loại dịch hại này. [3] Để ngăn ngừa hoặc quản lý sự xâm nhập, người trồng trọt được khuyến khích duy trì các điều kiện vệ sinh cho đàn ong của họ, vì nó sẽ giữ cho đàn ong mạnh mẽ để họ có thể ngăn chặn G. mellonella . Các vết nứt và kẽ hở cũng nên được bịt kín để G. mellonella trưởng thành không thể đẻ trứng ở đó. Nên thay lược thường xuyên và loại bỏ lược bị nhiễm khuẩn càng sớm càng tốt.Xử lý nhiệt độ cũng tiêu diệt G. mellonella ở tất cả các giai đoạn trong vòng đời của nó. Xử lý nhiệt giữ lược và thiết bị nuôi ong ở 45-80 ° C trong 1–4 giờ, hoặc trong nước nóng trong 3-5 giờ. [10] Tuy nhiên, đun nóng ở nhiệt độ này có thể khiến sáp bị chảy xệ và biến dạng. Xử lý lạnh làm nguội lược xuống -15 đến -7 ° C trong 2-4,5 giờ', 'G. mellonella lần đầu tiên được báo cáo là loài gây hại ở châu Á , nhưng sau đó lan sang miền bắc châu Phi , Anh , một số vùng ở châu Âu , bắc Mỹ và New Zealand . [3] Loài này hiện phân bố trên toàn cầu. [1] Nó đã được báo cáo ở 27 quốc gia châu Phi, chín quốc gia châu Á, năm quốc gia Bắc Mỹ, ba quốc gia Mỹ Latinh, Úc , mười quốc gia châu Âu và năm quốc đảo. Dự báo dịch hại có thể lây lan xa hơn, đặc biệt là do biến đổi khí hậu .', 'null', 'insect_Green_moth_wax_cicada/67374.jpg', 'Moths', 'null'),
('Green stink bug', 'bọ xanh', 'insect_Green_stink_bug', 'Con trưởng thành xuất hiện trên đồng ruộng vào đầu tháng 9 và trở nên dồi dào ở những vị trí có mái che. Sau đó, giao phối xảy ra vào đầu tháng 10 và cuối cùng, trứng có thể được tìm thấy từ giữa đến cuối tháng 10. Nhộng xuất hiện vào cuối tháng Mười và đầu tháng Mười Một. Hai hoặc ba thế hệ xảy ra trong những tháng mùa hè trên thực địa và trong phòng thí nghiệm ở 26 ° C.', 'Màu của bọ xít xanh thường có màu xanh lục sáng, với các cạnh hẹp màu vàng, cam hoặc hơi đỏ. Nó là một loài bọ lớn, hình khiên, có hình bầu dục, thon dài và chiều dài từ 13 đến 18 mm. Nó có thể được phân biệt với loài Nezara viridula bằng ba đoạn ăng ten ngoài cùng màu đen của nó . Trước ngoài của nó (= ở phía trước và xa giữa) pronotal lề là tương đối thẳng và không arced mạnh mẽ như trong Chinavia pensylvanica', 'Nó được tìm thấy trong vườn cây ăn quả, vườn, rừng và cánh đồng trồng trọt trên khắp Bắc Mỹ, [1] kiếm ăn bằng miệng như kim của chúng trên nước ép của nhiều loại thực vật từ tháng 5 cho đến khi băng giá xuất hiện. Con trưởng thành thích phát triển hạt giống và do đó trở thành sâu bệnh hại cây trồng (cà chua, đậu, đậu, bông, ngô, đậu tương, cà tím). Khi không có hạt, chúng cũng ăn thân và tán lá, do đó gây hại cho một số cây ăn quả, chẳng hạn như cây táo, anh đào, cam và đào. Hơn nữa, nó có thể được tìm thấy ở Queensland và New South Wales, Úc. Bọ xít xanh sinh sản tốt trên cây hoa salvia lửa cũng như cà chua và dâu tằm . Ngoài ra nó đã được tìm thấy trên đào , mơ, nho , củ cải bạc và đậu Pháp . Sự khác biệt ở đây là chúng dường như không phải là loài gây hại cho chúng', 'Phát hiện sớm, diệt các ổ bọ xít xanh mới nở, vợt bắt con trưởng thành.Nên trồng sớm họăc đồng lọat, luân canh với các cây khác không cùng ký chủ. Sử dụng thuốc hóa học nên lưu ý dến sự lưu bả độc trên trái đậu rau.\r\n\r\n- Sử dụng các loại thuốc hóa học lưu dẫn, có vị độc, tiếp xúc như Ofatox 400EC, Fastac 5EC, Padan 95 SP; Cyperan 5EC/10EC hoặc 25EC; Bassan 50EC; Sumicidin 10 hoặc 20EC, BIAN 40EC để phòng trị....', 'Nó xuất hiện rộng rãi ở Châu Âu, Bắc Phi, Trung Đông và Châu Á.', 'null', 'insect_Green_stink_bug/23089.jpg', 'Chinavia', 'null'),
('Ground Beetles', 'bọ cánh cứng mặt đất', 'insect_Ground_Beetles', 'Bọ cánh cứng xanh Delta sinh sản từ tháng 1 đến tháng 9, với con cái sinh ra một thế hệ mỗi năm.', 'Bọ cánh cứng có thể dài từ 2 đến 25 mm, chúng có xu hướng dài và hình bầu dục. Hầu hết các loài đều có màu sẫm, nhưng một số loài có thể có vỏ óng ánh với nhiều màu kim loại như xanh lam, đồng, xanh lá cây, cam, đỏ, vàng hoặc sự kết hợp của các màu đó.', 'Môi trường sống phổ biến là dưới vỏ cây, dưới khúc gỗ, hoặc giữa các tảng đá hoặc cát ven ao và sông. Hầu hết các loài đều ăn thịt và tích cực săn lùng bất kỳ con mồi không xương sống nào mà chúng có thể chế ngự được. [2] Một số chạy nhanh để bắt con mồi; bọ hổ (Cicindelinae) có thể duy trì tốc độ 9 km / h (5,6 mph) [9] - so với chiều dài cơ thể, chúng là một trong những động vật trên cạn nhanh nhất trên Trái đất. Không giống như hầu hết các loài thuộc họ Carabidae, là loài sống về đêm , bọ hổ là loài săn mồi tích cực vào ban ngày và thường có màu sắc rực rỡ; chúng có đôi mắt to và săn mồi bằng thị giác. Bọ cánh cứng thuộc loài Promecognathus laevissimuslà những kẻ săn mồi đặc biệt của loài Harpaphe haydeniana cyanide , đối kháng với hydrogen cyanide khiến những con milipedes này trở nên độc đối với hầu hết các loài ăn thịt.', 'Nếu bạn tin rằng bạn có thể bị bọ đất xâm nhập bên trong hoặc sự kiện bên ngoài nhà của bạn, hãy liên hệ với chuyên gia kiểm soát dịch hại dân cư chuyên nghiệp, như các kỹ thuật viên tại ASAP Pest Control. Một kỹ thuật viên và kỹ thuật viên diệt trừ chuyên nghiệp sẽ có thể xác định mức độ xấu của sự lây nhiễm, quyết định sử dụng phương pháp phòng ngừa nào và đảm bảo rằng các biện pháp cần thiết được thực hiện để ngăn chặn khả năng tái nhiễm. Để biết thêm thông tin về cách phát hiện và giảm thiểu sự xâm nhập của bọ đất trong nhà của bạn, hãy liên hệ với nhóm ASAP Pest Control ngay hôm nay.', 'Bọ cánh cứng là một trong những nhóm bọ lớn nhất, phổ biến nhất ở Bắc Mỹ. Hàng ngàn loài, bao gồm cả bọ cánh cứng bản địa và không động đất, được tìm thấy trên khắp Hoa Kỳ.', 'null', 'insect_Ground_Beetles/21182.jpg', 'Ground', 'null'),
('Gryllotalpa', 'Dế nhủi', 'insect_Gryllotalpa', 'Mỗi năm có một đợt, khoảng cuối Đông - đầu Xuân, dế bắt đầu sinh sản dưới những lớp đất mềm sâu từ 25-30cm. Sau 3 tuần trứng bắt đầu nở.', '', '', '', '', 'null', '', 'Gryllotalpa', 'null'),
('Haplothrips aculeatus', 'Bọ trĩ', 'insect_Haplothrips_aculeatus', 'Con trưởng thành nhỏ, dài 1–2 mm có màu đen, râu đầu dài, chiếm 1/3 thân, 2 đuôi cánh hẹp, cánh trước ở phần giữa thắt lại. Trưởng thành đẻ trứng rải rác trong mô lá. Trứng nhỏ mới đẻ màu trắng sữa, gần nở có màu vàng nhạt. Bọ trĩ non rất giống thành trùng nhưng không cánh màu  vàng nhạt.\r\nChúng có thể sống đến 3 tuần Bọ trĩ hoạt động cả ban ngày và ban đêm, ban ngày chúng hoạt động tương đối nhanh nhẹn khi bị khua động chúng lẩn tránh sang lá khác hoặc giả chết rơi xuống đất. Chúng ẩn lấp trong lá nõn hoặc các chót lá quăn do không ưa ánh sáng trực xạ. Khi trời râm mát chúng bò ra ngoài.', 'Cơ thể của nó màu đen, dài 2 mm, con đực nhỏ hơn con cái. Trứng có hình trứng và trong mờ, ấu trùng có màu đỏ cam, dài 1,8 mm. Nhộng có màu giống với ấu trùng và dài 1,7 mm.', 'Nó hình thành một thế hệ mỗi năm và qua mùa đông khi trưởng thành trong tàn dư thực vật của những cây bị tấn công. Con trưởng thành và sâu non cư trú ở lớp phủ của chiếc lá cuối cùng, chúng đẻ trứng và kiếm ăn bằng các cơ quan tai, bằng hoa và hạt non. Sự phát triển của một thế hệ từ khi đẻ trứng mất 50-56 ngày.', 'Cày sâu 20-25 cm đảm bảo biến mất 90% ấu trùng bám vào tàn dư thực vật trong đất.Xử lý hóa chất với các sản phẩm được chứng nhận khác nhau như Actara (0,02%), Biscaya 240 OD (0,16 l / ha), Faster 10 CE (0,15 l / ha), Fury 10 CE (0,1 l / ha), Kaiso Sorbie 5 WG (0,15 kg / ha) v.v.', 'Ở châu Âu, loài này được biết đến từ các khu vực thảo nguyên cho đến vùng núi. Nó thường được tìm thấy trên ngũ cốc, nhưng rõ ràng nó thích lúa mạch đen hơn.', 'null', 'insect_Haplothrips_aculeatus/25096.jpg', 'Stenchaetothrips', 'null'),
('Hedylepta indicata', 'Sâu cuốn lá', 'insect_Hedylepta_indicata', '- Trưởng thành thân dài 7,5 – 9,5mm, cánh dang rộng 20mm cánh trước màu vàng, phần giữa cánh và gần mép ngoài có 2 vệt ngang màu nâu đen. Trứng hơi vàng hoặc xanh, giao kết với nhau thành một chuỗi dẹt. Sâu non mình dài 20mm. Nhộng dài 6 – 8mm, lúc đầu màu xanh, dần chuyển màu nâu, màu vàng nhạt hoặc màu xanh.', '', '', '', '', 'null', '', 'Hedylepta', 'null'),
('Helicoverpa armigera', 'Sâu xanh', 'insect_Helicoverpa_armigera', 'Khi trưởng thành sâu non dài 2-3 cm, màu xanh với sọc trắng nhạt ở hại bên cạnh. Sau khi giai đoạn sâu non kết thúc giai đoạn nhộng xảy ra trên hoặc ngay dưới mặt đất, hoặc dưới tàn dư cây. Đôi khi nhộng dính vào cây bằng một vài sợi tơ mùa hè giai đoạn nhộng kéo dài khoảng 10 ngày, bướm màu ghi nâu xuất hiện và sau khoảng 7 ngày đẻ trứng trên hai mặt lá đậu, trứng nở sau 5 ngày. Sâu sống qua đông dưới dạng nhộng hoặc sâu trưởng thành. Tuỳ thuộc vào khí hậu, màu vụ có thể có 4 thế hệ trong một năm.', '', '', '', '', 'null', '', 'Helicoverpa', 'null'),
('Heliothis virescens', 'mọt cỏ linh lăng', 'insect_Heliothis_virescens', 'Bướm đêm xuất hiện từ tháng 3 đến tháng 5 ở các bang miền nam, tiếp theo là 4 đến 5 thế hệ trong suốt mùa hè, với mùa đông bắt đầu từ tháng 9 đến tháng 11. Bốn thế hệ đã được báo cáo từ phía bắc Florida và Bắc Carolina, và ít nhất năm thế hệ từ Louisiana. Bướm đêm đã được thu thập ở New York từ tháng 7 đến tháng 9, nhưng ở các vĩ độ phía bắc như vậy nó không được coi là dịch hại. Loài này sống qua mùa đông trong giai đoạn nhộng.Trứng : Trứng được gửi vào hoa, quả và sự phát triển cuối cùng. Trứng hình cầu, đáy dẹt. Chúng có kích thước chiều rộng từ 0,51 đến 0,60 mm và chiều cao 0,50 đến 0,61 mm. Trứng ban đầu có màu từ trắng đến trắng hơi vàng, nhưng sau đó sẽ chuyển sang màu xám khi chúng già đi. Các gờ hẹp tỏa ra từ đỉnh của quả trứng, và số lượng từ 18 đến 25. Ấu trùng : Ấu trùng sâu búp thuốc lá có từ 5 đến 7 trường hợp, trong đó 5 hoặc 6 trường hợp phổ biến nhất.Con trưởng thành : Bướm đêm có màu nâu, pha chút xanh lá cây. Các cánh trước được cắt ngang bởi ba dải sẫm màu, mỗi dải thường đi kèm với một đường viền màu trắng hoặc màu kem. Con cái có xu hướng có màu sẫm hơn. Các cánh sau màu trắng, với rìa xa có dải sẫm màu. Bướm đêm có chiều dài sải cánh từ 28 đến 35 mm. Thời kỳ trước khi đẻ của con cái dài khoảng hai ngày. Tuổi thọ của bướm đêm được báo cáo là từ 25 ngày khi được giữ ở 20 ° C, đến 15 ngày ở 30 ° C. Một pheromone giới tính đã được xác định (Tumlinson et al. 1975).', 'C. virescens trưởng thành có màu nâu pha chút xanh lục nhạt. Các cánh trước có ba dải sẫm màu, mỗi dải được kết hợp với một đường viền màu trắng hoặc kem. Cánh sau có màu trắng với một dải tối ở rìa xa. Những con trưởng thành hoàn toàn có sải cánh dài từ 28 đến 35 mm (1,1 đến 1,4 inch). Con cái thường có màu sẫm hơn con đực.', 'Sâu non đục thành chồi và hoa (cơ sở cho tên gọi chung của loài côn trùng này), và đôi khi là sự phát triển của lá ở đầu cuối mềm, cuống lá và cuống. Trong trường hợp không có mô sinh sản, ấu trùng dễ dàng ăn các mô lá. Neunzig (1969), đã lây nhiễm thuốc lá với cả sâu tơ thuốc lá và sâu tai ngô, và quan sát thấy các mô hình và mức độ tổn thương rất giống nhau của các loài có quan hệ họ hàng gần này. Sự xâm nhập của ấu trùng vào quả làm tăng tần suất bệnh hại cây trồng. Nghiên cứu ở các cánh đồng cà chua phía nam Arkansas chỉ ra rằng mặc dù sâu đục búp thuốc lá xuất hiện từ tháng 5 đến tháng 7, nhưng chúng gần như không nhiều hoặc gây hại như sâu tai ngô (Roltsch và Mayse 1984).', 'Thuốc diệt côn trùng . Thuốc trừ sâu qua lá thường được sử dụng cho các loại cây trồng có khả năng xảy ra sâu bệnh hại búp thuốc lá. Tuy nhiên, việc tiêu diệt các sinh vật có ích thường dẫn đến kết quả và điều này được cho là làm trầm trọng thêm thiệt hại của sâu chồi. Ngoài ra, khả năng kháng thuốc trừ sâu cũng phổ biến, đặc biệt là ở các loại cây trồng thường xuyên sử dụng pyrethroid.Kỹ thuật văn hóa . Tiêu diệt cỏ dại vào đầu mùa bằng thuốc diệt cỏ hoặc cắt cỏ, hoặc tiêu diệt ấu trùng trên cỏ bằng cách xử lý bằng thuốc trừ sâu, có thể làm giảm kích thước quần thể sâu chồi thuốc lá vào cuối năm.\r\n\r\nKiểm soát sinh học . Thuốc trừ sâu vi sinh Bacillus thuringiensis có tác dụng trừ sâu chồi. Virus Heliothis có nhiều hạt nhân đã được sử dụng hiệu quả để ngăn chặn sâu chồi thuốc lá trên đồng ruộng và ký chủ cỏ dại đầu mùa. Giun búp thuốc lá cũng nhạy cảm với vi rút đa hạt nhân từ cỏ linh lăng looper, Autographa californica (Speyer). Sự phóng thích của ký sinh trùng trứng Trichogramma đã được chứng minh là có lợi trên một số cây rau (Martin và cộng sự. 1976).\r\n\r\nCây ký chủ kháng thuốc . Mặc dù có rất ít bằng chứng về khả năng kháng sâu chồi thuốc lá tự nhiên trong nhiều loại cây trồng, bông đang được biến đổi gen để biểu hiện tính kháng. Cải thiện khả năng chống lại sự tồn tại của ấu trùng bằng bông sẽ làm giảm áp lực côn trùng trên các cây rau gần đó.', 'được tìm thấy ở khắp miền đông và tây nam Hoa Kỳ, mặc dù nó cũng được biết đến từ California. Nó thường chỉ vượt qua mùa đông thành công ở các bang phía nam. Tuy nhiên, nó đôi khi sống sót trong khí hậu lạnh trong nhà kính và các địa điểm có mái che khác. Sâu đục búp thuốc lá phân tán hàng năm về phía bắc và có thể được tìm thấy ở New England, New York và nam Canada vào cuối mùa hè. Nó cũng xuất hiện rộng rãi ở Caribê, và rải rác ở Trung và Nam Mỹ.', 'null', 'insect_Heliothis_virescens/30796.jpg', 'Chloridea', 'null'),
('Hellula sp', 'Sâu đục nõn cãi', 'insect_Hellula_sp', 'Sâu non có những sọc màu chạy dọc lưng, đẫy sức dài 14 mm,Sâu đục vào thân hoặc gân lá ngoài bao bởi có lớp tơ mỏng,Sâu hóa nhộng ngay trong thân hoặc lớp đất mặt, trong kén,Vòng đời sâu 20 -25 ngày', '', '', '', '', 'null', '', 'Hellula', 'null'),
('Hellula undalis', 'Sâu ăn đọt cải 1', 'insect_Hellula_undalis', 'Bướm nhỏ, màu nâu xám đậm, trên cánh có nhiều sọc ngang gãy khúc màu xám nhạt. Rải rác trên cánh có những đốm hình dạng không đồng nhất màu đậm, cuối bìa cánh có một hàng điểm đen. Đời sống của bướm ngắn, độ 1 tuần và đẻ 100-200 trứng rải rác trên các lá non của đọt cải. Trứng hình bầu dục, màu trắng ngà, nở trong vòng 4-5 ngày. Ấu trùng màu hồng, đầu đen và có những sọc đen chạy dọc thân mình, thời gian phát triển lâu độ 10 ngày. Nhộng màu đỏ nâu, phát triển 6-8 ngày.Ấu trùng nở ra tìm ăn ở đọt non của cây cải. Chúng nhả tơ bao phủ đọt cải và ở ăn bên trong làm cho đọt non bị chết nên gây thiệt hại đáng kể cho cải bắp, cải ngọt, bẹ xanh và cải bông.', '', '', '', '', 'null', '', 'Hellula', 'null'),
('Helopeltis sp', 'Bọ xít muỗi', 'insect_Helopeltis_sp', 'Bọ xít muỗi ưa sống ở những nơi ẩm thấp, chè sinh trưởng xanh tốt. Trên nương chè bọ xít muỗi tập trung hại nhiều ở những chỗ râm mát, rậm rạp.\n\nMùa hè bọ xít muỗi hoạt động gây hại vào buổi sáng sớm, chiều tối hoặc sau cơn mưa trời hửng nắng.\n\nMùa đông bọ xít muỗi thường hoạt động gây hại mạnh vào buổi trưa và buổi chiều.\nBọ xít non thường sống theo nhóm 2 - 3 con trên một búp hoặc trên lá non gần búp. Thời gian cho giai đo ạn bọ xít non khoảng 9- 19 ngày, bọ xít trưởng thành sống 8 -13 ngày, sau khi hoá trưởng 2 - 6 ngày bọ xít muỗi bắt đầu giao phối, sau giao phối 1 - 3 ngày đẻ trứng.\nTrứng được đẻ từng quả hoặc đẻ thành cụm 2 - 3 quả vào phần non trên cọng búp hay gân chính của lá non.\nMột bọ xít muỗi cái có thể đẻ từ 12 - 74 trứng, Thời gian trứng từ đẻ đến nở khoảng 5 - 10 ngày. Bọ xít non qua 4 lần lột xác thành bọ xít muỗi trưởng.\nVòng đời của bọ xít muỗi khoảng từ 27 đến 45 ngày tuỳ thuộc nhiệt độ môi trường.', '', '', '', '', 'null', '', 'Helopeltis', 'null'),
('Heteronychus sp', 'Bọ hung đen đục gốc', 'insect_Heteronychus_sp', 'Vòng đời là 1 năm, sâu tuổi 1 là 10-20 ngày, tuổi 2 là 42-50 ngày, tuổi 3 120-150 ngày. ', '', '', '', '', 'null', '', 'Heteronychus', 'null'),
('Hofmannophila pseudospretella', 'bướm đêm nhà màu nâu', 'insect_Hofmannophila_pseudospretella', 'Thông thường, có tới 260 noãn được đẻ bởi một con cái trong một vòng đời, đơn lẻ hoặc thành từng đợt. [2] Những con cái lớn đã được báo cáo đẻ 400 - 500 trứng. [10] Trong điều kiện thuận lợi, trứng nở 10 - 20 ngày sau khi được đẻ. [11]. Ấu trùng hoạt động tích cực từ tháng 6 đến tháng 4, trong thời gian này chúng quay các ống mềm bằng thức ăn mà chúng ăn, để lại cặn bẩn và tơ. Chúng yêu cầu độ ẩm tương đối cao để phát triển thành công đến khi trưởng thành, và thời gian ở giai đoạn nhộng của chúng được rút ngắn do nhiệt độ môi trường cao hơn. [11] Mặc dù chúng có thể xâm nhập trong điều kiện không thuận lợi, chúng bị chết do sương giá nghiêm trọng. [12] Trước khi hóa nhộng, ấu trùng rời khỏi nơi kiếm ăn sơ sinh của chúng và có thể di chuyển trong 2 - 3 ngày trước khi tìm một nơi thích hợp mới để làm nhộng. [11].', 'Trứng có hình elip với các rãnh dọc song song nối với nhau bằng các đường ngang mảnh. Màu sắc từ trắng sáng đến vàng. Sâu non có đầu màu nâu, thân màu trắng đục mờ và chân màu nâu vàng nhạt. Do phần thân trong suốt nên nó có thể thay đổi màu sắc tùy thuộc vào thành phần ruột, lần lượt phụ thuộc vào màu sắc của các loại vải được ăn vào. Nhộng có màu nâu vàng và bao gồm các bộ nhộng có móc câu chắc chắn trên các đoạn cuối của cơ thể bụng. Các cá thể trưởng thành có lông màu vàng nhạt xen kẽ với các mảng màu nâu đen. Mỗi cánh có một đốm hình đĩa nổi bật và các đốm tế bào nhỏ hơn màu nâu đen. Cánh sau có màu xám nâu, trong khi đầu, ngực và bụng màu nâu xám đen. Ăng-ten rất đơn giản và dạng sợi. [2] Sải cánh từ 15 - 26 mm.', 'Con trưởng thành thường hoạt động từ tháng 5 đến tháng 9, mặc dù chúng có thể được tìm thấy vào mọi thời điểm trong năm trong các tòa nhà có hệ thống sưởi. Chúng đặc biệt bị thu hút bởi ánh sáng và có thể bay quanh năm. Ve Cheyletus eruditus dường như là một kẻ săn mồi đáng kể của loài bướm đêm này.', 'null', 'Các nước châu Âu và châu Á', 'null', 'insect_Hofmannophila_pseudospretella/68071.jpg', 'Hofmannophila', 'null'),
('Homoeocerus unipunctatus', 'Bọ xít bụng to', 'insect_Homoeocerus_unipunctatus', 'Trứng đẻ thành ổ, từ 1-2 hàng dọc trên cả hai mặt lá lúa (từ 10-15 quả). Đa số đẻ ở mặt trên và ngoài mép lá, có khi đẻ trên bẹ lá. Trứng nở vào buổi sáng. Trứng hình bầu dục, có vết lõm ở giữa, mới đẻ có màu trắng đục, sau chuyển dần màu nâu. Bọ xít non có hình dáng giống trưởng thành, có màu vàng lục. Vòng đời của bọ xít dài khoảng 31,5-37 ngày, trong đó:\n\nGiai đoạn trứng: 6-7 ngày.\nGiai đoạn sâu non: 17-22 ngày.\nGiai đoạn trưởng thành: 7-8 ngày.\nBọ xít non mới nở sống tập trung quanh ổ trứng, nhưng chỉ sau 2-3 giờ là phân tán lên bông lúa để chích hút nhựa cây và sau 2-5 ngày lột các lần thứ nhất. Con trưởng thành đẻ hoạt động giao phối vào ban ngày, nhất là lúc sáng sớm và chiều mát, buổi trưa nằm im. Một con cái đẻ trung bình từ 250-300 trứng, bọ xít trên lúa đẻ khoẻ hơn trên cỏ. Bọ xít dài trưởng thành khi hút dịch ở bông lúa non nếu bị khua động thì rơi ngày xuống và lẩn trốn ngay lập tức.', '', '', '', '', 'null', '', 'Homoeocerus', 'null'),
('Hydrellia sp', 'Ruồi đen đục lá nõn lúa', 'insect_Hydrellia_sp', 'Vòng đời:\n\n- Trứng: 2-4 ngày\n\n- Ấu trùng: 10 -13 ngày\n\n- Nhộng: 5-7 ngày\n\n- Trưởng thành: 1-3 ngày\n\nCon ruồi cái đẻ trứng trên mặt lá, một con cái có thể đẻ 250 trứng. Trứng nở sau khoảng 3 - 4 ngày tùy thuộc vào nhiệt độ.\n\nDòi đục lá đục ăn mô lá làm giảm diện tích quang hợp, do vậy chúng làm cây vàng, cằn cỗi, lá rụng sớm, chúng gây hại nặng giai đoạn cây con. Khi lá bị hại nặng, nhất là những lá gần quả mới hình thành có thể làm ảnh hưởng đến năng suất. Đối với một số cây rau ăn lá, vết đục của dòi đục lá làm giảm thương phẩm.\n\nNgoài ra, vết thương trên lá do dòi đục lá gây ra tạo điều kiện cho các vi sinh vật gây hại cây khác xâm nhập. Dòi đục lá có thể xuất hiện nhiều lứa gây hại trong năm nhưng thường gây hại nặng vào mùa nắng.', '', '', '', '', 'null', '', 'Hydrellia', 'null'),
('Hypera postica', 'mọt cỏ linh lăng', 'insect_Hypera_postica', 'Trứng được đẻ thành từng đợt lên đến 25 quả bên trong thân cỏ linh lăng. Ấu trùng kiếm ăn trong ba hoặc bốn tuần, lột xác ba lần, trước khi hóa nhộng trong kén mà chúng tạo ra. Chúng xuất hiện khi trưởng thành trong khoảng một hoặc hai tuần. Sau khi thức ăn cho một hoặc hai tuần, họ có thể gặp aestivation trong phần còn lại của mùa hè, trong đó họ chứng minh một giảm chấn của trao đổi chất của họ, hoạt động hệ thống hô hấp và thần kinh. Vào mùa thu, những con trưởng thành ẩn náu trong các tán cây cỏ linh lăng hoặc di chuyển lên thảm thực vật thô trong mương hoặc hàng rào hoặc trong rừng cây gần đó.Cả ấu trùng và con trưởng thành đều ăn ngày và ăn lá cỏ linh lăng, loại ấu trùng gây hại nhiều nhất. Con trưởng thành ăn mép lá, tạo cho chúng có lông tơ. Lúc đầu, ấu trùng ăn các lá cuối để lại các vết thủng, nhưng sau đó chúng di chuyển xuống cây để ăn các lá thấp hơn. Những chiếc lá bị tấn công bị đóng xương do ấu trùng ăn giữa các gân lá và năng suất cây trồng có thể giảm tới 15%. Đôi khi ấu trùng bị giết bởi nấm gây bệnh Zoophthora phytonomi , đặc biệt là trong thời tiết ấm và ẩm ướt. Chúng cũng có thể bị ong bắp cày ichneumon , Bathylplectes anurus và B. curculionis ký sinh. Con cái của những con ong bắp cày này chỉ dài khoảng 0,125 in (0,32 cm), và đẻ một quả trứng bên trong giai đoạn đầu của ấu trùng của mọt. Ấu trùng ong bắp cày đang phát triển là một loại ký sinh trùng , sống bên trong ấu trùng mọt và ngấu nghiến nó, cuối cùng sẽ hóa nhộng ngay sau vật chủ của nó . Kén màu nâu của ong bắp cày có một dải rộng màu trắng trong trường hợp của B. curculionis , và một dải hẹp hơn, nhô ra trong trường hợp của B. anurus . Khi nó bị xáo trộn, kén của loài sau này có thể \"nhảy\" vài cm để tránh bị săn mồi .  Cả hai loài ong bắp cày này đều đã được nghiên cứu về khả năng kiểm soát sinh học đối với mọt và B. anurusthường được coi là ưu việt hơn B. curculionis vì tốc độ sinh sản cao hơn.', 'Mọt cỏ linh lăng phát triển với chiều dài khoảng 4 đến 5,5 mm (0,16 đến 0,22 in). Râu hoặc mỏ ngắn và rộng. Các vây có chiều rộng bằng một nửa của trống trong khi pronotum rộng nhất ở trung tâm. Màu sắc chung của côn trùng là màu nâu, với một sọc đen ở giữa lưng. Ấu trùng có đầu màu đen đặc biệt và không có chân; nó có màu xanh lục vàng, với một sọc trắng ở lưng và các sọc bên màu trắng mờ nhạt. Nó dài khoảng 1 cm (0,4 in) ngay trước khi hóa nhộng. Nó nhộng trong một cái kén màu trắng, kích thước bằng hạt đậu làm bằng lụa dệt lỏng lẻo. [2] Nó giống mọt lá cỏ ba lá ( Hyperaunctata ), nhưng loài này lớn gần gấp đôi, ấu trùng có đầu màu rám nắng và chúng hiếm khi gây hại nhiều cho cây cỏ linh lăng.', 'Vào đầu mùa xuân, ấu trùng đuông cỏ linh lăng nở ra từ trứng gửi trong thân cây và bắt đầu kiếm ăn trong các lá gấp khúc ở ngọn đang phát triển. Khi những chiếc lá này mở ra, sự phá hoại giai đoạn đầu của ấu trùng xuất hiện dưới dạng những \"lỗ kim\" nhỏ trên lá.Khi ấu trùng lớn lên, chúng sẽ đục những lỗ lớn hơn, khiến cây cối trông như bị cắt nhỏ hoặc trơ xương. Một sự phá hoại nặng của ấu trùng có thể tiêu thụ đủ số tán lá khiến toàn bộ cánh đồng có thể có màu xám.\r\n\r\nSự phá hoại của mọt trưởng thành thường nhẹ, dưới dạng những vết cắt nhỏ, hình tròn dọc theo mép lá. Con trưởng thành thường ăn các lá thấp hơn. Người lớn ăn thân cây ngay sau lần cắt đầu tiên có thể gây ra thiệt hại được gọi là \"ăn vỏ cây\".', 'Thuốc diệt côn trùng để quản lý mọt cỏ linh lăng có thể được đăng ký để sử dụng cho người lớn, ấu trùng hoặc cả hai. Các loại thuốc trừ sâu nhắm vào giai đoạn ấu trùng bao gồm organophosphates, carbamat và pyrethroids ( Wright et al. 2015 ). Để điều trị cho người lớn, organophosphates và pyrethroid là phổ biến nhất ( Wright et al. 2015). Một số sản phẩm sử dụng kết hợp hai trong số các loại thuốc diệt côn trùng này. Các quyết định về việc sử dụng thuốc diệt côn trùng nên được thực hiện bằng cách dò tìm và tính toán ngưỡng kinh tế. Một lưu ý quan trọng khác trong việc sử dụng thuốc trừ sâu để điều trị mọt cỏ linh lăng là độc tính đối với ong và thiên địch. Nhiều sản phẩm được đăng ký sử dụng cho mọt cỏ linh lăng có độc tính cao hoặc trung bình đối với thiên địch và có thể gây độc cao đối với ong (Khoa Nông nghiệp và Tài nguyên Thiên nhiên của Đại học California [UCANR] 2015 ). Nguy cơ đối với ong tăng cao khi cỏ linh lăng đang nở hoa, do đó nhãn sẽ ghi rõ “tránh sử dụng khi ong đang tích cực kiếm ăn” hoặc “không áp dụng sản phẩm này cho cây trồng hoặc cỏ dại đang nở hoa” ( Wright et al. 2015). Thông tin hiện tại về các sản phẩm kiểm soát hóa chất cụ thể, khoảng thời gian trước khi thu hoạch và các ghi chú khác được đăng tải một cách đáng tin cậy nhất trên các trang web Khuyến nông khu vực cập nhật như High Plains IPM Wiki ( Peairs et al. 2016 ).', 'nó có thể được tìm thấy trongcác cánh đồng cỏ linh lăng khắp Châu Âu.  Được coi là mối đe dọa hủy diệt đối với sản xuất cỏ linh lăng ở Bắc Mỹ, một số sự du nhập tình cờ đã được chống lại thành công mặc dù việc sử dụng nhiều loài kiểm soát sinh học', 'null', 'insect_Hypera_postica/30294.jpg', 'Hypera', 'null'),
('Hypomeces squamosus', 'Câu cấu xanh lớn', 'insect_Hypomeces_squamosus', 'Con trưởng thành là bọ cánh cứng, màu xanh vàng óng ánh, dài từ 10-15mm, mỏ nhọn và quặp. Con cái đẻ trứng nhỏ màu trắng, rời rạc, chúng sống từng cụm 3-4 con, núp phía dưới mặt lá, giả chết khi rơi xuống đất khi bị động.\n\n-  Sâu non (ấu trùng) màu vàng nhạt, dài từ 15-20mm sinh sống trong đất bằng cách đục phá rễ và gốc cây. Làm nhộng trong đất.\n\n- Trưởng thành cắn gặm lá già chừa gân lá lại, đôi khi ăn trụi cả lá non nếu mật số cao. Sự gây hại của câu cấu có thể làm giảm sinh trưởng của cây.', '', '', '', '', 'null', '', 'Hypomeces', 'null'),
('Icerya purchasi Maskell', '‎Vảy đệm cottony‎', 'insect_Icerya_purchasi_Maskell', 'Khi trưởng thành, côn trùng vẫn đứng yên, bám vào cây bằng chất tiết sáp, và tạo ra một túi trứng màu trắng trong các rãnh, bằng cách đùn ra, trong cơ thể có hàng trăm quả trứng màu đỏ. Túi trứng sẽ phát triển dài gấp 2-3 lần cơ thể. Nhộng mới nở là giai đoạn phát tán sơ cấp, với sự phát tán được biết là xảy ra nhờ gió và do bò. Nhộng non ở giai đoạn đầu ăn từ gân giữa của lá và cành cây nhỏ, và gây ra phần lớn thiệt hại. Ở mỗi lần thay lông, chúng để lại ở điểm kiếm ăn cũ lớp da cũ và chất tiết dạng sáp mà chúng đã bao phủ chính mình và từ đó tên chung của chúng được đặt ra. Không giống như nhiều loài côn trùng có vảy khác, chúng có chân và khả năng di chuyển hạn chế trong tất cả các giai đoạn của cuộc đời. Nhộng già di chuyển đến các cành cây lớn hơn và cuối cùng khi trưởng thành đến các cành và thân cây. Vòng đời của chúng phụ thuộc nhiều vào nhiệt độ, vì thời gian trong mỗi giai đoạn sống ở nhiệt độ lạnh dài hơn nhiệt độ cao.', 'Con lưỡng tính trưởng thành hình bầu dục, màu nâu đỏ, có lông đen, dài 5 mm', 'Những con đực thực sự là không phổ biến đến hiếm gặp, và trong nhiều trường hợp nhiễm bệnh không xuất hiện. Những con cái thuần chủng chưa được biết đến. Sự tự thụ tinh của một cá thể lưỡng tính sẽ chỉ tạo ra những cá thể lưỡng tính. Sự giao phối giữa con đực và con lưỡng tính sẽ tạo ra cả con đực và con lưỡng tính.', 'Icerya Purchasi là quan trọng như một trong những thành công lớn đầu tiên của việc kiểm soát sinh học. Việc nhập khẩu bọ rùa vedalia (Novius cardinalis) vào năm 1888-1889 bởi C. V. Riley, sau này là người đứng đầu Bộ phận Côn trùng học của USDA, đã làm giảm nhanh chóng quần thể I. buysi, cứu ngành cam quýt đang phát triển của California khỏi loài gây hại phá hoại này.\r\n\r\nMột biện pháp kiểm soát sinh học thứ hai, loài ruồi ký sinh Cryptochetum iceryae cũng đã được đưa đến California như một vật trung gian kiểm soát bổ sung. Chỉ nên sử dụng thuốc diệt côn trùng như một biện pháp kiểm soát nếu không có loài kiểm soát sinh học nào. Đặc biệt chống chỉ định imidacloprid, vì nó không có tác dụng đối với loài này, nhưng rất độc đối với Rodolia cardinalis.', 'Australia,  New Zealand', 'null', 'insect_Icerya_purchasi_Maskell/59244.jpg', 'Icerya', 'null'),
('Idioscopus nitidulus', 'mango leafhopper', 'insect_Idioscopus_nitidulus', 'Idioscopus nitidulus sinh sản ở hoa và lá mới, trong khi Idioscopus clypealis chỉ sinh sản ở hoa. Mỗi con cái đẻ từ 100-200 trứng đơn lẻ vào gân giữa ở mặt dưới của lá và / hoặc hoa.', 'null', 'Rầy xoài xuất hiện với số lượng lớn trên hoa và lá, gây thiệt hại cho cây trồng lên đến 50%. Những thiệt hại này xảy ra theo hai cách: (i) rầy lá ăn nhựa cây, chúng ăn và đẻ trứng làm cho hoa chuyển sang màu nâu và khô, làm giảm khả năng đậu trái và sản lượng; và (ii) khi chúng ăn, chúng tiết ra chất lỏng được gọi là \'honeydew\' dính; Honeydew lắng đọng trên lá và trái cây và trở thành khu trú của nấm mốc, làm cho lá chuyển sang màu đen và làm giảm khả năng quang hợp', 'Sử dụng pyrethroid tổng hợp hoặc dimethoate, nếu loại thuốc trừ sâu toàn thân được ưu tiên. Dimethoate có thể được phun hoặc tiêm vào thân cây. Ở Úc, khuyến cáo phun hai lần cách nhau 7 ngày trước khi bắt đầu ra hoa. Phun thuốc trước khi ra hoa làm giảm nguy cơ giết chết các loài thụ phấn. Ở Úc, dimethoate đã được xem xét từ giữa năm 2015. Nó không còn được phép sử dụng trong vườn nhà.', 'Các nước châu Âu và châu Á', 'null', 'insect_Idioscopus_nitidulus/68393.jpg', 'Idioscopus', 'null'),
('Idioscopus niveosparsus', 'Rầy nhảy xoài, Rầy bông xoài', 'insect_Idioscopus_niveosparsus', 'Vòng đời phát triển của loài rầy bông xoài bao gồm các giai đoạn: Thành trùng, trứng, ấu trùng. Đặc điểm của mỗi giai đoạn như sau:\n\n- Đặc điểm hình thái của thành trùng của rầy bông xoài: có thân dài khoảng 4 mm, cánh màu nâu, trên cánh phần giúp với ngực có một băng trắng chạy ngang.\n\n- Đặc điểm trứng của rầy bông xoài: Khi mới đẻ trứng có màu trắng, sắp nở chuyển sang màu vàng. Thời gian ủ trứng từ 4 – 7 ngày.\n\n- Ấu trùng của rầy bông xoài khi mới nở có màu trắng sữa, có 5 tuổi với thời gian phát triển từ 8 – 10 ngày.', '', '', '', '', 'null', '', 'Idioscopus', 'null'),
('ischiopsopha', 'Bọ cánh cứng', 'insect_ischiopsopha', 'Ấu trùng nở ra có thân cong, màu trắng sữa, đầu có mảnh sừng cứng màu nâu, trên thân có lông tơ màu trắng, dài khoảng 35mm, phá hại bộ rễ làm cây bị héo và dễ đổ ngã. Vòng đời của chúng từ 1 - 2 năm.Con trưởng thành màu nâu vàng có vân vạch ở cánh trước\n\nSau khi vũ hóa, các con trưởng thành giao phối và tìm đến  các vườn dứa xanh tốt để đẻ trứng. Sâu non khi nở ra đã có sẵn thức ăn tốt.', '', '', '', '', 'null', '', 'Ischiopsopha', 'null'),
('Laccoptera nepalensis', 'Bọ cánh cứng', 'insect_Laccoptera_nepalensis', 'Bọ cánh cứng sinh trưởng theo vòng đời gồm 4 giai đoạn: Trừng- Ấu trùng- Nhộng – Thành trùng. Mỗi lần đẻ bọ cánh cứng cái đẻ khoảng 90 trứng.\nVòng đời của một con trưởng thành từ 30 – 60 ngày. Các con đực trưởng thành sống tầm 13 ngày, trong khi con cái sống từ 14 – 44 ngày. Tuy nhiên, chiều dài của vòng đời cũng phụ thuộc vào lượng thức ăn có sẵn cho ấu trùng cũng như các điều kiện môi trường.\nVà tùy theo từng loài bọ cánh cứng, có một số loài bọ cánh cứng lớn rất nhanh và chúng có thể sản sinh nhiều hơn một thế hệ mỗi năm.\nNhưng có những loài, ví như loài bọ ăn gỗ có thể mất vài năm đến hàng thập kỷ để phát triển từ trứng thành một con bọ trưởng thành', '', '', '', '', 'null', '', 'Laccoptera', 'null'),
('Laodelphax striatellus', 'Rầy xám', 'insect_Laodelphax_striatellus', 'Vòng đời của rệp ngắn từ 6 – 19 ngày. Rệp cái đẻ con nên quần thể rệp tăng rất nhanh về số lượng trong thời gian ngắn.\r\n- Rệp gây hại chủ yếu trên các cây thuộc họ cải. Hại trên tất cả các bộ phận của cây, thường tập trung ở búp non, lá con, cành non, cành non, quả, nụ hoa,... hoặc ở mặt dưới lá; Rệp xuất hiện quanh năm, nhưng hại mạnh vào vụ xuân hè và thu đông.', 'Rầy trưởng thành màu nâu và có 2 dạng cánh: cánh dài phủ kín thân, cánh ngắn phủ 2/3 thân.Trứng hình quả chuối, một đầu to, một đầu nhỏ màu trong suốt.Rầy non lúc nhỏ có màu đen xám, sau thành màu nâu vàng, thân hình tròn trĩnh. Rầy non có 5 tuổi, dài 1- 3mm.', 'Đầu tiên, rầy xuất hiện thành từng đám/vạt giữa ruộng, sau đó lan dần ra quanh ruộng.Rầy nâu tập trung ở gốc lúa, chích hút nhựa cây, làm lúa chậm phát triển. Khi mật độ rầy cao gây hiện tượng “cháy rầy”. Rầy trưởng thành thường tập trung thành đám ở trên thân cây lúa, phía dưới khóm để hút nhựa. Khi bị khua động thì lẩn trốn bằng cách bò ngang hoặc nhảy sang cây khác, hoặc xuống nước hoặc bay xa đến chỗ khác.Mưa nắng xen kẻ là điều kiện thuận lợi để rầy phát sinh mạnh. Trường hợp thiếu thức ăn do lúa bị “cháy” hoặc khô già thì xuất hiện rầy cánh dài để di chuyển sang ruộng khác.', 'Hiện nay, lúa đang giai đoạn trổ bông, mật độ rầy còn thấp nhưng không được chủ quan, cần thường xuyên thăm đồng, đặc biệt chú ý tới những điểm, những vùng thường có các ổ rầy đã gây hại ở  những vụ trước. Khi phát hiện trong ruộng có rầy với mật độ cao trên 1.500con/m2 (2- 3 con/dãnh lúa) thì phun trừ bằng các loại thuốc như Chess 50WG, Cheestar 50WG, Sagometro 50WG, Oscare 50WG, Startcheck 755WP,… Sau phun 3- 5 ngày kiểm tra lại, nếu rầy tiếp tục nở, mật độ còn cao cần phun lại lần 2.Trường hợp mật độ rầy quá cao, đen gốc (trên 10.000 con/m2), có nhiều pha phát dục, có khả năng gây “cháy rầy”, thì sử dụng các loại thuốc tiếp xúc, xông hơi như Bassa 50EC, Vibasa 50EC trộn với cát, dầu diezel để vãi ở gốc lúa, phía trên phun bằng các loại thuốc như Chess 50WG, Cheestar 50WG, Sagometro 50WG, Oscare 50WG,... Trường hợp rầy gây hại mạnh, lúa đã chín gần thu hoạch nên thu hoạch sớm 5-7 ngày để hạn chế thiệt hại do rầy gây ra.Khi sử dụng thuốc ruộng phải có nước hiệu quả trừ rầy mới cao. Nên giữ nước trong ruộng lúa đến khi mật độ rầy giảm không có khả năng gây hại mới rút nước để chuẩn bị thu hoạch.', 'Algeria, Morocco, Tunisia,Armenia, China, Iran, Israel, Japan, North Korea, Philippines, South Korea, Thailand', 'null', 'insect_Laodelphax_striatellus/06022.jpg', 'Laodelphax', 'null'),
('Large yellow underwing', 'giun vàng', 'insect_Large_yellow_underwing', 'Trứng được đẻ thành từng lô lớn, thẳng hàng với nhau từ hai đến ba trăm quả trên nhà máy thức ăn cho ấu trùng. Những con cái cũng sẽ đẻ tự do trong điều kiện nuôi nhốt kể cả bên trong bẫy đèn.Trứng nở trong vòng 10 ngày và sâu bướm ăn nhiều loại cây thân thảo thấp bao gồm bồ công anh, bến tàu, cỏ và các loại cây nông nghiệp trồng thương mại.Khi chúng trở nên lớn hơn, chúng kiếm ăn chủ yếu vào ban đêm, ban ngày ngay dưới bề mặt đất hoặc giữa các gốc và rễ của cây.', 'Cánh trước dài, hẹp và tròn. Chúng có màu sắc thay đổi từ nâu đỏ đến nâu đen nhưng có một chấm đen nhỏ ở gần mép chính ở đầu. Phần đuôi màu vàng có một dải hẹp màu đen không có hình lưỡi liềm hoặc lớp phủ sẫm màu được tìm thấy ở các loại quần lót màu vàng khác.Những con trưởng thành đến với ánh sáng với số lượng lớn và có thể bị quấy rầy bởi các mảnh vụn thực vật hoặc thảm thực vật mặt đất vào ban ngày. Ấu trùng có thể được tìm thấy từ tháng 8 đến đầu mùa xuân, kiếm ăn vào ban đêm và ẩn dưới đất vào ban ngày.', 'Sâu bướm mùa đông trong đợt áp chót hoặc đợt cuối và có thể kiếm ăn ít trong những đợt nhẹ.Đôi khi chúng được bắt gặp trên mặt đất hoặc thậm chí trên bề mặt tuyết vào giữa mùa đông.\r\nBắt đầu phát triển khi thời tiết ấm lên.', 'có thể mua tuyến trùng có lợi từ một số nhà bán lẻ thương mại. Tưới nước vào đất để loại bỏ sâu mọt trong đất. Nhiệt độ đất cần từ 12-20ºC để việc xử lý đạt hiệu quả. Luôn chú ý nghiên cứu các sản phẩm để đảm bảo chúng là giải pháp phù hợp cho vấn đề của bạn! Luôn đọc hướng dẫn trước khi nộp đơn.', 'Quốc gia - Anh, Wales, Scotland và Ireland. Phổ biến và rộng rãi trên khắp nước Anh, Ireland và quần đảo Channel. Những cuộc di cư lớn thỉnh thoảng cũng đã được ghi nhận ở bờ biển phía nam.', 'null', 'insect_Large_yellow_underwing/13326.jpg', 'Noctua', 'null'),
('Lawana imitata', 'Lawana imitata', 'insect_Lawana_imitata', 'Bướm trắng có thể tạo ra tới 300 quả trứng cùng một lúc nằm ở mặt dưới lá. Sau 4 – 12 ngày, những quả trứng nhỏ, màu trắng, hình bầu dục. Chúng đi vòng quanh mặt dưới của chiếc lá cho đến khi tìm thấy một nơi để kiếm ăn. Các nữ thần mất khả năng đi lại và sẽ ở cùng một chỗ. Trông giống như những con côn trùng nhỏ, phẳng không có chân hoặc râu.Các nữ thần dần dần lớn hơn khi chúng tiến triển qua bốn giai đoạn instar. Cuối cùng, chúng nổi lên như những con trưởng thành có cánh, giống như bướm đêm. Toàn bộ vòng đời của ruồi trắng mất 14 – 60 ngày, tùy thuộc vào nhiệt độ. Trong điều kiện lý tưởng (khoảng 80 F), chúng sẽ đến tuổi trưởng thành trong khoảng 3 tuần.', 'Bướm đêm lông trắng là một loài côn trùng đặc biệt với sải cánh dài từ 26 đến 34 mm (1,0 đến 1,3 in). Con trưởng thành có màu trắng tinh, các cánh chia thành năm chùm mỏng như lông vũ, hai phần tạo thành cánh trước và ba phần tạo thành cánh sau. Loài côn trùng này sống về đêm, nổi lên vào lúc hoàng hôn và có cánh trong tháng 6 và tháng 7. Các ấu trùng có màu xanh, với sọc vằn trên lưng màu vàng và những túm lông nhạt.', 'Bướm trắng có thể truyền nhiều loại bệnh sang rau và cây cảnh. Nhiều trong số này, chẳng hạn như virut xoăn lá vàng cà chua, có thể tàn phá mùa màng.', 'Dùng phương pháp thủ công: Bạn cần quan sát và thường xuyên kiểm tra vườn cây của mình. Truy tìm trứng sâu bướm và sâu bướm và loại bỏ chúng ngay sau khi bạn vừa phát hiện.Dùng lưới che phủ cho vườn cây: của bạn với lưới có nhiều lỗ sẽ vẫn cung cấp lưu lượng không khí và ánh sáng mặt trời trong khi cách ly với sâu.\r\n\r\nTrồng xen canh các loại thảo dược để sua đuổi bướm: Ví dụ như các loại cây: Bạc hà, oải hương, ngãi cứu, xô thơm… Những cây này sẽ giúp sâu bướm và những loài gây hại khác tránh xa.', 'Loài bướm đêm này được tìm thấy ở phần lớn châu Âu và Trung Đông, xa về phía đông như Iran, cũng như Bắc Phi. Ở Anh, nó phổ biến ở Anh và xứ Wales nhưng địa phương hơn ở miền nam Scotland và ở các vùng ven biển phía tây, nam và đông Ireland.', 'null', 'insect_Lawana_imitata/66800.jpg', 'Lawana Distant', 'null'),
('Leafminer', 'Ruồi đục lá', 'insect_Leafminer', 'Con cái đẻ trứng bên trong các mô lá của cây nhạy cảm, tạo ra các lỗ thủng nhỏ. Ấu trùng đang phát triển ăn các mô lá, tạo ra một đường hầm giữa bề mặt trên và bề mặt dưới khi nó tiến lên. Điều này bắt đầu nhỏ nhưng ngày càng rộng ra khi ấu trùng tăng kích thước. Sau ba giai đoạn , ấu trùng cắt một khe, thường là ở mặt trên của lá, và rơi xuống đất nơi nó thành nhộng . Ở 25 đến 30 ° C (77 đến 86 ° F), giai đoạn ấu trùng kéo dài khoảng tám ngày với thời kỳ tương tự đối với giai đoạn nhộng, trong khi ở 15 ° C (59 ° F), toàn bộ chu kỳ mất 25 ngày . Một con cái có thể đẻ vài trăm quả trứng trong suốt vòng đời của mình một tháng. ', '', '', '', '', 'null', '', 'Liriomyza', 'null'),
('Lema pectoralis', 'Bọ cánh cứng màu vàng', 'insect_Lema_pectoralis', '', '', '', '', '', 'null', '', 'Lema', 'null'),
('Leptinotarsa decemlineata', 'Bọ cánh cứng khoai tây Colorado (Colorado Potato Beetle)', 'insect_Leptinotarsa_decemlineata', 'Con cái của bọ khoai tây Colorado rất sung mãn và có khả năng đẻ hơn 500 quả trứng trong khoảng thời gian từ 4 đến 5 tuần. [20] Trứng có màu vàng đến cam và dài khoảng 1 mm (0,039 in). Chúng thường được gửi thành từng đợt khoảng 30 con ở mặt dưới của lá cây chủ. Sự phát triển của tất cả các giai đoạn sống phụ thuộc vào nhiệt độ. Sau 4-15 ngày, trứng nở thành ấu trùng màu nâu đỏ, lưng có bướu và hai hàng đốm nâu sẫm ở hai bên. Chúng ăn lá của cây chủ. Ấu trùng tiến triển qua bốn giai đoạn phát triển riêng biệt (các giai đoạn). Các tấm kính đầu tiên dài khoảng 1,50 mm (0,059 in) và các tấm kính cuối cùng (thứ tư) có chiều dài 8 mm (0,31 in). Các đợt đầu tiên đến đợt 3, mỗi đợt kéo dài khoảng 2-3 ngày; lần thứ tư kéo dài 4-7 ngày. Khi đạt đến kích thước đầy đủ, mỗi phiên bản thứ tư trải qua vài ngày như một giai đoạn chuẩn bị không cho ăn, có thể được nhận biết bằng cách không hoạt động và màu sáng hơn. Các mầm non rơi xuống đất và đào sâu đến vài inch, sau đó thành nhộng .  Trong 5 đến 10 ngày, bọ cánh cứng trưởng thành xuất hiện để kiếm ăn và giao phối. Do đó, loài bọ này có thể chuyển từ trứng thành con trưởng thành chỉ trong vòng 21 ngày.  Tùy thuộc vào nhiệt độ, điều kiện ánh sáng, và chất lượng máy chủ, người lớn có thể nhập diapausevà trì hoãn sự xuất hiện cho đến mùa xuân. Sau đó chúng quay trở lại cây chủ để giao phối và kiếm ăn; Những con trưởng thành trú đông có thể bắt đầu giao phối trong vòng 24 giờ sau khi xuất hiện vào mùa xuân.  Ở một số địa điểm, ba hoặc nhiều thế hệ có thể xảy ra mỗi mùa sinh trưởng.', '', '', '', '', 'null', '', 'Leptinotarsa', 'null'),
('Leptocorisa acuta', 'Bọ xít dài', 'insect_Leptocorisa_acuta', 'Sau 8-29 ngày, con trưởng thành của cả hai giới đều hoàn toàn trưởng thành. Con trưởng thành có thể sống đến 69 ngày. Con cái sống lâu hơn con đực trung bình: lần lượt là 60 và 48 ngày. Bọ gạo sinh sôi nhiều nhất ở điều kiện 80-82 ° F và độ ẩm tương đối khoảng 80% (Pathack và Khanv 1994). Các quần thể có xu hướng gia tăng trong giai đoạn lúa trổ bông, trùng với thời tiết ấm hơn.\nKhi trưởng thành vào mùa xuân, bọ gạo ăn các cây ký chủ hoang dã trong một hoặc hai thế hệ trước khi di cư vào ruộng lúa. Người ta tin rằng sau khi thu hoạch lúa, bọ xít xâm nhập vào các bãi cỏ hoang hoặc các loại cây cỏ khác. Theo Schaefer và Panizzi (2001), con cái đẻ tới 25-87 trứng trong suốt thời gian sống của chúng. Trứng được ký sinh thành hàng đơn hoặc hàng đôi gồm 10 đến 20 quả ở mặt trên của lá cây ký chủ. Trứng được gắn vào lá bởi một chất kết dính do con cái tiết ra trong quá trình rụng trứng.\nTheo Corbett (1930), nhộng mới xuất hiện có thể sống ít nhất 24 giờ mà không cần thức ăn. Mặc dù chúng có kích thước khác nhau, nhưng năm cá thể tiên nữ không dễ phân biệt với nhau vì sự giống nhau về ngoại hình của chúng.', '', '', '', '', 'null', '', 'Leptocorisa', 'null'),
('Lesticus nubilus', 'Bọ cánh cứng mặt đất', 'insect_Lesticus_nubilus', 'Những sinh vật này thuộc nhóm con bọ cánh cứng ăn thịt và phần lớn tạo thành một gia đình lớn, trong đó có khoảng 25 nghìn loài, mặc dù có một giả định rằng có nhiều gấp đôi số đó trên Trái đất. Đồng thời, khoảng ba nghìn loài được tìm thấy ở Nga.\nĐây là những con bọ cánh cứng rất lớn, kích thước đạt tới 6 cm, nhưng phần lớn là khoảng 3 cm. Về màu sắc, chúng chủ yếu là màu tối, thường có màu ánh kim, đôi khi ánh kim. Tuy nhiên, màu sắc của các loài rất đa dạng, giống như hình dạng của cơ thể chúng. Hầu hết các loài có cánh kém phát triển, và do đó gần như không bay, nhưng chúng phát triển tốc độ đáng kể khi chạy.\nHầu hết chúng thường là động vật ăn thịt, và do đó ăn giun, bướm, ốc, sên và chỉ một ít thức ăn thực vật. Bọ cánh cứng mặt đất đi săn vào ban đêm và đặc biệt hoạt động vào những ngày nhiều mây của những tháng ấm áp. Đất chính là các lớp đất phía trên, trong những trường hợp hiếm hoi chúng có thể được nhìn thấy trên cây và các loại cây khác.\nNhững kẻ háu ăn nhất được coi là những con bọ cánh cứng vàng sống ở châu Âu và Trung Á. Họ thích ăn những con tằm chưa ghép đôi và ăn loài vật gây hại văn hóa này, mang lại lợi ích không thể nghi ngờ. Bọ cánh cứng mặt đất màu tím cũng nổi tiếng với một sự thèm ăn tốt, rất hữu ích.\nMàu sắc chính của những con bọ cánh cứng như vậy là màu tối, nhưng với đường viền màu tím, từ vẻ ngoài đó, nó đã nhận được tên được chỉ định. Nhưng bọ cánh cứng mặt đất - một người yêu để gặm nhấm triệt để những hạt lúa nảy mầm. Bằng cách này, nó gây ra thiệt hại khủng khiếp cho cây trồng, theo quan điểm trên, nó được coi là một loài gây hại.', '', '', '', '', 'null', '', 'Lesticus', 'null');
INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('Limacodidae', 'bướm đêm', 'insect_Limacodidae', 'mùa đông như một ấu trùng trong kén hình bầu dục lỏng lẻo', 'Sâu bướm trưởng thành thường có màu xanh lá cây nhưng cũng có thể có màu cam, đỏ và các màu khác. Sự đa dạng về màu sắc này là đặc trưng của loài sâu bướm đa pha . Trong sâu bướm màu xanh lá cây, ít nhất, các vây lưng bên có giữa nổi bật lưng , ban nhạc màu hoa cà giáp với một sọc màu xanh đậm. Dải màu hoa cà bị phá vỡ bởi các đốm màu xanh lam lớn được bao bọc trực tiếp bởi một đường sọc sẫm màu ngắn và sau đó là một đốm màu vàng. Các gai lớn, hình bầu dục và xiên. Như là một điển hình cho gia đình, prolegs và crochets vắng  mặt.\r\n\r\nMặt lưng của cơ thể được trang bị các gai nổi trên các nốt sần nổi bật , các gai này lớn hơn ở ngực và A7. Các đốt cuối này hướng về phía trước và phía sau, giống như sừng; gai của chúng có màu sẫm hơn những phần còn lại. Nọc độc của gai đặc biệt đau đớn. Vì vậy, những con sâu bướm nên được xử lý một cách thận trọng. Chiều dài khoảng 20-39 mm (Cock et al . 1987).', 'Thường cho ăn nhiều loại cây lương thực Biến về hình thức. Nhiều loài urticating với gai trên scoli hoặc trũng verrucae , mọc dài ra và nốt sần đôi khi có thể tháo rời, và mịn loài (được gọi là gelatines) hoặc những người có mụn cóc gelatin. Tất cả đều nằm trên T2, T3 và các đoạn bụng A1-A9. (Hình 1, Hình 2, Hình 3)\r\nStemma 6 là loại cây bị cô lập nhất trong số các thân cây .\r\nLabrum thường có nhiều lông (không có ở Chrysopolominae).\r\nT1 chỉ với setae sơ cấp .\r\nLồng ngực chân nhỏ đến từng phút.\r\nNhững kẻ hút máu thay vì cố chấp trên A1-A8 hoặc A1-A7. Crochets thường vắng mặt, với một ngoại lệ ở châu Phi chi taeda (= Pantoctenia ) và Crothaema .\r\nFrass -flipping lông cứng có thể có mặt.', 'Để điều trị kích ứng do sâu bướm quấy rầy, hãy cởi bỏ tất cả quần áo bị ảnh hưởng và dán một miếng băng dính vào từng khu vực bị ảnh hưởng, sau đó kéo băng ra ngay lập tức. Điều này sẽ loại bỏ một số sợi lông và chất gây kích ứng và giảm tác động của kích ứng. Việc sử dụng thuốc giảm đau, kem, thuốc kháng histamine và kem dưỡng da có steroid cũng sẽ hỗ trợ làm giảm các triệu chứng.\r\n\r\nTránh tiếp xúc với sâu bướm có lông hoặc vật liệu mà chúng đã tiếp xúc. Phải luôn mặc quần áo bảo hộ thích hợp, bao gồm cả kính mắt và găng tay khi tiếp xúc với những côn trùng này. Hầu hết các sự phá hoại của sâu bướm thường tồn tại trong thời gian ngắn và nên được để yên, trừ khi chúng đang gây ra vấn đề, khi đó sẽ được khuyến nghị bởi một cán bộ kiểm soát dịch hại có uy tín. Nhiều loài phá hoại sẽ chết đi do ăn thịt hoặc khi tất cả các nguồn thức ăn cạn kiệt. Tuy nhiên, một số biện pháp kiểm soát phòng ngừa nên được áp dụng để đề phòng sự xâm nhập của Mistletoe browntail đặc biệt là trong hoặc gần các sân trường. Việc loại bỏ tất cả các cây tầm gửi khỏi cây Bạch đàn trong sân trường hoặc các khu vực lân cận trước mùa xuân sẽ ngăn chặn sự xâm chiếm thuộc địa. Làm đất trống hoặc phủ đá cuội ở gốc các thân cây bạch đàn hiện có sẽ giúp ngăn chặn giai đoạn sâu bướm hình thành nhộng và nghỉ ngơi. Trồng các loài cây không thu hút sâu bệnh, khi cần có bóng râm trong sân trường hoặc sân sau, là một biện pháp khác để tránh vấn đề này.', 'Indonesia nước Thái Lan\r\nViệt Nam (3 trên từ Bộ Nông nghiệp và Nguồn nước của Chính phủ Australia, 2015)\r\nbán đảo Malaysia\r\nJava\r\nSumatra (trên ba từ Cock và cộng sự . 1987)', 'null', 'insect_Limacodidae/41047.jpg', 'Limacodidae', 'null'),
('Liriomyza sativae', 'Ruồi đục lá', 'insect_Liriomyza_sativae', 'Con cái đẻ trứng bên trong các mô lá của cây nhạy cảm, tạo ra các lỗ thủng nhỏ. Ấu trùng đang phát triển ăn các mô lá, tạo ra một đường hầm giữa bề mặt trên và bề mặt dưới khi nó tiến lên. Điều này bắt đầu nhỏ nhưng ngày càng rộng ra khi ấu trùng tăng kích thước. Sau ba giai đoạn , ấu trùng cắt một khe, thường là ở mặt trên của lá, và rơi xuống đất nơi nó thành nhộng . Ở 25 đến 30 ° C (77 đến 86 ° F), giai đoạn ấu trùng kéo dài khoảng tám ngày với thời kỳ tương tự đối với giai đoạn nhộng, trong khi ở 15 ° C (59 ° F), toàn bộ chu kỳ mất 25 ngày . Một con cái có thể đẻ vài trăm quả trứng trong vòng đời một tháng. ', '', '', '', '', 'null', '', 'Liriomyza', 'null'),
('Lissorhoptrus oryzophilus Kuschel', 'mọt nước gạo', 'insect_Lissorhoptrus_oryzophilus_Kuschel', 'Trứng trắng có hình trụ (dài 0,8 mm và dài 0,14 mm) bằng quả lê với một lớp đệm rất mỏng. Trứng được đẻ trong bẹ lá và đôi khi ở rễ. Ấu trùng nở từ trứng sau 4-9 ngày.Các ấu trùng là thủy sản và sống trọn vẹn cuộc sống của họ trong vùng rễ. Chúng có màu trắng và dài tới 1 cm ở giai đoạn thứ 4. Ấu trùng sống sót trong vùng thiếu khí bằng cách sử dụng các xoắn khuẩn biến đổi có hình dạng như móc lưng nối với hệ thống khí quản. Các móc này xâm nhập vào tế bào nhu mô của cây lúa và các loại cỏ đất ngập nước khác để hô hấp.  Ấu trùng trải qua 4 giai đoạn (hoặc giai đoạn) và phát triển hoàn thiện trong khoảng 28–35 ngày. Nhộng là một kén tơ nhỏ bọc trong bùn (dài 0,5-0,9 cm) và bám vào rễ . Giai đoạn nhộng mất khoảng 7 ngày để hoàn thành.\r\n\r\nNhững người lớn dài 3,3-3,7 mm, trong đó có mỏ chim . Bộ xương ngoài có màu từ be sẫm, nâu hoặc nâu sẫm. Dọc theo tâm elytra, một số con mọt nước gạo có một vết dài màu nâu đen đến nâu đen. Các cặp chân ở giữa có lông kỵ nước cho phép nó bơi (Hix et al. 2000).', 'Con trưởng thành là những con mọt màu nâu xám (dài 1/8 inch) với một vết hình chữ V màu nâu sẫm trên lưng. Con trưởng thành bay vào ruộng lúa và bắt đầu ăn lá của cây lúa. Con đực và con cái trưởng thành RWW giao phối, sau đó con cái ký sinh trứng trong bẹ lá ở hoặc dưới mực nước. Ấu trùng trắng xuất hiện từ trứng trong khoảng một tuần và phát triển qua bốn giai đoạn khi ăn rễ cây lúa. Ấu trùng nhộng te trong kén được che phủ bằng một lớp nhỏ gọn của bùn và được gắn vào rễ lúa. Vòng đời từ trứng đến con trưởng thành mất khoảng một tháng.', 'mọt nước có thể bơi trong nước, con trưởng thành chủ yếu ăn mô lá. Kích thước trưởng thành của mọt nước hại lúa chỉ 3 - 4 mm màu nâu nhạt. Chúng thích nghi với đời sống thủy sinh, nhờ có các sợi lông kỵ nước trên chân, cho phép chúng có thể bơi như một số loài thuộc bộ cánh cứng và bộ cánh nửa sống thủy sinh khác.', 'Dọn cỏ sạch bờ ruộng, bờ đê vì đây là nơi duy trì tích lũy nguồn mọt nước. Tháo nước khô ruộng trước khi vào vụ mới, hoặc khi xuất hiện mọt gây hại. Ruộng khô có thể gây chết và ngăn chặn tốc độ gây hại của trưởng thành, vì trưởng thành di chuyển trong nước tốt hơn. Tuy nhiên biện pháp này không kiểm soát được trứng và ấu trùng.\r\n\r\n- Sau mỗi vụ thu hoạch, cho nước ngập chìm gốc rạ (nếu điều kiện thủy lợi cho phép) đến khi rơm rạ bị phân hủy. Cắt nguồn thức ăn của mọi nước.\r\n\r\n- Nên xử lý hạt giống trước khi gieo bằng các thuốc có chứa thiamethoxam như Actara 25WG, Cruiser plus 312.5FS.\r\n\r\n- Nếu mật độ vượt ngưỡng gây hại kinh tế, phòng trừ bằng các thuốc hóa học thuộc nhóm diamide (Chloratrniliprole) và neonicotinoids (Thiamethoxam) với các thuốc như Actara 25WG, Virtako 40WG.\r\n\r\n- Ngoài ra có thể sử dụng các thuốc có chứa lambda-cyhalothrin (Karate 2.5EC), fipronil (Regent 800WP), diflubenzuron… Trong biện pháp sinh học sử dụng chế phẩm vi khuẩn Bacillus thuringiensis.', 'Trung Quốc, Ấn Độ, Nhật Bản, Hàn Quốc và Đài Loan', 'null', 'insect_Lissorhoptrus_oryzophilus_Kuschel/06576.jpg', 'Lissorhoptus', 'null'),
('Loxostege sticticalis', 'bướm đêm meadow', 'insect_Loxostege_sticticalis', 'Trứng được đẻ thành từng chùm trên nhiều loại cây thân thảo thường nở trong vòng 5-10 ngày.Những con sâu bướm (ấu trùng) được đánh dấu rõ ràng ăn nhiều loại thân thảo và thường được nhìn thấy vào ban ngày.\r\n\r\nSâu bướm phát triển hoàn toàn trong vòng ba mươi ngày khi chúng thường được nhìn thấy vào ban ngày trên cây thức ăn của ấu trùng.\r\n\r\nNhững con sâu bướm chuẩn bị hóa nhộng và qua mùa đông trong một cái kén quay vòng giữa các lớp thực vật và lá.\r\n\r\nNhững con bướm đêm đầu tiên xuất hiện vào đầu tháng Năm.', 'vảy rìa cánh trước màu đen, tương phản với dải mỏng màu vàng nhạt dọc theo rìa ngoài; màu mặt đất nâu vàng với các mô hình chắp vá của các đốm sáng và tối; Đường PM rất lượn sóng, với một vùng nhạt cách xa đường nơi nó gặp mặt cắt; ở phần còn lại, phác thảo của bướm đêm là hình tam giác.Khoảng cánh: 2,4-2,9 cm', 'Sâu bướm phát triển chiều dài lên đến 40 mm.Cơ thể có thể thay đổi màu sắc từ màu nâu nhạt đến gần như đen với những đám lông màu nâu gỉ.\r\n\r\nĐường đứt đoạn của các mảng màu trắng ở lưng và đường xoắn phụ màu trắng gợn sóng với các đốm đỏ / cam là đặc biệt.\r\n\r\nSâu bướm đuôi nâu, có lông màu nâu đặc biệt hấp dẫn, đôi khi bị nhầm lẫn với sâu bướm Knot Grass.Sâu bướm ăn nhiều loại cây thân thảo thấp bao gồm cây cỏ, bến tàu và cỏ nút, cũng như cây bìm bịp, cây bìm bịp và cây táo gai.Khi đã trưởng thành hoàn toàn, sâu bướm sẽ hóa nhộng và mùa đông trong một cái kén xoay tròn giữa cây và lớp lá.', 'Khi có dấu hiệu đầu tiên của sự phá hoại của sâu bọ, hãy xử lý bãi cỏ của bạn bằng Ortho® BugClear ™ Insect Killer for Grassns & Landscapes Concentrate . Nó có thể được sử dụng trong bình xịt hoặc kết nối với ống của bạn bằng Máy phun kết thúc vòi phun Ortho® Dial N \' . Nó sẽ bắt đầu giết sâu web, cũng như các loại côn trùng được liệt kê khác, trong vòng vài phút.', 'Manitoba đến Texas và về phía tây; lẻ tẻ về phía đông đến các bang New England', 'null', 'insect_Loxostege_sticticalis/29504.jpg', 'Loxostege', 'null'),
('Lymantria sp', 'Sâu  róm', 'insect_Lymantria_sp', 'Vòng đời của chúng: Trứng - Sâu - Nhộng - Bướm. Bướm đẻ trứng lên cây cỏ, trứng nở thành sâu. Khi thời tiết nắng, nóng, ẩm, sâu bò đi tìm nơi khác khô ráo như hốc cây, khe đá, chuồng trại, nhà ở để tránh mưa và làm tổ tạo kén hóa nhộng. Nơi có điều kiện thuận lợi sâu có rất nhiều, từ vài chục con đến hàng trăm con trên một mét vuông, chúng bò hàng đàn hướng vào nhà, mỗi giờ chúng có thể đi được một đoạn đường dài 5 đến 6m. Mùa phát triển của sâu róm vào khoảng tháng 3 đến cuối tháng 6.', '', '', '', '', 'null', '', 'Lymantria', 'null'),
('lytta polita', 'bọ cánh cứng phồng rộp, màu đồng', 'insect_lytta_polita', 'Trứng được đẻ thành khối dưới đất hoặc dưới đá (Meloinae) hoặc trên cây thức ăn của người trưởng thành (Nemognathinae). Sự phát triển của ấu trùng là siêu biến hình, với bốn giai đoạn riêng biệt.Trong giai đoạn đầu tiên hoặc triungulin (T), ấu trùng tự đến nơi kiếm ăn (hầu hết Meloinae) hoặc bám vào ong trưởng thành và được mang đến đó (Meloini (không phải ở Florida) và Nemognathinae). Sau khi cho ăn để bổ sung, ấu trùng, qua quá trình lọc sinh thái, trở thành dạng bọ hung và bước vào thời kỳ phát triển nhanh chóng (giai đoạn đầu tiên, FG) kéo dài cho đến cuối năm hoặc sáu tuổi. Ở một số loài săn ong, ấu trùng FG chỉ sử dụng một tế bào duy nhất, trong khi ở một số loài khác, nó đào sâu vào các tế bào lân cận và nuốt chửng bên trong của chúng. Ở Meloinae, ấu trùng FG được cho ăn đầy đủ thường đào một khoang ngoài nơi cho ăn. Trong trường hợp sáu hoặc bảy, ấu trùng thường trở nên xơ cứng nặng và bất động (giai đoạn coarctate, C). Trong giai đoạn này, cơ bắp trải qua quá trình thoái hóa sâu sắc và quá trình hô hấp bị giảm xuống mức cực kỳ thấp, cho phép tồn tại hơn một năm, nếu cần thiết. Khi sự phát triển tiếp tục, các cơ sẽ tái sinh và, qua quá trình lọc sinh thái, ấu trùng một lần nữa trở thành dạng bọ hung (giai đoạn grub thứ hai, SG); tại thời điểm này, nó có thể khai quật hoặc không thể khai quật một buồng nhộng. Nemognathinae khác thường ở chỗ ấu trùng SG và nhộng sau cùng và con trưởng thành được bao bọc bởi lớp da nguyên vẹn nhưng còn nguyên vẹn của ấu trùng FG và ấu trùng C.', 'Con trưởng thành là những con bọ chân dài, thân mềm với đầu lệch, lộ ra ngoài hoàn toàn và đột ngột bị thắt lại phía sau để tạo thành một cái cổ hẹp bất thường, pronotum ở đầu trước hẹp hơn nhiều so với đuôi sau và không có vân (keeled) ở bên, các khoang ở trước mở ra phía sau, và (ở tất cả các loài ở Florida), mỗi móng vuốt ở đuôi lại tách ra thành hai lưỡi. Chiều dài cơ thể thường dao động từ 3/4 đến 2 cm ở các loài Florida. Bọ cánh cứng (họ Meloidae) thường bị nhầm lẫn với các loài bọ trong họ Oedemeridae (bọ phồng giả) (Arnett 2008) và phân họ Tenebrionidae Lagriinae (bọ có khớp dài).', 'Trong suốt vòng đời của chúng. bọ cánh cứng nâu gây ra sự tàn phá cho thực vật. Trong thời kỳ nhộng chúng ăn rễ cây.\r\n\r\nVào mùa xuân hoặc đầu mùa hè, bọ cánh cứng trưởng thành đẻ trứng trong đất. Những quả trứng này nở ra và trở thành ấu trùng. Những con sâu trắng hình chữ C có đầu sẫm màu và ăn rễ cây, thường gây ra thiệt hại nghiêm trọng. Ấu trùng ở trong đất cho đến mùa xuân năm sau, khi chúng nhộng và trưởng thành. Căn cứ vào đặc điểm này ta cần diệt những con sâu này trước khi nó gây ra thiệt hại đáng kể cho vườn bưởi !', 'Nên xử lý đất trước khi trồng thường xuyên, rải thuốc ngừa bọ cánh cứng. Các loại thuốc như Regent, Configent hoặc dùng thuốc nước tưới gốc cây như Pyrinex, Sairifos,…Luân canh với các loại cây trồng. Cày bừa thật kỹ, thu dọn sạch tàn dư thực vật và phơi ải.\r\nChăm sóc, thường xuyên kiểm tra lá đọt để phát hiện sớm và phòng trừ.\r\nBảo vệ thiên địch (kiến, đuôi kiềm), thiên địch ký sinh (ong ký sinh ấu trùng), nấm ký sinh…\r\nCây bị bọ gây hại nên tiêu huỷ các lá non để tiêu diệt trứng, ấu trùng nhộng và thành trùng.', 'Bắc Mỹ, chỉ chiếm một phần nhỏ trong tổng số ở Hoa Kỳ, nhưng gần gấp ba lần so với Tây Ấn', 'null', 'insect_lytta_polita/34759.jpg', 'Lytta', 'null'),
('Mantis', 'Bọ ngựa', 'insect_Mantis', ' Là loài côn trùng cỡ lớn, dài 40 – 80 mm, có hai cánh trước và hai cánh sau phát triển rộng. Hai cánh sau trông như tấm kính và chỉ ở viền trước trên đầu mút, cánh có màu xanh lá cây nhạt hoặc nâu nhạt. Đốt ngực trước dạng ống kéo dài và ở phía trong các xư­ơng chậu của đôi chân trước có 1 chấm đen, thường với một điểm nâu sáng ở chính giữa. Đôi chân trước có dạng l­ưỡi kiếm, bờ trong có răng, dùng để bắt mồi và chiến đấu với kẻ thù. Con cái thường lớn hơn con đực (Cái 48 – 76 mm; đực 40 – 61 mm). Màu sắc thay đổi theo màu của nơi ở (nhất là khi rình mồi): màu thường xuất hiện xanh lá cây, màu cỏ úa hoặc vàng, nâu. Chúng có mắt được ghép bởi nhiều tế bào thị giác khác nhau giúp chúng có thể nhìn từ khoảng cách rất xa.', 'null', 'null', 'null', 'null', 'null', '', 'Mantis', 'null'),
('Mecapoda elongata', 'Vạc sành hại bắp', 'insect_Mecapoda_elongata', 'Chiều dài cơ thể từ 55-70 mm, màu xanh hay nâu xám với những đốm đậm trên cánh trước đối với thành trùng cái. Bộ phận đẻ trứng hơi cong và thường dài bằng thân mình.\n\nCó râu đầu rất dài, tuổi thọ từ 25-30 ngày đối với thành trùng cái, còn đối với thành trùng đực khoảng 23-28 ngày.\n\nTrứng được đẻ bên trong một cái bọc, thời gian ủ trứng từ 15-22 ngày.\n\nẤu trùng màu xanh, cơ thể giống thành trùng nhưng râu đầu không dài bằng, có 4 tuổi, phát triển trong thời gian từ 30-40 ngày.', '', '', '', '', 'null', '', 'Mecopoda', 'null'),
('Melanagromyza sojae', 'Ruồi đục thân', 'insect_Melanagromyza_sojae', 'Thành trùng là loại ruồi rất nhỏ, màu đen, thường thấy đậu trên lá non vào buổi sáng. Con cái dùng ống nhọn ở cuối bụng để đẻ từng trứng vào trong mỗi lỗ đục trên mặt lá. Trứng nở sau độ 2 ngày. Ấu trùng đục thành đường hầm ngoằn ngoèo trên mặt lá rồi đục qua cuống để vào thân và đục xuống gốc để làm nhộng trong phần vỏ của gốc cây con. Ấu trùng có 3 tuổi và thời gian phát triển làm hại cây đậu lâu độ 7-10 ngày. Nhộng có hình trụ, màu nâu bóng và kéo dài độ 7 ngày.\n', '', '', '', '', 'null', '', 'Melanagromyza', 'null'),
('Melanitis leda ismene', 'Sâu sừng xanh', 'insect_Melanitis_leda_ismene', ' ', '', '', '', '', 'null', '', 'Melanitis', 'null'),
('Melanotus spp.', 'giun xoắn', 'insect_Melanotus_spp', 'Cùng xem chu kỳ sinh học của loại sâu hại cây ăn quả này như thế nào nhé. Những con trưởng thành chủ yếu trú ẩn trên mặt đất cho đến cuối mùa hè. Đó là từ giai đoạn này, nơi chúng bắt đầu xuất hiện và trùng hợp với sự đâm chồi của cây ăn quả. Đây là nguyên nhân khiến các loại cây trồng này bị ảnh hưởng. Những người lớn trở ra rất đói sau cả mùa đông dưới mặt đất. Điều này xảy ra ít nhiều vào cuối tháng Hai và đầu tháng Ba. Chúng bắt đầu ngấu nghiến tất cả các chồi non, chồi non và cuống lá trên đường đi của chúng. Sau khoảng 40 ngày cho ăn, chúng bắt đầu sinh sản. Mùa sinh sản kéo dài từ tháng Năm đến tháng Chín.Nhiệt độ mùa xuân và mùa hè ôn hòa hơn đối với sâu bệnh, vì vậy mỗi con cái có thể đẻ từ 350 đến 400 trứng trên mặt đất và cách thân cây chưa đầy một mét. Độ sâu của mặt đất nơi nó đẻ trứng xấp xỉ từ 0.5 đến 2 cm. Chỉ trong khoảng 10 ngày, trứng nở thành ấu trùng và tiến về phía rễ cây. Bên trong rễ chúng phát triển dài đến 7-10 cm', 'Loài giun này mảnh mai, có khớp nối, thường có vỏ cứng, có ba cặp chân và có màu nâu rám nắng. Đây là giai đoạn chưa trưởng thành của bọ kích, chúng đẻ trứng trên đất trong tháng 5 và tháng 6. Cỏ, sod và sorghum-sudangrass là những nơi đẻ trứng ưa thích. Trứng nở để trở thành giun xoắn ăn hạt, rễ, củ và các mô thực vật khác dưới mặt đất. Giun dây kiếm ăn trong vài năm trước khi hóa nhộng và xuất hiện khi trưởng thành. Do đó, vấn đề về sâu mọt vào mùa xuân có thể có nghĩa là đã có một loại cỏ hấp dẫn xuất hiện trong vòng 3-5 năm trước. Giun đũa cũng thích đất ẩm ướt và nhiệt độ vừa phải; chúng di cư lên để đến vùng đất ấm hơn, nhưng xuống dưới để tránh quá lạnh, nóng hoặc hạn hán.', 'Chúng gầy và ăn rễ và củ của các loại cây trồng như ngô, khoai tây và lúa mì. Chúng được coi là một loài gây hại khi chúng di chuyển từ cây này sang cây dưới đất và có thể làm như vậy trong nhiều năm trước khi hóa nhộng thành con trưởng thành.', 'Thông thường người trồng sử dụng lớp phủ hàng nổi trên các cây trồng sớm để loại trừ côn trùng gây hại, chỉ phát hiện ra rằng những loài gây hại cây con này gây ra rắc rối ngay bên dưới lớp phủ. Loài gây hại này thường trú ngụ trong đất, đặc biệt là những nơi có cây che phủ tươi tốt, và sẽ tìm kiếm thức ăn và nơi đẻ trứng ngay khi chúng hoạt động vào mùa xuân.', 'Murcia, Cộng đồng Valencia, Extremadura và Aragon là nơi có tầm quan trọng nhất.', 'null', 'insect_Melanotus_spp/10931.jpg', 'Melanotus', 'null'),
('Menida formosa', 'Bọ xít vân đen', 'insect_Menida_formosa', 'Bọ xít trưởng thành có xu tính với ánh sáng. Ban ngày sợ nắng nên thường ẩn náu dưới khóm lúa, buổi chiều tối hoặc những ngày râm mát có thể bò lên phía trên để gây hại.\n\nThời gian sinh trưởng phát dục các giai đoạn của bọ xít đen:\n\n- Trứng 3 - 8 ngày, trung bình 5 ngày\n\n- Bọ xít non 35 - 53 ngày, trung bình 40 ngày\n\n- Trưởng thành sống từ 10 - 10,5 tháng', '', '', '', '', 'null', '', 'Menida', 'null'),
('Menida histrio', 'Bọ xít vân đỏ', 'insect_Menida_histrio', '', '', '', '', '', 'null', '', 'Menida', 'null'),
('Metcalfa pruinosa', 'Rầy bướm', 'insect_Metcalfa_pruinosa', 'Rầy trưởng thành dài khoảng 20mm, cánh màu xanh lá nhạt, khi đậu cánh xếp lại dạng tam giác. Sau khi vũ hoá 10 – 15 ngày, rầy đẻ trứng thành hàng hay từng cụm ở mặt dưới lá nhất là ở gân giữa, cành non, cuống trái. Trứng mới đẻ có màu trắng, khi sắp nở chuyển sang nâu. Giai đoạn ủ trứng khoảng 10 ngày. Ấu trùng mới nở  thường sống ở mặt dưới lá, sau di chuyển dần và gây hại ở lá, cành non, cuống trái, hoa, nhất là ở nơi rậm rạp. Vào giai đoạn nầy cơ thể rầy non được bao phủ một lớp tơ, sáp mịn màu trắng. Giai đoạn ấu trùng khoảng 40 ngày.', '', '', '', '', 'null', '', 'Metcalfa', 'null'),
('Metura elongatus', 'Sâu  loa kèn', 'insect_Metura_elongatus', 'Bướm hoạt động vào ban ngày, có tính ăn thêm thường là đi hút mật hoa, bay khoẻ. Giao phối và đẻ trứng vào buổi sáng. Trứng được đẻ rải rác ở mặt dưới  của lá rau. Một bướm cái đẻ khoảng 120 – 140 trứng.\n\nNhộng thường vũ hoá về ban đêm, trưởng thành thường hoạt động về ban đêm còn ban ngày thì ẩn nấp ở trong bụi cỏ hay trong tán cây. Ngài có xu tính với ánh sáng đèn yếu nhưng lại có xu tính với ánh sáng đèn cực tím (cực đen), trưởng thành có tính ăn thêm.\n\nSau khi vũ hoá thì trưởng thành bắt đầu giao phối, hoạt động giao phối diễn ra từ chập tối đến sáng hôm sau, sau khi giao phối được 2 – 3 ngày thì trưởng thành bắt đầu đẻ trứng.\n\nNgài có tập tính là đẻ trứng rải rác trên các lá non hay trên hoa, thời gian đẻ trứng kéo dài từ 7 – 13 ngày, một ngài cái có thể đẻ được từ 200 – 3000 trứng đặc biệt nếu ngài được hút nhiều mật hoa thì số lượng trứng đẻ được nhiều hơn. Sau khi đẻ trứng thì ngài chết tuy nhiên trong bụng của nó vẫn còn trứng.\n\nSau khi trứng đẻ được từ 2- 12 ngày thì bắt đầu nở, sau khi nở sâu non ăn một phần hoặc tất cả vỏ trứng rồi mới chuyển sang phá hại cây.\n\n\n \n\nSâu non hoạt động mạnh, bò lung tung tìm nơi có thức ăn thích hợp để gây hại.\n\nSâu non đẫy sức chui suống đất hoá nhộng ở độ sâu 2 – 3 cm, trước khi hoá nhộng nó làm một kén bằng đất rồi nằm trong đó hoá nhộng và khi nhộng hoá trưởng thành thì sẽ bò lên mặt đất qua một đường làm sẵn.\n\nQuá trình phát triển cá thể của Sâu xanh trải qua 4 giai đoạn, thời gian phát dục các giai đoạn của sâu có liên quan tới điều kiện về nhiệt độ, độ ẩm và thức ăn nhưng nhìn chung thời gian phát dục các giai đoạn của sâu như sau: Trưởng thành sống 10 – 18 ngày (trưởng thành cái) và 6 – 11 ngày (trưởng thành đực), sâu non 16 – 26 ngày. Vòng đời trung bình của Sâu xanh trên đồng ruộng  là từ 36 – 70 ngày.', '', '', '', '', 'null', '', 'Metura', 'null'),
('Mictis longicornis', 'Bọ xít', 'insect_Mictis_longicornis', 'Trứng đẻ thành ổ, từ 1-2 hàng dọc trên cả hai mặt lá lúa (từ 10-15 quả). Đa số đẻ ở mặt trên và ngoài mép lá, có khi đẻ trên bẹ lá. Trứng nở vào buổi sáng. Trứng hình bầu dục, có vết lõm ở giữa, mới đẻ có màu trắng đục, sau chuyển dần màu nâu. Bọ xít non có hình dáng giống trưởng thành, có màu vàng lục. Vòng đời của bọ xít dài khoảng 31,5-37 ngày, trong đó:\n\nGiai đoạn trứng: 6-7 ngày.\nGiai đoạn sâu non: 17-22 ngày.\nGiai đoạn trưởng thành: 7-8 ngày.\nBọ xít non mới nở sống tập trung quanh ổ trứng, nhưng chỉ sau 2-3 giờ là phân tán lên bông lúa để chích hút nhựa cây và sau 2-5 ngày lột các lần thứ nhất. Con trưởng thành đẻ hoạt động giao phối vào ban ngày, nhất là lúc sáng sớm và chiều mát, buổi trưa nằm im. Một con cái đẻ trung bình từ 250-300 trứng, bọ xít trên lúa đẻ khoẻ hơn trên cỏ. Bọ xít dài trưởng thành khi hút dịch ở bông lúa non nếu bị khua động thì rơi ngày xuống và lẩn trốn ngay lập tức.', '', '', '', '', 'null', '', 'Mictis', 'null'),
('Miridae', 'rệp cây, rệp lá', 'insect_Miridae', 'Trứng được ký sinh trong các mô mềm của các điểm đang phát triển như cuống lá và nách cành. Thời gian phát triển của Nymphal trung bình là 18 ngày, và tổng vòng đời hoàn thành trong khoảng 22 ngày. Tuổi thọ trưởng thành của con cái là 15 ngày; ở nam giới, tuổi thọ ít hơn một tuần', 'Miridae là loài côn trùng sống trên cạn, nhỏ, thường có hình bầu dục hoặc thuôn dài và có chiều dài dưới 12 mm (0,5 in). Nhiều người trong số họ có cái nhìn gù vì hình dạng của phần lồi, phần đầu cúi xuống. Một số có màu sắc rực rỡ và có hoa văn hấp dẫn, số khác thì xám xịt hoặc tối, hầu hết đều không dễ thấy. Một số chi là giống kiến ​​ở một số giai đoạn nhất định của cuộc đời. Họ Miridae không có bất kỳ ocelli nào. Rostrum của họ có bốn phân đoạn. Một tính năng hữu ích trong việc xác định các thành viên của gia đình là sự hiện diện của một con cuneus; nó là đỉnh hình tam giác của corium, phần cứng, sừng của cánh trước, hemelytron. Cuneus có thể nhìn thấy ở gần như tất cả các họ Miridae, và chỉ ở một số họ Hemiptera khác, đặc biệt là họ Anthocoridae, không giống họ Miridae về các mặt khác. Các tarsi hầu như luôn luôn có ba đoạn.', 'Bọ thực vật là họ phổ biến nhất trong bộ Hemiptera-Heteroptera. Chúng thường được phát hiện ăn thực vật hoặc đậu trên lá. Một số loài thuộc họ này là động vật ăn cỏ và những loài khác là động vật ăn thịt. Những sinh vật nhỏ, thân mềm này được phân biệt bằng bốn râu phân đoạn, một cái mỏ và một cái cuneus ở hai cánh trước.', 'Cũng như nhiều loài côn trùng khác, thời gian ngắn ngày và nhiệt độ giảm thường xuyên gây ra hiện tượng chết máy thường xảy ra trong giai đoạn trứng. Đây là trường hợp của nhiều loài Miridae, chúng đẻ trứng ở các phần già hơn hoặc cành cây 1 năm tuổi, và đối với một số họ Anthocoridae, Microphysidae, Reduviidae và Lygaeidae. Trong số họ Nabidae, Himacerus apterus, loài ngủ đông ở giai đoạn trứng, xuất hiện như một ngoại lệ.', 'khắp thế giới', 'null', 'insect_Miridae/52418.jpg', 'Miridae', 'null'),
('Mycalesis horsfieldi', 'Sâu sừng xanh nhỏ', 'insect_Mycalesis_horsfieldi', '', '', '', '', '', 'null', '', 'Mycalesis', 'null'),
('Mythimna loreyi', 'Sâu cắn lá ngô', 'insect_Mythimna_loreyi', 'Trứng hình cầu, đẻ thành ổ xếp với nhau như dạng vẩy cá. Trứng mới đẻ màu trắng sữa, sau chuyển sang màu nâu. Sâu non màu nâu nhạt, đầu màu nâu vàng, có vân mạng lưới không theo quy luật. Trên lưng dọc theo cơ thể có 4 vạch nâu thẫm. Khi cây ngô còn nhỏ sâu thường hoá nhộng trong đất ở độ sâu 2- 5 cm, khi cây ngô đã trỗ cờ thì sâu hoá nhộng ngay trên bẹ lá, lá bi hoặc trong bắp. Nhộng dài 18 - 19mm, màu cánh gián nhạt hoặc sẫm. Bướm trưởng thành thân dài 14 - 18mm, sải cánh 25 - 30mm. Đầu ngực màu nâu tro. Cánh trước nâu nhạt hoặc nâu vàng. Cánh sau màu trắng, mạch cánh và mép ngoài màu nâu.', '', '', '', '', 'null', '', 'Mythimna', 'null'),
('Mythimna separata', 'Sâu cắn gié', 'insect_Mythimna_separata', ' Vòng đời: 45-60 ngày\n\n- Trứng: 3-5 ngày\n\n- Sâu non: 25-35 ngày\n\n- Nhộng: 5-7 ngày\n\n- Trưởng thành: 7-10 ngày\n\nBướm hoạt động về đêm, ban ngày ẩn nấp dưới gốc lúa hoặc đám cỏ, thích mùi vị chua ngọt. Bướm có sức bay mạnh, có thể bay xa hàng chục cây số. Mỗi con cái có thể đẻ hàng ngàn trứng.\n\nSâu non mới nở tập trung ở ngọn lá, sau di chuyển xuống thân lúa, ban đêm bò lên ăn lá hoặc cắn gié lúa.\n\nSâu phát triển thích hợp trong điều kiện thời tiết ẩm và mát. Những năm mưa nhiều sâu cắn gié thường phát sinh mạnh do không khí mát mẻ và thiên địch trên ruộng bị suy giảm.', '', '', '', '', 'null', '', 'Mythimna', 'null'),
('Myzus persicae', 'Rệp, rệp đào', 'insect_Myzus_persicae', 'Vòng đời của rệp đào xanh thay đổi đáng kể, và phần lớn phụ thuộc vào nhiệt độ mùa đông.  Rệp đào xanh có thể hoàn thành một thế hệ sau 10 đến 12 ngày. Hơn 10 thế hệ có thể xảy ra trong một năm và thậm chí có thể lên đến 30 - 40 thế hệ trong điều kiện khí hậu thuận lợi. Vào đầu mùa xuân, trứng nở và nhộng gây hại bằng cách ăn chồi, hoa, tán lá non cũng như thân cây. Thiệt hại nặng nhất là vào đầu mùa hè cho đỉnh điểm sinh sản của rệp, vì các chất phát tán có cánh từ Prunus spp nơi trứng của rệp sinh sản ở giai đoạn mùa đông ký sinh nhộng trên vật chủ mùa hè di chuyển sang thuốc lá, khoai tây và các loại rau họ cải để gây hại liên tục sau một vài thế hệ.', '', '', '', '', 'null', '', 'Myzus', 'null'),
('Nadezhdiella cantori', 'Sâu đục cành', 'insect_Nadezhdiella_cantori', 'Thành trùng màu nâu, cạnh ngoài cánh trước có những sọc ngang gẫy khúc rất rõ và sát rìa cánh có một hàng chấm đen. Chúng đẻ trứng trên chồi non hoặc trên lá. Trứng nhỏ, mới đẻ có mầu trắng nhưng trở nên nâu khi sắp nở. Ấu trùng có màu hồng, thời gian ủ trứng: 2- 4 ngày, ấu trùng có 5 tuổi. Chúng đục vào trong chồi non và bông, chồi bị hại thường bị héo, khô và không cho bông. Nếu sâu tấn công trên chùm bông sẽ làm bông bị rụng.', '', '', '', '', 'null', '', 'Nadezhdiella', 'null'),
('Naranga aenescens', 'Sâu đo xanh', 'insect_Naranga_aenescens', 'Thành trùng: Thành trùng loài Pseudoplusia includen Walker là một loài bướm sức bay khỏe, màu nâu sẫm dài 3 - 4 cm màu nâu với 2 đốm trắng ở giữa cánh trước. Tới xuân bướm xuất hiện và đẻ trứng trên những cây chủ khác (rau hoặc cây họ đậu khác). Trong một năm, nó có thể có một vài thế hệ.Ấu trùng: Khi trưởng thành, sâu non của sâu cuốn lá lớn hơn sâu xanh non, có màu xanh với những sọc sáng chạy đọc theo cơ thể, thường ở chân và đầu sâu đo có màu đen, sâu đo có phần đuôi to và nhỏ dần về phần đầu. Khi sâu di chuyển, phần giữa có thể tạo thành hình cong như con người đo gang tay cho nên nó có tên là sâu đo.Nhộng: Giai đoạn sâu non kết thúc trong vòng 14 - 21 ngày, sau đó nhộng suất hiện, nằm bám vào cây đậu bằng những sợi tơ. Sâu cuốn lá qua đông dưới dạng nhộng đến mùa hè, sau 14 ngày bướm xuất hiện.', '', '', '', '', 'null', '', 'Naranga', 'null'),
('Nephotettix bipunctatus', 'Rầy xanh đuôi đen', 'insect_Nephotettix_bipunctatus', 'Vòng đời: 25-30 ngày\n\n- Trứng: 3-5 ngày\n\n- Ấu trùng: 15-17 ngày\n\n- Trưởng thành: 7-10 ngày\n\nRầy trưởng thành ưa ánh sáng đèn, có thể bay xa tới vài cây số. Rầy cái đẻ trứng ở gân chính của lá hoặc mô bẹ lá lúa còn non, thành từng ổ 4 - 50 trứng/ổ. Mỗi con cái đẻ vài trăm trứng.\n\nSau khi nở, rầy non thường sống tập trung ở nơi râm mát, ẩm thấp. Khi mật số lên cao thường phân tán đi nơi khác nên ít khi đạt đến mật số gây cháy rầy.\n\nRầy còn là môi giới truyền các bệnh virus sang các cây lúa khỏe.\n\nRầy thích nơi ẩm, rậm rạp, thời tiết nắng nóng, hạn gay gắt có mưa giông xen kẽ thường là điều kiện thuận lợi cho rầy xanh đuôi đen phát triển mạnh. Lúa thường bị rầy xanh đuôi đen gây hại nặng ở thời kỳ mưa ít, nhiệt độ thấp và ẩm độ cao.\n\nRầy thường xuất hiện ở những ruộng trũng, vào thời kỳ lúa làm đòng đến ngậm sữa, ở những năm mưa nhiều tiếp theo là nắng khô, nhiệt độ cao.\n\nMột năm rầy phát sinh khoảng 8 lứa, trong đó cần chú ý lứa 3: từ đầu tháng 4 (dl) - cuối tháng 6. Lứa 4 (lứa thứ nhất trong vụ mùa): từ cuối tháng 5 - đầu tháng 8, lứa 5: từ cuối tháng 7 – trung tuần tháng 8.', '', '', '', '', 'null', '', 'Nephotettix', 'null'),
('Nezara viridula', 'Bọ xít xanh', 'insect_Nezara_viridula', 'Hành trùng có màu xanh lá cây, bóng với chiều dài cơ thể 20–22 mm, chiều rộng 15–16 mm. Kim chích hút dài đến cuối bụng. Rìa ngực trước có 2 gai nhọn, hai bên mép bụng có rìa răng cưa. Chính giữa mặt bụng có một đường nổi rõ rệt. Ấu trùng có 5 tuổi, ấu trùng mới nở dài khoảng 2,5–3 mm.\n\nỞ các tuổi khác, ấu trùng đều có màu vàng tươi, trên ngực, cánh và bụng có nhiều đốm đen, các đốm rất to và đen sẫm ở tuổi nhỏ, khi ấu trùng lột xác lớn lên các đốm nhỏ dần. Mầm cánh của ấu trùng tuổi 5 đã lộ rất rõ bên ngoài cơ thể. Trứng rất tròn, mới đẻ có màu trắng trong, sau đó chuyển sang màu vàng nhạt, khi sắp nở, trứng có màu đen trên phần đầu.', '', '', '', '', 'null', '', 'Nezara', 'null'),
('Nilaparvata lugens', 'Rầy nâu,', 'insect_Nilaparvata_lugens', 'Con cái di cư vào ruộng lúa ngay sau khi cấy, đẻ các nhóm từ 5-15 trứng vào các bẹ hoặc gân giữa của lá. Nhộng non đầu tiên nở sau 5-9 ngày; chúng lột xác năm lần trong khoảng thời gian 2-3 tuần. Ban đầu, hầu hết chúng phát triển thành những con trưởng thành thiếu máu não: nhưng khi mật độ dân số tăng lên, hoặc nếu thức ăn trở nên khan hiếm, thì tỷ lệ phát triển thành dạng đại thực bào sẽ tăng lên. Trong thời gian trưởng thành của chúng từ 10-30 ngày, mỗi con cái thuộc họ đại thực bào đẻ khoảng 100 trứng, con cái thuộc họ lông đen từ 300 đến hơn 700. Ở vùng nhiệt đới, N. lugens hoạt động quanh năm, và sinh sản 3-6 thế hệ mỗi vụ. Nó không có khả năng đông lạnh quá ở các vùng ôn đới, vì vậy nó di cư vào các vùng này vào mùa xuân, thường là sau khi đi một quãng đường dài.', 'Rầy nâu là loài lưỡng hình, với các dạng \'đại thực bào\' có cánh hoàn toàn và cánh cụt. Các dạng đại thực bào có khả năng là những người di cư và chịu trách nhiệm định cư các cánh đồng mới. Sau khi định cư trên cây lúa, chúng tạo ra thế hệ tiếp theo, nơi hầu hết các côn trùng cái phát triển thành các chương và con đực là các chương lớn. Con trưởng thành thường giao phối vào ngày xuất hiện, và con cái bắt đầu đẻ trứng từ ngày sau khi giao phối. Những con cái thuộc bộ lông to đẻ từ 300 đến 350 trứng, trong khi những con cái thuộc bộ lông to đẻ ít trứng hơn. Trứng đâm theo đường thẳng nói chung dọc theo vùng giữa của bẹ lá. Trứng nở trong khoảng sáu đến chín ngày. Nhộng non mới nở có màu trắng bông, và chuyển sang màu nâu tím trong vòng một giờ.', 'Rầy nâu xâm nhập vào cây lúa ở tất cả các giai đoạn phát triển của cây. Do cả nhộng và nhộng trưởng thành ăn ở gốc của đẻ nhánh, cây chuyển sang màu vàng và khô héo nhanh chóng. Trong giai đoạn nhiễm bệnh ban đầu, các mảng màu vàng tròn xuất hiện, sau đó sẽ sớm chuyển sang màu nâu do cây bị khô héo. Tình trạng này được gọi là \'cháy phễu\'. Nhiệt độ là một yếu tố quan trọng ảnh hưởng đến hoạt động sống của loài côn trùng này. Khả năng nở và tỷ lệ sống sót cao nhất vào khoảng 25 ° C. Trứng rất nhạy cảm với sự hút ẩm và sớm teo đi khi cây chủ bắt đầu héo. Tăng trưởng quần thể rầy nâu là tối đa trong phạm vi nhiệt độ từ 28 đến 30 ° C [cần dẫn nguồn].', 'Việc sử dụng quá nhiều urê làm phân đạm và thuốc trừ sâu có thể dẫn đến bùng phát dịch bệnh do làm tăng khả năng sinh sản của rầy nâu và làm giảm quần thể thiên địch. Theo đó, phương pháp tiếp cận quản lý dịch hại tổng hợp (IPM) chính bao gồm hạn chế việc sử dụng không thích hợp và quá mức các đầu vào này. Ví dụ vào năm 2011, chính phủ Thái Lan đã công bố sáng kiến ​​ứng phó với đợt bùng phát rầy nâu lớn bằng cách hạn chế các loại thuốc trừ sâu gây bùng phát dịch bao gồm abamectin và cypermethrin; quyết định được hỗ trợ bởi Viện Nghiên cứu Lúa gạo Quốc tế (IRRI). IRRI cũng đưa ra các khuyến nghị trong một kế hoạch hành động để giúp quản lý thông minh sự bùng phát của rầy. Vào tháng 12 năm 2011, IRRI đã tổ chức một hội nghị tại Việt Nam để giải quyết các mối đe dọa của việc lạm dụng thuốc trừ sâu và tìm ra các giải pháp để giảm thiểu. \r\nCác giống lúa kháng rầy nâu, ví dụ: IR64, rất quan trọng để ngăn ngừa bùng phát. Tuy nhiên, ở những khu vực ít sử dụng thuốc trừ sâu, mức độ kháng rầy nâu cao thường không cần thiết.  Sự đột biến hóa học có thể làm tăng hoặc giảm đáng kể mức độ kháng rầy nâu của cây lúa. Một số hóa chất diệt côn trùng, ví dụ: imidacloprid, có thể ảnh hưởng đến sự biểu hiện gen của lúa và do đó làm tăng tính nhạy cảm với rầy nâu. \r\n\r\nTrong một nỗ lực để làm cho việc kiểm soát rầy nâu cụ thể hơn cho từng loài, các nhà nghiên cứu đang cố gắng phát triển các phương pháp tắt các gen BPH cụ thể để tiêu hóa, phòng thủ- và chuyển hóa xenobiotic. Nhiều gen mới cho các chức năng này đã được phát hiện trong mô từ ruột của rầy nâu. \r\n\r\nMột số lectin thực vật là chất kháng rầy nâu và nếu được pha chế đúng cách có thể có khả năng bảo vệ lúa khỏi rầy nâu. sử dụng laal đa dạng kháng', 'Rầy nâu phân bố khắp Australia, Bangladesh, Bhutan, Miến Điện (Myanmar), Campuchia, Trung Quốc, Fiji, Ấn Độ,  Indonesia, Nhật Bản, Bắc và Hàn Quốc, Lào, Malaysia, Ấn Độ, Nepal, Pakistan, Papua New Guinea, Philippines, Sri Lanka, Đài Loan, Thái Lan và Việt Nam', 'null', 'insect_Nilaparvata_lugens/04297.jpg', 'Nilaparvata', 'null'),
('Nipaecoccus vastalor', 'spherical mealybug', 'insect_Nipaecoccus_vastalor', 'quần thể N. viridis đạt đỉnh vào tháng 5 và tháng 10 (Jarjes et al., 1989). Có mối tương quan thuận đáng kể giữa mật độ dân số và nhiệt độ, và mối tương quan âm với độ ẩm tương đối. Các con cái của N. viridis mỗi lần đẻ 90-138 trứng, và giai đoạn trứng và nhộng kéo dài lần lượt là 10-13 và 31-43 ngày. Quá đông diễn ra khi trứng, nhộng và con trưởng thành.', 'Trứng có màu tím sẫm và do con cái đẻ ra có màu vàng nhạt đến trắng do các sợi sáp tạo thành. Các trường hợp ấu trùng đực và cái được mô tả và minh họa bởi Ghosh và Ghose (1989). Ghose và Ghosh (1990) cung cấp các chìa khóa cho ấu trùng cái thứ nhất, ấu trùng cái thứ hai và thứ ba và con cái trưởng thành.', 'N. viridis mỗi năm (Cilliers và Bedford, 1978). Thế hệ tháng 9-10 của con cái trưởng thành đẻ trứng nở trong tháng 10-12. Các loài bò sát di cư và định cư chủ yếu trong các khu bảo tồn, dưới các lá đài của quả con khi chúng có kích thước bằng hạt đậu hoặc lớn hơn. Thế hệ thứ hai này trưởng thành vào tháng 11 và đẻ trứng nở vào tháng 12. Thế hệ thứ ba của con cái trưởng thành vào khoảng tháng 3-4.', 'null', 'Châu Phi, Úc, Châu Mỹ, các đảo Thái Bình Dương và Ý', 'null', 'insect_Nipaecoccus_vastalor/60946.jpg', 'Nipaecoccus', 'null'),
