('Noctua pronuba', 'giun lớp', 'insect_Noctua_pronuba', 'Trứng được đẻ trên vật liệu thực vật gần bề mặt đất. Chúng có màu trắng kem khi đẻ và mất ba ngày đến vài tuần để nở tùy thuộc vào nhiệt độ. Những con sâu bướm mới xuất hiện sẽ phát triển với một số moults cho đến khi chúng có kích thước đầy đủ và sau đó thành nhộng trong đất. Bướm đêm chui ra từ nhộng. Có thể mất một tháng hoặc cả năm để hoàn thành vòng đời của một con giun chỉ tùy thuộc vào loài có liên quan và nhiệt độ.', 'Các loài giun chỉ phổ biến nhất xuất hiện trong các khu vườn ở Minnesota là giun đồng, giun nhiều màu, giun đen, giun nhăn nheo, giun thủy tinh và giun quân đội.Bướm đêm trưởng thành là loại côn trùng có kích thước vừa phải, màu nâu hoặc đen với nhiều đốm khác nhau, hoặc các sọc có màu xám, nâu, đen hoặc trắng.\r\n\r\nNhìn chung, chúng có chiều dài cơ thể khoảng 1 inch với các sải cánh có chiều ngang lên đến 1 1/2 inch.\r\nThông thường, cánh trước sẫm màu hơn cánh sau và có hoa văn.', 'Ấu trùng giun chỉ thường sống về đêm. Chúng ẩn mình dưới bề mặt đất, đất đóng cục hoặc thành lớp và đi ra ngoài vào ban đêm để kiếm ăn, mặc dù việc kiếm ăn vào ban ngày trên mặt đất đôi khi xảy ra, đặc biệt là khi ấu trùng ở mật độ cao. Sâu bướm thường cuộn tròn khi bị quấy rầy. Vào ban đêm, những con bướm đêm trưởng thành là những con bay mạnh mẽ và có thể được nhìn thấy xung quanh đèn hoặc trên ô cửa sổ.', 'Biện pháp canh tác: làm đất kỹ, vệ sinh đồng ruộng, xử lý đất trước khi trồng để tiêu diệt mầm mống sâu hại ở trong đất.Biện pháp nhiệt hóa học để xử lý hạt giống, mầm hạt trước khi gieo.\r\n- Đối với sâu chích hút nhựa Quế cần quét vôi vào cây hòa bột cây ruốc cá với xà phòng phun vào sáng sớm hay chiều tối.', 'Châu Âu , Bắc Phi , Quần đảo Canary , Trung Đông , Thổ Nhĩ Kỳ , Iraq , Iran , Afghanistan , tây bắc Ấn Độ , Nga , Novosibirsk Oblast , Caucasus , Transcaucasia và Trung Á', 'null', 'insect_Noctua_pronuba/12817.jpg', 'Noctua', 'null'),
('Nomadacris', 'Châu chấu', 'insect_Nomadacris', 'Trứng là giai đoạn đánh dấu sự bắt đầu vòng đời của châu chấu. Châu chấu đẻ trứng thụ tinh vào giữa mùa hè, chúng đặt trứng xuống đất trong một lỗ nhỏ. Sau đó, châu chấu mẹ tiết một chất dính để kết nối trứng lại một cụm với nhau, đảm bảo rằng con của nó sẽ không bị lạc.Mỗi cụm trứng chứa từ 15 – 150 trứng, tùy thuộc vào loài. Thông thường, một con châu chấu cái có thể đẻ tới 25 cụm trứng. Trứng phải trải qua mùa thu và mùa đông trước khi nở vào mùa xuân hoặc trong những ngày đầu hè.- Âú trùng:Đây là giai đoạn thứ hai trong vòng đời của châu chấu, và là giai đoạn đầu tiên trong hình dạng một con châu chấu. Ấu trùng trông giống những con châu chấu trưởng thành, nhưng chúng không có cánh và thiếu các cơ quan sinh sản.1 Ngày sau khi trứng nở, ấu trùng bắt đầu ăn lá cây và hút nhựa để sống. Giai đoạn này kéo dài khoảng 5-6 tuần trước khi những ấu trùng đạt đến hình thái trưởng thành.\nẤu trùng phải trải qua 5 giai đoạn nhỏ, đó là 5 lần lột da trước khi phát triển hoàn toàn thành châu chấu trưởng thành. Sau mỗi lần lột da, cơ thể ấu trùng phát triển lớn hơn và ở lần lột da cuối cùng chúng sẽ hoàn thiệt đôi cánh.-giai đoạn lột da:Lột da diễn ra trong giai đoạn ấu trùng. Con châu chấu sẽ làm rụng lớp vỏ ngoài của nó nhiều lần trước khi trở thành người lớn.\nLớp vỏ ngoài bao phủ cơ thể của ấu trùng, cung cấp cho nó sự bảo vệ từ những tác động từ bên ngoài nhưng đồng thời cũng ức chế sự tăng trưởng của nó vì lớp vỏ cứng và không có khả năng co giãn. Do đó, chúng phải lột da nhiều lần để phù hợp với sự phát triển của cơ thể. Sau 5 – 6 lần thay đổi lớp vỏ, châu chấu trưởng thành dần xuất hiện với các chức năng hoàn chỉnh.-Trưởng Thành:Một con chấu chấu trưởng thành phải mất đến 1 tháng để hoàn thiện đôi cánh của mình. Châu chấu trưởng thành linh hoạt hơn ấu trùng, nhờ đó chúng dễ dàng lẩn trốn khỏi tầm nhìn của kẻ thù.Ở giai đoạn cuối cùng này, các cơ quan sinh sản được phát triển đầy đủ vì vậy con cái có thể đẻ trứng và con đực có thể thụ tinh. Tuy nhiên, con cái sẽ không giao phối cho đến khi nó được 1 đến 2 tuần tuổi, vì cô ta cho rằng thời điểm mới trưởng thành là chưa đủ trọng lượng để đẻ trứng.Một khi bắt đầu đẻ trứng, con cái vẫn tiếp tục đẻ trứng trong khoảng từ 3 đến 4 ngày cho đến khi nó chết. Những con châu chấu trưởng thành sống khoảng hai tháng, tùy thuộc vào thời tiết.', '', '', '', '', 'null', '', 'Nomadacris', 'null'),
('Nymphula depunctalis', 'Sâu phao', 'insect_Nymphula_depunctalis', 'Trứng nhỏ được đẻ trên lá và để lại bẹ lá thành hàng và theo đợt. Trong điều kiện của Nam Ấn Độ, một con cái đẻ khoảng 150 quả trứng và nở trong khoảng một tuần. Bạn thay đổi thức ăn của ấu trùng bằng cách cạo bỏ bề mặt trái. Ấu trùng tạo ra một vỏ hình trụ, hình ống ra khỏi một phần của lá bị cắt và vẫn ở bên trong nó, di chuyển cùng với vỏ trên lá. Nó ăn lá chủ động và trở nên phát triển hoàn toàn trong khoảng 20 ngày, đạt chiều dài 10-12 mm. Sâu bướm trải qua sáu lần và được đặc trưng bởi sự hiện diện của các mang hình ống trên cơ thể của nó.\n\nMang trở nên phân nhánh cùng với sự phát triển về kích thước của sâu bướm. Các trường hợp lớn hơn được thực hiện bởi các cá thể ấu trùng tiếp theo. Giai đoạn ấu trùng hóa nhộng bên trong thùng cuối cùng. Trước khi hóa nhộng, vỏ được gắn vào bẹ lá trên mực nước và cả hai đầu của nó đều được cắm vào. Thời kỳ nhộng kéo dài khoảng một tuần, sau đó nó được chuyển thành côn trùng trưởng thành. Sâu bệnh hoạt động trong thời kỳ gió mùa và có thể có hai hoặc ba cá bố mẹ trong một mùa. Vòng đời hoàn thành trong khoảng 35-40 ngày.', '', '', '', '', 'null', '', 'Nymphula', 'null'),
('odontothrips loti', 'loài odontothrips loti', 'insect_odontothrips_loti', 'Bọ trĩ đẻ những quả trứng cực nhỏ, dài khoảng 0,2 mm. Những con cái của phân bộ Terebrantia cắt các khe trong mô thực vật bằng ovipositor của chúng và đưa trứng của chúng vào, mỗi cái một cái vào khe. Những con cái thuộc phân bộ Tubulifera đẻ trứng đơn lẻ hoặc thành từng nhóm nhỏ trên bề mặt bên ngoài của thực vật. Bọ trĩ dị hóa, biến chất dần dần sang dạng trưởng thành. Việc đầu tiên hai instars , được gọi là ấu trùng hoặc nhộng, giống như người lớn không cánh nhỏ (thường bị nhầm lẫn với bọ đuôi bật ) mà không cơ quan sinh dục; chúng ăn vào mô thực vật. Ở Terebrantia, cá thể thứ ba và thứ tư, và ở cá thể Tubulifera cũng là cá thể thứ năm, là giai đoạn nghỉ ngơi không cho ăn tương tự như nhộng : trong những giai đoạn này, các cơ quan của cơ thể được định hình lại, chồi cánh và cơ quan sinh dục được hình thành. [60] Giai đoạn trưởng thành có thể đạt được sau khoảng 8–15 ngày; con trưởng thành có thể sống trong khoảng 45 ngày. [61] Con trưởng thành có cả dạng có cánh và không có cánh; trên cỏ bọ trĩ Anaphothrips obscurusVí dụ, dạng có cánh chiếm 90% dân số vào mùa xuân (ở đới ôn hòa), trong khi dạng không cánh chiếm 98% dân số vào cuối mùa hè. [62] Bọ trĩ có thể sống sót trong mùa đông như người lớn hoặc thông qua trứng hoặc nhộng diapause .', 'Cả hai giới hoàn toàn có cánh. Thân và chân màu nâu sẫm, nhạt màu hơn, đoạn III màu vàng, đoạn IV màu nâu nhạt; cánh trước màu nâu với dải màu trắng dưới đáy. Đầu rộng hơn dài; có ba cặp bộ phận tế bào, cặp III dài bằng khoảng cách giữa các mắt kép, phát sinh ở hoặc ngay bên ngoài rìa trước của tam giác tế bào. Ăng-ten 8 phân đoạn; các phân đoạn III – IV bị thắt chặt vào đỉnh, giác quan được chia đôi; cảm giác phân đoạn VI với đế hình bầu dục mở rộng. Pronotum với hai cặp lá dài hình chữ nhật. Đỉnh trước xương chày có móng vuốt nhỏ gần bờ ngoài, cũng có bao lao gần bờ trong. Metanotum lọc yếu; giữa các đốt dài, phát sinh ở rìa trước; hiện tại campaniform sensilla. Tĩnh mạch thứ nhất của cánh trước với hàng định vị thay đổi, thường có khoảng trống dưới đỉnh nhỏ; hàng setal hoàn thành trên tĩnh mạch thứ hai. Bụng mối không có điêu khắc trung gian; tergite VIII với lược sau gốc rộng ngắt quãng ở giữa, với microtrichia mảnh dài ở bên; ctenidium không được phát triển, nhưng đối diện với spiracle là một nhóm nhỏ của microtrichia. Sternites không có đĩa đệm.', 'Cũng như các loài bọ trĩ khác, vòng đời từ trứng đến trưởng thành phụ thuộc vào nhiệt độ. Chu kỳ đầy đủ có thể mất khoảng 15 ngày ( Lewis, 1973 ) đến hơn một tháng và con trưởng thành có thể sống hơn một tháng để tạo ra nhiều thế hệ trong một năm tùy thuộc vào thời tiết theo mùa. Với nhiệt độ nhà kính, thời gian phát triển từ trứng đến trưởng thành có thể giảm xuống còn khoảng một tuần.', 'Do kích thước nhỏ và tốc độ sinh sản cao nên rất khó kiểm soát bọ trĩ bằng biện pháp kiểm soát sinh học cổ điển . Những kẻ săn mồi thích hợp phải đủ nhỏ và mảnh để xâm nhập vào các kẽ hở nơi bọ trĩ ẩn náu trong khi kiếm ăn, đồng thời chúng cũng phải săn mồi rộng rãi trên trứng và ấu trùng để có hiệu quả. Chỉ có hai gia đình của ký sinh Hymenoptera trứng ký sinh và ấu trùng, các Eulophidae và Trichogrammatidae . Các tác nhân kiểm soát sinh học khác của người lớn và ấu trùng bao gồm bọ anthocorid thuộc chi Orius , và bọ ve phytoseiid . Thuốc trừ sâu sinh học như nấm Beauveria bassiana và Verticillium lecaniicó thể diệt bọ trĩ ở tất cả các giai đoạn của vòng đời. [74] Xịt xà phòng diệt côn trùng có hiệu quả đối với bọ trĩ. Nó có bán trên thị trường hoặc có thể được làm bằng một số loại xà phòng gia dụng. Các nhà khoa học ở Nhật Bản báo cáo rằng sự giảm đáng kể ấu trùng và bọ trĩ dưa trưởng thành xảy ra khi cây được chiếu sáng bằng ánh sáng đỏ', 'vùng Holarctic, bao gồm Iran và Trung Quốc, nhưng một loài được mô tả từ Rajasthan, Ấn Độ và một loài khác từ Guinea,Châu Á, Châu Âu, Bắc Mỹ', 'null', 'insect_odontothrips_loti/38996.jpg', 'odontothrips', 'null'),
('oides decempunctata', 'Oides decempunctata', 'insect_oides_decempunctata', 'Cầu trùng ăn thịt thường được tìm thấy trên các loài thực vật chứa con mồi của chúng. Chúng đẻ trứng gần con mồi, để tăng khả năng ấu trùng dễ dàng tìm thấy con mồi. Ở Harmoniac axyridis , trứng nở trong vòng ba đến bốn ngày với số lượng từ vài cái đến vài chục cái. Tùy thuộc vào nguồn tài nguyên sẵn có, ấu trùng trải qua bốn giai đoạn trong 10–14 ngày, sau đó sẽ xuất hiện nhộng . Sau một teneral thời gian vài ngày, người lớn trở thành sinh sản hoạt động và có khả năng tái tạo lại sau, mặc dù họ có thể trở thành sinh sản hoạt động gì nếu eclosing cuối mùa giải. Tổng tuổi thọ trung bình là một đến hai năm.', 'Hầu hết các loài cầu trùng có cơ thể từ tròn đến elip, hình vòm với sáu chân ngắn. Tùy thuộc vào loài, chúng có thể có đốm, sọc hoặc không có dấu hiệu nào cả. Cầu gai bảy đốm có màu đỏ hoặc cam với ba đốm ở mỗi bên và một ở giữa; chúng có một đầu đen với các mảng trắng ở mỗi bên.', 'Nó xuất hiện ở các khu rừng lá rộng Tây Âu, rừng rụng lá phía đông, rừng hỗn giao Sarmatic , ở bìa rừng, đất hoang công viên và vườn và ở thảo nguyên Á-Âu , thảo nguyên Pannonian . Nó được tìm thấy trên bụi rậm và cây rụng lá, trên cỏ, dưới vỏ cây, trong rêu trên cây, trong lớp lá, trên gỗ cọ, mảnh vụn thân gỗ thô và trong đất phù sa .Các loài côn trùng này ăn rệp trên cây và bụi rậm. [6] Những con trưởng thành rải rác trong đám đông và giữa những chiếc lá rụng.', '- Ngắt bỏ lá bị hại và lá có nhộng bám, bắt giết bọ non và bọ trưởng thành. - Vệ sinh đồng ruộng, tiêu diệt ký chủ phụ, thu dọn tàn dư thực vật, phơi và đốt bỏ. - Phun thuốc vào lúc sáng sớm hay chiều mát.', 'Châu Âu, Bắc Phi, Châu Âu Nga, Caucasus, Siberia, Belarus, Ukraine, Moldova, Transcaucasia và tây Á.', 'null', 'insect_oides_decempunctata/43063.jpg', 'Oides', 'null'),
('Orseolia oryzae', 'Sâu năn/ muỗi hành', 'insect_Orseolia_oryzae', 'Con trưởng thành chủ yếu sống về đêm và ẩn náu vào ban ngày. Con cái đẻ nhiều lứa trứng nhỏ (lên đến sáu quả) ở mặt dưới của lá lúa. Những quả trứng lúc đầu có màu đỏ, nhưng đến khi nở, hai đến bốn ngày sau, chúng có màu nâu sô cô la. Những ấu trùng nhỏ bé chui xuống bẹ lá cho đến khi chúng chạm tới nách lá, nơi chúng chui vào thân. Sau khi kiếm ăn khoảng mười ngày và hình thành một túi mật , chúng sẽ hóa nhộng bên trong. Bốn đến bảy ngày sau, chúng sử dụng gai ở đầu bụng để tạo một lỗ trên túi mật gần đầu của nó. Ở đây các côn trùng trưởng thành xuất hiện. Chúng sống trong ba hoặc bốn ngày, và có thể có tới tám thế hệ muỗi vằn trong năm.', 'Trưởng thành là loài muỗi nhỏ, dài khoảng 3-5mm, bụng màu hồng nhạt, chúng đẻ trứng rãi rác từng quả, rất nhỏ, màu trắng, trước khi nở có màu vàng. Ấu trùng giống như con dòi, mình dẹt, màu trắng sữa, dài 4-5mm. Nhộng màu hồng, dài 4-5mm, nằm trong ống hành. Vòng đời từ 25-30 ngày. Muỗi hoạt động về đêm, có xu tính rất mạnh với ánh sáng. Sức bay yếu nên sự phân bố thường có tính khu vực. Trứng đẻ riêng lẻ hoặc từng nhóm 3-4 cái ở phía dưới mặt lá gần gốc lúa. Mỗi con cái đẻ hàng trăm trừng. Trứng cần có ẩm độ cao (trên 80%) để phát triển và nở. Sâu năn phát triển thích hợp trong điều kiện thời tiết tương đối ẩm, có mưa và trời ít nắng. Thường phát sinh cục bộ trên một cánh đồng hoặc một vùng hẹp do khả năng di chuyển yếu của muỗi.', 'Muỗi hành phá hại lúa từ giai đoạn mạ đến giai đoạn cuối đẻ nhánh, khi bị tấn công đỉnh sinh trưởng biến dạng thành \"cọng hành\" (hay còn gọi ống hành). Khi ống hành đã vươn ra ngoài cũng là lúc sâu non đã hoá nhộng. Cần phân biệt triệu chứng thiệt hại do sâu đục thân và muỗi hành. Với sâu đục thân đọt lúa cuốn tròn có màu xanh lúc đầu, sau đó những đọt này héo khô, nắm kéo lên thì đứt ra ngay, đó là do sâu ăn phá đọt non làm dưỡng chất và nước không di chuyển lên nuôi đọt được.\r\n\r\nVới muỗi hành là những ống tròn màu xanh lá cây nhạt, đó là bẹ lá bị biến dạng, phiến lá chỉ là một mảnh nhỏ ở đầu ống, nắm kéo lên không đứt, những ống này không chết đi nhưng làm chồi bị nhiễm không trổ bông được, những bụi lúa bị nhiễm lùn, đâm nhiều chồi, lá xanh thẫm, ngắn, dựng đứng, có nhiều cọng lúa giống như cọng hành lẫn trong bụi lúa.', 'Sử dụng giống kháng. Liên hệ với văn phòng nông nghiệp địa phương của bạn để biết danh sách cập nhật các giống có sẵn.\r\n\r\nCày ratoon của vụ trước và loại bỏ tất cả các ký chủ thực vật trái vụ.\r\n\r\nKhuyến khích sử dụng các tác nhân phòng trừ sinh học: platygasterid, eupelmid, và pteromalid ong bắp cày (ký sinh ở ấu trùng), ve phytoseiid (ăn trứng), nhện (ăn con trưởng thành).', 'Cambodia, China, India,Laos, Malaysia, Myanmar, Vietnam, Thailand …', 'null', 'insect_Orseolia_oryzae/03424.jpg', 'Orseolia', 'null');
INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('Oryctes rhinoceros', 'Kiến vương', 'insect_Oryctes_rhinoceros', 'Kiến vương Oryctes rhinoceros Linne là loài côn trùng có kiểu biến thái hoàn toàn. Vòng đời của chúng dao động từ 110 - 250 ngày, gồm 4 giai đoạn :* Trứng\nTrứng có màu trắng vàng, hình bầu dục, đường kính 3 mm, khoảng 4-5 ngày sau khi đẻ, trứng chuyển thành màu trắng nâu, những quả trứng mềm và thon dài ban đầu sẽ mở rộng thành hình một quả cầu (quả bóng) (Hình 2A) và thời gian nở trong vòng 11- 13 ngày. Trứng được đẻ bên trong thân dừa và gốc dừa mục, ẩm, đống rác, phân trâu bò, rơm mục, thân bắp, lá mía xác bả hữu cơ.*Ấu trùng:\nGiai đoạn ấu trùng có 3 tuổi (1, 2, và 3), thường có màu trắng vàng hoặc trắng kem, có 3 đôi chân, chân và đầu có màu nâu, hình chữ C và có thể dài tới khoảng 60 - 100 mm hoặc hơn, chiều rộng tối đa là khoảng 10,6-11,4 mm (Hình 2B). Thời gian giai đoạn ấu trùng từ 82 - 207 ngày. Các vị trí ưa thích để phát triển của ấu trùng là những khúc gỗ chết hoặc sắp chết, hoặc trong gốc cây dừa, nơi có nhiều chất hữu cơ hoai mục. Chúng ăn xác bả hữu cơ trong thân cây mục và dưới đất, giai đoạn này không gây hại cho cây.* Nhộng:\nNhộng có màu nâu vàng và có chiều dài lên tới 50 mm. Chiều dài của các phần nhô ra hình sừng ở phía trước có thể chỉ ra giới tính của thành trùng. Nhộng có hầu hết các đặc điểm bên ngoài nhìn thấy ở một con trưởng thành, với lớp màng ngoài màu nâu vàng cứng, mỏng, dẻo và hơi trong suốt (Hình 2C). Từ 17-30 ngày nhộng sẽ vũ hóa thành thành trùng.* Thành trùng:\nKiến vương trưởng thành là những con bọ cánh cứng lớn màu nâu sẫm đến đen, sáng bóng, dài 35-50 mm và rộng 20-23 mm, có sừng nổi bật trên đầu . Con đực và con cái khác nhau về kích thước cơ thể (lên đến 40 mm) và sừng con cái ngắn hơn. Sừng cũng có thể khác nhau về kích thước giữa các con bọ cánh cứng tùy thuộc vào môi trường phát triển của ấu trùng. Con đực và cái cũng có thể được phân biệt bằng mặt dưới của cơ thể, con đực có một đầu nhẵn, bóng của bụng, con cái có một chùm lông đỏ cứng ở đầu bụng. Thời gian sống trung bình từ 5 - 10 tháng. Con cái sống lâu hơn con đực, con cái trưởng thành sống được khoảng 9 tháng, còn con đực sống được khoảng 5 tháng. Con cái sẽ giao phối với một vài con đực và sẽ đẻ 3-4 ổ trứng, 30-50 trứng. Mỗi con cái đẻ được khoảng 100 trứng.', '', '', '', '', 'null', '', 'Oryctes', 'null'),
('Ostrinia furnacalis', 'Sâu đục thân, bắp', 'insect_Ostrinia_furnacalis', 'Trứng :\nTrứng của sâu đục bẹ ngô châu Á được tìm thấy thành từng nhóm ở gốc và dưới lá cây ngô với khối lượng từ 25 đến 50 trứng.  Chúng có vẻ có vảy và xếp thành từng nhóm chồng lên nhau, giống như mái ngói và vảy cá. Trứng dài khoảng nửa mm và có màu trắng, chuyển sang màu đen trước khi xuất hiện, xảy ra từ 3 đến 10 ngày sau khi ấp . \nẤu trùng :\nẤu trùng O. furnacalis bị hại ở tai ngô\nSâu đục bắp châu Á đi qua sáu instar giai đoạn trong khi ở các ấu trùng giai đoạn. Ấu trùng lứa đầu có màu hơi hồng với những đốm đen và đầu sẫm màu. Ấu trùng giai đoạn muộn có màu nâu vàng với những đốm đen và dài tới 2,9 cm. \nPupa :\nSau 3 đến 4 tuần, ấu trùng sâu bướm biến thành nhộng từ 6 đến 9 ngày trong kén trong đất hoặc thân cây, trước khi trở thành bướm đêm . \nTrưởng Thành:\nBướm đêm trưởng thành có màu sắc riêng biệt cho từng giới nên dễ nhận biết. Con cái có màu vàng nhạt hoặc rám nắng với các dải lượn sóng đậm hơn trên cánh của chúng. Con cái cũng có xu hướng lớn hơn con đực với sải cánh dài 20–30 mm. Trong khi đó, những con đực có màu sẫm hơn với phần bụng thuôn và những dải tương tự trên cánh của chúng và có xu hướng kích thước nhỏ hơn một chút so với những con cái.  Bướm đêm trưởng thành sống từ 10 đến 24 ngày. Trong suốt vòng đời này, bướm đêm cái có thể đẻ tới 1500 trứng.', '', '', '', '', 'null', '', 'Ostrinia', 'null'),
('Ostrinia nubilalis Huber', 'sâu đục thân ngô', 'insect_Ostrinia_nubilalis_Huber', 'Trứng: Trứng được xếp thành từng chùm không đều, có kích thước khoảng 15 đến 20. Trứng có hình bầu dục, dẹt, màu trắng kem, thường có ánh kim. Trứng sẫm dần thành màu be hoặc nâu vàng theo tuổi. Trứng thường được tích tụ ở mặt dưới của lá và chồng lên nhau giống như bệnh zona trên mái nhà hoặc vảy cá. Trứng có chiều dài khoảng 1,0 mm và chiều rộng 0,75 m. Ngưỡng phát triển của trứng là khoảng 15 ° C. Trứng nở sau bốn đến chín ngày.Ấu trùng:Ấu trùng có xu hướng có màu nâu nhạt hoặc xám hồng ở mặt lưng, với một nang đầu màu nâu đến đen và một tấm ở ngực màu nâu vàng.Người lớn:Bướm đêm khá nhỏ, con đực có sải cánh dài từ 20 đến 26 mm và con cái từ 25 đến 34 mm. Bướm đêm cái có màu từ vàng nhạt đến nâu nhạt, với cả cánh trước và cánh sau đan chéo nhau bằng những đường ngoằn ngoèo sẫm màu và mang những mảng màu nhạt, thường hơi vàng. Con đực có màu lông sẫm hơn, thường là nâu nhạt hoặc nâu xám, nhưng cũng có những đường ngoằn ngoèo sẫm màu và các mảng màu vàng.', 'Còn gọi là xén tóc sao hay xén tóc hoa vì trên toàn thân màu đen của con bọ trưởng thành cánh cứng này có điểm khoảng 30 chấm trắng. Con trưởng thành thường ăn bổ sung bằng các phần non của cây, đặc biệt là rễ non trước khi đẻ trứng vào tháng 5, tháng 6, vũ hoá vào tháng 5-6. Trước khi đẻ, xén tóc sao cắn vào gốc cây một vết hình chữ T ngược rồi đẻ trứng vào đó. Sau 6-12 ngày thì trứng nở, sâu non di chuyển xuống phía dưới gốc, phá hại phần gốc, rễ cây tiếp giáp với thân. Đầu tiên sâu hại vỏ, sau đó đục vào bên trong phần gỗ. Nhiều khi sâu đục cả những rễ to làm cho cây héo toàn bộ, rụng lá và chết. Sâu non phá hại trong 2-3 tháng thì nghỉ đông ở gốc cây. Đến tháng 3, tháng 4 năm sau thì hoá nhộng, tháng 5-6 vũ hoá. Vòng đời của xén tóc sao là một năm.', 'Nếu là sâu non chúng sẽ chọn các đốt ở chồi và hoa để tấn công từ đó làm chúng héo đi. Sau đó các phần trên non sẽ bị gãy và chết. Con nào gây hại cho trái thì làm trái bị hỏng, nếu có phát triển cũng không đạt kích thước tiêu chuẩn.Các con cái sẽ đục vào vỏ thân thành từng lỗ rồi đẻ trứng vào đó. Phần xung quanh lỗ đục sẽ có màu đậm hơn chỗ khác và sau vài giờ sẽ chuyển sang màu đen.', 'Việc kiểm soát sinh học đã được cố gắng nhiều lần trên ngô ngọt và các loại rau khác dễ bị sâu đục thân ngô châu Âu tấn công. Các sản phẩm Bacillus thuringiensis có thể có hiệu quả như nhiều loại thuốc trừ sâu hóa học, nhưng thường tỏ ra kém hiệu quả hơn một số loại. Hầu hết các phương pháp tiếp cận đơn yếu tố, ngoại trừ các công thức mới hơn của Bacillus thuringiensis , đã được chứng minh là không ổn định. Phát hành Trichogramma spp bản địa . (Bộ cánh màng: Trichogrammatidae), chẳng hạn, cung cấp mức độ đàn áp thay đổi và trung bình.', 'Malaysia hay Indonesia.', 'null', 'insect_Ostrinia_nubilalis_Huber/14315.jpg', 'Ostrinia', 'null'),
('Othreis fullonia', 'Ngài chích hút trái', 'insect_Othreis_fullonia', 'Vòng đời:\n\n- Trứng: 2-3 ngày\n\n- Sâu non: 18-22 ngày\n\n- Nhộng: 16-18 ngày\n\n- Trưởng thành: có thể sống trên 10 tuần.\n\nMột con cái đẻ khoảng 30 - 32 trứng, rải rác trên lá cây leo hoang dại.\n\nThành trùng hoạt động và để trứng vào ban đêm. Chúng gây hại bằng cách châm vòi hút trực tiếp vào trái để hút dịch. ', '', '', '', '', 'null', '', 'Othreis', 'null'),
('Oulema atrosuturalis', 'Bọ lá đầu dài', 'insect_Oulema_atrosuturalis', '', '', '', '', '', 'null', '', 'Oulema', 'null'),
('Oxya chinensis', 'Châu chấu (lúa)', 'insect_Oxya_chinensis', 'Vòng đời của châu chấu khoảng 200-210 ngày trong đó giai đoạn trứng 15-21 ngày. Giai đoạn sâu non: 100 ngày. Giai đoạn trưởng thành: khoảng 3 tháng. Con trưởng thành của châu chấu sống khoảng 3 tháng, trong đó con cái sống lâu hơn con đực. Sau khi hóa trưởng thành được 5-40 ngày thì bắt đầu giao phối, sau 10-41 ngày (trung bình trên dưới 20 ngày) bắt đầu đẻ trứng.\n\nMỗi con cái có thể đẻ 3 ổ, mỗi ổ có 10-102 quả. Châu chấu thường thích đẻ trứng ở đất ẩm, xốp, có nhiều cỏ dại, nhiều ánh nắng, thích đẻ trên đất cát pha. Trứng hình ống hơi cong ở giữa, một đầu hơi to màu vàng đậm, ổ trứng hình túi, trong đó trứng xếp xiên hai hàng. Trứng đẻ thành ổ từ 10-30 quả trong thân lúa, nếp gấp của lá lúa và trong những bụi cỏ trên mặt nước.', '', '', '', '', 'null', '', 'Oxya', 'null'),
('Pachydiplosis oryzae', 'ruồi gạo', 'insect_Pachydiplosis_oryzae', 'Trứng dài màu hồng nhạt được đẻ ở gốc lá lúa, đơn lẻ hoặc thành từng chùm. Số lượng trứng tối đa của một con cái là 200. Ấu trùng nở trong khoảng 4-5 ngày. Nó chui vào giữa các bẹ lá và cố gắng đạt đến điểm ngọn hoặc điểm đang phát triển. Sau đó nó bắt đầu cho ăn. Do bị cho ăn và bị kích thích liên tục, một khoang hình bầu dục được hình thành xung quanh giòi. Những khoang này phát triển thành hình trụ, dài, được gọi là \"Chồi bạc\". Thời kỳ ấu trùng kéo dài 5-15 ngày, tùy thuộc vào điều kiện khí hậu. Ấu trùng trưởng thành có chiều dài khoảng 3 mm và có màu đỏ nhạt. Sau khi hình thành mật, ấu trùng sẽ hóa nhộng bên trong nó. Sau 5-8 ngày hóa nhộng, ruồi trưởng thành chui ra khỏi túi mật. Toàn bộ vòng đời được hoàn thành trong khoảng 2-3 tuần. Giai đoạn lúa đẻ nhánh dễ bị sâu bệnh này tấn công nhất.', 'Con trưởng thành là một con muỗi mỏng manh như ruồi, dài 1/4 inch và có thân hình mảnh mai với đôi chân dài. Giòi có màu hơi hồng.', 'Giòi xâm nhập vào các mô thực vật và kích thích sự hình thành sự phát triển hình ống rỗng được gọi là \"Chồi bạc\". Những máy xới đất như vậy không tạo ra hạt và cuối cùng cây bị ảnh hưởng sẽ chết. Đôi khi người ta quan sát thấy sự phát triển bất thường của cây bị nhiễm bệnh có thể là do sự kích ứng của giòi phát triển bên trong thân cây. Thiệt hại đối với cây trồng do dịch hại này dao động trong khoảng 10-15%.', 'Nên sử dụng các giống lúa kháng bệnh để bảo vệ cây trồng khỏi loại dịch hại này. Ở những khu vực lưu hành, việc sử dụng hạt Phorate trong vườn ươm rất hữu ích trong việc giảm sự lây nhiễm trên đồng ruộng.Carbaryl Quinalphos, Phosphamidon và các hạt của Quinalphos nên được phun trong vườn ươm hoặc trên đồng ruộng nếu sự nhiễm bệnh có tính chất nghiêm trọng (Ghosh và cộng sự, 1960; Aggar, 1963).Sử dụng bẫy đèn khá hiệu quả.', 'Nó là loài gây hại chính trên lúa ở nhiều vùng khác nhau của Ấn Độ và thường được gọi là “Kharika hoặc Kane”.', 'null', 'insect_Pachydiplosis_oryzae/03960.jpg', 'pachydiplosis', 'null'),
('Panonchus citri McGregor', 'mite đỏ cam quýt', 'insect_Panonchus_citri_McGregor', 'Con cái đẻ từ 20 đến 30 quả trứng gần như hình cầu. Những quả trứng có một \"sợi tóc\" uốn cong nhô lên từ trên xuống được gọi là \"trứng cá\". Con cái đẻ hai hoặc ba quả trứng mỗi ngày và thường kéo một mạng tơ mỏng từ vòi trứng đến bề mặt chất nền. Ấu trùng bọ xít đỏ có múi nở sau 8 đến 30 ngày và có ba cặp chân. Sau đó, chúng phát triển qua hai giai đoạn nhộng (với bốn cặp chân), mỗi giai đoạn kéo dài vài ngày, và sau đó lột xác thành con trưởng thành. Trong thời tiết nóng, Quá trình phát triển từ trứng thành trứng có thể ngắn khoảng 3 tuần, và con trưởng thành có thể sống 18 ngày. Phát triển chậm hơn trong thời tiết mát mẻ. Thời tiết quá nóng, khô hoặc thời gian ẩm độ cao kéo dài không thuận lợi cho sự tồn tại của mạt đỏ trên cây có múi.', 'Mạt đỏ có múi, Panonychus citri, là một loài nhện thường liên quan đến cam quýt, nhưng nó cũng ăn hoa hồng, lê, hạnh nhân và một số loài trang trí lá rộng. Nó là một loài gây hại nghiêm trọng trên cây có múi ở Florida và California. Con cái có màu đỏ, đầy đặn và dài khoảng 0,5 mm. Con đực nhỏ hơn và thuôn về phía sau. Bộ lông (\"lông\") có màu trắng với phần gốc màu đỏ.', 'Mạt đỏ có múi ăn lá, thân và trái cây có múi cũng như Skimmia japonica , hoa hồng và lê. Nó có thể xâm nhập vào nhà vào mùa thu và mùa xuân để phá hoại cây họ cam quýt trên hiên nhà và phòng tắm nắng. Lúc đầu, bọ ve gây ra hiện tượng lá bị bạc màu khi chúng hút các chất bên trong tế bào thực vật ở lớp biểu bì và trung bì. Vết ăn giống như vết xước làm cho lá và quả non xanh nhợt nhạt đi rõ rệt. Cam và chanh trưởng thành bị thương chuyển sang màu vàng rơm nhạt. Nếu không được kiểm soát, ve đỏ trên cây có múi có thể gây rụng lá hoàn toàn.', 'Một trong các loại dầu bóng cây, dầu làm vườn hoặc xà phòng diệt côn trùng nên kiểm soát đầy đủ bọ đỏ có múi. Những chất này đều hiệu quả và an toàn cho con người khi sử dụng theo hướng dẫn trên nhãn. Một số hỗn hợp xịt cho cây trồng trong nhà cũng được bán trên thị trường. Những loại này cũng sẽ kiểm soát bọ ve đỏ trên cây có múi.', 'phân bố trên toàn thế giới trên cây có múi.', 'null', 'insect_Panonchus_citri_McGregor/58669.jpg', 'Panonychus', 'null'),
('Papilio spp', 'Sâu non bướm phượng', 'insect_Papilio_spp', 'Sâu có 5 tuổi phát triển từ 15-25 ngày.\n\n- Nhộng các loài Bướm Phượng có hình dáng rất đặc biệt, phần đầu phân làm hai nhánh như hai cái sừng, phần bụng cong vòng ra phía trước, đồng thời nhô sang hai bên thành hai gốc. Mình nhộng bám chắc vào cành cây nhờ túm tơ ở mặt bụng và sợi tơ treo vòng ngang lưng. Mình nhộng có nhiều màu sắc, phần lớn màu xanh nhạt, có lúc màu xám hoặc nâu vàng. Nhộng dài từ 25-30 mm.Thời gian nhộng khoảng một tuần đến 10 ngày.', '', '', '', '', 'null', '', 'Papilio', 'null'),
('Papilio xuthus', 'đuôi én châu á', 'insect_Papilio_xuthus', 'P. xuthus có các thụ thể quang nhạy cảm cao, hay còn gọi là ommatidia, có thể phát hiện một loạt các bước sóng. [11] Sự thích nghi này giúp chúng xác định các thành viên trong loài của chính chúng. Màu sắc và hoa văn riêng biệt của chúng là những gì làm cho chúng khác biệt với các loài bướm khác. Màu cánh có nguồn gốc từ “vảy”, và P. xuthus có vảy màu vàng (kem), cam, đen và xanh lam từ ánh sáng mà mỗi vảy hấp thụ và phản xạ. Các nghiên cứu bằng máy quang phổ cho thấy các vảy màu vàng được hấp thụ trong dải UV đến tím, màu da cam được hấp thụ ở nửa bước sóng thấp hơn của quang phổ nhìn thấy, các vảy màu đen được hấp thụ trong hầu hết dải ánh sáng nhìn thấy và các vảy màu xanh lam hấp thụ rất ít ánh sáng. Các khoảng hấp thụ này là do các phân tử sắc tố chứa trong mỗi vảy cánh. Màu vàng và cam chứa papiliochrome II và màu đen chứa melanin. Các vảy màu xanh lam đặc biệt ở chỗ chúng không có phân tử sắc tố và thay vào đó được tô màu bằng hiện tượng quang học. Sự tương tác của ánh sáng với lớp trên và lớp dưới của quy mô tạo cho chúng màu xanh lam riêng biệt mà chúng ta nhìn thấy. \r\nThực nghiệm thao tác tạo màu cánh đã đạt được thông qua việc sử dụng axit cacboxypeptidase, Molsin. Tiêm Molsin vào nhộng 0-2 ngày, bướm có nhiều vảy cánh đen. Những đối tượng bị biến đổi này đã tạo ra một lượng lớn sắc tố melanin và papiliochrome II. Tiêm Molsin vào nhộng 3-4 ngày không thấy thay đổi màu sắc cánh. Điều này chỉ ra rằng P. xuthus có khả năng có một axit cacboxypeptidase của riêng nó để tạo ra các sắc tố này một cách tự nhiên và hoạt động của nó kéo dài trong hai ngày đầu tiên của quá trình nhộng. Việc sử dụng một lượng axit carboxypeptidase cao hơn cho nhộng ở 0–2 ngày sẽ gây ra sự sản sinh quá mức các phân tử sắc tố, dẫn đến số lượng vảy đen cao. \r\n\r\nP. xuthus sử dụng màu sắc và hoa văn của cánh để xác định côn trùng cùng loài. Các hành vi tình dục được khơi gợi từ nam giới chỉ bằng nhận dạng trực quan. Những con đực P. xuthus trưởng thành có thể tìm thấy những đặc điểm không mùi, và trong khi chúng không phân biệt giới tính, chúng có thể xác định một con cái sau khi tiếp xúc cơ thể.', 'Đuôi én châu Á là một loài bướm cỡ trung, màu vàng, có đuôi nổi bật. [10] Nó có sải cánh từ 45 đến 55 mm. [10] Mẫu màu bình thường của nó bao gồm một mẫu màu đen trên nền vàng. [10] Màu sắc của cánh là lưỡng hình về giới tính, với những con cái có dải biên gần rộng hơn ở cánh sau. [10] Các vảy màu xanh ánh kim và màu da cam ngăn cách các dải màu đen trên cánh sau. [10] Các dải màu đen cũng chạy thành các sọc có độ dày khác nhau dọc theo cánh trước. [10] Sâu non bắt chước phân chim và có một đốm trắng và nâu trên đầu. [6] Khi trưởng thành, sâu bướm phát triển cơ thể có màu xanh lục nhạt với các đốm nâu. [6]', 'Trong mùa giao phối, những con đực đuôi én châu Á bay qua tán lá cây để tìm kiếm bạn tình. [14] Nếu một con đực bắt gặp một con cái đang nghỉ ngơi trên một cây có cánh mở và ngang, nó sẽ tiếp cận cô ấy và kiểm tra cô ấy bằng cách tiếp xúc các chân trước của mình với các đầu cánh của cô ấy. Ngoài ra, con đực sử dụng các dấu hiệu thị giác để tiến hành nghi lễ giao phối và đặc biệt bị thu hút bởi những mảng màu vàng có khoảng cách gần nhau trên cánh của con cái. \r\n\r\nHầu hết các con cái của loài bướm đuôi én châu Á đều giao phối nhiều hơn một lần trong đời. Hành vi này là điển hình của nhiều loài bướm đuôi én khác bao gồm P. glaucus, P. helenus và P. protenor.  Bằng cách giao phối nhân lên, con cái có thể làm tăng sự đa dạng di truyền của thế hệ con cái của chúng.  Ngoài ra, nhiều lần giao phối cho phép con cái sinh ra số lượng trứng lớn hơn, trong đó có thể lên đến ba mươi quả.', '- Đối với những ruộng nhỏ, khi mật độ sâu thấp có thể bắt sâu bằng tay vào buổi sáng sớm hay chiều tối bằng cách bới đất quanh gốc cây bị sâu cắn để bắt sâu.- Dùng bẫy bả chua ngọt để bẫy bướm. Cách làm bẫy bả chua ngọt: Trộn hỗn hợp gồm 4 phần đường + 4 phần dấm + 1 phần rượu + 1 phần nước. Cho vào trong bình đậy kín sau 3 - 4 ngày thì thêm vào 1% thuốc trừ sâu. Quấn giẻ hay bùi nhùi rơm rạ vào đầu gậy nhúng vào bả cắm trên bờ ruộng. Bướm trưởng thành sẽ bay vào ăn bả chua ngọt và bị chết. Cứ 2 - 3 ngày nhúng bả lại 1 lần.- Dùng cám rang thơm trộn với thuốc Vibasu 10G để bẫy sâu. Trộn 2 kg cám với 0,5 kg thuốc, rải cho 1.000 m2 trước khi trời tối. Rải thuốc theo hàng hoặc hốc gần gốc cây.', 'được tìm thấy ở Đông Bắc Á, bắc Myanmar, nam Trung Quốc, Đài Loan, bán đảo Triều Tiên, Nhật Bản (từ Hokkaidō đến Yaeyama Quần đảo), Siberia và quần đảo Hawaii. [1] Nó cũng được ghi nhận ở bang Arunachal Pradesh, Ấn Độ, vào năm 2014.', 'null', 'insect_Papilio_xuthus/58212.jpg', 'Papilio', 'null'),
('Paranthrene tabaniformis', 'poplar clearwing moth', 'insect_Paranthrene_tabaniformis', 'Ấu trùng có 6 - 7 giai đoạn. Ấu trùng trưởng thành hóa nhộng trong các khoang trong phòng trưng bày ấu trùng. Nhộng được tìm thấy ở trung tâm của cây dương một năm tuổi, hoặc bên dưới vỏ thân và cành của những cây già nhất.', 'Các sải cánh là c. 30 mm. Chiều dài của cánh trước là c. 14 mm. Meyrick mô tả nó - Đầu có vạch dọc màu trắng trước mỗi mắt và vòng sau màu vàng. Bụng có các vòng màu vàng trên 2, 4, 6, và đôi khi 7. Xương chày giữa và sau màu cam, có dải đen. Các cánh tiên khá tối, với các mảng hyalin dài che khuất về phía cơ sở; vệt đen hơi tím. Hyaline của Hindwings; tĩnh mạch và lông tơ tối màu termen. [1] Bướm đêm bay từ tháng 5 đến tháng 8 tùy thuộc vào vị trí.', 'ấu trùng đào kho trong thân và cành cây khi kiếm ăn. Việc cành cây bị hư hại khiến chúng yếu đi và chúng có thể gãy khi gặp gió. Nói chung, các phòng trưng bày ảnh hưởng đến chất lượng của gỗ, khiến nó không thể sử dụng cho mục đích thương mại. Các vết thương cũng tạo điều kiện cho các mầm bệnh thứ cấp xâm nhập.', 'null', 'Nó được tìm thấy ở Croatia , Bosnia và Herzegovina , Serbia và Montenegro , Cộng hòa Macedonia và Bulgaria , [2] cũng như Thổ Nhĩ Kỳ , Azerbaijan và Iran .', 'null', 'insect_Paranthrene_tabaniformis/43759.jpg', 'Paranthrene', 'null'),
('Parapoynx fluctuosalis', 'Sâu phao bướm vân loang lỗ', 'insect_Parapoynx_fluctuosalis', 'Vòng đời hoàn thành trong khoảng 35–40 ngày. Chiều dài của cánh trước là 16 mm. Con trưởng thành có cánh màu trắng với các mảng gợn sóng màu nâu nhạt. Có hai dấu phẩy màu đen trên mỗi cánh trước. Con đực có thể được xác định bằng phần bụng hẹp và đều, trong khi phần bụng của con cái rộng nhất ở giữa nhưng thon dần về phía sau. [2] Con cái thường đẻ 150 trứng và ấu trùng lứa đầu tiên xuất hiện sau một tuần. Ấu trùng cuối cùng xuất hiện sau 20 ngày, và đạt chiều dài tối đa 10-12mm. Bướm đêm có sáu trường hợp ấu trùng. Do mang hình ống phân nhánh, sâu bướm có thể hô hấp trong môi trường nước. Do đó, instar có thể phân tán qua nước. Nhộng xảy ra khi nhộng bám vào bẹ lá trên mực nước. Sau một tuần hóa nhộng, con trưởng thành xuất hiện. ', '', '', '', '', 'null', '', 'Parapoynx', 'null'),
('Parapoynx stagnalis', 'Sâu phao bướm trắng', 'insect_Parapoynx_stagnalis', 'Vòng đời hoàn thành trong khoảng 35–40 ngày. Chiều dài của cánh trước là 16 mm. Con trưởng thành có cánh màu trắng với các mảng gợn sóng màu nâu nhạt. Có hai dấu phẩy màu đen trên mỗi cánh trước. Con đực có thể được xác định bằng phần bụng hẹp và đều, trong khi phần bụng của con cái rộng nhất ở giữa nhưng thon dần về phía sau. [2] Con cái thường đẻ 150 trứng và ấu trùng lứa đầu tiên xuất hiện sau một tuần. Ấu trùng cuối cùng xuất hiện sau 20 ngày, và đạt chiều dài tối đa 10-12mm. Bướm đêm có sáu trường hợp ấu trùng. Do mang hình ống phân nhánh, sâu bướm có thể hô hấp trong môi trường nước. Do đó, instar có thể phân tán qua nước. Nhộng xảy ra khi nhộng bám vào bẹ lá trên mực nước. Sau một tuần hóa nhộng, con trưởng thành xuất hiện. ', '', '', '', '', 'null', '', 'Parapoynx', 'null'),
('Parasa lepida', 'Sâu nái', 'insect_Parasa_lepida', 'Trưởng thành sâu nái là một loài bướm màu xanh lá cây, có một đốm màu nâu ở gần cạnh trước và dọc cạnh ngoài của cánh trước và cánh sau có một đường viền lớn màu nâu nhạt với đường viền màu nâu đậm ở phía ngoài. Bướm sải cánh 35-40mm. Sâu non màu xanh lá cây, có kích thước lớn, dài khoảng 25-30mm, Có nhiều chùm lông sắp xếp đều đặn dọc theo thân sâu, 4 chùm lông ở gần đầu và phía sau đuôi màu đỏ và ngắn. trên thân có nhiều lông. Nhộng dài khoảng 15mm, được bao bọc bởi kén màu nâu, bên ngoài phủ một lớp tơ trắng. Trứng trơn láng có hình tròn hoặc bầu dục, thường được đẻ thành từng nhóm từ 10-20 trứng.', '', '', '', '', 'null', '', 'Parasa', 'null'),
('Parlatoria zizyphus Lucus', '‎vảy parlatoria đen‎', 'insect_Parlatoria_zizyphus_Lucus', 'Tỷ lệ giới tính ở C. aonidum được phát hiện có xu hướng nghiêng về con cái (Nur, 1990). Mỗi con cái trưởng thành đẻ khoảng 50-150 trứng hình bầu dục dưới vảy trong khoảng thời gian từ 1-8 tuần, tùy thuộc vào bộ phận của cây bị nhiễm bệnh (những quả trên lá ít bị nhiễm bệnh hơn những quả bị nhiễm bệnh) (Rose và DeBach, 1978) . Trứng nở theo quy mô và nhộng đầu tiên hoặc nhộng bò đi tìm nơi kiếm ăn thích hợp trước khi chuyển sang lối sống không cuống. Nhộng trùng lứa thứ hai là giai đoạn kiếm ăn chính ở cả hai giới. Phát triển đến trưởng thành mất 7-16 tuần theo nhiệt độ. Ở California, Hoa Kỳ, C. aonidum có tới sáu thế hệ mỗi năm (Gill, 1997). Ở các quốc gia có mùa đông lạnh giá, chẳng hạn như Đài Loan, có thể có ba thế hệ khác biệt mỗi năm (Su, 1983), trong khi ở điều kiện nhiệt đới (và nhà kính sưởi ấm) việc sinh sản diễn ra liên tục và các thế hệ không đồng bộ.', 'Con cái trưởng thành và ở giai đoạn trung gian có dạng vảy tròn từ phẳng đến lồi vừa phải, đường kính đến 2 mm, mỗi vảy có một điểm dưới trung tâm hơi nhô lên, đôi khi có màu nhạt. Nếu dùng đầu kim nhấc vảy lên, côn trùng bên dưới có màu vàng và dài tới 1,7 mm. Vảy đực hơi nhạt hơn vảy cái, hình bầu dục dài và có kích thước bằng một nửa. Con đực trưởng thành dài 0,7 mm và có một đôi cánh, hai cặp mắt đơn giản, không có miệng và cơ quan sinh dục rất dài. Nhộng đầu tiên dài 0,3 mm và có chân nhưng sau đó sẽ sớm lắng xuống để tạo thành các vảy màu trắng hình tròn (giai đoạn đốm trắng) có chiều ngang lên tới 0,4 mm. Chúng trở nên hợp nhất với quy mô của các giai đoạn tiếp theo, tạo thành điểm dưới trung tâm nhạt màu hơn.', 'C. aonidum đã khá phổ biến, đặc biệt là ở các vùng trồng cam quýt trên thế giới. Khi hiện tượng ấm lên toàn cầu tiến triển, sự phân bố của nó có khả năng mở rộng theo hướng Bắc và Nam với sự gia tăng của các khu vực sản xuất cam quýt. Các quốc gia có ngành công nghiệp cây có múi mới hoặc đang phát triển ngay bên ngoài vùng phân bố hiện tại của C. aonidum (CIE, 1988) sẽ cần phải thận trọng để loại trừ quy mô nếu có thể. Quy mô cũng có thể trở thành một vấn đề đối với cây cảnh ở những nước này, và có thể trở thành một loài gây hại cho các vật trang trí dưới kính ở các nước ôn đới, như ở Hungary (Reiderné và Kozár, 1994). Nó được đề cập trong danh sách kiểm dịch (Burger và Ulenburg, 1990).', 'Sử dụng các biện pháp kiểm soát văn hóa và sinh học và xịt dầu từ dầu mỏ lên cây có múi được quản lý hữu cơ.', 'Châu Âu', 'null', 'insect_Parlatoria_zizyphus_Lucus/60841.jpg', 'Parlatoria', 'null'),
('Parnara guttata', 'Sâu cuốn lá lớn đầu vệt đen', 'insect_Parnara_guttata', 'Trưởng thành: Là một loại ngài tương đối nhỏ, kích thước trung bình đạt 8,41 ± 0,4mm; sải cánh rộng 19,31 ± 0,91 mm. Râu đầu hình sợi chỉ. Lúc đậu cánh xếp hình mái nhà. Đôi cánh trước có góc đỉnh hơi vuông. Mép trước của đôi cánh trước hơi lõm xuống ở vị trí 3/4 tính từ gốc cánh, và cũng tại đó có một vân hình bán nguyệt màu nâu. Mép ngoài cánh trước hình lượn sóng, có viền lông tơ màu nâu đậm. Mặt trên của đôi cánh trước có những vệt vân nâu, trắng xen kẽ trông loang lổ. Tấm lưng ngực trước và ngực giữa màu nâu cùng với màu của đầu. Đôi cánh sau và bụng có màu vàng rơm.\n\n- Trứng: Trứng được đẻ thành ổ, bề mặt ổ trứng được phủ một lớp keo trong suốt. Số lượng trứng mỗi ổ dao động từ 23 - 101 quả. Quả trứng có hình cầu, khi mới đẻ có màu vàng nhạt, sắp nở chuyển sang màu vàng sẫm.\n\n- Sâu non: Có 5 tuổi, trải qua 4 lần lột xác. Đầu, mảnh mai đốt ngực tr−ớc và đôi chân ngực trước màu đen.\n\n+ Sâu non tuổi 1 rất linh hoạt, chiều dài dao động từ 1,64 – 2,05 mm, trung bình 1,80 ± 0,14 mm; Cơ thể có màu vàng nhạt, sắp lột xác màu vàng đậm hơn.\n\n+ Tuổi 2 khi mới lột xác có màu vàng xanh, kích thước dài khoảng 3,3 – 3,9 mm, trung bình 3,68 ± 0,10 mm.\n\n+ Sâu non tuổi 3 có màu xanh lục hơi vàng, cơ thể dài trung bình 8,93 ± 1,67 mm.\n\n+ Tuổi 4 cơ thể có màu xanh đậm. Chiều dài trung bình đạt 16,6 ± 0,15 mm. Tuổi 5 khi mới lột xác, cơ thể dài khoảng 18,6 mm; đẫy sức có thể dài tới 23,2 mm; trung bình 20,43 ± 0,73 mm. Cơ thể có màu xanh lục, cuối tuổi chuyển sang màu vàng xanh.\n\n+ Nhộng: Khi mới hoá có màu xanh lá mạ ở phần bụng; mặt lưng các đốt bụng có màu cánh gián; ở giữa mặt lưng mỗi đốt bụng có một vân đen nằm ngang tạo thành một vệt đen chạy dọc thân. Kích thước nhộng dài trung bình 10,77 ± 0,51 mm; Mầm cánh kéo dài đến đốt bụng thứ 5.', '', '', '', '', 'null', '', 'Parnara', 'null'),
('Pegomya hyoscyami', 'ruồi củ cải', 'insect_Pegomya_hyoscyami', 'Hai đến năm quả trứng hình trụ màu trắng được đẻ ở mặt dưới của lá và nở từ bốn đến sáu ngày sau đó. Ấu trùng chui vào lá tạo ra một vệt mỏng lúc đầu và cuối cùng là một vết hoặc \"vết phồng rộp\". Ấu trùng trưởng thành từ bảy đến mười sáu ngày sau đó và thả xuống đất nơi chúng thành nhộng. Sâu non có thể di chuyển từ lá này sang lá khác trước khi xâm nhập vào đất. Sâu non cũng có thể hóa nhộng trong chính lá. Con ruồi trưởng thành xuất hiện sau hai đến bốn tuần và lặp lại chu kỳ, tạo ra nhiều thế hệ mỗi năm.', 'là một loài ruồi màu xám dài khoảng 6 mm (0,24 in). Nó xuất hiện vào tháng 4 - tháng 5 và đẻ trứng ở mặt dưới của lá củ cải đường , rau bina , cải bẹvà các loại rau xanh khác. Trứng phát triển thành ấu trùng chui vào lá làm rỗng các mảng lớn giữa các bề mặt lá, thường làm chết các phần lớn của lá.', 'Ruồi, còn được gọi là sâu đục khoét lá củ cải, hoạt động mạnh vào tháng 4 và đầu tháng 5 và đẻ trứng ở mặt dưới của lá, nơi giòi nở ra và chui vào lá.', 'Kiểm soát là văn hóa, tạo rào cản bằng cách sử dụng các lớp phủ hàng nổi hoặc loại bỏ sâu bệnh ngay khi chúng xuất hiện và tiêu hủy các lá bị hại ra khỏi khu vực. Có thể dùng bẫy dính màu vàng để bẫy con trưởng thành. Thuốc trừ sâu không hiệu quả vì giai đoạn dễ bị tổn thương, giòi, được bảo vệ bên trong lá.', 'Nam Mỹ, Châu Âu, Châu Phi, Châu Á, Châu Đại Dương', 'null', 'insect_Pegomya_hyoscyami/25856.jpg', 'Pegomya', 'null'),
('Pelipidas mathias', 'Sâu cuốn lá lớn đầu vệt đỏ', 'insect_Pelipidas_mathias', 'Vòng đời của sâu cuốn lá  trung bình khoảng 30 – 35 ngày. Bướm sống từ 5 – 10 ngày. Giai đoạn trứng từ 3 – 5 ngày. Sâu non sống khoảng 15 – 28 ngày. Nhộng sống từ 6 – 10 ngày.\n\n+ Trong đó giai đoạn sâu non gây hại chiếm khoảng 15 – 28 ngày, sâu non có từ 5 – 6 tuổi. Sâu non tuổi 2 – 3 sẽ nhả tơ khâu mép lá cuốn lại tạo thành bao để sốngnên gây khó khăn trong việc phòng trừ. Sâu cuốn lá nhỏ gây hại bằng cách ăn mô lá chỉ chừa lại lớp biểu bì màu trắng, ruộng lúa bị hại trông xơ xác, nhìn từ xa thấy bạc trắng, làm giảm khả năng quang hợp, cây lúa sinh trưởng phát triển kém, hạt bị lép lửng nhiều, ảnh hưởng đến năng suất.\n\n+ Thành trùng sâu cuốn lá nhỏ thường gọi là ngài có màu vàng rơm, thân dài khoảng hơn 1cm, đây là đặc điểm rất dễ nhận dạng. Khi chúng đậu, đặc điểm cánh xếp thành hình tam giác và khi có tác động vào chúng bay rất nhanh.\n\n+ Một con sâu cuốn lá thường gây hại từ 3 – 5 lá trong một vòng đời và hóa nhộng ngay trong bao lá.', '', '', '', '', 'null', '', 'Pelopidas', 'null'),
('Penthaleus major', 'mite hạt mùa đông', 'insect_Penthaleus_major', 'Loài sinh vật gây hại cỏ này đẻ trứng từ tháng 6 đến tháng 10, và phần lớn hoạt động của loài bọ này là trong những tháng mùa đông. Hai thế hệ chồng chéo có thể xảy ra trong mùa đông với quần thể cao điểm được tìm thấy vào cuối tháng 12 và cuối tháng 2.', 'Ve hạt mùa đông có cơ thể màu nâu sẫm đến gần như đen với các chân màu cam đỏ dễ thấy. Chân trước của chúng dài hơn các chân khác, nhưng không rõ rệt như trên loài ve lúa mì nâu. Chúng cũng có hai móng vuốt ở cuối mỗi chân. Chúng khá bất thường ở chỗ chúng là loài ve duy nhất có tầm quan trọng về kinh tế trong khu vực này với lỗ hậu môn ở bề mặt trên của bụng. Hầu hết các loài ve khác có lỗ hậu môn ở mặt dưới hoặc ở đầu bụng. Đặc điểm này được nhìn thấy rõ nhất bằng kính hiển vi, nhưng có thể quan sát bằng ống kính cầm tay. Lỗ chân lông ở hậu môn xuất hiện như một đốm màu nâu đến cam trên đầu cơ thể, nhưng biến mất nhanh chóng trong rượu.', 'Khi mặt trời mọc, bọ ve đi xuống cây và tìm kiếm sự bảo vệ trên bề mặt đất ẩm dưới tán lá trong thời gian nóng bức trong ngày. Bọ ve gây hại cho cây bằng cách đục thủng các tế bào riêng lẻ, làm cho lá có màu xám bạc. Những lá bị hại nặng sẽ có đầu lá màu nâu. Nếu đất khô và có ít tán lá, bọ ve sẽ chui vào đất để tìm kiếm độ ẩm và nhiệt độ mát hơn. Nhiệt độ và độ ẩm là những yếu tố quan trọng nhất ảnh hưởng đến sự phát triển và phong phú của mạt. Nhiệt độ mát mẻ thay vì ấm áp có lợi cho sự phát triển của chúng. Hoạt động của những con ve này là lớn nhất trong khoảng từ 40º đến 70ºF. Trứng kiến ​​không nở vào mùa thu cho đến khi mưa cung cấp đủ độ ẩm. Vào những ngày khô nóng, có thể phải đào sâu vào đất 4 hoặc 5 inch để tìm ve. Những con ve dường như không bị tổn hại bởi độ ẩm cao, lượng mưa, thời gian ngắn của mưa tuyết hoặc băng bao phủ, hoặc bởi mặt đất đóng băng ở độ sâu vài inch, vào mùa thu. Tuy nhiên, mưa lớn vào mùa xuân có thể khiến quần thể bọ ve biến mất.', 'Khi cây đang có các triệu chứng bị hại do ăn và có thể tìm thấy một số WGM trên mỗi cây, việc sử dụng thuốc trừ sâu trên lá có thể có hiệu quả trong việc giảm số lượng mạt hạt mùa đông. Mặc dù không có thuốc diệt côn trùng nào được dán nhãn đặc biệt cho mạt hạt mùa đông, nhưng Warrior II, được dán nhãn để ức chế bọ ve ở lúa mì và lúa mạch, cũng như dimethoate được dán nhãn để kiểm soát bọ nâu (chỉ lúa mì) đã ngăn chặn quần thể WGM. Hãy chắc chắn đọc nhãn để biết tỷ lệ sử dụng và các hạn chế.', 'Loài ve ký sinh thực vật Penthaleus major (Dugès) xuất hiện như một loài gây hại trên cỏ lâu năm trong các cánh đồng cỏ khô ở Iceland, miền bắc Na Uy và miền nam Greenland.', 'null', 'insect_Penthaleus_major/24606.jpg', 'Penthaleus', 'null'),
('Phaeochrous emarginatus', 'bọ hung', 'insect_Phaeochrous_emarginatus', 'Vòng đời của chúng dao động từ 110 - 250 ngày, gồm 4 giai đoạn Trứng có màu trắng vàng, hình bầu dục, đường kính 3 mm, khoảng 4-5 ngày sau khi đẻ, trứng chuyển thành màu trắng nâu, những quả trứng mềm và thon dài ban đầu sẽ mở rộng thành hình một quả cầu (quả bóng) (Hình 2A) và thời gian nở trong vòng 11- 13 ngày. Trứng được đẻ bên trong thân dừa và gốc dừa mục, ẩm, đống rác, phân trâu bò, rơm mục, thân bắp, lá mía xác bả hữu cơ.	Giai đoạn ấu trùng có 3 tuổi (1, 2, và 3), thường có màu trắng vàng hoặc trắng kem, có 3 đôi chân, chân và đầu có màu nâu, hình chữ C và có thể dài tới khoảng 60 - 100 mm hoặc hơn, chiều rộng tối đa là khoảng 10,6-11,4 mm (Hình 2B). Thời gian giai đoạn ấu trùng từ 82 - 207 ngày. Các vị trí ưa thích để phát triển của ấu trùng là những khúc gỗ chết hoặc sắp chết, hoặc trong gốc cây dừa, nơi có nhiều chất hữu cơ hoai mục. Chúng ăn xác bả hữu cơ trong thân cây mục và dưới đất, giai đoạn này không gây hại cho cây.Nhộng có màu nâu vàng và có chiều dài lên tới 50 mm. Chiều dài của các phần nhô ra hình sừng ở phía trước có thể chỉ ra giới tính của thành trùng. Nhộng có hầu hết các đặc điểm bên ngoài nhìn thấy ở một con trưởng thành, với lớp màng ngoài màu nâu vàng cứng, mỏng, dẻo và hơi trong suốt (Hình 2C). Từ 17-30 ngày nhộng sẽ vũ hóa thành thành trùng.Kiến vương trưởng thành là những con bọ cánh cứng lớn màu nâu sẫm đến đen, sáng bóng, dài 35-50 mm và rộng 20-23 mm, có sừng nổi bật trên đầu (Hình 2D). Con đực và con cái khác nhau về kích thước cơ thể (lên đến 40 mm) và sừng con cái ngắn hơn. Sừng cũng có thể khác nhau về kích thước giữa các con bọ cánh cứng tùy thuộc vào môi trường phát triển của ấu trùng. Con đực và cái cũng có thể được phân biệt bằng mặt dưới của cơ thể, con đực có một đầu nhẵn, bóng của bụng, con cái có một chùm lông đỏ cứng ở đầu bụng. Thời gian sống trung bình từ 5 - 10 tháng. Con cái sống lâu hơn con đực, con cái trưởng thành sống được khoảng 9 tháng, còn con đực sống được khoảng 5 tháng. Con cái sẽ giao phối với một vài con đực và sẽ đẻ 3-4 ổ trứng, 30-50 trứng. Mỗi con cái đẻ được khoảng 100 trứng.', 'Đầu màng trắng đục, vảy vàng, chân có màu đen. Tùy vào môi trường và điều kiện sinh sống mà màu sắc cơ thể của chúng sẽ biến đổi da dạng để thích nghie. Điểm chung của hầu hết loại bọ cánh cứng là chúng có một chiếc miệng rộng to lớn và hàm răng sắc bén. Điều này giúp chung săn bắt và giữ chắc con mồi một cách thuận tiện  hơn.\r\n\r\nĐôi cánh là lá chăn kiên cố giúp chúng chống đỡ lại các cuộc tấn công từ phía đối thủ. Cùng với đó là cặp sừng to cứng giúp việc nhận biết bọ cánh cứng được dễ dàng hơn.', 'Sâu non cắn rễ tạo thành các vết thương làm cho rễ hoạt động kém, không cung cấp đủ nước và chất khoáng cho cây . Đáng chú ý là từ các vết thương do sâu gây ra, một số loài tuyến trùng và một số loài nấm gây bệnh xâm nhập gây hại cho cây. Đặc biệt trong số này có nấm Thielaviopsis paradoxa xâm nhập và gây ra bệnh thối trái, thối gốc chồi làm cho vườn dứa tàn lụi nhanh chóng.Ấu trùng nở ra có thân cong, màu trắng sữa, đầu có mảnh sừng cứng màu nâu, trên thân có lông tơ màu trắng, dài khoảng 35mm, phá hại bộ rễ làm cây bị héo và dễ đổ ngã. Vòng đời của chúng từ 1 - 2 năm.Con trưởng thành màu nâu vàng có vân vạch ở cánh trước\r\n\r\nSau khi vũ hóa, các con trưởng thành giao phối và tìm đến  các vườn dứa xanh tốt để đẻ trứng. Sâu non khi nở ra đã có sẵn thức ăn tốt.', 'Nên xử lý đất trước khi trồng dứa thường xuyên, rải thuốc ngừa bọ cánh cứng bằng các loại thuốc dạng hạt như Regent, Basudin 10 H hoặc dùng thuốc nước tưới gốc cây như Pyrinex 20EC, Fenbis 25EC. Oncol 20EC. Tưới thuốc Oncol 20EC hoặc rải thuốc Lorsban 15G vào gốc  dứa.\r\n\r\nLuân canh dứa với các loại cây trồng. Thời gian trồng dứa trở lại 2 - 3 năm.\r\n\r\nCày bừa kỹ, thu dọn sạch tàn dư thực vật, phơi khô.\r\n\r\nDùng thuốc để phun trừ sâu trưởng thành. Có thể dùng thuốc Basudin, Sevidol 8G, bón vào chung quanh vùng rễ để diệt sâu non.', 'Đồng bằng Sông Cửu Long PHáp, Bỉ, Anh và Đức', 'null', 'insect_Phaeochrous_emarginatus/30085.jpg', 'Phaeochrous', 'null'),
('Phyllocnistic citrella', 'Sâu vẽ bùa', 'insect_Phyllocnistic_citrella', 'Vòng đời: 19-38 ngày\n\n- Trứng: 1-6 ngày\n\n- Sâu non: 4-10 ngày\n\n- Nhộng: 7-12 ngày\n\n- Trưởng thành: 7-10 ngày', '', '', '', '', 'null', '', 'Phyllocnistis', 'null'),
('Phyllocnistis citrella Stainton', 'bướm đêm thuộc họ Gracillariidae', 'insect_Phyllocnistis_citrella_Stainton', 'Trứng của được đẻ đơn lẻ ở mặt dưới của lá cây chủ. Sự xuất hiện của trứng xảy ra trong vòng từ hai đến 10 ngày, khi đó ấu trùng xâm nhập ngay vào lá và bắt đầu kiếm ăn. Sâu non tạo mỏ ngoằn ngoèo trên lá non (đôi khi cả chồi non), dẫn đến lá bị quăn và bị thương nặng. Mìn lá thường ở mặt bụng lá, trừ trường hợp bị sâu bệnh nặng khi sử dụng cả hai mặt lá. Thường chỉ có một mỏ lá trên mỗi lá nhưng nhiễm nặng có thể có hai hoặc ba mỏ trên mỗi lá, và có tới chín mỏ trên các lá lớn đã được tìm thấy ở Florida.', 'Con trưởng thành của CLM (Hình 2) là những con bướm đêm nhỏ với một lớp cánh 4 mm. Chúng có vảy màu trắng và ánh bạc trên cánh trước, với một số mảng màu đen và rám nắng, cộng với một điểm đen trên mỗi đầu cánh. Cánh sau và thân màu trắng, với các vảy rìa dài kéo dài từ rìa cánh sau. Ở tư thế nghỉ ngơi với đôi cánh xếp lại, loài bướm đêm có bề ngoài nhỏ hơn nhiều (khoảng 2,4 mm). Đầu rất mịn và có vảy màu trắng, và lông tơ không có vảy cơ bản. CLM được phát hiện dễ dàng nhất bởi mỏ của ấu trùng ngoằn ngoèo, thường ở mặt bụng của lá. Sâu non có kích thước phút (đến 3 mm), màu vàng lục mờ, nằm bên trong mỏ lá. Đặc điểm của nhộng là trong một tế bào nhộng ở mép lá. Người lớn thường quá ít phút để có thể dễ dàng nhận thấy, và hoạt động vào ban ngày và vào buổi tối.', 'Ấu trùng hình thành các mỏ ngoằn ngoèo trong lá (Hình 3) và hiếm khi ra quả của vật chủ. Những mỏ này được lấp đầy bởi một đường viền trung tâm. Đặc điểm này giúp tách loài sâu vẽ bùa này khỏi sâu vẽ bùa. Ấu trùng sâu vẽ bùa chỉ phá hoại những tán lá non, đỏ rực. Con trưởng thành đẻ trứng ở cả mặt trên và mặt dưới của lá có chiều dài dưới 1,27 cm (1/2 in). Các báo cáo từ Úc cho thấy sự xâm nhập của một đến ba quả mìn trên mỗi lá, trong khi điều kiện ẩm ướt hơn ở các khu vực khác, chẳng hạn như Florida, có thể hỗ trợ nhiều thợ khai thác trên lá hơn (Jones 2001).', 'kiểm soát sinh học và các ứng dụng của dầu là những phương pháp phù hợp để giúp giảm quần thể CLM. Thiên địch đã có mặt ở Florida đã đối phó với sự phá hoại của sâu vẽ bùa, gây ra tỷ lệ chết ấu trùng và nhộng lên đến 90%. Những kẻ thù tự nhiên này bao gồm loài ký sinh trùng Ageniaspis citricola được giới thiệu thành lập ở hầu hết Florida và là nguyên nhân gây ra tới 30% tỷ lệ tử vong này chủ yếu vào cuối năm (Rogers, Stansly và Stelinski 2009). Rõ ràng, Ageniaspis citricola đã được đưa vào Hawaii cùng lúc với sâu vẽ bùa hại cây có múi. Kể từ đó, Ageniaspis citricola đã lan rộng ra tất cả các đảo và có khả năng kiểm soát tốt (Nagamine và Heu 2003).', 'được tìm thấy trên khắp thế giới, bao gồm Argentina, Úc, Brasil, Trung Quốc, Corse, Costa Rica, Cuba, Ấn Độ, Israel, Malaysia, Mauritius, Nam Phi, México, Philippines, Tây Ban Nha, và Hoa Kỳ.', 'null', 'insect_Phyllocnistis_citrella_Stainton/64463.jpg', 'Phyllocnistis', 'null'),
('Phyllocoptes oleiverus ashmead', 'Phyllocoptes oleiverus ashmead', 'insect_Phyllocoptes_oleiverus_ashmead', 'Trạng thái quá đông của côn trùng và nơi trú ngụ của bọ xít rỉ sắt có múi khác nhau tùy thuộc vào nhiệt độ trong mùa đông. Ở Tứ Xuyên và Chiết Giang, ve trưởng thành được tìm thấy trong chồi nách của cây có múi. Những người khai thác lá và cuốn lá trong mùa đông trên lá chết hoặc cuộn lá và dưới những lát hoa và quả chanh mùa thu; ở Phúc Kiến, chúng mùa đông trên lá và cành xanh trong nhiều loại mạt; ở Quảng Đông, chúng mùa đông trên lá mùa thu. Số lượng phát sinh của bọ xít gỉ sắt có múi thay đổi theo khí hậu. Nó xảy ra từ 18 đến 30 thế hệ một năm, và các thế hệ chồng lên nhau. Ve gỉ sắt nói chung là di truyền biểu sinh, và không có ve trưởng thành đực nào được tìm thấy cho đến nay. Khả năng sinh sản của nó đặc biệt mạnh mẽ. Trứng nói chung rải rác, chủ yếu ở mặt dưới lá và chỗ lõm trên bề mặt quả. Nhộng mới nở nằm yên và hoạt động sau đó. Nhộng bậc hai hoạt động nhiều hơn và bọ trưởng thành hoạt động mạnh; nếu bị quấy rầy, chúng sẽ bò nhanh và có thể tung tăng. Cả ve trưởng thành và nhộng đều ưa bóng râm và kỵ ánh sáng. Chúng có nhiều lá hơn ở cả hai mặt của gân chính ở mặt lưng và ít lá hơn. Trên cây có múi, bệnh này xuất hiện đầu tiên ở phần dưới của ngọn và mặt trong lá, và sau đó chuyển sang Tác hại trên bề mặt quả và lá ngoài. Ve gỉ sắt sống trên cây có múi quanh năm, quy luật xuất hiện và sinh trưởng của chúng thay đổi theo môi trường địa lý, điều kiện khí hậu và giống cây có múi, khi nhiệt độ ban ngày từ 15 ° C trở lên chúng có thể di chuyển đi kiếm ăn. Nhiệt độ trung bình hàng ngày đạt khoảng 15 ℃, chồi mùa xuân bắt đầu đẻ trứng khi chúng nảy mầm. Các chồi mới và lá mềm bắt đầu leo ​​vào đầu tháng 4. Chúng tập trung ở cả hai mặt của gân chính của lá trở lại để gây hại. Sau giữa tháng 5, mật độ côn trùng tăng nhanh, lan rộng trên bề mặt quả vào tháng 7 và tháng 8, quần thể bọ xít phát triển cao nhất trong năm từ tháng 7 đến tháng 8, thời kỳ cao điểm từ tháng 7 đến tháng 10. Có nhiều mạt trên một lá và một quả, có hàng trăm đến hơn nghìn trứng. Có một số lượng lớn xác côn trùng và lớp vỏ lột xác trên bề mặt lá và quả, giống như một lớp bụi mỏng, trước thời kỳ này là thời kỳ thích hợp để phòng trừ bằng hóa chất. Sau tháng 8, một phần quần thể bọ ve chuyển sang chồi và lá mùa thu cùng năm, cho đến tháng 11 vẫn có thể thấy chúng ăn lá và quả. Từ tháng 7 đến tháng 9, chúng thường phát tán tràn lan trong điều kiện nhiệt độ cao hơn và độ ẩm. Ve gỉ sắt có kích thước nhỏ và có thể phát tán và lây lan qua việc vận chuyển côn trùng, chim, thiết bị, cây con và trái cây theo gió. Có 7 loại thiên địch của loài ve này, trong đó giun nhiều tơ là thiên địch hữu hiệu. Chú ý bảo vệ, sử dụng cẩn thận hỗn hợp Boocđô và các chế phẩm đồng khác để phòng trừ bệnh, đồng thời chú ý xu hướng phát triển của bọ xít rỉ sắt ở thời điểm nào để phòng trừ kịp thời.', 'có kích thước nhỏ, khi quan sát dưới kính lúp sẽ thấy bọ non và nhộng có hình nêm, bọ trưởng thành có hình củ cà rốt. Bọ trưởng thành và nhộng tụ lại trên lá, quả và ngọn cành và gây hại, lá bị hại tạo thành lá gỉ sắt, quả bị hại tạo thành quả có vỏ đen', 'Mọt rỉ sắt có múi ưa môi trường bóng râm, chúng thường bắt đầu từ dưới và trong tán, lan dần ra ngoài và phần trên của tán, ở giai đoạn đầu hại tập trung trên lá, mức độ gây hại là chủ yếu là trên trái ở giai đoạn sau. Mật độ quần thể côn trùng cao trên mặt sau của lá mới, dưới quả và ở mặt sau của mặt trời. Những vườn cam được quản lý rộng rãi, cây yếu bị thiệt hại nặng. Nhiệt độ cao và khô hạn là điều kiện thuận lợi cho sự xuất hiện của bọ xít gỉ sắt trên cây có múi, chủ yếu xuất hiện vào mùa nhiệt độ cao mùa hè và mùa thu.', 'Phòng trừ nông nghiệp: Kết hợp tỉa nhựa, cắt bỏ cành rậm rạp, thông thoáng tán, giảm mật độ côn trùng; trồng cỏ ba lá và các loại cây che phủ khác trên mặt đất, tưới nước hợp lý trong thời kỳ khô hạn để duy trì độ ẩm cho vườn cam.\r\n\r\nPhòng trừ hóa học: Từ tháng 6 đến tháng 9, phun dung dịch pyridaben 20% 1000 lần, spirodiclofen 24% lần 4000 lần, dung dịch 96% dysenzinc 600 lần, và bón 2-3 lần, cứ cách 30 ngày phun 1 lần.\r\n\r\nKhi sử dụng thuốc trừ sâu, vui lòng mặc quần áo bảo hộ và tuân theo các hướng dẫn trên nhãn sản phẩm, chẳng hạn như liều lượng, thời gian sử dụng và khoảng thời gian trước khi thu hoạch.', 'phân bố trên toàn thế giới trên cây có múi.', 'null', '', 'Gallidae', 'null'),
('Phyllotreta striolata', 'Bọ nhảy', 'insect_Phyllotreta_striolata', 'Con trưởng thành là một loại bọ cánh cứng, hình bầu dục, cơ thể dài khoảng 2-2,5mm, cánh cứng, màu đen bóng, giữa mỗi cánh có một vạch màu vàng nhạc, cong hình củ lạc, chân sau to khỏe, có sức nhảy dài nên gọi là bọ nhảy sọc cong. Chúng có khả năng nhảy xa và bay rất khỏe. Một con trưởng thành cái có thể đẻ đến 200 trứng, ở dưới đất xung quanh vùng rễ chính của cây.\n\n- Trứng của bọ nhảy rất nhỏ, màu vàng nhạt đẻ trên mặt đất gần gốc cây. \n\n- Sâu non màu trắng ngà hoặc màu vàng tươi. Sâu non đẩy sức dài khoảng 5 - 6 mm, sống và làm nhộng dưới đất.\n\n- Ấu trùng nằm trong đất, có hình ống, màu vàng nhạt, đẫy sức dài khoảng 4mm, chúng cắn phá rễ và củ (cải củ), tạo ra những đường lõm ngoằn ngèo, hoặc thành lỗ ăn sâu vào trong củ, trong rễ, làm cho cây cải bị còi cọc, chậm lớn, củ và rễ dễ bị thối.\n', '', '', '', '', 'null', '', 'Phyllotreta', 'null'),
('Pieris Brassicae', 'bướm đêm trắng', 'insect_Pieris_Brassicae', 'Con cái đẻ trứng đơn lẻ, chủ yếu ở mặt dưới của lá cây chủ, đôi khi ở thân cây (Scott 1986, 1992, 2006; James và Nunnallee 2011). Số lượng trứng trên một noãn (1/8 tổng số) khoảng 90 (Ehrlich và Ehrlich 1978). Trứng nở trong khoảng 4-5 ngày (tùy thuộc vào nhiệt độ), phát triển nhanh chóng từ kích thước L1 đến kích thước L5 và nhộng trong khoảng 18-21 ngày sau khi trứng nở, con trưởng thành nở (nhộng ra khỏi nhộng) trong khoảng 8-10 ngày (Guppy và Shepard 2001; James và Nunnallee 2011). Sâu non đục vào lá, ăn cả hoa và quả, không xây tổ, nhộng trên cây ký chủ; nhộng ngủ đông (Scott 1979, 1986; Guppy và Shepard 2001; James và Nunnallee 2011). Con đực tuần tra suốt cả ngày dọc theo những con đường mòn, con đường, những con suối có bóng râm để tìm kiếm những con cái', 'Được xác định tốt nhất bởi sự kết hợp của bề mặt từ trắng không nguyên chất đến nhiều bụi với màu đen, vảy đen tập trung dọc theo các gân cánh và gần như không có trong các tế bào giữa các gân; mặt dưới gần như vô nhiễm màu trắng đến ngả vàng, có nhiều đường gân xanh xám dọc theo các đường gân.', 'Rừng và đồng cỏ ẩm, khoảng trống của rừng cây lá kim, dọc theo các dòng suối, ven đường, khe, thấm, lãnh nguyên (Scott 1986; Opler và Wright 1999; Glassberg 2001; Pyle 2002). Trong Vườn quốc gia Glacier, Montana đã báo cáo về đường trên trong địa hình núi cao (Debinski 1993); trong Hệ sinh thái Greater Yellowstone được báo cáo trong rừng cây lá kim và rụng lá râm mát, rừng và ven rừng, lãnh nguyên, ven đường và đồng cỏ ẩm ướt trên núi', 'Dùng vợt bắt bướm, ngắt nhộng trên lá, thu dọn và hủy bỏ tàn dư cây trồng.Luân phiên sử dụng một số loại thuốc sau: Emamectin; Lufenuron và hỗn hợp có hoạt chất (Chlorantraniliprole + Abamectin)…', 'Châu Âu, Bắc Phi và Châu Á đến dãy Himalaya thường ở các khu vực nông nghiệp, đồng cỏ và đất công viên.', 'null', 'insect_Pieris_Brassicae/11817.jpg', 'Pieris (Lepidoptera)', 'null'),
('Pieris canidia', 'Sâu xanh bướm trắng', 'insect_Pieris_canidia', 'Vòng đời của sâu xanh bướm trắng từ 26- 30 ngày. Trong đó giai đoạn trứng từ 6- 8 ngày, sâu non 10- 14 ngày, nhộng 7- 8 ngày. Bướm vũ hóa sau 3-4 ngày thì đẻ trứng. Sâu phát sinh và gây hại nặng từ tháng 10 năm trước đến tháng 5 năm sau, nhưng thường nặng nhất từ tháng 2 đến tháng 5 vì thời tiết lúc này phù hợp với sinh trưởng và phát triển của sâu. Sâu xanh thường tập trung và gây hại nặng ở những ruộng rau xanh tốt. Vì vậy trong kỹ thuật thâm canh cần lưu ý bón phân hợp lý, cân đối và đúng thời kỳ sinh trưởng của cây.', 'Con đực có màu kem từ trắng đến nhạt ở mặt trên của nó. Phần đáy của cánh trước, phần đáy của chi phí, và phần đáy và rìa trên của ô có một lớp vảy đen rải rác. Nó có màu đen từ đỉnh đến khoảng giữa của lề đầu cuối. Ở mặt sau, màu đen kéo dài một khoảng rất ngắn theo hình tam giác dọc theo các tĩnh mạch. Có một đốm đen tròn ở khoảng trống 3. Cánh sau có một đốm đen dưới màng xương như ở Pieris rapae nhưng nhìn chung lớn hơn và dễ thấy hơn, và một loạt bốn hoặc năm đốm đen cuối có kích thước khác nhau ở các đỉnh của gân.Mặt dưới: cánh trước màu trắng; tế bào và chi phí được chiếu xạ nhẹ (lốm đốm) với các vảy đen; đỉnh có màu hơi rộng với màu vàng đục. Các giao điểm 1, 3 và 5 có các đốm đen phụ dễ thấy; vị trí trong khoảng trống 1 đôi khi mở rộng ra ngoài khoảng trống 1. Vị trí đó trong khoảng cách 5 không được xác định rõ. Mặt sau: từ màu trắng nhạt, gần như trắng, đến sẫm màu, toàn thân dày đặc (ngoại trừ một vệt dọc trong tế bào, và ở các mẫu vật sẫm màu hơn, các vệt dọc tương tự ở các kẽ) có vảy đen; costa trên vân 8 có màu vàng chrome. Ăng-ten có màu đen với các đốm trắng nhỏ; các lông dài trên đầu và ngực có màu xám lục; phần bụng màu đen. Bên dưới, đầu, ngực và bụng có màu trắng. [3]\r\n\r\nCon cái tương tự con đực ở mặt dưới nhưng rải rác có vảy đen nổi rõ hơn; màu đen trên đỉnh và đầu của cánh trước và các đốm đen trên đầu của cánh sau rộng hơn và kéo dài hơn vào phía trong; ở mặt trước có thêm một đốm ở khoảng trống 1, và cả đốm này và đốm ở khoảng trống 3 trong nhiều mẫu vật được nối với nhau bằng một đường vảy đen dọc theo các đường gân với đường viền đen bên ngoài; còn điểm trong khoảng trống 1 thường kéo dài qua tĩnh mạch 1 vào khoảng trống bên dưới. [3] [4]\r\n\r\nNó có sải cánh dài 42–60 mm.', 'Loài này xuất hiện ở các khu vực có cỏ và ruồi trong nhóm của Chim hải âu sọc và Psyche, cả hai đều có chung cây ký chủ địa phương với Bắp cải trắng. Nó là một loài bay yếu ớt, và bám sát mặt đất để tìm kiếm những bông hoa để kiếm ăn. Vào những ngày nắng, nó bay không ngừng nghỉ, và hiếm khi dừng lại lâu. Loài này thỉnh thoảng có thể được tìm thấy ở các vùng đất hoang, các cách trang trại và đất công viên và đôi khi phổ biến ở những nơi nó xuất hiện. Thông thường, một số cá thể được nhìn thấy cùng một lúc, đặc biệt là ở vùng lân cận của cây chủ. Con đực có thói quen bơi lội trong vũng nước để hút khoáng chất. Mặc dù C & P4 đã mô tả Bắp cải trắng không phải là hiếm ở Singapore, tuy nhiên, việc nhìn thấy loài này đã trở nên ít thường xuyên hơn trong những năm qua.', 'Trải qua vô số các thử nghiệm về phòng trừ bướm đêm như: dùng thuốc sinh học, dùng bẫy nhử, dùng keo, dùng đèn cao áp đuổi bướm nhưng không hiệu quả. Lão nông chủ trang trại cam khe mây Phương Oánh đã thử nghiệm và thành công với phương pháp ”Mắc màn cho cây ngủ” . Hai năm nay ông đã không còn phải thức đêm ngủ ngày để bắt bướm.', 'Nó sống ở cận Himalaya Ấn Độ và Pakistan từ Chitral, Kashmir đến Sikkim và Bhutan, độ cao từ 2.000 đến 11.000 ft (610 đến 3.350 m); những ngọn đồi ở miền nam Ấn Độ; Assam; Thượng Mianma : các bang Shan; mở rộng sang Trung Quốc.', 'null', 'insect_Pieris_canidia/40196.jpg', 'Pieris (Lepidoptera)', 'null');
INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('Piezodorus hybneri', 'Bọ xít xanh vai đỏ', 'insect_Piezodorus_hybneri', 'Vòng đời:\nkhoảng 65 - 70 ngày\n\n+ Giai đoạn trứng: 5 - 7 ngày (mùa đông 14 - 21 ngày).\n\n+ Giai đoạn sâu non: 20 - 30 ngày.\n\n+ Giai đoạn trưởng thành: sống nhiều tháng.Bọ xít trưởng thành hoạt động giao phối vào ban ngày, lúc 9-10 giờ sáng, trứng được đẻ thành từng ổ, mỗi ổ trứng có từ 30-130 trứng; mỗi con cái đẻ từ 50-500 trứng. Bọ xít trưởng thành có tập tính qua đông và qua đông trong vỏ cây, tàn dư lá cây hoặc những khu vực khác. Mùa xuân đến, nhiệt độ ấm lên, bọ xít xanh chui ra khỏi nơi ẩn nấp, phá hại và đẻ trứng. Con cái có thể bắt đầu đẻ sau khi hoá trưởng thành 3-4 tuần. Bọ xít trưởng thành thích ánh sáng đèn. Trưởng thành có thể di chuyển xa với khoảng cách hàng cây số.', '', '', '', '', 'null', '', 'Piezodorus', 'null'),
('Platymycterus sieversi', 'Câu cấu xanh nhỏ', 'insect_Platymycterus_sieversi', 'Vòng đời phát triển của câu cấu xanh hại xoài bao gồm các giai đoạn: Thành trùng, sâu non, trứng, nhộng. Đặc điểm của mỗi giai đoạn như sau:\n\n- Thành trùng là bọ cánh cứng, thân bầu dục, trên toàn thân có phủ lớp ánh kim nhũ, trưởng thành cái màu xanh, trưởng thành đực có màu vàng, đầu kéo dài như một cái vòi, dài khoảng từ 10 - 15mm, mỏ nhọn và quặp.\n\n- Sâu non: Màu trắng sữa, vàng nhạt mình hơi cong, không có chân, sống trong đất ăn chất hữu cơ và rễ cây. Đục phá rễ và gốc cây, làm nhộng trong đất.\n\n- Trứng: Đẻ rải rác, rời rạc từng quả trên mặt đất, hình bầu dục, dài khoảng 1mm, màu trắng ngà. Chúng sống từng cụm 3 – 4 con, núp phía dưới mặt lá, giả chết khi rơi xuống đất khi bị động.\n- Nhộng: Màu trắng ngà, dài khoảng 10mm, nằm trong đất.', '', '', '', '', 'null', '', 'Corigetus', 'null'),
('Plautia crossota', 'Bọ xít xanh cánh gụ', 'insect_Plautia_crossota', 'Một con bọ xít xanh có vòng đời khoảng 65 – 70 ngày. Trong đó 5 – 7 ngày là giai đoạn trứng, 20 – 30 ngày là giai đoạn sâu non và giai đoạn trưởng thành có thể kéo dài đến vài tháng.\n\nThời điểm giao phối của những con bọ xít trưởng thành diễn ra vào ban ngày, khoảng 9 – 10 giờ sáng. Bọ xít cái đẻ trứng thành từng ổ, mỗi ổ có từ 30 – 130 trứng. Mỗi con bọ xít cái có thể đẻ từ 50 – 500 trứng,\n\nBọ xít xanh trưởng thành có tập trình qua đông và quá đông ở trong tàn dư lá cây, vỏ cây hoặc khu vực kín đáo khác. Vào mùa xuân, thời tiết ấm áp dần lên chúng sẽ chui ra khỏi nơi ẩn nấp, bắt đầu lớn nhanh, phá hoại và sinh sản. Sau khi trưởng thành khoảng 3 – 4 tuần những con cái bắt đầu đẻ trứng. Bọ xít trưởng thành di chuyển nhanh nhẹn và đi xa hàng cây số. Những con bọ xít trưởng thành cũng rất thích những nơi sáng đèn.', '', '', '', '', 'null', '', 'Plautia', 'null'),
('Plutella xylostella', 'Sâu tơ', 'insect_Plutella_xylostella', 'Trứng: Trứng của bướm đêm Diamondback có hình bầu dục và dẹt, dài 0,44 mm và rộng 0,26 mm. Trứng có màu vàng hoặc xanh lục nhạt, được gửi đơn lẻ hoặc thành từng nhóm nhỏ từ hai đến tám trứng ở chỗ lõm trên bề mặt tán lá, hoặc thỉnh thoảng trên các bộ phận khác của cây. Con cái có thể gửi 250 đến 300 trứng nhưng tổng sản lượng trứng trung bình có thể là 150 trứng. Thời gian phát triển trung bình 5,6 ngày.\n\nẤu trùng:Bướm đêm diamondback có bốn phiên bản. Thời gian phát triển trung bình và phạm vi lần lượt là khoảng 4,5 (3-7), 4 (2-7), 4 (2-8) và 5 (2-10) ngày. Trong suốt quá trình phát triển của chúng, ấu trùng vẫn khá nhỏ và hoạt động. Nếu bị quấy rầy, chúng thường vặn vẹo dữ dội, lùi lại phía sau và quay xuống từ cây trên một sợi tơ. Chiều dài tổng thể của mỗi tấm hiếm khi vượt quá 1,7, 3,5, 7,0 và 11,2 mm, tương ứng đối với các tấm từ 1 đến 4. Chiều rộng trung bình của viên nang đầu cho các tấm này là khoảng 0,16, 0,25, 0,37 và 0,61 mm. Cơ thể ấu trùng hình thành các đầu thuôn nhọn ở cả hai đầu, và một đôi ống chân nhô ra từ đầu sau, tạo thành chữ \"V\" đặc biệt. Ấu trùng không có màu trong lần đầu tiên, nhưng sau đó có màu xanh lục. Cơ thể mang tương đối ít lông, có chiều dài ngắn, và hầu hết được đánh dấu bằng sự hiện diện của các mảng trắng nhỏ. Có năm cặp prolegs. Ban đầu, thói quen kiếm ăn của ấu trùng mới bắt đầu là khai thác lá, mặc dù chúng rất nhỏ nên rất khó nhận thấy các mỏ. Ấu trùng chui ra từ mỏ của chúng khi kết thúc lần đầu tiên, lột xác bên dưới lá, và sau đó ăn ở bề mặt dưới của lá. Việc nhai của chúng dẫn đến những mảng hư hại không đều và biểu bì trên của lá thường không còn nguyên vẹn.\n\nNhộng: Nhộng xuất hiện trong một kén tơ lỏng lẻo, thường hình thành ở mặt dưới hoặc mặt ngoài của lá. Ở súp lơ và bông cải xanh, có thể xảy ra hiện tượng nhộng trong các bông hoa. Nhộng màu vàng có chiều dài từ 7 đến 9 mm. Thời gian của kén trung bình khoảng 8,5 ngày (từ năm đến 15 ngày).Con trưởng thành là một loài bướm đêm nhỏ, mảnh, màu nâu xám với các râu rõ rệt. Nó dài khoảng 6 mm và được đánh dấu bằng một dải màu kem rộng hoặc nâu nhạt dọc theo lưng. Các dải này đôi khi được thắt lại để tạo thành một hoặc nhiều viên kim cương sáng màu trên lưng, đó là cơ sở cho tên gọi chung của loài côn trùng này. Khi nhìn từ bên cạnh, có thể thấy các đầu của cánh hơi quay lên trên. Con đực và con cái trưởng thành lần lượt sống khoảng 12 và 16 ngày, và con cái gửi trứng trong khoảng 10 ngày. Bướm đêm là loài bay yếu ớt, thường bay cách mặt đất 2 m và không bay xa. Tuy nhiên, chúng dễ dàng bị gió cuốn đi. Con trưởng thành là giai đoạn mùa đông ở các khu vực ôn đới, nhưng bướm đêm không sống được qua mùa đông lạnh giá như được tìm thấy ở hầu hết Canada. Chúng thường xuyên tái xâm nhập những khu vực này vào mỗi mùa xuân,', '', '', '', '', 'null', '', 'Plutella', 'null'),
('Polyphagotarsonemus latus', 'broad mite', 'insect_Polyphagotarsonemus_latus', 'Ve rộng có bốn giai đoạn trong vòng đời của nó: trứng, ấu trùng, nhộng và trưởng thành. Con cái trưởng thành đẻ từ 30 đến 76 trứng (trung bình năm quả mỗi ngày) ở mặt dưới của lá và ở chỗ lõm của quả nhỏ trong thời gian từ 8 đến 13 ngày rồi chết. Con đực trưởng thành có thể sống từ năm đến chín ngày. Trong khi những con cái chưa giao phối đẻ trứng trở thành con đực, những con cái giao phối thường đẻ 4 quả trứng cho mỗi quả trứng của con đực.Trứng nở sau hai hoặc ba ngày và ấu trùng chui ra khỏi trứng để kiếm ăn. Ấu trùng di chuyển chậm và không phân tán xa. Sau hai hoặc ba ngày, ấu trùng phát triển thành giai đoạn ấu trùng (nhộng) tĩnh lặng. Ấu trùng cái chưa trưởng thành trở nên hấp dẫn đối với những con đực nhặt chúng và mang chúng đến những tán lá mới.', 'Con trưởng thành: Ve cái dài khoảng 0,2 mm và có đường viền hình bầu dục. Cơ thể của chúng phồng lên và có màu từ vàng nhạt đến hổ phách hoặc xanh lục với một đường sọc ở giữa, nhạt, không rõ ràng, ở gần phần cuối của cơ thể. Con đực có màu tương tự nhưng không có sọc. Hai chân sau của con cái trưởng thành tiêu giảm thành phần phụ giống roi. Con đực nhỏ hơn (0,11mm) và di chuyển nhanh hơn con cái. Chân sau mở rộng của con đực được sử dụng để nhấc nhộng cái và đặt nó ở góc vuông với cơ thể của con đực để giao phối sau này (Peña và Campbell 2005).Trứng: Trứng không màu, trong mờ và có hình elip. Chúng dài khoảng 0,08 mm và được bao phủ bởi 29 đến 37 búi trắng rải rác ở bề mặt trên (Đan Mạch 1980, Peña và Campbell 2005, Baker 1997).\r\n\r\nẤu trùng: Những con ve non rộng chỉ có ba cặp chân. Chúng di chuyển chậm và có vẻ hơi trắng do những đường gờ nhỏ trên cơ thể (Peña và Campbell 2005). Khi lớn lên, chúng có kích thước dài từ 0,1 đến 0,2 mm (Ẩn danh a). Giai đoạn tĩnh lặng xuất hiện như một ấu trùng bất động, căng sữa (Baker 1997).\r\n\r\nNhộng: Sau một ngày, ấu trùng trở thành một nhộng tĩnh lặng, rõ ràng và nhọn ở cả hai đầu. Giai đoạn nymphal kéo dài khoảng một ngày. Nhộng thường được tìm thấy ở những chỗ lõm trên quả, mặc dù nhộng cái thường do con đực mang theo (Peña và Campbell 2005).', 'Con đực và con cái rất hiếu động, nhưng những con đực dường như chiếm phần lớn trong việc phát tán một quần thể bọ ve rộng lớn trong sự điên cuồng của chúng để mang những ấu trùng cái đang yên lặng chuyển sang những chiếc lá mới. Khi con cái xuất hiện từ giai đoạn tĩnh lặng, con đực ngay lập tức giao phối với chúng (Anonymous a, Baker 1997, Peña và Campbell 2005). Cũng có những báo cáo về loài ve rộng sử dụng vật chủ là côn trùng, đặc biệt là một số loài ruồi trắng, để di chuyển từ cây này sang cây khác (Palevsky et al. 2001).Các con ve có thể tụ tập thành các kẽ hở và chồi (Đan Mạch 1980). Bọ ve thích mặt bóng râm của trái cây, mặt này thường hướng về phía cây trồng, vì vậy phải dành thời gian và công sức để kiểm tra trái cây thích hợp', 'Trong khi một số loại thuốc diệt côn trùng được dán nhãn để kiểm soát loài gây hại này, các loại dầu hoặc xà phòng diệt côn trùng thường hiệu quả và ít độc hại hơn đối với môi trường. Để kiểm soát diện tích lớn hoặc trong nhà kính, có sẵn các chất kiểm soát sinh học, bao gồm một số loài ve ăn thịt (Wilkerson 2005, Peña và Campbell 2005, Fan và Petitt 1994, Peña et al. 1996). Ngoài ra, có thể sử dụng phương pháp xử lý nước nóng để kiểm soát bọ ve mà không làm cây bị thương. Điều này liên quan đến việc hạ thấp cây trồng xuống nước được giữ ở 43 đến 49 ° C (109,4-120,2 ° F) trong 15 phút (Ẩn danh a).', 'Polyphagotarsonemus latus có phân bố trên toàn thế giới và được biết đến với một số tên thông thường. Ở Ấn Độ và Sri Lanka, nó được gọi là mạt trà vàng, trong khi những người ở Bangladesh gọi nó là mạt đay vàng. Ở một số nước châu Âu, nó được gọi là nhện rộng. Ở các vùng của Nam Mỹ, nó được gọi là mạt nhiệt đới hoặc mạt gỉ rộng (Ẩn danh a).', 'null', 'insect_Polyphagotarsonemus_latus/43342.jpg', 'Polyphagotarsonemus', 'null'),
('Pomacea canaliculata', 'Ốc bươu vàng', 'insect_Pomacea_canaliculata', 'Ốc thuộc nhóm thụ tinh trong, thường đẻ trứng vào chiều tối. Khi đẻ leo lên giá thể cao trên mặt nước, trứng bám thành chùm, màu hồng, có khoảng 120 - 500 trứng. Trứng nở sau 12 - 15 ngày, nở hết trong 2 - 7 ngày. Tỉ lệ nở khoảng 70%, tỉ lệ sống sau 10 ngày tuổi khoảng 80%. Tuổi thành thục sớm 100 ngày, thời gian tái phát dục ngắn, khoảng 3 ngày. Khi thời tiết ấm lên cũng là lúc ốc bươu vàng sinh sản mạnh.\n\nTuổi thọ 2 - 4 năm. Trong quần đàn, tỉ lệ con đực/cái khoảng 1/4. Tuỳ theo loại thức ăn có được mà tốc độ sinh trưởng nhanh, chậm khác nhau. Ốc bươu vàng ăn thực vật, thức ăn ưa thích là xà lách, bèo tấm, mạ non, rau muống, vv... ốc bươu vàng là đối tượng hại lúa hay dưa hấu,đặc biệt là mạ dưới 3 tuần có thể bị ốc ăn hết toàn bộ.\n\nỐc bươu vàng giao phối với ốc bươu bản địa, ốc lác. Lai tạo thế hệ ốc mới có đặc tính khác biệt như: mài ốc cứng hơn (kế thừa từ ốc bản địa), cấu trúc vỏ + màu trứng + kích cỡ trứng + đặc điểm khi sinh sản giống với ốc bươu vàng \"gốc\". Đây cũng là nguyên nhân chính dẫn đến ốc bản địa dần biến mất.', '', '', '', '', 'null', '', 'Pomacea', 'null'),
('Poophilus costalis', 'Ve sầu bọt, Ve sầu nhảy, bọ nước bọt', 'insect_Poophilus_costalis', 'Sau khi giao phối, ve cái đào những rãnh nhỏ lên vỏ các cành cây và đẻ trứng vào đó. Ve cái có thể làm nhiều lần như vậy cho đến khi nó đẻ hết vài trăm trứng. Khi trứng nở, ấu trùng ve rơi xuống và đào sâu vào trong đất. Hầu hết các loài ve có vòng đời từ 2 đến 5 năm. Một số loài có vòng đời dài hơn nhiều, ví dụ như loài Magicicada có vòng đời 17 năm và đôi khi là 13 năm. Những vòng đời dài như thế là một sự thích ứng để chống lại các loài ăn thịt ve như loài ong bắp cầy ăn ve và bọ ngựa bởi vì các loài ăn thịt này không thể thường xuyên xuất hiện đồng thời với ve.\n\nPhần lớn cuộc đời của ve là thời kỳ ấu trùng ở dưới đất với độ sâu khoảng từ 30 cm (1 ft) đến 2,5 m (khoảng 8½ ft). Các ấu trùng ve hút nhựa rễ cây và có những chân trước đào bới rất khỏe.\n\nKhi đến giai đoạn chuyển tiếp cuối cùng để kết thúc thời kỳ ấu trùng, những ấu trùng ve đào một đường hầm lên mặt đất và chui lên. Sau đó, chúng lột xác lần cuối trên một cái cây gần đó và trở thành ve trưởng thành. Xác ve vẫn còn nằm đó và gắn vào vỏ cây.', '', '', '', '', 'null', '', 'Poophilus', 'null'),
('Popillia japonica', 'Bọ cánh cứng nhật bản', 'insect_Popillia_japonica', 'Trứng nở vào cuối mùa hè, ấu trùng chui ra khỏi trứng và bắt đầu ăn rễ cây. Chúng trải qua mùa đông trong các lớp đất đá để tránh rét.\n\nVào mùa xuân, ấu trùng thức dậy và tiếp tục ăn rễ cây. Vào đầu mùa hè là thời điểm chúng đã sẵn sàng để hóa nhộng dưới lòng đất.\n\nNgười lớn xuất hiện vào cuối tháng 6 của mùa hè, chúng ăn lá và giao phối trong ngày. Bọ cái sẽ đào các hốc đất sâu vài inch để đặt những quả trứng. Hầu hết, vòng đời bọ cánh cứng Nhật Bản kéo dài một năm, nhưng ở các vùng phía Bắc có thể kéo dài đến hai năm.', '', '', '', '', 'null', '', 'Popillia', 'null'),
('Prays citri', 'Sâu đục vỏ trái', 'insect_Prays_citri', 'Thành trùng sâu đục trái: Con trưởng thành của loài sâu này có kích thước nhỏ, chiều dài sải cánh 14 - 20mm, chiều dài thân 6 mm, màu nâu. Toàn thân và cánh màu vàng, trên cánh có nhiều chấm đen.- Ấu trùng sâu đục trái: Ấu trùng dài khoảng 10 - 22 mm, sâu non có màu hồng hoặc màu hồng tím, đầu nhỏ màu nâu đen, thân mầu trắng ửng hồng, hai đốt ngực (trước và giữa) và hai đốt thân ở cuối đuôi thường có mầu trắng hơi hồng, các đốt còn lại có mầu hồng. Mỗi đốt sống lưng có 4 đốm nâu nhạt, 2 đốm trên to, hai đốm dưới dài và hẹp, trên mỗi đốm  đều có  lông cứng nhỏ, mỗi có một  đốm nhỏ mầu nâu ở bên hông cơ thể, lổ thở mầu đen.\n\n- Nhộng và trứng: Nhộng mới nở màu lợt, lúc sắp vũ hóa chuyển sang màu nâu sậm, dài 6 - 8mm, thời gian nhộng kéo dài khoảng 8 ngày. Trứng sâu đục trái hình bầu dục, dài khoảng  2-2,5 mm.', '', '', '', '', 'null', '', 'Prays', 'null'),
('Psalis securis', 'Sâu róm lúa', 'insect_Psalis_securis', 'Sâu trưởng thành: Sâu trưởng thành có màu nâu đất, thân phủ lông dẹt, dầy, màu nâu, có vòi, râu miệng vểnh lên. Chân phủ lông, có một đôi gai nhỏ ở đốt chầy. Kích thước trung bình của ngài cái thường lớn hon con đực. Trưởng thành đực chiều dài thân trung bình 28,2mm (±0,5mm), chiều dài cánh 20,3mm (±0,lmm); kích thước trưởng thành cái chiều dài thân trung bình 30,lmm (±0,6mm), chiều dài cánh 26,9mm (±0,2mm). Mắt kép màu xanh vàng, cánh của ngài đực và ngài cái có các đặc điểm và màu sắc giống nhau. Cánh trước màu nâu sẫm hơn cánh sau, mép ngoài và phía dưới cánh trước có nhiều chấm nâu sẫm. Ở phía ngoài cánh có 8 chấm sẫm xếp thành hình số 3. Giữa cánh có nhiều chấm nhạt xếp thành đường cong gẫy. Cuối gốc cánh có 1 chấm trắng. Râu con đực hình lông chim (Hình 1). Râu con cái hình răng cưa xếp theo hình sợi chỉ (Hình 2).\n\n*/ Trứng: Trưởng thành đẻ trúng từng dãy hoặc từng đám dọc theo lá thông, trứng có hình khối elíp. Khi mới đẻ, trứng có màu xanh nhạt, sau dần chuyển thành màu hồng, khi sắp nở có màu hồng xẫm (Hình 3).\n\n*/ Sâu non\n\nSâu non thay đổi theo tuổi về kích thước và màu sắc. Thân của sâu non phủ lông đơn và lông kép. Thân gồm 12 đốt, có 3 đôi chân ngực và 5 đôi chân bụng. Sâu non có sự biến đổi rõ rệt về màu sắc, hình thái trong từng giai đoạn tuổi và sâu non lột xác 5 lần.', '', '', '', '', 'null', '', 'Psalis', 'null'),
('Pseudococcus comstocki', 'Comstock mealybug', 'insect_Pseudococcus_comstocki', 'Trứng nở vào cuối mùa xuân và nhộng ăn lá và chồi non cho đến khi hoàn thành sự phát triển vào khoảng đầu tháng Bảy. Những con trưởng thành này sau đó đẻ trứng nở trong khoảng 11 ngày, và ấu trùng thế hệ thứ hai phát triển thành con trưởng thành vào đầu mùa thu. Những con trưởng thành này đẻ trứng quá đông và trong một số trường hợp, chính chúng đẻ quá đông.', 'Rệp sáp Comstock cái trưởng thành dài từ 3 đến 5 mm (0,12 đến 0,20 in), không có cánh và có \"17 đôi sợi\" kéo dài từ rìa cơ thể với một đôi dài hơn ở phía sau. Con đực trưởng thành rất nhỏ, tương tự như kích thước của gặm nhấm, và có tuổi thọ ngắn. Các ấu trùng giống như người lớn nữ ngoại trừ \"là nhỏ hơn với ít sáp và không có sợi dài\". Trứng của nó có hình bầu dục dài 0,3 mm (0,012 in) màu cam, tụ lại với nhau trên cành cây, vết cắt trên cây và trên quả vào mùa hè. Trong suốt mùa thu, các cụm trứng được đẻ trong các kẽ hở của vỏ cây. Mỗi khối trứng được gọi là trứng hoặc ổ và nó được bao phủ bởi các sợi trắng giống như bông', 'Tấn công chủ yếu là lê, táo và đào. Con trưởng thành và nhộng (con bò) là những loài ăn nhựa sống trên mô xanh, và tụ tập ở đài hoa và đầu cuống của quả gần khi thu hoạch. Tình trạng dịch hại của rệp sáp Comstock bắt nguồn từ sự phát triển của nấm mốc trên mật ong mà nó tiết ra (C), và từ các vấn đề thẩm mỹ và ô nhiễm do sự hiện diện của nó trong quá trình chế biến.', 'Hóa chất đã được sử dụng để giảm dân số của loài này với hiệu suất 80% mặc dù nó không thành công ở Trung Á. Một hỗn hợp kiểm soát dịch hại sinh học và hóa chất đã loại bỏ thành công các loài này khỏi vườn cây ăn quả và ruộng rau ở nơi từng là một phần của Liên Xô. Parasitoidsvà những kẻ săn mồi được đưa vào California để kiểm soát quần thể loài bao gồm Pseudaphycus malinus , Allotropa aimxifrons , Allotropa burrelli , và Zarhopalus corvinus . [2] Trong một nghiên cứu ở Nhật Bản năm 1980, những con cái trưởng thành còn trinh được lấy từ bí ngô để các nhà khoa học có thể chiết xuất pheromone giới tính của chúng để bắt những con đực.', 'Loài này có nguồn gốc từ Đông Á và nó được đưa vào Trung Á, Đông Âu, Hoa Kỳ, Canada, Brazil và Argentina', 'null', 'insect_Pseudococcus_comstocki/43448.jpg', 'Pseudococcus', 'null'),
('Pseudococcus spp', 'Rệp sáp (khác số 66)', 'insect_Pseudococcus_spp', 'Rệp sáp sinh sản rất nhanh, có thể sinh sản theo kiểu đơn tính và lưỡng tính. Con đực có thêm giai đoạn tiền nhộng và nhộng. Rệp cái đẻ trứng thành từng ổ, một con cái đẻ khoảng 300 - 400 trứng, tỷ lệ nở của trứng khá cao khoảng 80% trở lên. Rệp sáp đẻ trứng sớm, sau khi nở khoảng 20 - 25 ngày (tuổi 3) là rệp sáp bắt đầu đẻ trứng, từ khi bắt đầu đẻ đến lúc ngưng đẻ và chết là khoảng 20 - 30 ngày.', '', '', '', '', 'null', '', 'Pseudococcus', 'null'),
('pseudoplusia includens', 'Sâu đo', 'insect_pseudoplusia_includens', ' Sâu trưởng thành sau khi vũ hóa di chuyển khá chậm chạp và thường đậu tại nơi gần nhộng nghỉ ngơi để cách giang rộng ra. Sau đó sâu trưởng thành cái đã tiết chất dẫn dụ sinh dục cùng với sâu trưởng thành đực ghép đôi rất nhanh giao phối xong con cái tìm nơi đẻ trứng. Trứng thường được đẻ thành từng đám, vị trí đẻ trứng thường ở thân, cành cây chỗ được che bóng. Loài Sâu đo ăn lá Keo tai tượng sâu trưởng thành có tính xu quang. Trong 1 năm sâu trưởng thành xuất hiện 5 đợt: Đợt 1 từ giữa tháng 2 đến giữa tháng 3; Đợt 2 từ cuối tháng 4 đến giữa tháng 5; Đợt 3 trong tháng 7; Đợt 4 giữa tháng 9 đến đầu tháng 10; Đợt 5 từ giữa tháng 11 đến tháng 12.\n\n          Trứng xuất hiện trong năm có 5 đợt, sau khi sâu trưởng thành xuất hiện khoảng từ 2 đến 3 ngày.\n\n          Sâu non là pha duy nhất duy trì dinh dưỡng của sâu, lượng thức ăn của sâu non tùy thuộc vào độ tuổi. Sau khi nở sâu non tuổi 1 đã tìm đường kiếm thức ăn bằng cách nhả tơ để nhờ gió đưa đẩy truyền đến cây khác. Sâu non tuổi nhỏ thường chỉ ăn phần biểu bì lá và ăn từ mép lá vào trong, tuổi lớn hơn sâu ăn toàn bộ lá kể cả gân lá. Sâu non thường không hoạt động mạnh về đêm và sáng sớm. Khi nghỉ ngơi sâu non thường dùng 2 đôi chân bụng ở đốt bụng bám vào cành, lá cây ngả đầu và căng cứng người. Trước khi lột xác vài ngày, sâu non ăn ít, hoạt động chậm sau đó bò xuống thân cây và chui xuống đất ở độ sâu từ 2,5 đến 5,0cm so với mặt đất để hóa nhộng. Thời gian sâu non xuất hiện trong năm gồm 5 đợt như sau: Đợt 1 từ tháng 1 đến giữa tháng 2; Đợt 2 từ tháng 3 đến giữa tháng 4; Đợt 3 tháng 7; Đợt 4 từ giữa tháng 9 đến đầu tháng 10; Đợt 5 từ giữa tháng 11 đến hết tháng 12.\n\n          Nhộng trước khi vào nhộng chính thức sâu đo có 1 đến 2 ngày ở hình thái tiền nhộng, sâu non co mình lại còn dài khoảng từ 34,0 - 36,1mm di chuyển xuống đất để vào nhộng. Thời gian nhộng xuất hiện trong 1 năm có 5 đợt: Đợt1 trong tháng 2; Đợt 2 trong tháng 4; Đợt 3 từ giữa tháng 6 đến đầu tháng 7; Đợt 4 cuối tháng 8 đến cuối tháng 9 và Đợt 5 cuối tháng 10 đến giữa tháng 11.', '', '', '', '', 'null', '', 'Chrysodeixis', 'null'),
('Pseudoxya diminuta', 'Châu chấu cánh ngắn', 'insect_Pseudoxya_diminuta', 'Tuyến nước bọt và ruột giữa cũng có khả năng tiết ra Enzym giúp chúng tiêu hóa thức ăn.\nHệ thần kinh của cào cào (châu chấu) được kiểm soát bởi các hạch phân bổ nhiều đoạn trong đó phần lớn tập trung ở phần đầu hay còn gọi là não bộ.\nChúng cũng sử dụng các bó thần kinh để truyền tín hiệu với các con khác.\nTương tự như các loài côn trùng khác cào cào cũng sinh sản và đẻ trứng bằng cách giao phối với nhau. Khi giao phối con đực sẽ phóng tinh trùng vào buồng trứng thông qua bộ phận sinh dục của con cái.\nSau đó con cái sẽ đẻ trứng xuống sâu dưới đất và trứng sẽ nằm sâu dưới đất cho đến khi nhiệt độ đủ ấm sẽ nở và cào cào con sẽ tự đào hầm để có thể chui lên mặt đất và sinh trưởng.\nVề tuần hoàn và hô hấp thì cào cào hô hấp nhờ tim và hệ động mạch, phần chất lỏng bên trong cơ thể cũng góp phần không nhỏ giúp cho cào cào có thể duy trì sự hô hấp của nó.\nChúng ta vừa tìm hiểu về  con cào cào (châu chấu ) – một loài côn trùng khá nhỏ nhưng lại có một sự phá hoại và sức hủy diệt khá kinh khủng.\nDo đặc tính thường di chuyển thành từng đàn số lượng lớn nên cào cào có khả năng phá hoại mùa màng với tốc độ rất nhanh.\nChúng sẽ gây ảnh hưởng đến bất cứ hoa màu nào mà chúng bắt gặp trên đường đi, bởi thức ăn của cào cào chủ yếu là lá cây và nó đặc biệt ưa thích lúa và ngô – những hoa màu của người nông dân.\nCào cào tuy là một loài côn trùng nhưng nó lại được xem là một loại thực phẩm khá nhiều protein và được xem là đặc sản của một số nước vùng Đông Nam Á. Nếu như có cơ hội thì bạn hãy thử một lần thưởng thức món ăn làm từ cào cào (châu chấu) để cảm nhận hương vị của loài côn trùng này như thế nào nhé.', '', '', '', '', 'null', '', 'Pseudoxya', 'null'),
('Pyrops candelaria', 'Ve sầu vòi voi', 'insect_Pyrops_candelaria', 'Ấu trùng sống ở dưới đất và ăn các lớp mùn thảm thực vật rừng nơi phân bố. Ấu trùng loài này lột xác vào đầu mùa mưa hàng năm.', '', '', '', '', 'null', '', 'Pyrops', 'null'),
('Quasipaa verrucospinosa', 'Ếch gai sần', 'insect_Quasipaa_verrucospinosa', 'đây là loài ăn tạp, thức ăn thuộc Ngành chân khớp (Athropoda) chiếm 68%; sức sinh sản tuyệt đối dao động từ 483 trứng đến 968 trứng/cá thể cái, trung bình 795 trứng/cá thể cái; sức sinh sản tương đối dao động từ 4 đến 6 trứng/g khối lượng cơ thể, trung bình 05 trứng/g khối lượng cơ thể; thời gian hoàn thành sự biến thái 61,43 ngày, ếch con có khối lượng thân trung bình 2,11 g, dài thân trung bình 23,85 mm.', '', '', '', '', 'null', '', 'Quasipaa', 'null'),
('Rattus Rattus', 'Chuột', 'insect_Rattus_Rattus', 'Chuột nhà được biết đến với khả năng sinh sản rất nhanh chóng. Một con chuột cái có khả năng đẻ 8 lứa/năm.mỗi lứa 6 con. Sau khi mang thai 21 ngày những con chuột con sẽ được sinh ra, lúc này chuột con sẽ phụ thuộc hoàn toàn vào mẹ vì chúng chưa thể nhìn thấy ánh sáng. Sau 21 ngày từ khi sinh ra những con chuột con có thể cai sữa và bắt đầu di chuyển ra khỏi tổ để khám phá môi trường. Sau 35 ngày các cơ quan sinh dục của chuột phát triển và có thể giao phối được sau 6 tuần tuổi.', '', '', '', '', 'null', '', 'Rattus', 'null'),
('Recilia dorsalis', 'Rầy điện quang', 'insect_Recilia_dorsalis', 'Thân trưởng thành dài từ 3 đến 4mm, màu vàng nhạt, có các vết màu nâu nhạt. Có 2 đốm nâu vàng nhạt ở mặt trước của vương miện, và 2 đốm nâu vàng nhạt ở mặt sau. Lớp vỏ có màu xám nhạt, ở mỗi góc gốc có một đốm nâu vàng nhạt. Cánh trước có màu vàng xám nhạt, với các sọc rộng màu vàng nâu giống tia chớp, các dải màu xung quanh dày đặc, có các đặc điểm rõ ràng. Mặt bụng của ngực và bụng có màu trắng vàng với những đốm nâu sẫm rải rác. Trứng dài 1 ～ 1,2mm, hình bầu dục, hơi cong, lúc đầu màu trắng, sau chuyển sang màu vàng. Các nhộng có 5 cá thể. Nhộng con cuối cùng có chiều dài 3,5 mm và màu trắng hơi vàng. Hai bên đầu, lưng ngực, bàn chân và 3 phần cuối của bụng có màu nâu, mỗi phần từ 1 đến 6 phần bụng có một đôi vạch màu nâu, chồi cánh đến phần thứ tư của bụng.', '', '', '', '', 'null', '', 'Recilia', 'null'),
('Rhopalosiphum padi', 'chim anh đào-yến mạch', 'insect_Rhopalosiphum_padi', 'Trứng của Rhopalosiphum padi được đẻ vào mùa thu trong khe hẹp giữa chồi nách và thân (xem hình bên dưới).ước tính chỉ có đủ chỗ trong khu vực này cho 10-15 quả trứng được bảo vệ đầy đủ khỏi những kẻ săn mồi, và đã chỉ ra rằng sau khi đẻ trứng có một khoảng thời gian tỷ lệ chết phụ thuộc vào mật độ nơi trứng ở những khu vực chưa tối ưu được ăn trước. Động vật ăn thịt bao gồm nhện và chim. Sau khi trứng nở, nhộng non mới xuất hiện (xem hình đầu tiên bên dưới) di chuyển đến những chiếc lá anh đào chim đang hé mở, nơi chúng kiếm ăn và phát triển (xem hình thứ hai bên dưới).', '1,2-2,4 mm, màu xanh đậm và hình cầu.Apterous: đốm đỏ xung quanh các điểm chèn của cornicles.\r\nAlate: râu sẫm và ngắn hơn thân; các mảnh vụn ở rìa ở bụng và một mảnh lớn hơn ở gốc của các lớp sừng; cornicles thẳng, có sắc tố, với một điểm  thắt ở đầu, cauda ngắn và có sắc tố.', 'Rhopalosiphum padi là loài rệp xen kẽ ký chủ - nó thường khai thác các cây thân gỗ (ký chủ thứ cấp) vào mùa hè và trả lại cho nó vật chủ thân gỗ chính (anh đào) để hoàn thành thế hệ hữu tính vào mùa thu. Những con cái hữu tính (oviparae) đẻ trứng dày đặc trên cành anh đào và những con cái này nở thành những con cái sinh sản thế hệ đầu tiên (sinh sản) vào mùa xuân. Vào thời điểm các con cái của những sinh vật gốc này trưởng thành, sự phát triển mới trên cây anh đào cứng lại và không còn là nguồn thức ăn thích hợp nữa, vì vậy hầu như tất cả đều phát triển thành các dạng có cánh (alatae) phân tán để tập trung vào các cây ăn hạt thích hợp như lúa mì, yến mạch hoặc lúa mạch.', 'Ấn phẩm này được chuẩn bị để giúp các nhà sản xuất quản lý quần thể côn trùng bằng các phương pháp tốt nhất hiện có đã được chứng minh là thực tế trong điều kiện Kansas. Các hướng dẫn và hạn chế trên nhãn thuốc trừ sâu có thể thay đổi, và một số có thể đã thay đổi kể từ khi ấn phẩm này được viết. Các nhà côn trùng học của Đại học Bang Kansas không chịu trách nhiệm về hiệu suất của sản phẩm, thương tích cá nhân, thiệt hại tài sản hoặc các loại tổn thất khác do xử lý hoặc sử dụng các loại thuốc trừ sâu được liệt kê. Hãy nhớ rằng, sử dụng thuốc trừ sâu theo cách không phù hợp với nhãn là bất hợp pháp. Người sử dụng phải chịu trách nhiệm về việc sử dụng đúng. Luôn đọc và làm theo hướng dẫn trên nhãn một cách cẩn thận.', 'Loài rệp này phân bố trên toàn cầu, nằm ở tất cả các môi trường sống trên cạn lạnh giá nhất.', 'null', 'insect_Rhopalosiphum_padi/23424.jpg', 'Rhopalosiphum', 'null'),
('Rhynchocoris poseidon', 'Bọ xít xanh', 'insect_Rhynchocoris_poseidon', 'Bọ xít trưởng thành hoạt động giao phối vào ban ngày, lúc 9-10 giờ sáng, trứng được đẻ thành từng ổ, mỗi ổ trứng có từ 30-130 trứng; mỗi con cái đẻ từ 50-500 trứng. Bọ xít trưởng thành có tập tính qua đông và qua đông trong vỏ cây, tàn dư lá cây hoặc những khu vực khác. Mùa xuân đến, nhiệt độ ấm lên, bọ xít xanh chui ra khỏi nơi ẩn nấp, phá hại và đẻ trứng. Con cái có thể bắt đầu đẻ sau khi hoá trưởng thành 3-4 tuần. Bọ xít trưởng thành thích ánh sáng đèn. Trưởng thành có thể di chuyển xa với khoảng cách hàng cây số.', '', '', '', '', 'null', '', 'Rhynchocoris', 'null'),
('Rhynchophorus ferrugineus', 'Đuông', 'insect_Rhynchophorus_ferrugineus', 'Trứng: màu trắng sữa, bóng, dài 2,5 mm. khoảng 3 - 4 ngày trứng sẽ nở ra ấu trùng.\n         + Ấu trùng: dài 40 - 50 mm, cơ thể màu trắng, đầu màu nâu đỏ, gồm 13 đốt, không có chân, miệng cứng rất phát triển, cuối đuôi dẹp và có nhiều lông trắng.\n         + Nhộng: ban đầu có màu trắng sữa sau đó chuyển sang màu nâu, dài khoảng 35 mm.\n         + Trưởng thành: là loài bọ cánh cứng có kích thước tương đối lớn, thân dài 25 - 30 mm, rộng 10 - 15 mm. Toàn thân màu nâu đỏ. Phía đầu có một vòi dài, cong. Đầu và vòi chiếm 1/3 chiều dài thân. Cánh cứng có 6 sọc lõm chạy dọc và 3 sọc mờ, cánh không che hết bụng.', '', '', '', '', 'null', '', 'Rhynchophorus', 'null'),
('Riptortus linearis', 'Bọ xít hông viền trắng', 'insect_Riptortus_linearis', 'Trứng của Riptortus được đẻ trên lá đậu và các loại cây khác; thường thì trứng được đẻ đơn lẻ. Chúng nở và nhộng trải qua năm giai đoạn. Nhộng là loài bắt chước kiến , có nghĩa là chúng trông giống như những con kiến ​​đen lớn, có lẽ là để bảo vệ chúng khỏi sự săn mồi. Con trưởng thành có màu nâu sẫm và dài khoảng 20 mm', '', '', '', '', 'null', '', 'Coreidae', 'null'),
('Sagra femorata', 'Bọ lá chân ếch', 'insect_Sagra_femorata', 'có thể đạt chiều dài 20 mm (0,79 in). Những con bọ này có một lưỡng hình giới tính nổi bật. Con đực lớn hơn nhiều và có chân sau rất dài và khỏe giống như của ếch (do đó có tên gọi chung). Hình thái đáng chú ý này giúp những con đực có thể áp đảo các đối thủ trong quá trình sinh sản. Màu sắc cơ bản khá thay đổi, nhưng thường là màu xanh lam kim loại.', '', '', '', '', 'null', '', 'Sagra', 'null'),
('Sarcophagidae', 'Ruồi thịt', 'insect_Sarcophagidae', 'Vòng đời kéo dài từ 2-4 tuần. \nCon cái đẻ ra ấu trùng trên một môi trường có thức ăn phù hợp (từ thịt hay cá hư, hay phân động vật, hay rác thải thực phẩm hư thối có trong thùng rác). \nẤu trùng ăn vài ngày, sau đó di chuyển ra khỏi môi trường có thức ăn để phát triển thành nhộng ở các khu vực khô hơn bên cạnh.', '', '', '', '', 'null', '', 'Sarcophagidae', 'null'),
('Schizaphis graminum', 'Rệp muội', 'insect_Schizaphis_graminum', 'Sự sinh sản của rệp muội thường thích nghi cao với môi trường mới bằng cách tăng số lượng nhanh chóng. Tất cả các cá thể đều là con cái với kiểu sinh sản đơn tính (không cần thụ tinh). Con non sinh ra với hình dạng đầy đủ và có thể tự kiếm ăn ngay. Chúng phát triển nhanh chóng, lột xác 4 lần trước khi trưởng thành. Tốc độ tăng trưởng đạt được cao nhất ở nhiệt độ khoảng 23°C.', '', '', '', '', 'null', '', 'Schizaphis', 'null'),
('Scirpophaga incertulas', 'Sâu Đục thân (bướm) 2 chấm', 'insect_Scirpophaga_incertulas', 'Sâu non qua đông tới mùa xuân hóa nhộng.\r\n\r\n- Nhộng hóa trong gốc thân lúa ở dưới mặt đất 1 - 2 cm. Trước khi hóa nhộng sâu đục sẵn một lỗ ở thân lúa, chừa lại một lớp biểu bì mỏng để khi vũ hóa đục chui ra.\r\n\r\n- Sâu đục thân phát triển thuận lợi trong điều kiện nhiệt độ từ 23 -30oC, độ ẩm trên 90%.\r\n\r\n- Khả năng gây dảnh héo và bông bạc của sâu non từ một ổ trứng là 12 dảnh khi lúa đẻ nhánh và 9,2 bông bạc khi lúa trỗ (khi mật độ ổ trứng thấp hơn 5 ổ/ m2).', 'Sải cánh của con đực là 18–22 mm và con cái là 34 mm.  Con đực trưởng thành nhỏ hơn con cái. Con đực có màu nâu nâu. Cánh chim có vảy đen và có các đường gân hơi loang lổ. Một điểm đen được tìm thấy ở góc thấp hơn của ô. Có một đường xiên chạy từ đỉnh đến vân 2. Có thể nhìn thấy một loạt đốm đen ở rìa. Màu trắng đục như bọt biển. Con cái có lông màu nâu với những chiếc lông sau màu nâu nhạt.', 'Sau khi nở, sâu non đục vào bẹ lá và gây ra các mảng màu trắng vàng theo chiều dọc do bị ăn. Sau đó, nó xâm nhập vào thân cây lúa và ở trong mấu để ăn bề mặt bên trong của thành thân. Đây không phải là biểu hiện bên ngoài như các triệu chứng. Ăn nhiều gây ra một vết cắt hình tròn sâu xuyên qua mô nhu mô cho thấy những vết chết ở giai đoạn sinh dưỡng và mụn đầu trắng ở giai đoạn sinh sản.', 'Do lúa trên toàn thế giới bị thiệt hại nặng, nhiều biện pháp kiểm soát đang được tiến hành. Các biện pháp kiểm soát hóa học, vật lý và sinh học và nhiều phương pháp truyền thống được sử dụng để kiểm soát dịch hại ở bất kỳ giai đoạn nào trong vòng đời của nó. Nhiều giống lúa kháng sâu bệnh đã được chính quyền địa phương biến đổi gen và đưa vào đồng ruộng. Trong kiểm soát sinh học, khả năng ký sinh ở trứng cao và phổ biến. Các loài của ba chi Telenomus, Tetrastichus và Trichogramma có hiệu quả rất tốt đối với trứng, ấu trùng và sâu non trưởng thành.', 'Nó được mô tả bởi Francis Walker vào năm 1863. Nó được tìm thấy ở Afghanistan, Nepal, đông bắc Ấn Độ, Sri Lanka, Bangladesh, Myanmar, Việt Nam, Thái Lan, Malaysia, Singapore, Sumatra, Java, Borneo, Sumba, Sulawesi, Philippines, Đài Loan, Trung Quốc và Nhật Bản.', 'null', 'insect_Scirpophaga_incertulas/02916.jpg', 'Scirpophaga', 'null'),
('Scirpophaga innotata', 'Sâu đục thân mình trắng', 'insect_Scirpophaga_innotata', 'Vòng đời từ trứng - sâu non - trưởng thành - đẻ trứng là 200 - 211 ngày trong vụ đông và 126 - 176 ngày đối với vụ hè.\n\n - Sâu phát triển quanh năm và thường gây hại nặng vào tháng 4, 5 và 10, 11. Trưởng thành ưa đẻ trứng vào những cây ít cành, thưa lá. Chúng hoạt động mạnh khi nhiệt độ cao, ánh sáng nhiều. ', '', '', '', '', 'null', '', 'Scirpophaga', 'null'),
('Scirtothrips aurantii', 'Bọ trĩ cam', 'insect_Scirtothrips_aurantii', '   Vòng đời bọ trĩ khoảng 15-20 ngày. Giai đoạn nhộng khoảng 03-04 ngày.\n\n-             Sau khi vũ hóa 3 ngày, con cái bắt đầu đẻ trứng. Một con cái có thể đẻ từ 20-25 trứng.\n\nBọ trĩ gây hại trên cây thuộc họ cam quýt và nhiều loại cây trồng khác.\n\nTrưởng thành đẻ trứng trong mô lá non, cành non hoặc trái non.  \n\nCả thành trùng và ấu trùng đều gây hại trên lá non, trái non. ', '', '', '', '', 'null', '', 'Scirtothrips', 'null'),
('Scirtothrips dorsalis', 'bọ trĩ trà vàng', 'insect_Scirtothrips_dorsalis', 'Các giai đoạn vòng đời của Scirtothrips dorsalis bao gồm trứng, ấu trùng cái đầu tiên và thứ hai, giai đoạn chuẩn bị, nhộng và trưởng thành. Những con cái mập mạp nhét trứng vào bên trong các mô thực vật phía trên bề mặt đất. Trứng có kích thước siêu nhỏ (dài 0,075 mm và rộng 0,070 mm), hình quả thận và có màu trắng kem (Seal et al. 2009a). Trứng nở từ hai đến bảy ngày, tùy thuộc vào nhiệt độ. Ấu trùng và con trưởng thành có xu hướng tụ tập gần gân giữa hoặc viền của lá chủ. Hai giai đoạn ấu trùng được hoàn thành trong tám đến mười ngày và giai đoạn nhộng kéo dài trong 2,6-3,3 ngày. Tuổi thọ của bọ trĩ ớt bị ảnh hưởng bởi các loài cây ký chủ. Ví dụ, ở 28 ° C, mất 11,0 ngày để ấu trùng lứa đầu tiên tiến đến giai đoạn trưởng thành trên cây hồ tiêu và 13,3 ngày trên cây bí. Tuổi thọ trưởng thành của bọ trĩ ớt kéo dài 15,8 ngày trên cây cà tím, nhưng chỉ 13,6 ngày trên cây cà chua', 'Bọ trĩ ớt có màu nhạt và chiều dài của ấu trùng lần thứ nhất và thứ hai và nhộng lần lượt là 0,37-0,39, 0,68-0,71 và 0,78-0,80 mm. Con trưởng thành dài khoảng 1,2 mm với đôi cánh sẫm màu và các đốm đen tạo thành các sọc không hoàn chỉnh xuất hiện ở mặt lưng trên bụng (Seal et al. 2009a). Có rất nhiều microtrichia và các gờ phản tinh thể ngang sẫm màu trên bụng cũng như xương ức. Trên các trường vi mô bên của các loài mối bụng là ba bộ đĩa đệm. Lược sau gốc trên phân đoạn VIII đã hoàn tất. Các cánh trước bóng mờ có màu sáng ở xa với các lông mao thẳng. Các cánh trước sở hữu tĩnh mạch thứ hai không hoàn chỉnh, hoặc một dãy gân guốc với hai hoặc ba tĩnh mạch không đều ở nửa xa và tĩnh mạch thứ nhất hoàn chỉnh', 'Bọ trĩ xâm nhập và chích hút các loại mụn ở miệng và gây ra tổn thương bằng cách lấy nội dung của các tế bào biểu bì riêng lẻ dẫn đến hoại tử mô. Điều này làm thay đổi màu mô từ bạc sang nâu hoặc đen. Bọ trĩ ớt tạo ra các vết sẹo ăn gây hại, biến dạng lá, và sự đổi màu của chồi, hoa và quả non bằng cách ăn các mô phân sinh của các đầu cuối của cây ký chủ và trên các bộ phận mềm khác trên bề mặt đất. Scirtothrips dorsalis không được báo cáo ăn các mô vật chủ trưởng thành. Theo Sanap và Nawale (1987), con trưởng thành và nhộng của Scirtothrips dorsalis hút nhựa tế bào của lá, gây ra hiện tượng cuốn lá lên trên và giảm kích thước lá. Ví dụ, một sự phá hoại nặng của Scirtothrips dorsalis trên cây hồ tiêu làm thay đổi diện mạo của cây thành cái được gọi là \"bệnh xoăn lá ớt\". Sự xuất hiện của các bộ phận cây bị biến màu hoặc biến dạng cho thấy sự hiện diện của Scirtothrips dorsalis.', 'Việc phát triển các phương pháp quản lý hiệu quả đối với Scirtothrips dorsalis vẫn còn trong giai đoạn sơ khai. Nhiều khuyến nghị đã được đưa ra bởi Trung tâm Rau quả Thế giới (AVRDC) có thể được coi là các biện pháp quản lý cơ bản đối với dịch hại này. Thực hành quản lý bao gồm luân canh cây trồng, loại bỏ cỏ dại (có thể là vật chủ) và hỗ trợ sử dụng tối đa các loài thiên địch, bao gồm cả động vật ăn thịt và ký sinh trùng, và luân phiên thuốc trừ sâu.', 'miền Nam và Đông Á, Châu Phi và Châu Đại Dương', 'null', 'insect_Scirtothrips_dorsalis/65532.jpg', 'Scirtothrips', 'null'),
('Scotinophara bispinosa', 'Bọ xít đen 2 gai', 'insect_Scotinophara_bispinosa', 'Tại Việt Nam, theo Nguyễn Mạnh Chinh, vòng đời bọ xít đen trung bình 50 – 60 ngày, trong đó giai đoạn trứng từ 4 – 7 ngày, bọ non: 40 – 45 ngày, trưởng thành – đẻ trứng: 10 – 15 ngày. Mỗi con cái đẻ khoảng 200 trứng. Trứng được đẻ thành từng ổ 10 – 15 trứng, xếp thành hàng dọc theo gân lá gần mặt nước. Au trùng mới nở có màu đỏ nâu, dạng giống trưởng thành, không cánh, trên lưng có những chấm đen. Au trùng khi nở thành từng đàn, di chuyển xuống gốc lúa, ban đêm bọ xít có khuynh hướng di chuyển lên trên. Bọ xít có 5 tuổi, trưởng thành có màu đen, dạng lục giác, dài khoảng 7 – 8 mm, hai bên đốt ngực có gai nhọn. Bọ xít non và trưởng thành đều gây hại bằng cách chích hút nhựa làm lúa vàng, héo, cây thấp lùn, đẻ nhánh kém, trổ bông kém, hạt bị lép, lửng, nếu mật số cao có thể gây cháy cục bộ như ghi nhận ở Tiền Giang và Long An khoảng năm 1999 - 2000. Trưởng thành thích ánh sáng đèn. Trong điều kiện ruộng khô hay mùa đông, bọ trưởng thành trú ẩn trong các khe nứt trong đất hay các bờ cỏ ven ruộng lúa, khi gặp điều kiện thích hợp sẽ di chuyển đến ruộng lúa và gây hại.', '', '', '', '', 'null', '', 'Scotinophara', 'null'),
('Scotinophora lurida', 'Bọ xít đen', 'insect_Scotinophora_lurida', 'Bọ xít trưởng thành có xu tính với ánh sáng. Ban ngày sợ nắng nên thường ẩn náu dưới khóm lúa, buổi chiều tối hoặc những ngày râm mát có thể bò lên phía trên để gây hại.\n\nThời gian sinh trưởng phát dục các giai đoạn của bọ xít đen:\n\n- Trứng 3 - 8 ngày, trung bình 5 ngày\n\n- Bọ xít non 35 - 53 ngày, trung bình 40 ngày\n\n- Trưởng thành sống từ 10 - 10,5 tháng', '', '', '', '', 'null', '', 'Scotinophara', 'null'),
('Selenothrips rubrocinctus', 'Bọ trĩ', 'insect_Selenothrips_rubrocinctus', ' Vòng đời của chúng bao gồm năm giai đoạn cuộc sống: trứng, ấu trùng, pre-pupae (tiền nhộng), nhộng và bọ trĩ trưởng thành. Toàn bộ chu trình có thể mất tới 30 ngày để hoàn thành, nhưng sẽ rút ngắn ở nhiệt độ cao hơn. Bọ trĩ trưởng thành đẻ trứng trực tiếp vào mô thực vật tạo cho chúng một nơi để sống xót qua mùa đông và vị trí mô đó cũng là nguồn thức ăn cho ấu trùng. Sau khi nở, ấu trùng ăn phàm và phát triển cho tới khi chúng rới xuống đất và thành nhộng. Những con nhộng nở thành những con nhộng không cánh. Các con nhộng không cánh này lột xác hai lần, trở thành bọ trĩ trưởng thành, có cánh và sẵn sàng giao phối. Bọ trĩ có thể sinh sản tới 12-15 thế hệ mỗi năm ở vùng khí hậu ấm áp.\n\n  Hầu hết các loại bọ trĩ gây hại chích hút nhựa cây. Nó chích hút nhựa từ lá, chồi non, hoa, trái cây nên nó sẽ gây những vết sẹo lớn trên lá, hoa, trái, chồi non hoặc khiến cho lá quăn và thui chồi không thể phát triển được.', '', '', '', '', 'null', '', 'Selenothrips', 'null'),
('Sesamia inferens', 'Sâu đục thân màu hồng', 'insect_Sesamia_inferens', 'Chúng đẻ trứng trong các mô mềm thực vật và ấu trùng sống trong các mô này nên rất khó nhìn thấy trứng bọ trĩ bằng mắt thường.', '', '', '', '', 'null', '', 'Sesamia', 'null'),
('Sitobion avenae', 'rệp tiếng anh ngũ cốc', 'insect_Sitobion_avenae', 'Khi cây trưởng thành, rệp di chuyển đến các bông hoa đang phát triển - những tai mới nổi trong trường hợp lúa mì. Các dạng có cánh phát triển vào cuối tháng 5 dẫn đến việc thành lập nhiều thuộc địa hơn trong tháng 6. Các dạng có cánh tiếp tục được sản xuất trong suốt mùa hè để đối phó với mật độ dân số ngày càng tăng và chất lượng thực phẩm giảm sút. Vào mùa thu, chúng chuyển sang tái phá hoại ngũ cốc hoặc các loại cỏ khác.', '1,3-3,3 mm.Apterous: vàng, xanh lá cây hoặc đỏ, lá thẳng, màu đen và dạng  lưới .\r\nAlate: màu xanh lục hoặc đỏ với các đốm bên sẫm màu, râu dài, màu đen; cornicles dài vừa phải, đen, thẳng và có lưới; cauda dài và sáng màu.', 'Rệp hạt, Sitobion avenae, một loài sinh vật sống ở vũ trụ khác, ăn thực vật trên cỏ và ngũ cốc, và thực sự là loài gây hại chính sau này. Nó hiển thị một loạt các dạng màu từ xanh táo đến xanh đậm và hồng cá hồi đến nâu đậm. Mặc dù cũng thể hiện một loạt các phương thức sinh sản, nó chủ yếu là vô tính ở vùng khí hậu ôn đới, nhưng tạo ra các hình thức hữu tính dẫn đến việc đẻ trứng quá đông khi được cảm ứng dưới ngưỡng nhiệt độ và ánh sáng quan trọng (<15 ° C; <16 giờ ánh sáng) . Chiều dài cơ thể trưởng thành = 1,3-3,3 mm; ảnh (không theo tỷ lệ) cho thấy alate (có cánh) di cư vô tính với nhộng [© RD Dransfield & R. Brightwell, influencer.com; xem trang web của họ và Blackman & Eastop (2000) để biết thêm chi tiết về lịch sử cuộc đời, bao gồm cả việc phân phối].', 'sử dụng một loạt các kỹ thuật quản lý để thúc đẩy kiểm soát sinh học tự nhiên. Chúng bao gồm việc cho phép hoa umbellifer và cây tầm ma phát triển mạnh ở các rìa ruộng và các khu vực dành riêng để cung cấp mật hoa cho syrphidae trưởng thành và con mồi thay thế cho loài cầu gai. Mặc dù rất hứa hẹn, nhưng tính đầy đủ của phương pháp này vẫn chưa được kiểm tra nghiêm ngặt trong các thử nghiệm ngẫu nhiên. Đây là một lý do tại sao các nhà khoa học tại một viện nghiên cứu ở Anh (Rothamsted Research) gần đây đã bắt tay vào một thử nghiệm gây tranh cãi về lúa mì biến đổi gen.', 'Nó xuất hiện rộng rãi ở Châu Âu, Bắc Phi, Trung Đông và Châu Á.', 'null', 'insect_Sitobion_avenae/22441.jpg', 'Sitobion', 'null'),
('Sitodiplosis mosellana', 'lúa mì midge', 'insect_Sitodiplosis_mosellana', 'Muỗi vằn bay trong điều kiện khô ráo khi nhiệt độ trên 15 ° C. Trứng được đẻ ở bên trong các bông lúa mì có thể nở trong vòng 4-10 ngày. Khi được cho ăn đầy đủ ấu trùng sẽ thả xuống đất. Người ta cho rằng midge hoa lúa mì màu cam có thể tồn tại trong đất từ ​​10-15 năm và midge hoa lúa mì vàng lên đến 3 năm. Trong điều kiện thích hợp, ấu trùng rời kén và di chuyển lên bề mặt đất để hóa nhộng. Vào giữa mùa hè và trong điều kiện ấm áp và ẩm ướt, con trưởng thành xuất hiện từ các hộp nhộng trong đất để hoàn thành vòng đời của chúng.', 'Trong số 2 loài thì hoa lúa mì màu cam midge là loài gây hại chủ yếu trên cây lúa mì ở Anh. Ruồi trưởng thành có màu da cam, dài 2-3mm và rất yếu. Ấu trùng cũng có màu cam, nhỏ và dễ nhận biết. Như tên cho thấy hoa lúa mì vàng midge có màu vàng khi trưởng thành và ấu trùng. Những ấu trùng này có thể được tìm thấy khi kiếm ăn trong tai của cây trồng trong vài tuần sau khi ra hoa.', 'Hầu hết ấu trùng vẫn nằm trong 5 cm (2 inch) trên cùng của đất, nhưng một số có thể đào sâu 10 cm (4 inch) dưới bề mặt đất. Ấu trùng quay những kén tròn có kích thước bằng một nửa hạt cải dầu kiểu Ba Lan. (Hinh 4). Ấu trùng trú đông có thể ở trạng thái ngủ đông cho đến khi có điều kiện thuận lợi để phát triển, cho dù đó là mùa xuân năm sau hay vài năm sau.', 'Bẫy pheromone tổng hợp có thể được sử dụng để theo dõi muỗi đực và đưa ra cảnh báo sớm về sự xuất hiện của muỗi vằn liên quan đến các giai đoạn sinh trưởng nhạy cảm của cây trồng. Con cái đẻ trứng có thể ẩn náu tốt trong tán cây trồng và ấu trùng cũng ẩn trong tai lúa mì, và cả hai đều là mục tiêu phun khó khăn. Vì vậy, để đạt được hiệu quả kiểm soát bất kỳ ứng dụng thuốc trừ sâu nào phải được áp dụng kịp thời trước khi ấu trùng chui vào giữa bọ xít và bọ phấn.', 'Alberta, Saskatchewan, Manitoba, nam British Columbia, Minnesota, Bắc Dakota và Idaho.', 'null', 'insect_Sitodiplosis_mosellana/24132.jpg', 'Sitodiplosis', 'null'),
('Sogata furcifera', 'Rầy lưng trắng,', 'insect_Sogata_furcifera', 'Trưởng thành được 4 - 5 ngày thì bắt đầu đẻ trứng, một trưởng thành đẻ được 400-600 trứng. Có xu tính nhẹ với ánh sáng.\r\n\r\n- Rầy non thường tập trung ở gốc sát mặt nước, ít di chuyển. Khi bị động có thể nhảy lên các bộ phận khác của cây hoặc rơi xuống nước. Nhiệt độ thích hợp cho rầy phát triển là 25-30oC, ẩm độ 80-85%.\r\n\r\n- Điều kiện môi trường thuận lợi, thức ăn phong phú thì rầy cánh ngắn xuất hiện nhiều; trong điều kiện không thuận lợi (cuối vụ-rầy hết thức ăn) thì rầy cánh dài là chủ yếu.\r\n\r\nKhi trưởng thành cánh ngắn xuất hiện nhiều (0,5 - 2 con/khóm) báo hiệu rầy lứa mới sẽ phát sinh thành dịch.', 'Trứng rầy lưng trắng có dạng quả chuối tiêu như trứng rầy nâu nhưng nhỏ, dài và nhọn hơn. Rầy đẻ trứng thành từng ổ theo chiều dọc, chìm trong bẹ hoặc gân chính của lá, mỗi ổ 2-7 quả. Rầy non mới nở có màu trắng đục, đến tuổi 3 xuất hiện các vệt vằn trên lưng. Rầy trưởng thành có màu đen nâu với một dải trắng trên mảnh lưng giữa. Cơ thể màu trắng kem, bụng màu đen. Con cái có hai dạng: cánh dài và cánh ngắn; con đực chỉ có một dạng hình cánh dài. Thời gian từ khi vũ hoá đến đẻ trứng 3-5 ngày, có thể sống 20 - 30 ngày.', 'Gây hại cùng với rầy nâu nhưng trong cùng lứa thì rầy lưng trắng phát sinh rộ sớm hơn. Rầy non có màu trắng hoặc nền trắng cùng các vết xám đậm. Thường hại nặng trên các giống lúa nhiễm rầy, lúa lai, thâm canh cao, bón nhiều đạm, ruộng lúa cấy dày, rậm rạp. Rầy lưng trắng thường có mật độ cao, gây hại nặng vào giai đoạn giai đoạn lúa làm đòng. ở vùng lúa đồng bằng sông Hồng một năm có 6-7 lứa. Quan trọng là lứa tháng 4 và cuối tháng 8 đầu tháng 9 trùng với các giai đoạn trên. Rầy lưng trắng đặc biệt nguy hiểm vì là môi giới truyền bệnh virus lùn sọc đen.', 'Tránh sử dụng quá nhiều phân đạm\r\n\r\nKiểm soát việc tưới tiêu bằng cách tháo nước gián đoạn\r\n\r\nViệc gieo cấy đồng bộ trong vòng 3 tuần kể từ khi gieo sạ và duy trì thời kỳ lúa trỗ cũng có thể làm giảm sự hình thành của rầy nâu.\r\n\r\nCó những giống do IRRI phát hành, có chứa các gen kháng rầy lưng trắng, như IR26, IR64, IR36, IR56 và IR72.\r\n\r\nTránh trồng gần và tạo khoảng cách cách nhau 30 cm, cứ 2,5 đến 3,0 m để giảm tỷ lệ sâu bệnh.', 'Australia, Russia, Vietnam, Thailand, Taiwan, South Korea, …', 'null', 'insect_Sogata_furcifera/05133.jpg', 'Sogatella', 'null'),
('Solenopsis geminata', 'Kiến lửa', 'insect_Solenopsis_geminata', 'Sau khi phân đàn khỏi tổ và giao phối, kiến chúa tìm kiếm nơi phù hợp để đẻ trứng. Khi bị phát hiện, nó có thể đẻ lên đến 125 trứng vào cuối mùa Xuân. \nẤu trùng nở trong vòng 8 đến 10 ngày, và giai đoạn nhộng kéo dài từ 9 đến 16 ngày. \nẤu trùng ăn các chất tiết ra từ các tuyến nước bọt của kiến chúa và các cơ cánh gãy cho đến khi các kiến thợ đầu tiên xuất hiện. Sau khi lứa ấu trùng đầu tiên này nở thành kiến thợ, vai trò của kiến chúa trở lại giai đoạn đẻ trứng - kiến chúa có thể đẻ đến 1.500 trứng một ngày. Kiến thợ tiếp tục chăm sóc ấu trùng, xây tổ và tìm thức ăn. \nKiến đực có khả năng sinh sản được sinh ra vào cuối mùa.', '', '', '', '', 'null', '', 'Solenopsis', 'null'),
('Spider mite', 'nhện dài', 'insect_Spider_mite', 'Điều kiện khô nóng thường liên quan đến sự tích tụ quần thể của bọ ve nhện. Trong điều kiện tối ưu (khoảng 27 ° C), nhện hai đốm có thể nở trong vòng 3 ngày và trưởng thành về mặt giới tính trong vòng ít nhất là 5 ngày. Một con cái có thể đẻ tới 20 quả trứng mỗi ngày và có thể sống từ 2 đến 4 tuần, đẻ hàng trăm quả trứng. Tốc độ sinh sản nhanh này cho phép các quần thể bọ xít nhện thích nghi nhanh chóng để kháng thuốc trừ sâu , vì vậy các phương pháp kiểm soát hóa học có thể trở nên kém hiệu quả khi cùng một loại thuốc trừ sâu được sử dụng trong thời gian dài. Spider mạt, như hymenopterans và một số côn trùng quy mô , là arrhenotochous : nữ là lưỡng bội và con đực đơn bội . [4] Khi giao phối, con cái tránh sự phân chia một số trứng để tạo ra con đực. Trứng được thụ tinh tạo ra con cái lưỡng bội. Những con cái chưa được giao phối, chưa được thụ tinh vẫn đẻ trứng chỉ có nguồn gốc từ những con đực đơn bội .', 'Nhện có kích thước nhỏ hơn 1 mm (0,04 in) và có nhiều màu sắc khác nhau. Chúng đẻ những quả trứng nhỏ, hình cầu, ban đầu trong suốt và nhiều loài quay thành những tấm màng tơ để giúp bảo vệ đàn khỏi những kẻ săn mồi ; họ nhận được phần \"con nhện\" trong tên thông thường của họ từ mạng lưới này.', 'null', 'Kiểm soát văn hóa: Nếu sự xâm nhập của bọ nhện được phát hiện đủ sớm, phun sương hàng ngày hoặc phun nước có thể là biện pháp kiểm soát hiệu quả.Thuốc trừ sâu: Việc sử dụng thuốc trừ sâu ăn lá trong thời tiết khô nóng có thể gây bùng phát bọ xít nhện bằng cách giết chết các động vật chân đốt có ích thường ăn bọ ve. Ngoài ra, nấm bệnh tấn công bọ nhện sau thời tiết ẩm ướt, mát mẻ. Một số loại thuốc diệt nấm có thể loại bỏ loại nấm này và nên tránh sử dụng trong vài tuần nếu cây bị nhiễm bệnh và các tình trạng như vậy xảy ra.\r\n\r\nCác giai đoạn nghỉ ngơi và trứng của nhện hai đốm có khả năng chống chịu với thuốc trừ sâu hơn so với các dạng di động. Do đó, có thể cần phải phun thuốc trừ sâu lần thứ hai vào khoảng thời gian 4 hoặc 5 ngày khi thời tiết nóng (7 đến 10 ngày trong thời tiết mát mẻ) để tiêu diệt những con mạt có thể còn sống sót sau lần bón đầu tiên. Để biết các khuyến nghị kiểm soát hóa chất cụ thể, hãy tham khảo ý kiến ​​của Dịch vụ Khuyến nông Hợp tác .', 'Nhiều loài nhện ve (họ: Tetranychidae), rất phổ biến ở Bắc Mỹ, tấn công cả cây trồng trong nhà và ngoài trời. Chúng có thể phá hoại đặc biệt trong nhà kính.', 'null', 'insect_Spider_mite/24851.jpg', 'Spider', 'null');
INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('Spodoptera eridania', 'sâu quân đội bắp cải', 'insect_Spodoptera_eridania', 'Ấu trùng có màu xanh lục nhạt với một sọc trắng nhạt dọc theo mỗi bên và hai sọc trắng mỏng ở lưng. Cơ thể thuôn về phía đầu. Có ba đôi chân mảnh ở gần đầu và hai đôi chân hình chùy hướng về đầu kia. Khi trưởng thành, ấu trùng đạt chiều dài 1-1 / 2 inch. Trứng hình tròn, màu trắng, có vân, thường được đẻ đơn lẻ ở mặt dưới của các lá bên ngoài. Nhộng có màu nâu, dài khoảng 3/4 inch và được bọc trong một cái kén mỏng manh bằng những sợi chỉ rối màu trắng. Bướm đêm trưởng thành là loài bướm đêm có đốm, màu nâu xám với sải cánh dài 1-1 / 2 inch và một đốm nhỏ màu bạc giống như một chiếc tất ở giữa mỗi cánh trước. \r\n\r\nVì ấu trùng không có chân ở vùng giữa cơ thể nên vùng này cong lên khi côn trùng di chuyển. Tất cả các giai đoạn ấu trùng của côn trùng đều di chuyển theo chuyển động lặp lại này. Sâu non lớn thường sẽ cuộn tròn lại và thả xuống gốc cây khi lá bị xáo trộn. Khi chúng phát triển, chúng di chuyển về phía trung tâm của cây. Chúng thường ăn các khu vực giữa các gân lá.', 'Bướm đêm bắp cải đẻ trứng hình vòm, đơn lẻ ở mặt dưới của các lá già. Một con cái có thể đẻ từ 275 đến 350 trứng. Trứng sẽ sẫm màu khi chúng già đi và sẽ nở sau 2 đến 5 ngày. Ấu trùng có màu xanh lục nhạt và có một sọc trắng đặc biệt dọc theo mỗi bên của cơ thể.', 'Ấu trùng là động vật làm rụng lá và kiếm ăn như đồng loại khi còn non, thường xuyên tạo xương trên lá. Khi trưởng thành, chúng trở nên đơn độc, và cũng dễ dàng đâm chồi thành quả, thường làm hỏng cà chua ở Florida. Nó có thể dẫn đến tổn thất năng suất đáng kể nếu không được kiểm soát. [4] Khi bị căng thẳng do thiếu thức ăn, chúng sẽ ăn phần đỉnh của cành, đục sâu vào mô thân và tấn công các củ gần bề mặt đất.', 'Dầu neem nguyên chất đã được phát hiện là chất chống cảm cúm hiệu quả nhất vào năm thứ ba. Dầu neem nguyên chất và azatrol là chất ngăn chặn thức ăn hiệu quả nhất đối với lứa thứ hai và thứ tư của sâu mọt quân phương nam. Mặc dù các sản phẩm này hoạt động theo kinh nghiệm trong phòng thí nghiệm, nhưng người ta thấy rằng mức độ ảnh hưởng tiêu cực đến tỷ lệ chết của ấu trùng và khả năng sinh thái của nhộng khác nhau đáng kể giữa các loại thuốc trừ sâu có nguồn gốc từ neem được thử nghiệm.', 'Bọ chét hoa cải và bọ chét sọc đều được du nhập từ Âu-Á và là những loài gây hại đáng kể. Theo truyền thống, bọ chét sọc phổ biến hơn ở các khu vực phía bắc của Canada và bọ chét cây thập tự phổ biến hơn ở các khu vực phía nam, cũng như loài phổ biến nhất trên khắp miền tây Canada. Tuy nhiên, phạm vi và quần thể bọ chét sọc đã tăng lên đáng kể trong vài thập kỷ qua, trở thành loài bọ chét thường xuyên gặp nhất ở trung tâm Alberta, trung tâm Saskatchewan và phần lớn Manitoba', 'null', 'insect_Spodoptera_eridania/26752.jpg', 'Spodoptera', 'null'),
('Spodoptera exigua', 'Sâu xanh da láng', 'insect_Spodoptera_exigua', 'Ngài đẻ trứng thành từng ổ trên lá. Một ngài cái có thể đẻ 300 - 400 trứng.\n\nSâu non tuổi 1 tập trung gây hại xung quanh ổ trứng, đến cuối tuổi 1 sâu mới phát tán sang các lá khác. Khi lớn sâu phân tán dần. Sâu non tuổi 2 có tập quán nhả tơ buông mình khi có động. Ở tuổi 3 sâu cắn phá mạnh nhất, có thể cắn thủng lá làm lá bị gục héo.', '', '', '', '', 'null', '', 'Spodoptera', 'null'),
('Spodoptera litura', 'Sâu keo, Sâu khoang, Sâu ăn tạp', 'insect_Spodoptera_litura', 'Ngài: Bướm thường vũ hoá vào buổi chiều và bay ra hoạt động vào lúc vừa tối, ban ngày bướm đậu ở mặt sau lá hoặc trong các bụi cỏ. Bướm hoạt động từ tối đến nửa đêm, có thể bay xa đến vài chục mét và cao đến 6-7 mét, có xu tính với mùi chua ngọt và ánh sáng bước sóng ngắn. Sau khi vũ hoá vài giờ, bướm có thể bắt cặp và một ngày sau đó có thể đẻ trứng.\r\n\r\n- Sâu vừa nở ăn gặm vỏ trứng và sống tập trung, nếu bị động sâu bò phân tán hoặc nhả tơ buông mình xuống đất. Sâu tuổi 1-2 chỉ ăn gặm phần diệp lục của lá và chừa lại lớp biểu bì trắng, từ tuổi 3 trở đi sâu ăn phá mạnh cắn thủng lá và gân lá. Khi mật độ sâu cao có thể làm cho lá rụng nhanh. Tuy nhiên sự gây hại thường không nghiêm trọng lắm do khả năng tự đền bù của cây. Khi đẫy sức sâu chui xuống đất hoá nhộng, sau khoảng 10 ngày thì vũ hoá. Ở tuổi lớn khi thiếu thức ăn, sâu còn tập quán ăn thịt lẫn nhau và không những ăn phá lá cây mà còn ăn trụi cả thân, cành, trái non. Khi làm nhộng, sâu chui xuống đất làm thành một khoang và nằm yên trong đó hoá nhộng.', 'Có sự khác biệt nhỏ nhưng rõ ràng về hình thái giữa con đực và con cái của S. litura cho phép dễ dàng phân biệt hai giới tính. Chiều dài cánh trước của con đực là 14–17 mm trong khi chiều dài của cánh trước của con cái lớn hơn một chút và là 15–18 mm. Các đốm vảy trên cánh trước cũng rõ ràng hơn ở con đực.', 'Ở động vật sinh sản hữu tính, sự nhận biết và thu hút bạn tình tiềm năng có thể xảy ra dưới dạng pheromone. [13] Ở các loài bướm đêm, pheromone được sản xuất bởi con cái bởi các tuyến pheromone và được tiết ra để thu hút con đực cùng loài. [14] Việc nhận biết chính xác bạn tình tương thích là điều cần thiết cho sự thành công trong sinh sản vì nếu không làm như vậy sẽ đi kèm với chi phí lớn: lãng phí thời gian và năng lượng, nguy cơ bị ăn thịt cao hơn và giảm số con còn sống. Do đó, có một sự lựa chọn chặt chẽ cho các tín hiệu nhận biết bạn tình chính xác để tối đa hóa khả năng sinh sản. Cả S. litura và S. littoralis đều có chung 11 thành phần tạo nên pheromone của chúng (với số lượng khác nhau), với Z9, E11–14: Ac đóng vai trò là thành phần chính. [13]. Có một mối quan hệ nghịch đảo giữa nồng độ pheromone trong cơ thể của phụ nữ và hành vi kêu gọi của phụ nữ. Điều này là do pheromone được giải phóng trong quá trình nữ gọi. Trước đây, người ta đã tuyên bố rằng tuyến phụ của nam giới ngăn chặn sự kêu gọi của con cái và sau đó, tái giao phối. Khi tiếng gọi bị kìm hãm, nồng độ pheromone sẽ tích tụ trong cơ thể của những con cái được giao phối. Do đó, khi phân tích các tuyến pheromone, những con cái giao phối sẽ có hiệu giá cao hơn những con cái còn trinh. Điều quan trọng cần lưu ý là kết quả này khác với các nghiên cứu trước đây về các loài côn trùng khác.', 'thuốc trừ sâu luôn được sử dụng trên các loài cây này quanh năm. Điều này đã gây ra sự phát triển nhanh chóng của khả năng kháng thuốc trừ sâu và thuốc trừ sâu ở S. litura. [9] Ngoài ra, lượng thuốc bảo vệ thực vật được sử dụng quá nhiều đã gây ra mối lo ngại về dư lượng thuốc trừ sâu trên thực phẩm, hủy hoại môi trường và tiêu diệt các loài có ích. Do đó, các nghiên cứu gần đây đã tập trung vào các cách sinh học khác để kiểm soát hiệu quả những loài gây hại này. [4] Một nghiên cứu hiện tại về việc kiểm soát loài gây hại này tập trung vào việc sử dụng nấm Nomuraea rileyi trên giai đoạn ấu trùng của loài sâu bướm này. Người ta nhận thấy rằng việc phun dung dịch nấm này lên ấu trùng trong phòng thí nghiệm đã dẫn đến việc kiểm soát hiệu quả giai đoạn cuối giai đoạn thứ hai và đầu giai đoạn thứ ba của ấu trùng trên cây thầu dầu. Khi thử nghiệm trên đồng ruộng, tỷ lệ ấu trùng chết rất cao là 88–97% sau 19 ngày sau khi sử dụng dung dịch nấm.', 'Châu Á, Châu Đại Dương và tiểu lục địa Ấn Độ', 'null', 'insect_Spodoptera_litura/62704.jpg', 'Spodoptera', 'null'),
('Spodoptera mauritia', 'Sâu keo, sâu đàn hại lúa', 'insect_Spodoptera_mauritia', 'Bướm có cơ thể dài từ 14-20 mm, sải cánh rộng từ 30-35 mm, thân màu nâu xám. Cánh trước màu đen xám với nhiều đốm và vân không rõ nét, gần cạnh ngoài có một đường gợn sóng đậm, đường vân phụ cạnh ngoài có màu trắng xám hình gợn sóng, bên trong có một vân cũng màu xám chạy song song và giữa cánh có một đốm đen to, dưới đốm này có một số đốm trắng nhỏ. Cánh sau màu trắng hơi nâu, cạnh ngoài màu nâu đậm. Bướm cái sống trung bình từ 7-12 ngày, đẻ từ 200-300 trứng thành từng ổ 50-100 cái ở mặt dưới lá.\n\n\n \nTrứng hình tròn hơi dẹp, rộng từ 0,4-0,6 mm, mới đẻ màu trắng sữa, sắp nở chuyển sang màu vàng xám và sau cùng là xám đen, được đẻ thành từng ổ hình bầu dục, có lông màu vàng xám bao phủ. Thời gian ủ trứng từ 3-7 ngày.\n\nKhi mới nở sâu non màu xanh lục, càng lớn sâu càng chuyển sang màu nâu, phần bụng có màu nhạt hơn phần lưng. Lớn đủ sức sâu dài từ 35-40 mm. Giữa thân có một sọc màu lợt, mỗi bên thân có 3 sọc màu nâu và màu xanh lục, phía trên ba sọc nâu có một hàng đốm đen hình bán nguyệt. Sâu có 5 tuổi và phát triển từ khi nở đến lớn hoàn toàn từ 15-24 ngày.\n\nNhộng dài 12-14 mm, màu nâu đậm, có hai gai nhỏ ở cuối bụng. Thời gian nhộng từ 7-15 ngày.\n\nVòng đời sâu đàn từ 30-55 ngày.', '', '', '', '', 'null', '', 'Spodoptera', 'null'),
('Spotted lanternfly', 'ruồi đèn đốm', 'insect_Spotted_lanternfly', 'Bắt đầu từ cuối tháng 4 đến đầu tháng 5, nhộng non nở ra từ các hộp trứng của chúng. Một con nhộng trải qua một số giai đoạn chưa trưởng thành ( cá thể ), tất cả đều không có cánh. Trong phiên bản đầu tiên, nó có màu đen với những đốm trắng. Các phiên bản sau có các mảng màu đỏ ngoài các đốm trắng. Cá thể nhộng trùng cuối cùng có đệm cánh màu đỏ và phần trên cơ thể màu đỏ, trước khi lột xác thành dạng trưởng thành, với đầu đen và đôi cánh màu xám có đốm đen. [18] Nhộng nhảy hoặc bò để tìm kiếm thực vật để kiếm ăn. [15] Nhộng non (lần đầu tiên đến lần thứ ba) dường như có phạm vi ký chủ rộng hơn sớm, chúng thu hẹp khi chúng lớn lên. [18] [22]Mặc dù đom đóm đã được ghi nhận ăn một số loài cây thân thảo, điều này rất có thể là do nhộng non mới bắt đầu leo ​​lên hoặc rơi xuống những cây này; Nhộng non và đom đóm trưởng thành không có mối liên hệ đáng tin cậy với cây thân thảo .Ngay từ tháng 7, người ta có thể nhìn thấy những con trưởng thành, chúng giao phối và đẻ trứng từ cuối tháng 9 cho đến khi bắt đầu mùa đông.Các khối trứng chứa 30–50 trứng [24] được bao phủ bởi một lớp sáp màu nâu vàng, thường được gọi là vỏ trứng . [18] Tuổi thọ của con đom đóm là một năm', 'dài khoảng 25 mm (0,98 inch) và rộng 12 mm (0,47 inch). Khi nghỉ ngơi, đôi cánh sau màu đỏ thẫm có thể nhìn thấy một phần qua cánh trước bán trong mờ, tạo cho con chuồn chuồn đèn màu đỏ. Các mảng màu đen hình chữ nhật cách nhau gọn gàng tạo màu cho các đầu của cánh trước theo một hình mẫu đôi khi được ví như gạch và vữa. Khi bay, con chuồn chuồn đốm có cánh sau màu đỏ với những đốm đen ở 1/3 gần , một hình nêm màu trắng ở giữa cánh và đầu cánh màu đen đặc. Phần bụng màu vàng nhạt với các dải màu đen và trắng ở trên và dưới. [15] Con cái có một bộ van chân màu đỏ ở đầu xa của bụng, và khi giao phối (giao phối), phần bụng của con cái phồng lên đến mức chúng cảm thấy khó bay. [16]Đom đóm là loài nhảy mạnh và sử dụng đôi cánh của mình để hỗ trợ những cú nhảy này hơn là thực hiện các chuyến bay liên tục.', 'L.ophiatula gây hại trực tiếp cho cây do ăn nhựa từ thân hoặc cành; thiệt hại đáng kể có thể xảy ra khi nhiều côn trùng đồng thời ăn cùng một cây và có thể biểu hiện như sự già đi của cành hoặc toàn cây. [22] Một ví dụ về thiệt hại gián tiếp là sự hình thành của honeydew, dịch tiết chất thải của ruồi đèn, khi nhựa cây bám trên thân của chúng khi nó khóc từ vết thương; sự tích tụ của nhựa ngọt này có thể thu hút kiến, ong, ong bắp cày và ong bắp cày. [8] Điều này thúc đẩy sự phát triển của nấm mốc trên nhựa cây khi chúng tích tụ ở gốc cây, dẫn đến giảm khả năng quang hợp của cây, thậm chí dẫn đến chết cây.', 'Giết trứng từ tháng 10 đến tháng 5 bằng cách cạo chúng khỏi bề mặt, \"đóng túi đôi và ném vào thùng rác\", [8] hoặc cạo trứng trực tiếp vào túi Ziploc có cồn hoặc nước rửa tay để giết chúng.Loại bỏ các ký chủ của đom đóm đốm, cây Ailanthus altissima (cây sơn hay cây thiên tuế của Trung Quốc), chỉ để dành các cây đực để dùng làm cây \"bẫy\", vì đom đóm đốm đòi hỏi một bữa ăn từ cây này trước khi đẻ trứng. [1] Những cây \"bẫy\" đực còn lại nên được quấn bằng băng dính bắt đầu từ đầu mùa xuân để bắt nhộng. Các chuyên gia về động vật hoang dã đã cảnh báo che các dải dính trên cây bằng dây gà hoặc một loại dây tương tự khác sau khi có nhiều báo cáo về việc các động vật khác (ví dụ như chim) bị mắc kẹt trên chúng và bị thương và / hoặc chết. [42]\r\nCây bị nhiễm bệnh có thể được xử lý bằng thuốc trừ sâu toàn thân từ tháng 6 đến tháng 8. Bộ Nông nghiệp Pennsylvania khuyến nghị phun thuốc vào cây và phun vỏ cây, được áp dụng bởi những người phun thuốc chuyên nghiệp, và phun rãnh đất và phun lá, có thể được áp dụng bởi chủ nhà.', 'Trung Quốc, Ấn Độ và Việt Nam', 'null', 'insect_Spotted_lanternfly/44660.jpg', 'Lycorma', 'null'),
('Stenchaetothrips biformis', 'Bọ trĩ hại lúa', 'insect_Stenchaetothrips_biformis', 'Bọ trĩ chủ yếu sinh sản theo phương thức đơn tính, tỷ lệ cái/đực thường rất lớn (trên 95%). Con cái trưởng thành đẻ khoảng 3-160 trứng, trong 5-7 ngày, nhiều nhất là ngày thứ 2, 3, 4. Một năm phát sinh 8-10 lứa,  lứa 1 và 2 phát sinh trên cỏ. Lứa 2-3 và lứa 6 là quan trọng nhất.\r\n\r\nNhiệt độ thích hợp để bọ trĩ phát sinh phát triển từ 15-25ᵒC, thích hợp gây hại lúa Đông Xuân đầu vụ, vì thời gian này ít mưa hoặc chấm dứt mưa. Mưa làm giảm rõ rệt số lượng bọ trĩ, đặc biệt là bọ trĩ trưởng thành. Thời gian xuất hiện bọ trĩ từ khi cây lúa mới mọc đến đẻ nhánh mật độ bọ trĩ tăng cao sau đó giảm vì lá lúa cứng không thích hợp cho bọ trĩ gây hại. Quần thể bọ trĩ phát triển mạnh ở những năm hạn hán, con trưởng thành có khả năng kháng thuốc cao.', 'Bọ trĩ non rất nhỏ, dài độ 1 mm màu vàng nhạt, hình dáng giống con trưởng thành nhưng chưa có cánh. Con trưởng thành có màu đen thon dài 1,5-2mm.', 'Bọ trĩ trưởng thành và non đều hút nhựa lá làm cho lá có màu vàng đỏ. Khi mật độ thấp xuất hiện những chấm nhỏ xếp theo hàng dọc trên lá, lá non hầu như bị quăn lại, không hồi phục được. Bọ trĩ gây hại ngay từ khi cây lúa xuất hiện, mật độ tăng dần từ khi lúa hồi xanh đến đẻ nhánh sau đó giảm dần tới lúc lúa trỗ.Trời mưa lớn là bất lợi cho bọ trĩ. Bọ trĩ thường hại nặng những ruộng thiếu nước. Ruộng khô xuất hiện nhiều bọ trĩ gây hại làm cho đầu lá lúa quăn lại và biến màu vàng. Khi trời mưa bọ trĩ giảm số lượng rõ rệt, nhất là giai đoạn bọ trĩ lớn.', 'Bọ trĩ gây hại không quan trọng đến mức làm giảm năng suất lúa, chỉ hạn chế sinh trưởng giai đoạn đầu và làm cho cánh đồng có màu vàng nên nông dân thấy khó chịu. Không cần phải phun thuốc mà cần tìm các biện pháp như vệ sinh đồng ruộng, làm sạch cỏ dại; gieo sạ mật độ vừa phải, giữ nước không để ruộng khô. Nếu cần thiết phun nên dùng các loại thuốc sinh học nhằm bảo vệ thiên địch không bùng phát các loại sâu, rầy khác giai đoạn sau. Bọ trĩ rất dễ tiêu diệt, biện pháp phòng trừ như sau: cần tăng cường bón phân chăm sóc, không để ruộng khô nước; khi bị bọ trĩ gây hại với tỷ lệ trên 15% dảnh hoặc  mật độ trên 2.500 con/m2 thì dùng các loại thuốc sinh học đặc hiệu như Actara 25Wp, Radiant 60SC, … để phun trừ.', 'Loài bọ trĩ này được coi là phổ biến trên khắp Cựu thế giới, từ Úc đến Châu Âu, và cũng du nhập vào Nam Mỹ', 'null', 'insect_Stenchaetothrips_biformis/07845.jpg', 'Stenchaetothrips', 'null'),
('Synanthedon exitiosa', 'sâu đục quả đào', 'insect_Synanthedon_exitiosa', 'Vòng đời của sâu đục thân cần một năm để hoàn thành. Chỉ có giai đoạn chưa trưởng thành (sâu non) (Hình 3) mới gây hại cho cây. Khi nở ra từ trứng (Hình 4), ấu trùng non ngay lập tức chui vào dát gỗ của cây, thường là qua các vết nứt và vết thương trên vỏ cây. Ấu trùng tiếp tục kiếm ăn và phát triển cho đến khi bắt đầu có thời tiết lạnh. Hầu hết các hoạt động xảy ra một vài inch dưới mặt đất trên thân cây và rễ lớn hơn. Các loài côn trùng trải qua mùa đông như ấu trùng phát triển một phần dưới mặt đất dưới vỏ cây.', 'Sâu đục quả đào trưởng thành là loài sâu bướm có cánh rõ ràng với sải cánh 1-1 / 4. Không giống như phần lớn các loài bướm đêm, những con bướm đêm này bay vào ban ngày và hoạt động mạnh nhất từ ​​10 giờ sáng đến 2 giờ chiều. Con cái và con đực có sự khác biệt về ngoại hình. Con cái có màu xanh lam sẫm, màu thép với một hoặc hai dải rộng màu cam quanh bụng. Đôi cánh trước của cô ấy mờ đục trong khi đôi cánh sau rõ ràng. Bướm đực nhỏ hơn và mảnh mai hơn. Nó cũng có màu xanh thép, nhưng có một số dải màu vàng hẹp xung quanh bụng. Cả hai đôi cánh đều rõ ràng.', 'Ấu trùng đục vào thân cây từ 8 cm dưới mặt đất đến khoảng 30 cm trên bề mặt. Một loại sâu bệnh hại cây đào.', 'Việc kiểm soát sâu đục thân cây đào trong vườn cây ăn trái thương mại dựa vào việc ngăn chặn sự thành lập của ấu trùng bên dưới vỏ cây. Khi đã ở dưới vỏ cây, việc kiểm soát hóa chất không hiệu quả. Thuốc diệt côn trùng nên được canh thời gian trùng với thời điểm trứng nở ban đầu để có hiệu quả. Để hỗ trợ thời điểm phun thuốc, bẫy pheromone được sử dụng để cảnh báo người chăn nuôi về sự hiện diện và hoạt động của sâu bướm bướm đào. Bởi vì quá trình nở trứng bắt đầu khoảng 9 đến 10 ngày sau khi bướm xuất hiện, nên phun thuốc diệt côn trùng từ 7 đến 14 ngày sau khi bắt được con sâu bướm cái đầu tiên trong bẫy.  Thuốc xịt có chứa Asana XL, Lorsban và Warrior được dán nhãn để kiểm soát sâu đục quả trên quả đào. Thuốc xịt trực tiếp nên được áp dụng đồng nhất trên thân cây từ gốc đến các chi dưới. Làm ướt kỹ vỏ cây. Không để thuốc xịt Lorsban tiếp xúc với tán lá của quả. Asana XL, trong khi Warrior và Lorsban có khoảng thời gian 14 ngày trước khi thu hoạch Asana XL, Warrior và Lorsban là thuốc diệt côn trùng HẠN CHẾ SỬ DỤNG.', 'Sâu đục thân Peachtree có nguồn gốc từ Hoa Kỳ. Chúng được tìm thấy trên khắp Hoa Kỳ và Canada.', 'null', '', 'Synanthedon', 'null'),
('Tanymecus palliatus', 'mọt củ cải', 'insect_Tanymecus_palliatus', 'Những con mọt ăn lá trưởng thành dài khoảng 1/2 inch, và đầu của chúng hơi thu hẹp về phía đỉnh thành một cái mõm rộng. Đây là đặc điểm điển hình của nhóm côn trùng mọt (hay còn gọi là bọ mõm).Mọt ăn lá có màu nâu lốm đốm đến xám nâu (Hình 1) , và cơ thể của chúng được bao phủ bởi các cấu trúc hình phút, màu xám, giống như lông. Vì loài mọt này là loài gây hại củ cải đường hiếm gặp và nó chưa được báo cáo về các loại cây trồng khác trong khu vực, nên rất ít thông tin về sinh học hoặc cách kiểm soát của chúng.Các nhà nghiên cứu tin rằng côn trùng này sinh sống khi trưởng thành trong đất hoặc trong tàn dư thực vật. Những con mọt trưởng thành xuất hiện vào mùa xuân và giao phối, còn con cái sau đó gửi trứng vào các mô của cây chủ. Các cây ký chủ được biết đến bao gồm cây cỏ heo, sò huyết, hướng dương dại và các loài cỏ phấn hương.\r\n\r\nẤu trùng (đuông chưa trưởng thành) được cho là ăn những cây này cho đến khi chúng phát triển thành con trưởng thành. Sau đó, những con trưởng thành lại phá hoại những vật chủ này hoặc đôi khi lại phá hoại những cây củ cải đường lân cận. Không thấy ấu trùng ăn củ cải đường.', 'Psalidium maxillosum là 6-10 mm dài. Các cơ thể là màu đen hoặc đen-xám nâu và sáng bóng; các cánh được không phát triển. Một thế hệ phát triển trong hai năm. Các mọt thiệt hại lênđến 130 loài của thực vật, trong đó, củ cải. Các con bọ cánh cứng gây ra các chính thiệt hại; các ấu trùng thức ăn chăn nuôi trên các rễ của nhiều loài thực vật, chủ yếu là cỏ dại.', 'Bothynoderes punctiventris có một màu xám cơ thể 10-16 mm dài. Nó tạo ra một thế hệ mỗi năm. Các con bọ cánh cứng ngủ đông trong những đất. Trước khi các củ cải nảy mầm, các mọt ăn trên hoang nhà máy của các gia đình Chenopodiaceae; sau đó chúng tấn công các cánh đồng củ cải đường . Các người lớn bọ cánh cứng ăn các lá mầm, nhai qua nhỏ thân cây, và đôi khi làm hỏng phần của các nhà máy mà đã không đẩy thông qua các đất bề mặt. Các mầm đang mỏng đi ra ngoài, và toàn bộ các lĩnh vực được đôi khi hoàn toàn bị phá hủy. Các con bọ cánh cứng là đặc biệt phàm ăn trong nóng và khô thời tiết. Các ấu trùng thiệt hại các của củ cải gốc hệ thống. Cây non thường chết; hơn phát triển các nhà máy tụt hậu đằng sau trong tăng trưởng và khô héo, những củ lấy trên biến dạng hình dạng, và các trọng lượng và đường nội dung được giảm.', 'Kiểm soát các biện pháp bao gồm các sử dụng của cắt xén kỹ thuật để tiêu diệt cỏ dại và thúc đẩy tốt tăng trưởng và phát triển của các cây trồng, bẫy mương xung quanh cũ và mới củ cải lĩnh vực, preplanting điều trị của hạt giống bằng cách kết hợp hạt xử, và các phun của các lĩnh vực với thuốc trừ sâu.', 'Loài Palaearctic phổ biến này xuất hiện khắp Châu Âu và Tiểu Á, kéo dài về phía bắc đến Vương quốc Anh và các tỉnh miền trung của Fennoscandia và phía đông qua Nga và Ukraine đến Trung Siberia, nơi nó mở rộng trên Vòng Bắc Cực, ở đây nó phổ biến mặc dù rất địa phương và thường hiếm qua Wales và miền nam và miền trung nước Anh và có một vài bản ghi rải rác xa hơn về phía bắc đến biên giới Scotland.', 'null', 'insect_Tanymecus_palliatus/29772.jpg', 'Tanymecus', 'null'),
('Tarnished plant bug', 'bọ bị xỉn màu', 'insect_Tarnished_plant_bug', 'L. lineolaris sử dụng cây bông như một trong những vật chủ sinh sản chính của chúng. Con cái đẻ trứng ở hàng cây đầu tiên của cây bông và sau đó chiếm nhiều cây hơn trên đồng ruộng. [5] Những con cái thường đẻ trứng vào tháng 5 sau thời kỳ trú đông . Trứng nở và nhộng bắt đầu phát triển vào khoảng tháng Sáu. [7] Mức độ quần thể cao nhất của L. lineolaris thường được đánh dấu vào tháng 10 và tháng 6, và nó cũng được coi là nguyên nhân dẫn đến sự gia tăng mức độ quần thể của Pisaurina mira , một loài nhện mạng săn mồi trên L. lineolaris', 'Loài côn trùng này có thể được tìm thấy trên khắp Bắc Mỹ , từ bắc Canada đến nam Mexico. Con trưởng thành có chiều dài lên đến 6,5 mm và có màu nâu với các điểm nhấn là vàng, cam hoặc đỏ, với chữ \"V\" màu nhạt trên lưng (lưng).', 'Bọ Lygus được biết đến với thói quen kiếm ăn phá hoại của chúng - chúng chọc thủng các mô thực vật bằng mũi xỏ lỗ của chúng và ăn bằng cách hút nhựa cây . Cả tổn thương vật lý và phản ứng của chính cây trồng đối với nước bọt của bọ đều gây ra thiệt hại cho cây trồng. Những con cái đưa trứng của chúng trực tiếp vào các mô thực vật bằng cách sử dụng vòi trứng đâm xuyên , và những con nhộng mới xuất hiện là những người phàm ăn của nước ép mô thực vật. Các dấu hiệu cho thấy cây đã bị bọ lygus tấn công bao gồm biến màu, biến dạng chồi và thân, lá quăn lại và các vết bệnh trên mô cây', 'Người trồng thường xuyên thực hiện 3-5 lần phun thuốc trừ sâu mỗi năm để kiểm soát loài côn trùng này. Xem xét tỷ suất lợi nhuận hẹp đối với nông dân ngày nay, chi phí của các ứng dụng như vậy là đáng kể. Tại Hoa Kỳ, đã có tổng cộng 38% vụ mất bông do dân số TPB.Việc nhổ và duy trì các cây cỏ dại có thể kiểm soát số lượng L. lineolaris trưởng thành trong các ruộng trồng trọt và vườn nho. [1] Lượng mưa có thể được phân loại như một hình thức kiểm soát cơ học đối với L. lineolaris vì những giọt mưa có thể làm chết các cá thể thực vật và làm giảm khả năng sống sót của chúng. [7] Kết quả từ một nghiên cứu điều tra ảnh hưởng của lượng mưa đến quần thể nhộng trùng L. lineolaris chỉ ra rằng số lượng nhộng trùng giảm trong những năm mưa nhiều. Trong những năm có lượng mưa lớn, L. lineolaris cũng ít bị ong bắp cày P. digoneutis ký sinh . Do kết quả của chúng mà lượng mưa giảmQuần thể L. lineolaris , các nhà nghiên cứu cho rằng nên sử dụng hệ thống tưới phun sương trên các cánh đồng cỏ linh lăng vì nó mô phỏng lượng mưa.', 'tìm thấy nhiều nhất ở nửa phía đông của Bắc Mỹ  Bắc Mỹ , từ bắc Canada đến nam Mexico', 'null', 'insect_Tarnished_plant_bug/32529.jpg', 'Lygus', 'null'),
('Telicota ancilla', 'Sâu cuốn lá lớn bướm vàng lớn', 'insect_Telicota_ancilla', 'Bướm đẻ trứng vào buổi sáng và đẻ rải rác ở mặt sau lá gần gân chính, mỗi lá từ 1-6 quả, một bướm cái có thể đẻ 120 quả trứng. Sau khi vũ hóa 20 phút là bướm có thể bay đi kiếm ăn. Bướm bay nhanh từng đoạn ngắn theo đường gấp khúc. Thường sau khi giao phối một ngày (cũng có thể sau 2 giờ) sau thì bướm sẽ đẻ trứng. Một năm sâu cuốn lá lớn phát sinh 6-7 lứa. Điều kiện hơi nóng bức và ẩm là thích hợp cho sâu phát sinh gây hại. Sâu non nhả tơ cuốn lá thành bao lớn và cắn khuyết lá. Bị hại nặng cây lúa có thể trụi hẳn lá làm ảnh hưởng đến sinh trưởng, phát triển. Cây bị hại thường thấp nhỏ, đòng ngắn, thời gian lúa chín kéo dài hoặc đòng bị cuốn cong, không trỗ thoát hoặc gãy gập, không nở hoa kết hạt.Sâu cuốn lá lớn phát sinh, gây hại từ giai đoạn lúa mới cấy cho đến khi lúa chín. Vào những năm mưa nhiều, thời tiết mát mẻ, sâu phát sinh nặng. Sâu cuốn lá lớn phân bố ở tất cả các vùng trồng lúa ở trong nước và trên thế giới. Ở Việt Nam, vùng trung du và miền núi bị hại nặng hơn vùng đồng bằng, vùng có bố trí cơ cấu cây trồng phức tạp cũng dễ bị hại nặng.', '', '', '', '', 'null', '', 'Telicota', 'null'),
('Tessaratoma papillosa', 'Bọ xít nâu (vải)', 'insect_Tessaratoma_papillosa', 'Bọ xít trưởng thành qua đông trong tán cây, bụi rậm. Tháng 2-3 bọ xít đẻ trứng trên đọt non, chùm hoa (trứng dạng hình cốc, xếp thành 2 hàng, mỗi hàng 7-8 quả). Bọ xít non sau khi nở sống tập trung thành tập đoàn ít di chuyển. Tuổi lớn mới phân tán dần ra. Trong năm bọ xít gây hại nặng từ tháng 3-7. Mật độ cao nhất vào giai đoạn quả hình thành đến khi chín.', '', '', '', '', 'null', '', 'Tessaratoma', 'null'),
('Tetanops myopaeformis', 'ruồi đóm', 'insect_Tetanops_myopaeformis', 'Vòng đời của chúng trải qua 4 giai đọan: trứng, dòi, nhộng và ruồi trưởng thành. Tùy thuộc vào nhiệt độ môi trường mà từ trứng nở thành ruồi trưởng thành thường mất từ 3 – 5 ngày. Ruồi trưởng thành có đời sống khoảng 1-2 tháng, ở điều kiện thích hợp có thể sống đến 3 tháng.', 'Ruồi trưởng thành có màu xám đen, dài 6-9 mm và có 4 sọc đen kéo dài trên tấm lưng của các đốt ngực.', 'Kiểu miệng liếm hút. Cả ruồi đực và cái đều ăn tất cả thức ăn, rác rưởi, chất thải của người và cả phân động vật. Nước là chất thường ngày không thể thiếu của ruồi, ruồi sẽ chết nếu sau 48 giờ không hút nước. Một ngày ruồi cần ăn 2-3 lần, họat động chủ yếu vào ban ngày khi chúng ăn và giao phối, về đêm bình thường ruồi đậu yên. Ban ngày, khi không tìm thức ăn, ruồi thường trú đậu ở sàn nhà, tường, trần nhà, cũng như ngoài bờ rào, gần nhà xí, thùng rác, dây phơi quần áo, thảm cây thấp … Ruồi thường tập trung ở các điểm tìm kiếm thức ăn, nơi giao phối, nơi đẻ trứng và nơi trú đậu. Ban đêm ruồi ưa đậu ở trần nhà và những cấu trúc treo cao khác, nhìn chung gần với nơi kiếm ăn, nơi đẻ và tránh được gió.', 'Q Ruồi đục lá (Liriomyza Sativaza Blanchard) là loài đa thực, phổ ký chủ rộng, gây hại nhiều loài cây trồng. Ruồi đục lá đục ăn mô lá làm giảm khả năng quang hợp, làm cho cây cằn vàng, cằn cỗi, lá rụng sớm đẫn đến làm giảm năng suất, chất lượng sản phẩm. Ngoài ra vết thương của lá giòi đục sẽ tạo điều kiện cho nấm và vi khuẩn sâm nhập phát sinh và phát triển gây hại làm rụng lá, chết cây. Sự gây hại của chúng rất nghiêm trọng, làm giảm hiệu quả kinh tế trong trồng nên ta phải tìm biện pháp thích hợp để phòng chống chúng vì việc nghiên cứu về các đặc điểm của loài ruồi đục lá rất cần thiết.', 'Là loài phân bố rộng, hại cây trồng ở Mỹ, Trung Quốc, Đông Nam Á, và nhiều nước khác.', 'null', 'insect_Tetanops_myopaeformis/29213.jpg', 'Tetanops', 'null'),
('Tetradacus c Bactrocera minax', 'Chinese citrus fly', 'insect_Tetradacus_c_Bactrocera_minax', 'Sự bắt đầu và thời gian của chu kỳ sống, cũng như số thế hệ mỗi năm phụ thuộc nhiều vào khí hậu xung quanh. [5] [6] Nhiệt độ ôn hòa cùng với độ ẩm cao là môi trường lý tưởng để cây sinh trưởng và phát triển thành công. Kuwana và cộng sự. (1927) đã có thể ghi lại khoảng 4 thế hệ mỗi năm, với 7 thế hệ xảy ra trong điều kiện phòng thí nghiệm lý tưởng này. [6] Nghiên cứu này cũng có thể chứng minh sự thay đổi trong thời gian của vòng đời.', 'Các quả trứng thường được đẻ gần nhau trên cây lương thực, chẳng hạn như cây họ cam quýt, thường là trên lá. Đom đóm có sáu giai đoạn phát triển: trứng, giai đoạn thu thập thông tin (giai đoạn đầu tiên), hai giai đoạn nhộng trùng không cuống (giai đoạn thứ 2 và thứ 3), nhộng (giai đoạn thứ 4) và trưởng thành. Về mặt nhận dạng trong họ Aleyrodidae, giai đoạn nhộng (giai đoạn 4) hiển thị nhiều đặc điểm chẩn đoán nhất của loài bướm trắng có họ hàng gần.', 'Chất lượng và sản lượng trái cây có múi là mục tiêu chính mà các nhà nghiên cứu đang tập trung vào. A. spiniferus gây hại trực tiếp cũng như gây hại gián tiếp cho cây bị nhiễm bệnh. [7] Thiệt hại trực tiếp bao gồm sự suy yếu của những cây bị nhiễm bệnh do nhựa cây ăn vào. Loại thiệt hại thứ hai xảy ra khi ruồi trắng tiết mật trên bề mặt lá. Điều này lại thúc đẩy sự phát triển của nấm mốc, khiến nhiều bộ phận của cây bị nhiễm bệnh như lá, quả và cành bị bao phủ bởi nấm mốc. Điều này cản trở quá trình quang hợp, do đó làm giảm chất lượng tổng thể của cây. Người ta đã quan sát thấy rằng những loài gây hại cây có múi này cũng đã tấn công cây chè, chẳng hạn như Camellia sinensis được tìm thấy ở Nhật Bản. Tuy nhiên, các nhà nghiên cứu phát hiện ra rằng những con cái trưởng thành của quần thể nhiễm bệnh có múi không đẻ trứng trên lá của những cây chè này, và chỉ trên những cây có múi, do đó chứng tỏ tính độc quyền của mỗi quần thể.', 'các biện pháp kiểm soát hóa học đã được cố gắng để đối phó với sự bùng phát như phun thuốc trừ sâu, có thể được coi là hiệu quả tuy nhiên điều này phải trả giá đắt. Nồng độ thuốc trừ sâu cao này có thể dẫn đến kháng thuốc trừ sâu, và thuốc trừ sâu trong đồ uống trà gây ra các nguy cơ độc hại cho con người. [13] Do đó, do những yếu tố này, nói chung nó không được chứng minh là có hiệu quả đối với A. spiniferus, bao gồm cả các loài ruồi trắng khác trong các hệ thống cây trồng', 'Châu Phi, Úc, Châu Mỹ, các đảo Thái Bình Dương và Ý', 'null', 'insect_Tetradacus_c_Bactrocera_minax/61719.jpg', 'Tephritidae', 'null'),
('Tetranychus sp.', 'nhện đỏ', 'insect_Tetranychus_sp', 'Nhện đỏ có 8 chân, chúng di chuyển nhanh chóng và linh hoạt, thành trùng cái có màu vàng nhạt hay hơi ngả sang màu xanh lá cây một chút. Loại này bạn có thể nhìn xuyên qua cơ thể và thấy hai đốm màu khá đậm bên trong. Đây là nơi chứa thức ăn của nhện đỏ. Thành trùng cái bắt đầu đẻ trứng khoảng 2 – 6 ngày sau khi bắt cặp, mỗi con đẻ khoảng 70 trứng mỗi lần.Trứng nhện đỏ nhìn hình cầu hoặc hình củ hành, bóng láng, nhìn bằng mắt thường rất nhỏ. Nhện đỏ thường đẻ trứng lá lá, cụ thể là sát gân lá ở cả 2 mặt lá, thường là gắn chặt ở mặt dưới ở lá, ở nơi nào có tơ do nhện giăng ra khi chúng di chuyển. Trứng sẽ nở rất nhanh vào 4 – 5 ngày sau đó.\r\n\r\nẤu trùng nhện đỏ khi mới nở trông khá giống thành trùng nhưng không có đủ 8 chân mà chỉ có 3 đôi chân. Thời gian sau đó ấu trùng sẽ nở ra thành trùng cái, sau đó thay da 3 lần. Tuy nhiên những ấu trùng sẽ nở thành trùng đực chỉ thay da 2 lần thôi. Mất khoảng 5 – 10 ngày để ấu trùng phát triển.', 'là loài côn trùng gây bệnh rất phổ biến trên cây. Có nhiều giống nhện đỏ khác nhau. Đa số giống nhện đỏ hiện nay có phần thân nhỏ, chỉ khoảng 0,4mm, thành trùng đực có kích thước nhỏ hơn, chỉ khoảng 0,3mm.Toàn thân nhện đỏ phủ một lớp lông thưa và có màu xanh, đỏ hoặc trắng, ở hai bên thân mình có đốm đen.', 'Loài nhện đỏ thường sống ở mặt trên của những lá già hoặc lá bánh tẻ, thậm chí nếu phát triển với mật độ cao chúng còn sống ở cả mặt dưới của lá, trên những cảnh lộc non hoặc quả.Nhện đỏ sẽ hút chẹc nhựa cây để sống nên sẽ tạo thành các vết chấm nhỏ li ti màu trắng bạc, hơi càng. Nếu lá bị nặng sẽ chuyển sang màu trắng bạc, rụng nhanh, cây còi cọc, chậm lớn, không ra chồi mới.', 'Biện pháp canh tác, kỹ thuật:+ Không nên trồng quá dầy làm cho vườn bị um tùm rậm rập, không thông thoáng, tán bị che phủ nhiều.Biện pháp hóa học:\r\n- Nhện đỏ rất khó trị vì rất nhỏ và thường sống ở gần gân lá, nơi thuốc trừ sâu rất khó tiếp xúc, hơn nữa, nhện tạo lập quần thể rất nhanh nên mật số tăng nhanh và nhiều. Có thể sử dụng các loại thuốc trừ nhện nhưng phải để ý đến quần thể thiên địch.\r\n\r\n+  Phun các thuốc có hỗn hợp hoạt chất (Chlorantraniliprole + Abamectin)…\r\n\r\n- Nếu vườn đào thường bị nhện gây hại nặng thì cứ mỗi đợt cây ra đọt, lá non nên phun xịt 3 lần thuốc trừ nhện: lần 1 khi cây vừa nhú đọt non, lần 2 khi đọt non ra rộ và lần 3 khi lá non bước sang giai đoạn bánh tẻ.', 'Phân bố rộng trên thế giới từ Hà Lan (phát hiện trên cây cau Phoenicis năm 1939) đến Achentina. Gây hại khá phổ biến cây trồng tại các vùng nhiệt đới nóng ẩm', 'null', 'insect_Tetranychus_sp/13784.jpg', 'Tetranychus', 'null'),
('Tetranychus urticae', 'Nhện nhỏ 4 chân hại lúa', 'insect_Tetranychus_urticae', 'Nhện đỏ hình bầu dục, con trưởng thành có 8 chân,  kích thước rất nhỏ từ 0,18cm – 0,35mm nên rất khó phát hiện bằng mắt thường. Vòng đời nhện đỏ ngắn, chỉ từ 2-4 tuần, nhưng chúng sinh sôi rất nhanh, con cái bắt đầu đẻ 15-20 trứng mỗi ngày trong vòng 1 tuần sau khi nở, kích thước của con đực nhỏ hơn con cái, toàn thân phủ lông lưa thưa và thường có màu vàng nhạt, xanh lá, trắng hay đỏ với đốm đen ở 2 bên thân mình. Nhện đỏ sinh sản quanh năm, nhưng chúng phát triển mạnh nhất vào mùa hè và mùa thu từ tháng 4-9 hàng năm', 'null', '', '', '', 'null', '', 'Tetranychus', 'null'),
('Therioaphis trifolii', 'rệp cỏ ba lá vàng', 'insect_Therioaphis_trifolii', 'Ấu trùng và thành trùng tập trung mặt dưới lá, nhất là đọt non, bông, chồi, hút nhựa làm cho các phần này bị héo hoặc để lại những vết thâm đen trên lá, và truyền bệnh virus cho cây. Trên dưa, rầy gây hại trầm trọng nếu tấn công các dây chèo hay đỉnh sinh trưởng, nếu tập trung số lượng lớn ở đọt sẽ làm cho lá bị quăn queo. Phân thải ra thu hút nhiều nấm đen bao quanh làm ảnh hưởng sự phát triển trái và ảnh hưởng đến quang hợp của cây.', 'Rệp cỏ linh lăng đốm dài khoảng 2 mm, màu vàng nhạt và có bốn đến sáu hàng đốm đen trên lưng. Nó thường được tìm thấy trên thân và lá ở phần dưới của cây. Nó hút nhựa cây và tiết ra một lượng lớn mật ong. Nước bọt độc hại của nó giết chết các cây con và có thể làm giảm năng suất của các cánh đồng đã trồng.', 'Rệp cỏ linh lăng đốm thích ăn cỏ linh lăng, mặc dù chúng sẽ phá hoại một số\r\ncỏ ba lá. Những con rệp này chích một chất độc tiết nước bọt vào cây, gây ra\r\núa vàng ở chỗ ăn và dọc theo gân lá. Vị trí của đốm\r\nRệp cỏ linh lăng trên cây chịu ảnh hưởng lớn bởi độ ẩm tương đối. Nói chung, họ\r\nđược tìm thấy ở mặt dưới của những chiếc lá thấp hơn nhưng sẽ di chuyển lên trên cây như những chiếc lá này\r\nbị giết. Các quần thể không được kiểm soát đã làm giảm một nửa năng suất và hàm lượng protein trên\r\nkhán đài đã thành lập và đã phá hủy khán đài mới. Ngoài ra, mật ong tiết ra và\r\nnấm mốc phát triển sau đó trên lá làm giảm chất lượng cỏ khô và làm cho\r\nthu hoạch khó khăn. Các giống nhạy cảm có thể bị hư hại nghiêm trọng bởi ít hơn\r\nmột con rệp trên mỗi cây con, nhưng tính kháng của cây ký chủ có thể làm giảm thiệt hại. May mắn là nhiều\r\ncác giống hiện đại có khả năng chống lại rệp cỏ linh lăng đốm.', 'Trên giá thể cây con, thuốc trừ sâu nên được áp dụng khi có hai đến ba con rệp trên mỗi cây\r\ncây con có mặt. Cây cao từ 2 đến 3 inch có thể chịu được 4 đến 5 rệp trên mỗi cây. Sử dụng tại\r\nít nhất 12 gallon nước trên mỗi mẫu Anh và áp dụng khi nhiệt độ ban ngày dự kiến ​​sẽ\r\ntrên 65 ° F. Ở cỏ linh lăng lâu đời, cần có quần thể cao hơn để biện minh cho việc điều trị.\r\nTrên cỏ linh lăng cao 10 inch, thường không cần điều trị cho đến khi có 50 con rệp trên mỗi thân\r\nMón quà. Trên cỏ linh lăng cao 20 inch, số lượng rệp trên mỗi thân cây nhiều gấp đôi sẽ cần thiết để bảo vệ\r\nsự đối xử.', 'Châu Âu, Bắc Phi, Trung Đông, Ấn Độ và Pakistan', 'null', 'insect_Therioaphis_trifolii/38752.jpg', 'Therioaphis Walker', 'null'),
('Thripidae', 'Bọ trĩ', 'insect_Thripidae', 'Bọ trĩ – bù lạch trưởng thành đẻ trứng rải rác trong mô lá, trứng nhỏ mới đẻ màu trắng sữa. Trứng: 3-4 ngày Ấu trùng 10-14 ngày', '', '', '', '', 'null', '', 'Thripidae', 'null'),
('Toxoptera aurantii', 'rệp vừng', 'insect_Toxoptera_aurantii', 'Ở vùng khí hậu nhiệt đới, rầy mềm chủ yếu sinh sản đơn tính và đẻ con, mỗi con cái đẻ trung bình 40 con. Vòng đời: của rầy mềm từ 7- 9 ngày, rầy có thể sống đến 3 tuần. Rầy mềm là môi giới truyền bệnh Tristera, rầy chỉ cần chích hút cây bệnh trong vòng 5- 10 phút là có thể truyền bệnh trong 24 giờ.', 'Khi trưởng thành thì chúng có cánh hoặc không cánh. Kích thước của trưởng thành ở con cái (không cánh và có cánh)dài khoảng 1,7-2,1mm. Trưởng thành cái không cánh có hình bầu dục nâu đen hoặc nâu đỏ, bóng. Giai đoạn ấu trùng có màu nâu. Các đoạn nối các đốt râu đầu của trưởng thành cái không cánh và ấu trùng tuổi lớn có màu tối nên râu đầu trông như có sọc. Cánh trước của trưởng thành cái có cánh có pterostigma màu đen sậm và chỉ có 1 gân chẻ đôi media. Ống siphunculi dài gấp đôi cauda. Cả hai bộ phận siphunculi và cauda đều có màu đen. Trên cauda có mang khoảng 8 -19 lông nhỏ.', 'Chúng thường gây hại trên cá c vườn cam, quýt, chanh còn tơ. Tương tự như rệp muội nâu đen Toxoptera citricidus, chúng cũng là tác nhân truyền bệnh \"Tristeza\" trên cam quýt. Đây là một loại bệnh đã gây chết nhiều vườn cam quýt trên thế giới. Tại một số nước, chúng còn là tác nhân truyền bệnh \"lá nhỏ Spiroplasma citri\" trên cam quýt và bệnh Đốm vòng trên cà phê cũng như bệnh Đốm vòng trên đu đủ và bệnh Khảm trên dưa leo.', 'Để xử lý rệp sáp hại cà phê trước hết bà con nên cắt tỉa những cây bị bệnh đem đi tiêu hủy để tránh lây lan. Sau đó sử dụng nấm xanh nấm trắng kết hợp với Siêu đồng phun xịt ướt đẫm hai lần cách nhau 5 ngày. Đồng mát sẽ giúp làm bào mòn lớp cutin của chúng. Từ đó giúp cho nấm xanh – nấm trắng xâm nhập tiêu diệt rệp một cách nhanh chóng. Nấm xanh khi được phun lên cây sẽ ký sinh gây bệnh cho côn trùng sau đó lây nhiễm cho cả đàn. Nấm xanh xâm nhập vào cơ thể rồi gây bệnh cho côn trùng gây hại.Ngoài ra, bà con nên kết hợp phân bón lá giúp lá cây mập, dày để cây quang hợp tốt. Bà con nên phun vào các ngày mát trời, không nắng gắt cũng không mưa dầm.\r\n\r\nĐồng thời, bà con cho tưới định kỳ 3 tháng/lần bộ giải pháp Wao boom. Đây là bộ giải pháp vừa tiêu diệt nấm bệnh, vừa kích thích tái tạo hệ rễ. Vừa bổ sung những dinh dưỡng thiết yếu cho cây trồng.', 'phân bố tại các vùng nhiệt đới và cận nhiệt đới, Nam Mỹ, châu Phi, châu Á, Úc, vùng Địa Trung Hải, Trung Mỹ, và Hoa Kỳ.', 'null', 'insect_Toxoptera_aurantii/64947.jpg', 'Toxoptera', 'null'),
('Toxoptera citricidus', 'rầy cam quýt nâu', 'insect_Toxoptera_citricidus', 'Vòng đời của rệp muội nâu ít phức tạp hơn nhiều so với hầu hết các loại rệp. Ở hầu hết các khu vực trên thế giới, rệp muội nâu vĩnh viễn không có chu kỳ sinh dục, có nghĩa là không có chu kỳ sinh dục vào mùa thu, và do đó, không có con đực, không có trứng và không có trứng. Tất cả các cá thể trong suốt cả năm đều là những con cái sinh sản biểu sinh viviparous. Ở Nhật Bản, có một hình ba vòng chức năng trên cây có múi (Komazaki 1988). Dự kiến, rệp nâu hại cam quýt vĩnh viễn ở các vùng sản xuất cam quýt chính của Florida.', 'Rệp muội đen có cánh hoặc không cánh, hình dạng và kích thước tương tự như rệp muội nâu Toxoptera aurantii, tuy nhiên đốt râu thứ I, II và III của trưởng thành có cánh có màu đen và trên cauda có mang 25-40 lông nhỏ. Vết trên cánh trước nhạt, bên cạnh đó gân media ở cánh trước của rệp muội đen Toxoptera citricida chẻ đôi 2 lần.', 'Đây là loài rệp muội gây hại quan trọng nhất trên cây có múi (Citrus). T. citicidus gây hại bằng cách chích hút chồi non, tập trung chủ yếu ở mặt dưới lá, làm chồi biến dạng, lá cong queo còi cọc, không phát triển. Ngoài ra, rệp muội đen còn tiết mật ngọt làm nấm muội đen phát triển, ảnh hưởng đến sự quang hợp của cây. T. citricidus còn là tác nhân quan trọng trong việc truyền bệnh “Tristeza” trên cam quýt. Đây là một loại bệnh đã gây chết nhiều vườn cam quýt trên thế giới.', 'null', 'phân bố phổ biến tại vùng Đông Nam châu Á, Australia, New Zealand, quần đảo Pacific, Nam Mỹ, Caribbean, Floria và Nam Phi.', 'null', 'insect_Toxoptera_citricidus/64753.jpg', 'Toxoptera', 'null'),
('Toxoptera sp', 'Rầy mềm', 'insect_Toxoptera_sp', 'Ở vùng khí hậu nhiệt đới, rầy mềm chủ yếu sinh sản đơn tính và đẻ con, mỗi con cái đẻ trung bình 40 con. Vòng đời: của rầy mềm từ 7- 9 ngày, rầy có thể sống đến 3 tuần. Rầy mềm là môi giới truyền bệnh Tristera, rầy chỉ cần chích hút cây bệnh trong vòng 5- 10 phút là có thể truyền bệnh trong 24 giờ.', '', '', '', '', 'null', '', 'Toxoptera', 'null'),
('Trialeurodes vaporariorum', 'Ruồi trắng nhà kính', 'insect_Trialeurodes_vaporariorum', 'Chiều dài cơ thể trưởng thành là 1,1mm bên trong và bên ngoài, và toàn bộ được phủ bột trắng. Con nhộng là một hình bầu dục màu vàng nhạt, dài khoảng 0,9 mm, ban đầu bằng phẳng và dần dần phình ra thành một hình tròn. Có nhiều chất tiết giống như xương sống bằng thủy tinh dài xung quanh và phía sau cơ thể, nhưng có nhiều biến thể tùy thuộc vào lông ở mặt sau của lá. Ở 20-25 ° C, thời gian trứng là 6-8 ngày, thời gian ấu trùng là 8 ngày và thời gian nhộng là khoảng 6 ngày. Điều này xảy ra hơn 10 lần một năm trong nhà kính và mỗi tiểu bang luôn bị trộn lẫn, gây khó khăn cho việc kiểm soát. Mediates dưa chuột vàng đốm. Khi nó phát triển, thiệt hại của việc hút là rất lớn, nhưng thiệt hại do bệnh bồ hóng gây ra là lớn hơn. Kẻ thù tự nhiên bao gồm Encarsia formosa và những loài khác của ong bắp cày ký sinh ở châu Âu. Một loài khác có liên quan chặt chẽ là sâu bướm dâu xâm hại T. packardi .', 'Con trưởng thành có chiều dài 1–2 mm chiều dài với cơ thể hơi vàng.', 'Tất cả các giai đoạn sống, ngoại trừ trứng và \"nhộng\" đều gây hại cây trồng thông qua việc cho ăn trực tiếp, cắm sâu mầm của chúng vào các gân lá và hút chất dinh dưỡng từ nhựa cây. Là một sản phẩm phụ của quá trình cho ăn, mật ong được bài tiết ra ngoài và chỉ đó có thể là nguồn thiệt hại thứ hai, chính. Đặc điểm thứ ba và có khả năng gây hại nhất là khả năng lây truyền một số vi rút thực vật ở người trưởng thành. Các ký chủ cây trồng bị ảnh hưởng chủ yếu là các loại rau như bầu bí, khoai tây và cà chua, mặc dù một loạt các loại cây trồng và cây trồng không phải cây trồng khác bao gồm cả các loài cỏ dại đều dễ bị nhiễm bệnh và do đó có thể nhiễm bệnh.', 'Kiểm soát hiệu quả đã được cung cấp trong nhiều năm thông qua việc thả côn trùng có ích, chẳng hạn như aphelinid ký sinh, Encarsia formosa (Gahan). Nếu cần thiết, các chiến lược quản lý dịch hại tổng hợp có thể kết hợp các ứng dụng của thuốc trừ sâu hóa học chọn lọc hoặc thuốc trừ sâu sinh học như Lecanicillium muscarium để bổ sung cho những loài thiên địch này. Đối với phần lớn các loại cây trồng ngoài trời, hóa chất vẫn là phương pháp phòng trừ được sử dụng rộng rãi nhất. [2] Để nghiên cứu quản lý tính kháng sâu bệnh, một bộ gen dự thảo chất lượng cao 787 Mb đã được giải trình tự và lắp ráp.', 'các vùng ôn đới trên thế giới', 'null', 'insect_Trialeurodes_vaporariorum/57481.jpg', 'Trialeurodes', 'null'),
('Tridactylidae', 'Dế nhảy', 'insect_Tridactylidae', 'Một dế mèn mái mỗi lần đẻ rất nhiều trứng, những trứng đã được thụ tinh sẽ nở ra dế con sau 9-12 ngày, trung bình một con dế mèn mái có thể cho ra khoảng 2.000 dế con. Con non thường được nở ra vào mùa xuân và trưởng thành sau đó vài tuần (thường là từ 40-45 ngày) và bắt đầu sinh sản được khi chúng được 50-55 ngày trở đi.', '', '', '', '', 'null', '', 'Tridactylidae', 'null'),
('Unaspis citri', 'Rệp dính', 'insect_Unaspis_citri', 'Con cái rệp sáp dính hình dạng thuông dài, khoảng 1mm có màu nâu sẫm và rệp dính hại dừa có hình dạng tròn, đường kính khoảng 1mm và có màu nâu vàng. Chúng thường nằm cố định trên mặt lá, cành hoặc quả và ít di chuyển.', '', '', '', '', 'null', '', 'Unaspis', 'null'),
('Unaspis yanonensis', 'arrowhead scale', 'insect_Unaspis_yanonensis', 'Vòng đời mất 10 đến 12 tuần để hoàn thành trong mùa hè nhưng lâu hơn trong\r\nthời tiết mát mẻ hơn. Mỗi cá cái có thể tạo ra tới 169 cá thể đầu tiên (trong khoảng thời gian 146 ngày);\r\nsố con trung bình của mỗi con cái là khoảng 80 con. Trong một thời gian ngắn sau khi nở,\r\nnhững trường hợp đầu tiên bị thu hút bởi ánh sáng và di chuyển lên trên về phía các cành ngọn hoặc đến\r\nquả, đặc biệt là nếu lá rụng đã xảy ra. Khi một địa điểm cho ăn đã được chọn,\r\ncon cái và con đực chưa trưởng thành trở nên không cuống', 'Những con cái trưởng thành có vảy hình vỏ sò, dài 2,5 đến 3,6 mm, màu nâu đen với một\r\nlợi nhuận thấp hơn (CABI, 2004). Đầu cuối Exuviae có màu vàng nâu. Quy mô nam chưa trưởng thành\r\nnắp dài, 1,3 đến 1,6 mm, có lông màu trắng, với hai hoặc ba đường gờ dọc', 'Loài chủ yếu ở châu Á này thích vùng ôn đới ấm áp Địa Trung Hải và nhiệt đới\r\nkhí hậu; cam quýt là loài ký chủ của nó. Có khả năng côn trùng vảy, U. yanonensis,\r\ntrở nên thành lập ở các khu vực cụ thể của Hoa Kỳ, nơi sản xuất cam quýt và ấm\r\nnhiệt độ cùng tồn tại.', 'Các tác nhân kiểm soát sinh học hiện có bao gồm ký sinh trùng Aphytis dạng màng nổi\r\nlingnanensis được sử dụng ở Florida (Mỹ), Argentina, quần đảo Solomon và Cuba và Encarsia\r\nlounsburyi ở Cuba. Xây dựng chuồng trại để bao bọc cây có múi đã tạo điều kiện cho\r\nphát hành và thành lập A. lingnanensis trong các lùm cây có múi ở Florida (Brooks & Vitelli,\r\nNăm 1976). Ở Úc, một loài sâu bướm săn mồi, Batrachedra sp., Gây ra số lượng giảm ngoạn mục\r\nvề số lượng quy mô bất cứ khi nào quần thể trở nên dày đặc (Hely và cộng sự, 1982).', 'Unaspis yanonensis có nguồn gốc từ Đông Nam Á, được du nhập vô tình\r\nvào các khu vực hạn chế ở miền nam nước Pháp và miền bắc nước Ý (Liguria). Unaspis citri có trong\r\nTrung Quốc, Nhật Bản, Hàn Quốc, Pháp, Ý và Fiji', 'null', 'insect_Unaspis_yanonensis/59977.jpg', 'Unaspis', 'null'),
('Viteus vitifoliae', '‎Nho phylloxera', 'insect_Viteus_vitifoliae', 'Phylloxera có một vòng đời phức tạp lên đến 18 giai đoạn, có thể được chia thành 4 dạng chính: dạng hữu tính, dạng lá, dạng rễ và dạng có cánh.Các hình thức tình dục bắt đầu với trứng nam và nữ nằm trên mặt dưới của lá nho nhỏ. Cá đực và cá cái ở giai đoạn này thiếu hệ thống tiêu hóa, khi nở ra chúng giao phối rồi chết. Trước khi con cái chết, nó đẻ một quả trứng mùa đông trong vỏ thân cây nho. Trứng này phát triển thành dạng lá . Nymph này, fundatrix (mẹ gốc), trèo lên một chiếc lá và đẻ trứng parthenogenetically trong một túi mật lá mà cô tạo ra bằng cách tiêm nước bọt vào lá. Nhộng nở ra từ những quả trứng này có thể di chuyển sang các lá khác hoặc di chuyển đến rễ nơi chúng bắt đầu nhiễm trùng mới ở dạng rễ. Ở dạng này, chúng đục vào rễ để tìm chất dinh dưỡng, làm nhiễm độc vào rễ bằng một chất độc khiến nó không thể chữa lành. Chất độc này cuối cùng giết chết cây nho. Nhộng này sinh sản bằng cách đẻ trứng đến bảy thế hệ nữa (cũng có thể sinh sản dị biệt) vào mỗi mùa hè. Những con này lây lan sang các rễ khác của cây nho, hoặc sang rễ của các loài dây leo khác qua các vết nứt trên đất. Thế hệ nhộng nở vào mùa thu ngủ đông trong rễ và xuất hiện vào mùa xuân năm sau khi nhựa cây bắt đầu trồi lên. Ở những nơi ẩm ướt, nhộng phát triển thành dạng có cánh, nếu không chúng thực hiện vai trò tương tự mà không cần có cánh. Những con nhộng này bắt đầu lại chu kỳ bằng cách ở trên cây nho để đẻ trứng đực và cái ở mặt dưới của lá nho non, hoặc bay đến một cây nho chưa bị nhiễm bệnh để làm điều tương tự.', 'Các dạng không có cánh của côn trùng rất nhỏ, màu nâu vàng, hình bầu dục hoặc hình quả lê và giống như rệp. Các dạng có cánh, ít được nhìn thấy hơn, cũng giống rệp, ngoại trừ các cánh được giữ phẳng trên lưng. Cả hai dạng có cánh và không có cánh đều không có nút chai, cấu trúc giống như ống đuôi ở phía trên bụng, giống như rệp', 'Vào mùa thu, nhộng di cư đến rễ nơi chúng ngủ đông trong suốt mùa đông. Mùa xuân năm sau, chúng hoạt động trở lại và tạo ra rễ trên các giống nho nhạy cảm. Những con cái không cánh này có thể quay vòng vô định trên rễ năm này qua năm khác. Vào cuối mùa hè và mùa thu, ở miền đông Hoa Kỳ, một số loài phylloxera sống ở rễ đẻ trứng phát triển thành những con cái có cánh. Những con cái này di cư từ rễ lên thân, nơi chúng đẻ trứng với hai kích cỡ, những con nhỏ hơn phát triển thành con đực và những con lớn hơn thành con cái. Giao phối xảy ra và con cái sau đó đẻ một quả trứng đã thụ tinh duy nhất qua mùa đông trên thân nho. Chính quả trứng này đã làm nảy sinh các thế hệ sinh sống trên lá.', 'Hiện tại chỉ có một loại thuốc trừ sâu được đăng ký có thể xâm nhập vào túi mật (một sản phẩm có tên Movento, loại thuốc này không có sẵn cho chủ nhà), vì vậy việc kiểm soát phải tập trung vào việc ngăn chặn côn trùng tiếp cận và bám vào bề mặt lá. Một số loại thuốc diệt côn trùng được dán nhãn cho dạng lá của phylloxera nho ở Nam Dakota, nhưng chúng sẽ có hiệu quả khác nhau và chỉ nên được sử dụng khi sự hiện diện của phylloxera đã được xác nhận (tìm những vết ban đầu trên ba chiếc lá già nhất). Hầu hết là thuốc xịt tiếp xúc, sẽ không kiểm soát được phylloxera khi chúng ở trong túi mật, vì vậy chúng cần được áp dụng bắt đầu từ khi chồi có 5 đến 10 lá. Sản phẩm có một số tác dụng còn lại sẽ có hiệu quả nhất. Một trong những sản phẩm chống thấm hiệu quả nhất hiện có cho chủ nhà hoặc các ứng dụng quy mô nhỏ là “Surround”, một sản phẩm có chứa đất sét cao lanh cũng được chấp thuận sử dụng trong các vườn nho hữu cơ được chứng nhận. Nó phải được bón lại sau khi mưa, và lặp đi lặp lại miễn là các lá mới xuất hiện, cho đến khi có 10-12 lá trên mỗi chồi. Xử lý nấm phylloxera vào mùa muộn (khi chồi có hơn 12 lá) không hiệu quả và lãng phí thời gian và tiền bạc.', 'Phylloxera có nguồn gốc từ miền đông Bắc Mỹ, nơi nó sống trên các cây nho bản địa. Tuy nhiên, loài côn trùng này hiện có mặt ở hầu hết các vùng trồng nho trên thế giới do sự di chuyển của những cây nho nhiễm phylloxera, đặc biệt là vào cuối những năm 1800.', 'null', 'insect_Viteus_vitifoliae/42478.jpg', 'Daktulosphaira', 'null');
INSERT INTO `insects_insect` (`eName`, `name`, `slug`, `characteristic`, `value`, `reality`, `protective`, `distribution`, `detail`, `thumb`, `genus_id`, `name_TA`) VALUES
('Wheat Stem Sawfly', 'chuồn chuồn lúa mì', 'insect_Wheat_Stem_Sawfly', 'Ruồi cưa thân lúa mì chỉ có một thế hệ mỗi năm. Mặc dù con trưởng thành tồn tại tương đối ngắn (từ bảy đến 10 ngày), sự xuất hiện của con trưởng thành xảy ra trong một thời gian dài, thường là khoảng ba tuần nhưng đôi khi dài đến một tháng.Lần xuất hiện đầu tiên thường là vào giữa đến cuối tháng 6 ở Bắc Dakota. Bướm cưa cái gửi trứng vào thân dài của cây ký chủ vào đầu mùa hè (Hình 8) , và ấu trùng phát triển ăn mô thân và di chuyển lên xuống theo chiều dài của thân. Mặc dù một số trứng có thể được đẻ trong một thân cây, nhưng chỉ có một ấu trùng duy nhất sống sót đến khi trưởng thành.Thời gian chờ bị phá vỡ khi nhiệt độ, độ ẩm và / hoặc chu kỳ quang tăng vào mùa xuân. Quá trình phát triển sau khi chết bao gồm giai đoạn tiền trưởng thành và giai đoạn nhộng kéo dài khoảng 20 đến 30 ngày, tùy thuộc vào nhiệt độ môi trường xung quanh. Con trưởng thành chui ra khỏi kén và dùng các răng hàm dưới để thoát ra khỏi phần cuống thông qua phần đầu đã được cắm sẵn.', 'Một con chuồn chuồn trưởng thành có màu đen bóng với ba dải màu vàng xung quanh bụng. Các chân có màu vàng. Những bộ cánh nhuốm màu \"khói\". Con trưởng thành có chiều dài khoảng 8 đến 13 milimét (mm) (5/16 -1/2 Inch) và có đặc điểm là không hoạt động, thường thấy nằm trên thân cây lúa mì với đầu hướng xuống dưới.Trứng dài khoảng một mm, màu trắng sữa và hình lưỡi liềm. Chúng mất khoảng năm đến tám ngày để nở. Ấu trùng có màu kem, nhăn nheo và có hình chữ S mạnh mẽ hơn (Hình 4) so ​​với các ấu trùng côn trùng đục thân khác (ví dụ như giòi thân lúa mì) khi tách khỏi thân. Chúng có đầu màu nâu và hình chiếu cùn ngắn ở phần đuôi. Khi trưởng thành, ấu trùng có thể đạt chiều dài khoảng 13 mm (1/2 in).', 'Sau khi hoàn thành quá trình phát triển và thoát ra khỏi nhộng, con trưởng thành nhai và đẩy qua thân cây đã cắm, xuất hiện từ giữa tháng 6 đến đầu tháng 7. Con đực xuất hiện trước, với con cái bắt đầu xuất hiện sau đó vài ngày. Họ có xu hướng ở gần khu vực mà họ xuất hiện bởi vì họ là những người bay yếu. Nếu thời tiết mát mẻ, ẩm ướt xảy ra trong thời kỳ trỗ thì thời kỳ trỗ được kéo dài. Điều kiện ẩm ướt cũng giúp làm mềm phích cắm trên thân cây cho phép ruồi cưa trưởng thành xuất hiện dễ dàng hơn.', 'Thuốc trừ sâu nói chung không có hiệu quả đối với ruồi cưa thân lúa mì. Các giai đoạn trứng, sâu non và nhộng được bảo vệ tốt bên trong thân cây.Việc phun thuốc cho con trưởng thành không thành công vì con trưởng thành mới xuất hiện có thể di chuyển vào ruộng đã được phun thuốc, thời gian xuất hiện của ruồi cưa quá dài và con trưởng thành xuất hiện sau khi phun thuốc đã giảm tiếp xúc với thuốc trừ sâu. Người lớn không cho ăn hoặc uống nước, điều này giúp giảm thiểu việc tiếp xúc với thuốc diệt côn trùng.\r\n\r\nNhìn chung, thuốc trừ sâu không hiệu quả trong việc kiểm soát ruồi đục thân lúa mì; tương đối tốn kém đối với một loại cây trồng có giá trị thấp, diện tích lớn như lúa mì; và gây hại cho các quần thể ký sinh trùng có ích.', 'Châu Âu, các vùng của Châu Á, Canada và Bắc Mỹ', 'null', 'insect_Wheat_Stem_Sawfly/25388.jpg', 'Symphyta', 'null'),
('Xylotrechus quadripes', '‎borer thân cà phê‎', 'insect_Xylotrechus_quadripes', 'Bọ cánh cứng cái gửi trứng vào các khe nứt và kẽ hở và dưới lớp vỏ có vảy lỏng lẻo của thân chính và các gốc dày, thích cây tiếp xúc với ánh sáng mặt trời. Một con cái có thể đẻ khoảng 100 quả trứng theo nhóm từ I đến 10 trong vòng đời của nó từ 9 đến 30 ngày Trứng nhỏ (dài 1,3 mm và mặt số 0,5 mm, màu trắng và nở trong vòng 9 đến 15 ngày. Ấu trùng nở ra kiếm ăn ở phần nút chai ngay dưới vỏ cây trong khoảng hai tháng. Sau đó, ấu trùng xâm nhập vào gỗ cứng và tạo đường hầm ở tất cả các hướng. Các đường hầm chứa đầy chất thải của sâu bọ. Tổng giai đoạn sâu bệnh kéo dài khoảng 10 tháng. Cây bụi phát triển đầy đủ có màu vàng nhạt và dài khoảng 2 đến 3 cm. Sự nhú diễn ra trong một buồng gần với ngoại vi thân cây. Giai đoạn nhộng kéo dài từ 3 đến 4 tuần, sau đó biến đổi thành con trưởng thành. Con trưởng thành ở trong đường hầm từ 3 đến 7 ngày và trồi ra ngoài bằng cách khoét một lỗ thoát trên vỏ cây. Lỗ thoát trên thân cây cho thấy sâu đã hoàn thành vòng đời và xuất hiện khi trưởng thành, tổng vòng đời của sâu hoàn thành trong khoảng một năm.', '- Trứng màu ngà, sâu non trắng ngà luôn nằm thẳng, không có chân, toàn thân gồm nhiều đốt, răng cứng khỏe. \r\n- Trưởng thành thuộc họ xén tóc dài 17-18mm, ngang 5-7mm. Râu đầu thẳng và có nhiều đốt. Cánh cứng màu đen có các khoang đen hình chữ nhân xen kẽ các vạch vàng xám cũng hình chữ nhân. Lưng ngực màu vàng xám.\r\n- Nhộng trần màu vàng.', 'Sâu non đục vào trong phần gỗ của cây. Đường đục ngoằn ngèo, tiện ngang các mạch gỗ, sâu đục đến đâu chúng đùn phân và mạt cưa bịt kín đến đó, có thể đục lên phía trên ngọn hay đục xuống phía dưới gốc.Cây bị hại thường vàng úa, cằn cỗi và héo, trong khi các cành phía dưới vẫn xanh tốt và có dấu hiệu phát triển mạnh chồi vượt, cành thứ cấp. Cây dễ bị gãy gục ở vị trí sâu đục.Sâu đục thân phát triển quanh năm nhưng có 2 đợt chính vào tháng 4, 5 và 10, 11.Trưởng thành ưa đẻ trứng vào những cây ít cành, thưa lá.Phá hoại nặng trên café che,hoạt động mạnh khi nhiệt độ cao,ánh sáng nhiều.Vòng đời của sâu đục thân: 130- 217 ngày.', 'Biện cáp canh tác:- Trồng cây che bóng làm giảm cường độ ánh sáng.\r\n\r\n- Tỉa cành tạo tán, bón phân đầy đủ cho cây phát triển tốt hạn chế bị xén tóc hại.\r\n\r\n-  Thường xuyên thăm vườn, vệ sinh vườn sạch sẽ; phát hiện sớm các cây bị gây hại, cưa bỏ kịp thời và đem tiêu hủy.\r\n\r\n- Dùng bẫy đèn thu hút trưởng thành và tiêu diệt.\r\n\r\n- Thường xuyên theo dõi đồng ruộng để phát hiện sự xuất hiện của trưởng thành..\r\n\r\nBiện pháp hóa học:\r\n\r\nKhi trưởng thành xuất hiện rộ, phun ướt đều phần vỏ từ gốc sát mặt đất lên đến ngọn, cành lớn.', 'Ấn Độ', 'null', 'insect_Xylotrechus_quadripes/49947.jpg', 'Xylotrechus', 'null'),
('Zeuzera coffeae', 'Sâu đục thân mình hồng', 'insect_Zeuzera_coffeae', 'Ngài (bướm) cái đẻ trứng thành ổ ở chồi non hay nụ của cành cây, mỗi ngài có thể đẻ 400 - 2000 quả trứng. Sau khi đẻ 14 - 16 ngày trứng nở thành sâu non. Sâu non rất nhỏ nhưng hoạt động nhanh nhẹn, đục vào cành tăm hay đốt non, ở tuổi 3 đục vào gốc cành, thường phá hại ở cành cấp 1, cấp 2. Sâu non có 6 tuổi, mỗi tuổi 1 lần lột xác, mỗi lần lột xác là một lần di chuyển chỗ ở, do đó sâu có thể phá hại rất nhiều cành, sâu đục cành đùn phân ra ngoài nên rất dễ phát hiện. Sâu non khi đẫy sức thì hoá nhộng trong cây, thời gian hoá nhộng 30 - 50 ngày. Những cành bị sâu đục lá héo rũ, khô đi, quả bị hại héo chín ép nên lép, ảnh hưởng đến sinh trưởng và phát triển của cây thậm chí làm gãy ngang gây chết cây. Khi trưởng thành, chúng bay ra ngoài tìm những nơi cành lá xanh tốt xum xuê để đẻ trứng. Sau khi nở, ấu trùng đục vào bên trong cành, đùn phân và mạt gỗ ra ngoài. Cành bị sâu tấn công sẽ gẫy hoặc chết khô.', '', '', '', 'Loài gây hại này phân bố rộng rãi ở Ấn Độ nhưng phổ biến hơn ở các vùng sản xuất chè và cà phê của đất nước.', 'null', '', 'Zeuzera', 'null');
